CAS CLIENT的步骤： &#160;(参考：<a href=\"http://sg552.iteye.com/blog/1297538\">http://sg552.iteye.com/blog/1297538</a> ) &#160;( below is about how to use rubycas-client )&#160;</p>\r\n<p>0. 在  Gemfile中，加入： &#160;&#160;<br />gem \'rubycas-client\'<br />然后 $sudo bundle<br />注意： 不要使用 \'rubycas-client-rails\' 这个GEM。 &#160; &#160;( notice: don\'t use \'rubycas-client-rails\' gem, it\'s unstable and unnecessary &#160;)</p>\r\n<p>1. environment.rb: 的结尾，加上： &#160; ( add your cas server url to this file)&#160;<br />CASClient::Frameworks::Rails::Filter.configure(<br />  :cas_base_url =&gt; \"http://192.168.56.10:8080/cas-server-webapp-3.4.11 \"<br />)</p>\r\n<p>2. application_controller.rb<br />before_filter CASClient::Frameworks::Rails::Filter</p>\r\n<p>3. 进入某个controller :  (例如 fish_controller.rb) ， 定义退出的action &#160;(define the logout method )&#160;</p>\r\n<pre> \r\ndef class fish_controller\r\n  def logout\r\n     CASClient::Frameworks::Rails::Filter.logout(self)\r\n  end\r\nend\r\n</pre>\r\n<p>4. 修改 route.rb ，加入退出的链接： (add the naming route)</p>\r\n<pre>Dudufish::Application.routes.draw do\r\n   resources :fish\r\n   match \'/logout\' =&gt; \"fish#logout\", :as =&gt; :logout\r\nend \r\n</pre>\r\n<p>5. 修改  application.html.erb 布局文件，增加这个链接。  关键的一点是： 在经典的rails authorization 框架用，都是用 current_user  这个变量取得当前登陆的用户。 在CAS CLIENT中，用的是 session[:cas_user] , 只取得当前用户名，是一个string.  而不是一个model. &#160; ( NOTICE: &#160;use session[:cas_user] to get the current_user information. &#160; )&#160;</p>\r\n<p>&lt;div style=\"border: 1px solid green\"&gt;<br />  &lt;%= session[:cas_user] %&gt; <br />&lt;/div&gt;<br />&lt;% if session[:cas_user] %&gt;<br />   &lt;%= link_to \"logout\" , logout_path %&gt; <br />&lt;% end %&gt;</p>\r\n<p>至于single sign out, 暂时就不设置了。 &#160;不过有需要的同学可以参考一下： &#160;(about single sign on, I decide to leave it there and don\'t touch it . but if you insist on using it, follow the steps below )&#160;</p>\r\n<p>1. 在服务器端（ruby cas server) ,修改 config.yml, &#160; &#160;(change the config file from server side: )<br />enable_single_sign_out = true</p>\r\n<p>2. 在客户端， (from client side)&#160;<br />&#160; 2.1 使用 数据库保存 &#160;session &#160; &#160;&#160;<br />&#160; &#160; config.action_controller.session_store = :active_record_store<br />&#160; 2.2 修改application.rb&#160;<br />&#160; &#160; self.allow_forgery_protection = false<br />&#160; 2.3 在 CAS client的设置中， &#160;<br />&#160; &#160;&#160;:enable_single_sign_out =&gt; true</p>\r\n<p>我本来想这样弄，但是考虑到： &#160; (considering the factors below, I don\'t want to use single-sign-on )&#160;<br />1. 这样太麻烦。 我怕让其他应用该起来太麻烦。 &#160;( complicated, for both ruby and other language applications )<br />2. 可以把 session有效时间缩短些，比如 闲置15分钟，就需要重新登录（默认是5分钟） &#160;( to shorten the unused-session-time could satisfy our need )&#160;一样可以<br />3. 去掉了 forgery protection 安全性下降太多。 ( it\'s dangerous to disable the forgery protection)&#160;</p>\r\n<p>所以 我不打算使用 single sign on 这个特性。</p>',0,'2012-12-20 06:55:00','2012-12-20 07:10:32','2012-12-20 07:10:32',1,NULL,'ruby-cas-client-and-single-sign-out ','','','',751,'ruby-cas-client-and-single-sign-out'),(62,'rspec中模拟CAS 登录( mock login for CAS ) ','<p>非常简单，用这个： &#160;( 1 line of code: )&#160;</p>\r\n<pre>CASClient::Frameworks::Rails::Filter.fake(\"some_user\")</pre>\r\n<p>例如： &#160;(e.g. )&#160;</p>\r\n<p># spec_helper.rb &#160;: define a method called \'login\')</p>\r\n<pre> def login\r\n   CASClient::Frameworks::Rails::Filter.fake(\"some_user\")\r\n end\r\n</pre>\r\n<p>然后就可以调用它了. ( then you can call it in your rspec files: )&#160;</p>\r\n<pre># in some rspec file\r\nrequire \'spec_helper\'\r\n\r\ndescribe MessagesController do\r\n  render_views\r\n  before do\r\n    login\r\n    @message = FactoryGirl.create(:message, :vid =&gt; 1, :title =&gt; \"test\")\r\n  end \r\n  it \"should get show\"  do  \r\n    get :show, :id =&gt; @message.id\r\n    response.should be_success\r\n  end \r\nend\r\n</pre>',0,'2012-12-20 10:14:00','2012-12-20 10:18:08','2012-12-20 10:18:08',1,NULL,'mock-login-for-cas','','','',714,'mock-login-for-cas'),(63,'asset_path 在rspec中的使用 ( use asset_path in rspec )','<p>今天很奇怪，我在测试 helper 时，居然遇到了 这个问题： ( today I met a strange problem when testing a Rails helper which called asset_path ) </p>\r\n<pre>undefined method `asset_path\' for #&lt;rspec::core::examplegroup::nested_2:0x8b35aa8&gt;</pre>\r\n<p>解决办法很简单： 加上下面这句就好了 ( the solution is simple: add the line of code to the spec_helper file, shown as below ) </p>\r\n\r\n<pre># spec_helper.rb \r\n RSpec.configure do |config|\r\n   config.include Sprockets::Helpers::RailsHelper\r\n end\r\n</pre>\r\n<p>原因：(reason) \r\n\"asset_path\" isn\'t a routing URL helper, it\'s a Sprocket helper.   出自：<a href=\"http://rubyforge.org/pipermail/rspec-users/2011-September/020619.html\">http://rubyforge.org/pipermail/rspec-users/2011-September/020619.html</a> </p>',0,'2013-01-08 09:45:00','2013-01-08 09:49:57','2013-01-08 09:49:57',1,NULL,'use-asset-path-in-rspec','','','',832,'use-asset-path-in-rspec'),(64,'VIM 的tab用法（tabs in vim)','<p>VIM 中的tab 一直是我希望学习使用的东西，可惜过去时间总是不够，没时间学习，就暂时使用 terminal tabs 代替了。 &#160;( The \'tab\' in VIM is a interesting concept that I have been always focusing on, but unluckily I don\'t have enough time to spend time learning it. so ... I have to use the \"terminal tabs \" instead. &#160;)</p>\r\n<p>但有时候terminal tabs 不如VIM 灵活。比如，我不希望在terminal tab中切换来切换去， 而且不知道是该 ctrl + tab 还是 alt + tab 还是 &#160;ctrl + up , ctrl + down. &#160;( However, it\'s not always good to use \'terminal tabs\' instead of \'VIM tabs\', such as, when I want to just open &#160;2 terminals &#160;without tab --- so that I just need to switch my window by typing \'alt+ tab\' , but not mixing \'alt + tab\' and \'ctrl + tab\' , \'ctrl + pageup\' and \'ctrl + pagedown\' .... .er.... *_* )&#160;</p>\r\n<p>所以我记录一下VIM 的tab 用法： ( so, let me record the usages of VIM tabs: )&#160;</p>\r\n<pre>:tabnew             new tab\r\n:gt/:tabnext             next tab\r\n:gT/:tabprevious      previous tab\r\n\r\n1gt :                  jump to the 1st tab\r\n[n]gt:             jump to the n tab\r\n</pre>',0,'2013-01-11 06:40:00','2013-01-11 06:47:12','2013-01-11 07:03:56',1,NULL,'vim-tab-usage','','','',634,'vim-tab-usage'),(66,'UBUNTU访问 WINDOWS 资源 (access windows resources from Linux using samba)','<p>参考(refer to)：<a href=\"http://wiki.ubuntu.com.cn/Samba#.E5.AE.89.E8.A3.85Samba\" title=\"http://wiki.ubuntu.com.cn/Samba#.E5.AE.89.E8.A3.85Samba\" target=\"_blank\">http://wiki.ubuntu.com.cn/Samba#.E5.AE.89.E8.A3.85Samba</a>\r\n</p><p>1. sudo apt-get install samba &#160;&#160;</p>\r\n<p>需要加上文件夹的名字使 server这个参数完整，同时不要使用-L 这个参数。 例如： &#160;（you should not use -L &#160;as the parameter if you met this error:&#160;</p>\r\n<p>session request to *SMBSERVER failed (Called name not present)<br />NetBIOS over TCP disabled -- no workgroup available &#160; )&#160;</p>\r\n<p>下面是一个实际的例子： (below is a real example )&#160;</p>\r\n<p>$ smbclient --user=&lt;group_name&gt;/shensiwei //10.10.0.70/IT文档 &#160; &#160; &#160; ( shensiwei 是用户名 )&#160;</p>\r\n<p>来使用跟FTP 差不多的方式来 GET， PUT 各种文件 &#160;( and type \'help\' once you logged in, you can see \'put\' , \'get\' and other similar commands with FTP)</p>',0,'2013-01-15 09:39:00','2013-01-15 09:45:32','2013-01-15 09:45:32',1,NULL,'access-windows-resources-from-Linux-using-samba','','','',770,'access-windows-resources-from-linux-using-samba'),(67,'安装JENKINS时记得要安装GIT PLUGIN哦亲！ (when installing JENKINs , remember to install its \'Git plugin!\' ) ','<p>参考：  https://wiki.jenkins-ci.org/display/JENKINS/Meet+Jenkins</p>\r\n<p>1. download jdk<br />2. download tomcat<br />3. remember to: install GIT plugin!!!! &#160;</p>',0,'2013-01-15 09:52:00','2013-01-15 09:53:55','2013-01-15 09:53:55',1,NULL,'remember-to-install-git-plugin-when-installing-jenkins','','','',648,'remember-to-install-git-plugin-when-installing-jenkins'),(68,'安装selenium IDE ( correct URL to install selenium IDE) ','<p>1.  由于现有的URL失效（ , 所以直接在这个页面中下载： &#160;( due to the related url is out-of-date, please come to this link to download: )&#160;<br />http://seleniumhq.org/download/</p>\r\n<p>2. 也可以看这里下载 http://code.google.com/p/selenium/wiki/SeIDEReleaseNotes &#160;( or come here: )</p>\r\n<p>3. 之后就可以了。  单独在 firefox中搜索 addons 不行。 &#160;( then it will install selenium IDE for you. if you want to install it from firefox\'s addons , you will fail )&#160;</p>',0,'2013-01-15 09:54:00','2013-01-15 09:56:44','2013-01-15 09:56:44',1,NULL,'correct-url-to-install-selenium-IDE','','','',704,'correct-url-to-install-selenium-ide'),(69,'调试SMTP 邮件服务器（看是否使用了BASE64 编码验证）(debug SMPT server to see if the BASE64 encoding is on )','<p>参考： <a href=\"http://help.netmail.com/display/KB/How+to+test+SMTP+AUTH+using+base64+format\"> http://help.netmail.com/display/KB/How+to+test+SMTP+AUTH+using+base64+format </a>\r\n</p>\r\n<p>1.  telnet smtp.yoursite.com 25</p>\r\n<p>2.  EHLO   (看是否有 auth login )( to see if there\'s \"auth login\" string )</p>\r\n<p>3.  auth login  </p>\r\n<pre>auth login\r\n334 VXNlcm5hbWU6\r\nc2hlbnNpd2Vp ( 这里输入 base64 encoded username) \r\n334 UGFzc3dvcmQ6\r\nc3NzMzMzJCQkNDQ0 ( base64 encoded password) \r\n235 2.7.0 Authentication successful\r\n</pre>\r\n<p>&#160;记得，你的邮箱名字一般不要超过20个字！否则会被自动截断！例如： &#160;(remember don\'t make your login name longer than 20 characters length)&#160;<br />notifier-of-push-ops &#160;就很好 &#160;(OK! )<br />notifier-of-push-ops-system 就超过了！ &#160; &#160; &#160; ( 26 digits length! auth will failed! )</p>\r\n',0,'2013-01-15 09:57:00','2013-01-15 10:01:46','2013-01-15 10:01:46',1,NULL,'debug-SMPT-server-to-see-if-the-BASE64-encoding-is-on','','','',675,'debug-smpt-server-to-see-if-the-base64-encoding-is-on'),(70,'VIM中的recording ( using recording in VIM )','<p>recording 是一个高级功能，对于我来说。所以我一直没有学习哈哈。前天又做了一件人肉替换字符串的事儿，我觉得实在不能再忍了，于是今天早上使用了一下，感觉良好。 (Recording is an advanced feature in VIM and I am too busy these days, so I haven\'t paid any time on it. However the day before yesterday, I have to do a job that containing of many duplicated operations which could &amp; should be done automatically. So I make my decision to learn how to use this feature)&#160;</p>\r\n<p>这个例子是： 把一个文本中的某个字，做一些替换。工作量呢，用人肉做不小，但是专门写个ruby脚本又显得过度重量了。(this example shown below is the case I met -- change some string by some patterns -- a Ruby script is too heavyweight, but manually doing it is too boring... so &#160;... ^_^)</p>\r\n<p>把这段代码：</p>\r\n<pre>  link1\r\n  link2\r\n  link3\r\n</pre>\r\n<p>替换成下面：</p>\r\n<pre><a href=\"link1\">link1</a>\r\n<br />\r\n<a href=\"link2\">link2</a>\r\n<br />\r\n<a href=\"link3\">link3</a>\r\n\r\n</pre>\r\n<p>所以，使用 VIM 的recording 正好，步骤是： &#160;( so the steps are: )&#160;</p>\r\n<p>1. 在普通模式下 按qq ( q&lt;寄存器名&gt; , 这里我为了方便，使用了 q ) &#160; ( press \'qq\' in normal mode )&#160;</p>\r\n<p>2. 开始编辑。 (edit it)&#160;</p>\r\n<p>3. 编辑好后，回到普通模式，再次按下 q . 表示录制结束 &#160;( press \'q\' again when you have done the edit in normal mode)&#160;</p>\r\n<p>4. 跳到第二行，然后按 @+q, &#160;就会发现，第二行变化啦～ ( jump to the line you want to make changes and press \'@q\', see what happens~ )</p>\r\n<p>5. 引申： 如果想一次操作多行，输入 5@q， 就可以操作接下来的5行哦亲～ &#160;(further more, press \'n@q\' to apply the changes on the following n lines )&#160;</p>\r\n\r\n',0,'2013-01-22 02:27:00','2013-01-22 02:41:31','2013-01-22 02:41:31',1,NULL,'using-recording-in-vim','','','',590,'using-recording-in-vim'),(71,'在本地搭建gem server的考虑 ( setup gem server on local  )','<p>$ gem server 是个好东西。 &#160;(gem server is easy to use )</p>\r\n<p>优点：1. 命令简单。 2. 可以 gem rdoc --all &#160;或者 gem rdoc &lt;gem_name&gt; 来生成对应的api &#160; ( advantages : simple , and could generate all the gem\'s doc )&#160;</p>\r\n<p>缺点：每次都要手动运行。(disadvantages: &#160;have to run it manually everytime)&#160;</p>\r\n<p>如果我希望我的nginx能运行 gem server? 貌似没办法 &#160;( seems impossible to use nginx to replace \'gem server\')&#160;</p>\r\n<p>如果你用max os, 可以试试这个：http://gugod.org/2010/09/local-gem-server/ &#160; (if using max os, you could probably try this: )</p>\r\n<p>p.s. what about run \'gem server\' as a nohup command?&#160;</p>',0,'2013-01-25 03:43:00','2013-01-25 03:49:07','2013-01-25 03:49:07',1,NULL,'setup-gem-server-locally','','','',724,'setup-gem-server-locally'),(72,'建立一个rubygem ( how to create a ruby gem)','<p>参考：&#160; <a href=\"http://guides.rubygems.org/make-your-own-gem/\">http://guides.rubygems.org/make-your-own-gem</a>\r\n</p>\r\n<p>1. 假设你的gem名字是 \"hola\", 就要先建立这样的目录结构。（记得 lib下要有个跟项目同名的rb文件哦）</p>\r\n<pre>% tree\r\n.\r\n├── hola.gemspec\r\n└── lib\r\n    └── hola.rb\r\n</pre>\r\n\r\n<p>2.  编辑 lib/hola.rb 这个文件，让它看起来如下：</p>\r\n<pre>class Hola\r\n  def self.hi\r\n    puts \"Hello world!\"\r\n  end\r\nend\r\n</pre>\r\n\r\n<p>3. 编辑 hola.gemspec ,  </p>\r\n<pre>% cat hola.gemspec\r\nGem::Specification.new do |s|\r\n  s.name        = \'hola\'\r\n  s.version     = \'0.0.0\'\r\n  s.date        = \'2010-04-28\'\r\n  s.summary     = \"Hola!\"\r\n  s.description = \"A simple hello world gem\"\r\n  s.authors     = [\"Nick Quaranto\"]\r\n  s.email       = \'nick@quaran.to\'\r\n  s.files       = [\"lib/hola.rb\"]\r\n  s.homepage    =\r\n    \'http://rubygems.org/gems/hola\'\r\nend\r\n</pre>\r\n\r\n<p> 4. 建立这个gem ，并且在本地安装它</p>\r\n<pre>% gem build hola.gemspec\r\nSuccessfully built RubyGem\r\nName: hola\r\nVersion: 0.0.0\r\nFile: hola-0.0.0.gem\r\n\r\n% gem install ./hola-0.0.0.gem\r\nSuccessfully installed hola-0.0.0\r\n1 gem installed\r\n</pre>\r\n<p> 5. 试试这个gem ... </p>\r\n<pre>% irb\r\n&gt;&gt; require \'hola\'\r\n=&gt; true\r\n&gt;&gt; Hola.hi\r\nHello world!\r\n</pre>\r\n<p> 6. 在 rubygems.org 上注册并且登录，进入到profile 界面，就会发现  </p>\r\n<pre>API Access\r\nYour API key is 6cd7fafaeb3b7f721da09686f9668???.\r\nIf you want to use gem commands from the command line, you\'ll need a ~/.gem/credentials file, which you can generate using the following command:\r\n$ curl -u Siwei Shen https://rubygems.org/api/v1/api_key.yaml &gt; ~/.gem/credentials\r\n</pre>\r\n<p>7. push this gem to rubygems.org</p>\r\n<pre>% gem push hola-0.0.0.gem\r\nPushing gem to RubyGems.org...\r\nSuccessfully registered gem: hola (0.0.0)\r\n</pre>\r\n\r\n<p> 8 . 来个稍微复杂点儿的文件结构：</p>\r\n<pre>.\r\n├── hola.gemspec\r\n└── lib\r\n    ├── hola\r\n    │   └── translator.rb\r\n    └── hola.rb\r\n\r\n% cat lib/hola/translator.rb\r\nclass Hola::Translator\r\n  def initialize(language)\r\n    @language = language\r\n  end\r\n\r\n  def hi\r\n    case @language\r\n    when :spanish\r\n      \"hola mundo\"\r\n    else\r\n      \"hello world\"\r\n    end\r\n  end\r\nend\r\n\r\n% cat lib/hola.rb\r\nclass Hola\r\n  def self.hi(language = :english)\r\n    translator = Translator.new(language)\r\n    translator.hi\r\n  end\r\nend\r\n\r\nrequire \'hola/translator\'\r\n</pre>\r\n\r\n<p> 然后在irb中试一下： </p>\r\n<pre>% irb -Ilib -rhola\r\nirb(main):001:0&gt; Hola.hi(:english)\r\n=&gt; \"hello world\"\r\nirb(main):002:0&gt; Hola.hi(:spanish)\r\n=&gt; \"hola mundo\"\r\n</pre>',0,'2013-01-25 09:42:00','2013-01-25 09:48:26','2013-01-25 10:03:01',1,NULL,'how-to-create-a-rubygem','','','',679,'how-to-create-a-rubygem'),(73,'版本号的规范命名方式( Semantic Versioning  )','<p> 今天看到了这个文章，终于知道了各种版本号的命名和由来。 贴在这里。 \r\n原文见： <a href=\"http://semver.org/\">http://semver.org/</a> </p>\r\n<p>刚才搜索了一下， Semantic Versioning的中文翻译很多版本， 有叫“语义法版本控制”的，有叫”语义法版本命名“的，也有”规范命名法“的。 &#160;这里 Semantic是语义（？）， Versioning 肯定是版本命名的意思了。 &#160;所以想了一下，我也不翻译了，直接叫Semantic Versioning.&#160;</p>\r\n\r\n<ol>\r\n<li><p>使用这套命名法，必须要有公共的API。 &#160;Software using Semantic Versioning MUST declare a public API. This API\r\ncould be declared in the code itself or exist strictly in documentation.\r\nHowever it is done, it should be precise and comprehensive. &#160;</p>\r\n</li>\r\n<li><p>正常的版本号应该形如 x.y.z. &#160; x,y,z 都必须是正数或者0. &#160; &#160;X： 主要版本，Y：次要版本号，Z： 补丁号。 增长的次序都是每次+1&#160;</p>\r\n<p>A normal version number MUST take the form X.Y.Z where X, Y, and Z are\r\nnon-negative integers. X is the major version, Y is the minor version, and Z\r\nis the patch version. Each element MUST increase numerically by increments of\r\none. For instance: 1.9.0 -&gt; 1.10.0 -&gt; 1.11.0.</p>\r\n</li>\r\n<li><p>当主要版本号增加时，后面的版本号都清零。</p>\r\n<p>When a major version number is incremented, the minor version and patch\r\nversion MUST be reset to zero. When a minor version number is incremented, the\r\npatch version MUST be reset to zero. For instance: 1.1.3 -&gt; 2.0.0 and 2.1.7 -&gt;\r\n2.2.0.</p>\r\n</li>\r\n<li><p>....没看明白。。。</p>\r\n<p>Once a versioned package has been released, the contents of that version\r\nMUST NOT be modified. Any modifications must be released as a new version.</p>\r\n</li>\r\n<li><p>0.y.z 是初始化版本，表示各种API都有随时变化的可能性，很不稳定。</p>\r\n<p>Major version zero (0.y.z) is for initial development. Anything may change\r\nat any time. The public API should not be considered stable.</p>\r\n</li>\r\n<li><p>1.0.0 中的API就固定下来了。</p>\r\n<p>Version 1.0.0 defines the public API. The way in which the version number\r\nis incremented after this release is dependent on this public API and how it\r\nchanges.</p>\r\n</li>\r\n<li><p>Patch version Z (x.y.Z | x &gt; 0) MUST be incremented if only backwards\r\ncompatible bug fixes are introduced. A bug fix is defined as an internal\r\nchange that fixes incorrect behavior.</p>\r\n</li>\r\n<li><p>Minor version Y (x.Y.z | x &gt; 0) MUST be incremented if new, backwards\r\ncompatible functionality is introduced to the public API. It MUST be\r\nincremented if any public API functionality is marked as deprecated. It MAY be\r\nincremented if substantial new functionality or improvements are introduced\r\nwithin the private code. It MAY include patch level changes. Patch version\r\nMUST be reset to 0 when minor version is incremented.</p>\r\n</li>\r\n<li><p>Major version X (X.y.z | X &gt; 0) MUST be incremented if any backwards\r\nincompatible changes are introduced to the public API. It MAY include minor\r\nand patch level changes. Patch and minor version MUST be reset to 0 when major\r\nversion is incremented.</p>\r\n</li>\r\n<li><p>A pre-release version MAY be denoted by appending a dash and a series of\r\ndot separated identifiers immediately following the patch version. Identifiers\r\nMUST be comprised of only ASCII alphanumerics and dash [0-9A-Za-z-].\r\nPre-release versions satisfy but have a lower precedence than the associated\r\nnormal version. Examples: 1.0.0-alpha, 1.0.0-alpha.1, 1.0.0-0.3.7,\r\n1.0.0-x.7.z.92.</p>\r\n</li>\r\n<li><p>A build version MAY be denoted by appending a plus sign and a series of dot\r\nseparated identifiers immediately following the patch version or pre-release\r\nversion. Identifiers MUST be comprised of only ASCII alphanumerics and dash\r\n[0-9A-Za-z-]. Build versions satisfy and have a higher precedence than the\r\nassociated normal version. Examples: 1.0.0+build.1, 1.3.7+build.11.e0f985a.</p>\r\n</li>\r\n<li><p>Precedence MUST be calculated by separating the version into major, minor,\r\npatch, pre-release, and build identifiers in that order. Major, minor, and\r\npatch versions are always compared numerically. Pre-release and build version\r\nprecedence MUST be determined by comparing each dot separated identifier as\r\nfollows: identifiers consisting of only digits are compared numerically and\r\nidentifiers with letters or dashes are compared lexically in ASCII sort order.\r\nNumeric identifiers always have lower precedence than non-numeric identifiers.\r\nExample: 1.0.0-alpha &lt; 1.0.0-alpha.1 &lt; 1.0.0-beta.2 &lt; 1.0.0-beta.11 &lt;\r\n1.0.0-rc.1 &lt; 1.0.0-rc.1+build.1 &lt; 1.0.0 &lt; 1.0.0+0.3.7 &lt; 1.3.7+build &lt;\r\n1.3.7+build.2.b8f12d7 &lt; 1.3.7+build.11.e0f985a.</p>\r\n</li>\r\n</ol>',0,'2013-01-25 10:21:00','2013-01-25 10:34:27','2013-01-25 10:34:27',1,NULL,'semantic-versioning','','','',751,'semantic-versioning'),(74,'使用Bundler 开发 rubygem  (Developing a RubyGem using Bundler)','<p>For English original post, please visit: &#160; <a href=\"https://github.com/radar/guides/blob/master/gem-development.md\" target=\"_blank\">https://github.com/radar/guides/blob/master/gem-development.md</a>\r\n</p>\r\n<p>Bundler is a tool created by Carl Lerche, Yehuda Katz, André Arko and various superb contributors for managing Rubygems dependencies in Ruby libraries. Bundler 1.0 was released around the same time as Rails 3 and it\'s the Rails project where Bundler is probably most well-known usage occurs. But remember, Bundler isn\'t just for Rails!\r\n\r\nDid you know that you can use Bundler for not only gem dependency management but also for writing our own gems? It\'s really easy to do this and Bundler provides a couple of things to help you along this path.</p>\r\n\r\n<p> 1. bundle gem kaka </p>\r\n<p> 2. 在kaka.gemspec 文件中，加入：\r\n</p>\r\n<pre>s.add_development_dependency \"rspec\", \"~&gt; 2.6\"  \r\n</pre>\r\n\r\n<p>3. bundle install ，就会有：</p>\r\n<pre>Using kaka (0.0.1) from source at /path/to/kaka\r\n</pre>\r\n<p> 4. 实现一个 spec  (很基础但是很重要：）\r\n</p>\r\n<pre>4.1 $ mkdir spec\r\n4.2 $ vim file:  lib/kaka/dog.rb\r\nmodule Kaka\r\n    class Dog \r\n        def self.bark\r\n            \"wangwang!\"\r\n        end \r\n    end \r\nend\r\n\r\n\r\n4.3 $ vim lib/kaka.rb\r\n+ require \"kaka/dog\"\r\n\r\n4.4  $ vim spec/kaka_spec.rb\r\nrequire \'kaka\'\r\ndescribe Kaka::Dog do\r\n    it \'should pass\' do\r\n        Kaka::Dog.bark.should == \"wangwang!\"\r\n    end \r\n    it \'should pluralize a word\' do\r\n        Kaka::Dog.pluralize(\"tomato\").should eql(\"tomatoes\")\r\n    end \r\nend\r\n\r\n4.5 $bundle exec rspec spec\r\n\r\n</pre>\r\n \r\n<p> 5. 引用一个第三方的gem，例如为了使用pluralize方法，我们要使用ActiveSupport: </p>\r\n<pre>  \r\ngem.add_dependency \"activesupport\", \"&gt;= 2.3.8\"\r\ngem.add_dependency \"i18n\"\r\n</pre>\r\n<p> 6. $ bundle install </p>\r\n<p> 7. $ bundle exec rspec spec </p>\r\n<p> 8. $ rake build </p>\r\n<pre>kaka 0.0.1 built to pkg/kaka-0.0.1.gem\r\n</pre>\r\n<p> 9. $ gem install pkg/kaka-0.0.1.gem </p>',0,'2013-01-28 01:44:00','2013-01-28 02:20:28','2013-01-28 05:56:46',1,NULL,'Developing-a-RubyGem-using-Bundler','','','',645,'developing-a-rubygem-using-bundler'),(75,'Cancan 的alias action 与 核心方法 can   (alias action of Cancan and its core method: can) ','<p>( 从 CanCan::Ability  这个RDOC中拿过来的）( grabbed from its rdoc)  </p>\r\n<p> 1. 核心方法 can  </p>\r\n<p>\r\n可以定义 可用的ability.  参数1是 action， 参数2 是对象名 (Defines which abilities are allowed using two arguments. The first one is the action you’re setting the permission for, the second one is the class of object you’re setting it on. )\r\n</p>\r\n<pre>can :update, Article </pre>\r\n<p>  做为懒人，咱也可以传入一个数组： (You can pass an array for either of these parameters to match any one. Here the user has the ability to update or destroy both articles and comments. )  </p>\r\n<pre>can [:update, :destroy], [Article, Comment] \r\n</pre> \r\n<p> :all 代表所有的对象, :manage 代表所有的action( You can pass :all to match any object and :manage to match any action. Here are some examples. )  </p>\r\n<pre>can :manage, :all\r\ncan :update, :all\r\ncan :manage, Project\r\n</pre>\r\n<p> 也可以传入一个hash. 下面的例子，是该用户只能read 属于自己的 ， active = true的project ( \r\nYou can pass a hash of conditions as the third argument. Here the user can only see active projects which he owns.  )</p>\r\n<pre>can :read, Project, :active =&gt; true, :user_id =&gt; user.id \r\n</pre>\r\n<p> 更多关于 DB 查询的内容请看  ActiveRecordAdditions#accessible_by  与 ControllerAdditions#load_resource  ( \r\nSee ActiveRecordAdditions#accessible_by for how to use this in database queries. These conditions are also used for initial attributes when building a record in ControllerAdditions#load_resource.  )\r\n</p>\r\n<p>  如果HASH参数不能满足你的要求的话，也可以传入一个block ( \r\nIf the conditions hash does not give you enough control over defining abilities, you can use a block along with any Ruby code you want. ) </p>\r\n<pre>can :update, Project do |project|\r\n  project.groups.include?(user.group)\r\nend\r\n</pre>\r\n<p> \r\nIf the block returns true then the user has that :update ability for that project, otherwise he will be denied access. The downside to using a block is that it cannot be used to generate conditions for database queries. </p>\r\n<p> 也可以指定对某个 object instance 检查ability.  注意，参数是一个symbol ( \r\nYou can pass custom objects into this “can” method, this is usually done with a symbol and is useful if a class isn’t available to define permissions on. ) </p>\r\ncan :read, :stats\r\ncan? :read, :stats # =&gt; true\r\n<p>  重要： 方法  can? 不会引用 条件参数 hash \r\n( IMPORTANT: Neither a hash of conditions or a block will be used when checking permission on a class.  )</p>\r\n<pre>can :update, Project, :priority =&gt; 3\r\ncan? :update, Project # =&gt; true\r\n</pre>\r\n<p> 如果你想定制can方法的话，那么就如下所示，仅仅传入一个block . 这个方式在你使用db验证时尤其有效 ( \r\nIf you pass no arguments to can, the action, class, and object will be passed to the block and the block will always be executed. This allows you to override the full behavior if the permissions are defined in an external source such as the database. ) </p>\r\n<pre>can do |action, object_class, object|\r\n  # check the database and return true/false\r\nend\r\n</pre>\r\n\r\n<p> 2. alias_action : &#160;  </p>\r\n\r\n<p> 可以把 多个action 重命名成1个新的。 (Alias one or more actions into another one. )</p>\r\n<pre>alias_action :update, :destroy, :to =&gt; :modify\r\ncan :modify, Comment\r\nThen :modify permission will apply to both :update and :destroy requests.\r\n\r\ncan? :update, Comment # =&gt; true\r\ncan? :destroy, Comment # =&gt; true\r\n</pre>\r\n<p>（看例子吧，文字描述的让我觉得模糊） This only works in one direction. Passing the aliased action into the “can?” call will not work because aliases are meant to generate more generic actions. </p>\r\n<pre>alias_action :update, :destroy, :to =&gt; :modify\r\ncan :update, Comment\r\ncan? :modify, Comment # =&gt; false\r\nUnless that exact alias is used.\r\ncan :modify, Comment\r\ncan? :modify, Comment # =&gt; true\r\n</pre>\r\n<p> 下面是已经默认使用的 alias_action了。对read, manage 有疑问的同学可以留意一下了。(The following aliases are added by default for conveniently mapping common controller actions. ) </p>\r\n<pre>alias_action :index, :show, :to =&gt; :read\r\n# wrong: alias_action :new, :create, :to =&gt; :create\r\nalias_action :new, :to =&gt; :create  \r\nalias_action :edit, :to =&gt; :update\r\n</pre> \r\n\r\n',0,'2013-01-28 06:02:00','2013-01-28 06:03:46','2013-01-29 09:02:30',1,NULL,'cancan-core-method-can-and-alias-action','','','',1160,'cancan-core-method-can-and-alias-action'),(76,'在Rails3中，保存任意结构的对象到 数据库 (save schema-less object to Rails DB\'s string column ) ','<h2 id=\"label-Saving+arrays%2C+hashes%2C+and+other+non-mappable+objects+in+text+columns\">Saving arrays, hashes, and other non-mappable objects in text columns</h2>\r\n\r\n<p>AR 可以保存任意对象到 TEXT 列。如下： &#160; ( Active Record can serialize any object in text columns using YAML. To do\r\nso, you must specify this with a call to the class method\r\n<code>serialize</code>. This makes it possible to store arrays, hashes, and\r\nother non-mappable objects without doing any additional work. )&#160;</p>\r\n\r\n<pre class=\"ruby\"><span class=\"ruby-keyword\">class</span> <span class=\"ruby-constant\">User</span> <span class=\"ruby-operator\">&lt;</span> <span class=\"ruby-constant\">ActiveRecord</span>\r\n<span class=\"ruby-operator\">::</span>\r\n<span class=\"ruby-constant\">Base</span>\r\n  <span class=\"ruby-identifier\">serialize</span> :<span class=\"ruby-identifier\">preferences</span>\r\n<span class=\"ruby-keyword\">end</span>\r\n\r\n<span class=\"ruby-identifier\">user</span> = <span class=\"ruby-constant\">User</span>.<span class=\"ruby-identifier\">create</span>(:<span class=\"ruby-identifier\">preferences</span> =<span class=\"ruby-operator\">&gt;</span> { <span class=\"ruby-string\">\"background\"</span> =<span class=\"ruby-operator\">&gt;</span> <span class=\"ruby-string\">\"black\"</span>, <span class=\"ruby-string\">\"display\"</span> =<span class=\"ruby-operator\">&gt;</span> <span class=\"ruby-identifier\">large</span> })\r\n<span class=\"ruby-constant\">User</span>.<span class=\"ruby-identifier\">find</span>(<span class=\"ruby-identifier\">user</span>.<span class=\"ruby-identifier\">id</span>).<span class=\"ruby-identifier\">preferences</span> <span class=\"ruby-comment\"># =&gt; { \"background\" =&gt; \"black\", \"display\" =&gt; large }</span>\r\n</pre>\r\n\r\n<p>也可以指定该对象的类型（ You can also specify a class option as the second parameter that’ll raise\r\nan exception if a serialized object is retrieved as a descendant of a class\r\nnot in the hierarchy. )&#160;</p>\r\n\r\n<pre class=\"ruby\"><span class=\"ruby-keyword\">class</span> <span class=\"ruby-constant\">User</span> <span class=\"ruby-operator\">&lt;</span> <span class=\"ruby-constant\">ActiveRecord</span>\r\n<span class=\"ruby-operator\">::</span>\r\n<span class=\"ruby-constant\">Base</span>\r\n  <span class=\"ruby-identifier\">serialize</span> :<span class=\"ruby-identifier\">preferences</span>, <span class=\"ruby-constant\">Hash</span>\r\n<span class=\"ruby-keyword\">end</span>\r\n\r\n<span class=\"ruby-identifier\">user</span> = <span class=\"ruby-constant\">User</span>.<span class=\"ruby-identifier\">create</span>(:<span class=\"ruby-identifier\">preferences</span> =<span class=\"ruby-operator\">&gt;</span> <span class=\"ruby-node\">%w( one two three )</span>)\r\n<span class=\"ruby-constant\">User</span>.<span class=\"ruby-identifier\">find</span>(<span class=\"ruby-identifier\">user</span>.<span class=\"ruby-identifier\">id</span>).<span class=\"ruby-identifier\">preferences</span>    <span class=\"ruby-comment\"># raises SerializationTypeMismatch</span>\r\n</pre>\r\n\r\n<p>When you specify a class option, the default value for that attribute will\r\nbe a new instance of that class.</p>\r\n\r\n<pre class=\"ruby\"><span class=\"ruby-keyword\">class</span> <span class=\"ruby-constant\">User</span> <span class=\"ruby-operator\">&lt;</span> <span class=\"ruby-constant\">ActiveRecord</span>\r\n<span class=\"ruby-operator\">::</span>\r\n<span class=\"ruby-constant\">Base</span>\r\n  <span class=\"ruby-identifier\">serialize</span> :<span class=\"ruby-identifier\">preferences</span>, <span class=\"ruby-constant\">OpenStruct</span>\r\n<span class=\"ruby-keyword\">end</span>\r\n\r\n<span class=\"ruby-identifier\">user</span> = <span class=\"ruby-constant\">User</span>.<span class=\"ruby-identifier\">new</span>\r\n<span class=\"ruby-identifier\">user</span>.<span class=\"ruby-identifier\">preferences</span>.<span class=\"ruby-identifier\">theme_color</span> = <span class=\"ruby-string\">\"red\"</span>\r\n</pre>',0,'2013-01-29 02:48:00','2013-01-29 02:53:31','2013-01-29 02:53:31',1,NULL,'saving-schema-less-object-to-rails-DB-s-string-column ','','','',681,'saving-schema-less-object-to-rails-db-s-string-column'),(77,'Linux 控制台神器：搜索历史命令 Ctrl + R    ( ctrl + r to search the history command )','<p>Linux下的神器 ctrl + r (reverse-i-search ) 的使用方法： &#160; (reverse-i-search usage: )&#160;</p>\r\n<p>(press ctl + r ) 输入任意字符，例如： \"mig\" &#160;就会出现 $ &#160;rake db:migrate &#160; &#160;( press ctrl + r, then input the content you want to search)&#160;</p>\r\n<p>如果我想找另一个命令呢？ &#160;输入完 \'mig\' 多按几次 ctrl + r ，就可以继续向前搜索 “mig\" 的内容了。 &#160;( if you want to search the last but n result, just press n times \'ctrl + r\'.)</p>\r\n<p>如果找到了，按 -&gt; 或者直接回车，就是执行 &#160;( press Enter to execute the command , or \'right arrow (-&gt;)\' to go to the end of the command.&#160;</p>\r\n<p>更多请看 (refer to )：<a href=\"http://www.thegeekstuff.com/tag/bash-control-r/ \" title=\"http://www.thegeekstuff.com/tag/bash-control-r/ \" target=\"_blank\">www.thegeekstuff.com/tag/bash-control-r/</a>&#160; &#160;</p>',0,'2013-01-29 07:30:00','2013-01-29 07:41:41','2013-01-29 07:41:41',1,NULL,'search-the-history-command-control-r','','','',952,'search-the-history-command-control-r'),(78,'Rails: 慎用 f.check_box  , 推荐使用 check_box_tag    ( prefer to use check_box_tag or hash, but not f.checkbox in Rails) ','<div class=\"description\">\r\n                  <p>TODO: 翻译成汉语&#160;</p>\r\n<p>\r\nReturns a checkbox tag tailored for accessing a specified attribute\r\n(identified by <tt>method</tt>) on an object assigned to the template\r\n(identified by <tt>object</tt>). This object must be an instance object\r\n(@object) and not a local object. It’s intended that <tt>method</tt>\r\nreturns an integer and if that integer is above zero, then the checkbox is\r\nchecked. Additional options on the input tag can be passed as a hash with\r\n<tt>options</tt>. The <tt>checked_value</tt> defaults to 1 while the\r\ndefault <tt>unchecked_value</tt> is set to 0 which is convenient for\r\nboolean values.\r\n</p>\r\n<h4>Gotcha</h4>\r\n<p>\r\nThe HTML specification says unchecked check boxes are not successful, and\r\nthus web browsers do not send them. Unfortunately this introduces a gotcha:\r\nif an <tt>Invoice</tt> model has a <tt>paid</tt> flag, and in the form that\r\nedits a paid invoice the user unchecks its check box, no <tt>paid</tt>\r\nparameter is sent. So, any mass-assignment idiom like\r\n</p>\r\n<pre>  @invoice.update_attributes(params[:invoice])\r\n</pre>\r\n<p>\r\nwouldn’t update the flag.\r\n</p>\r\n<p>\r\nTo prevent this the helper generates an auxiliary hidden field before the\r\nvery check box. The hidden field has the same name and its attributes mimic\r\nan unchecked check box.\r\n</p>\r\n<p>\r\nThis way, the client either sends only the hidden field (representing the\r\ncheck box is unchecked), or both fields. Since the HTML specification says\r\nkey/value pairs have to be sent in the same order they appear in the form,\r\nand parameters extraction gets the last occurrence of any repeated key in\r\nthe query string, that works for ordinary forms.\r\n</p>\r\n<p>\r\nUnfortunately that workaround does not work when the check box goes within\r\nan array-like parameter, as in\r\n</p>\r\n<pre>  &lt;%= fields_for \"project[invoice_attributes][]\", invoice, :index =&gt; nil do |form| %&gt;\r\n    &lt;%= form.check_box :paid %&gt;\r\n    ...\r\n  &lt;% end %&gt;\r\n</pre>\r\n<p>\r\nbecause parameter name repetition is precisely what <a href=\"../../Rails.html\">Rails</a> seeks to distinguish the elements of the\r\narray. For each item with a checked check box you get an extra ghost item\r\nwith only that attribute, assigned to “0”.\r\n</p>\r\n<p>\r\nIn that case it is preferable to either use <tt>check_box_tag</tt> or to\r\nuse hashes instead of arrays.\r\n</p>\r\n<h4>Examples</h4>\r\n<pre>  # Let\'s say that @post.validated? is 1:\r\n  check_box(\"post\", \"validated\")\r\n  # =&gt; &lt;input name=\"post[validated]\" type=\"hidden\" value=\"0\" /&gt;\r\n  #    &lt;input type=\"checkbox\" id=\"post_validated\" name=\"post[validated]\" value=\"1\" /&gt;\r\n\r\n  # Let\'s say that @puppy.gooddog is \"no\":\r\n  check_box(\"puppy\", \"gooddog\", {}, \"yes\", \"no\")\r\n  # =&gt; &lt;input name=\"puppy[gooddog]\" type=\"hidden\" value=\"no\" /&gt;\r\n  #    &lt;input type=\"checkbox\" id=\"puppy_gooddog\" name=\"puppy[gooddog]\" value=\"yes\" /&gt;\r\n\r\n  check_box(\"eula\", \"accepted\", { :class =&gt; \'eula_check\' }, \"yes\", \"no\")\r\n  # =&gt; &lt;input name=\"eula[accepted]\" type=\"hidden\" value=\"no\" /&gt;\r\n  #    &lt;input type=\"checkbox\" class=\"eula_check\" id=\"eula_accepted\" name=\"eula[accepted]\" value=\"yes\" /&gt;\r\n</pre>\r\n\r\n                </div>',0,'2013-01-30 01:21:00','2013-01-30 01:24:48','2013-01-30 01:24:48',1,NULL,'prefer-to-use-check-box-tag-in-rails','','','',1043,'prefer-to-use-check-box-tag-in-rails'),(79,'在Rails中，删除某个hash中的多个key (delete multiple keys from a hash in Rails  )','参考:  <a href=\"http://stackoverflow.com/questions/1560572/ruby-delete-multiple-hash-keys\" target=\"_blank\"> http://stackoverflow.com/questions/1560572/ruby-delete-multiple-hash-keys </a>\r\n\r\n<pre>sg552@youku:/sg552/workspace/postman$ bundle exec rails c\r\nLoading development environment (Rails 3.2.9)\r\n&gt;&gt; apple = {:shape =&gt; \'ball\', :taste =&gt; \'sweet\', :color =&gt; \'red\' }\r\n=&gt; {:shape=&gt;\"ball\", :taste=&gt;\"sweet\", :color=&gt;\"red\"}\r\n\r\n&gt;&gt; apple.except(:shape, :color)\r\n=&gt; {:taste=&gt;\"sweet\"}\r\n</pre>\r\n\r\n<p>结论： ActiveSupport 需要我们挖掘的东西太多了， 有空时务必看一下  (  we need to keep learning ActiveSupport )</p>',0,'2013-01-30 02:09:00','2013-01-30 02:12:41','2013-01-30 02:12:41',1,NULL,'delete-multiple-keys-from-hash-in-rails','','','',622,'delete-multiple-keys-from-hash-in-rails'),(80,'如何查看某个Action的RESTful 类型？(how to determine the restful type of an action in Rails? )','<p>今天为了这个问题想了半小时。呃。。。又是看RAILS源代码又是查文档啥的。 后来才发现，有个灰常简单的方法： &#160;( today I spent half an hour on this question, checking both the source code &#160;and the documentation. &#160;at last, I found this very simple solution: )</p>\r\n\r\n<pre>  # in rails application controller.   params is the common parameter as you know. \r\n  def restful_method(params)\r\n    params[:authenticity_token].blank? ? \'get\' : ((params[:_method]) || \'post\')\r\n  end\r\n</pre>\r\n<p>a bit more about the source code, see: &#160;gems/railties-3.0.8/lib/rails/tasks/routes.rake</p>',0,'2013-01-30 07:33:00','2013-01-30 07:38:02','2013-01-30 07:38:02',1,NULL,'how-to-determine-the-restful-type-of-an-action-in-rails','','','',605,'how-to-determine-the-restful-type-of-an-action-in-rails'),(81,'建立rails engine gem ( how to write a rails engine gem ) ','<p>注意：这个文章只针对Rails3.0.x 对于 后面的版本 &#160;, 请看 $ rails plugin new  (Enginex is only available for Rails 3.0. *For Rails 3.1 onwards, Enginex was ported to Rails as `rails plugin new` by Piotr Sarnacki.* )</p>\r\n<p>参考： <a href=\"http://coding.smashingmagazine.com/2011/06/23/a-guide-to-starting-your-own-rails-engine-gem/\" target=\"_blank\">http://coding.smashingmagazine.com/2011/06/23/a-guide-to-starting-your-own-rails-engine-gem/</a>\r\n</p>\r\n<p>昨天上午打算发布自己的第一个RAILS GEM （也叫 rails engine gem)  ，但是失败了，原因是不知道如何引入，或者扩展RAILS 的controller, views 等等。搜了一些文章，终于找到关键的了，所以一步一步的记录下来。 </p>\r\n<p>我们使用 enginex 这个gem, 作者是 Rails 的核心提交人员。这个GEM的作用是使大家对于RAILS ENGINE的开发更加快速，不必关注一些边缘的知识，把精力用在刀刃上～ 。</p>\r\n<p> 先看它是如何安装的</p>\r\n<pre>$ gem install enginex\r\n$ engine audited_controller\r\n\r\n      STEP 1  Creating gem skeleton\r\n      create  \r\n      create  audited_controller.gemspec\r\n      create  Gemfile\r\n      create  MIT-LICENSE\r\n      create  README.rdoc\r\n      create  Rakefile\r\n      create  lib/audited_controller.rb\r\n      create  test\r\n      create  test/audited_controller_test.rb\r\n      create  test/integration/navigation_test.rb\r\n      create  test/support/integration_case.rb\r\n      create  test/test_helper.rb\r\n      create  .gitignore\r\n\r\n      STEP 2  Vendoring Rails application at test/dummy\r\n      create  \r\n      create  README\r\n      create  Rakefile\r\n      create  config.ru\r\n      create  .gitignore\r\n      .....\r\n     STEP 3  Configuring Rails application\r\n       force  test/dummy/config/boot.rb\r\n       force  test/dummy/config/application.rb\r\n\r\n      STEP 4  Removing unneeded files\r\n      remove  test/dummy/.gitignore\r\n      remove  test/dummy/db/seeds.rb\r\n      remove  test/dummy/doc\r\n      ......\r\n\r\n</pre>\r\n<p>1. 修改 gemspec 文件。加入必要的内容</p>\r\n<pre># audited_controller.gemspec\r\nGem::Specification.new do |s| \r\n  s.name = \"audited_controller\"\r\n  s.summary = \"a tool to help auditing the actions of controller.\"\r\n  s.description = \"easily audit your actions\"\r\n  #s.files = Dir[\"{app,lib,config}/**/*\"] + [\"MIT-LICENSE\", \"Rakefile\", \"Gemfile\", \"README.rdoc\"]\r\n  s.version = AuditedController::VERSION\r\n  s.authors = [\"Siwei Shen\"]\r\n  s.email = [\"sg552sg552@gmail.com\"]\r\n  s.homepage = \"siwei.me\"\r\n  s.files = `git ls-files`.split(\"\\n\")\r\n  s.executables = `git ls-files`.split(\"\\n\").map{|f| f =~ /^bin\\/(.*)/ ? $1 : nil}.compact\r\n  s.require_path = \'lib\'\r\nend\r\n\r\n</pre>\r\n<p> 2. 编辑 Gemfile</p>\r\n<pre># Gemfile\r\nsource \"http://rubygems.org\"\r\n  \r\ngem \"rails\", \"&gt;= 3.0.0\"\r\ngem \"capybara\", \"&gt;= 0.4.0\"\r\ngem \"sqlite3\"\r\n</pre>\r\n<p> 3. 增加3个文件</p>\r\n<pre>1. version.rb :  \r\n# lib/audited_controller/version.rb\r\n module AuditedController\r\n   VERSION=\'0.0.7\'\r\n end\r\n\r\n2.\r\n# lib/audited_controller.rb\r\nrequire \'active_support/dependencies\'\r\nmodule AuditedController\r\n  mattr_accessor :app_root\r\n  def self.setup\r\n    yield self\r\n  end \r\nend\r\nrequire \'audited_controller/engine\'\r\n\r\n\r\n3. engine.rb\r\n# lib/audited_controller/engine.rb\r\nmodule AuditedController\r\n  class Engine &lt; Rails::Engine\r\n    initialize \'audited_controller.load_app_instance_data\' do |app|\r\n      config.app_root = app.root\r\n    end \r\n    initialize \"team_page.load_static_assets\" do |app|\r\n      app.middleware.use ::ActionDispatch::Static, \"#{root}/public\"\r\n    end \r\n\r\n  end \r\nend\r\n</pre>\r\n<p> 4. 重点来了： 建立 model.  在这个GEM中，我要用到一个model:  audit.  所以，要有一个task 来运行migration:   </p>\r\n<pre># file: lib/generators/audited_controller/audited_controller_generator.rb\r\nrequire \'rails/generators\'\r\nrequire \'rails/generators/migration\'\r\n    \r\nclass AuditedControllerGenerator &lt; Rails::Generators::Base\r\n  include Rails::Generators::Migration\r\n  def self.source_root\r\n    @source_root ||= File.join(File.dirname(__FILE__), \'templates\')\r\n  end\r\n\r\n  def self.next_migration_number(dirname)\r\n    if ActiveRecord::Base.timestamped_migrations\r\n      Time.new.utc.strftime(\"%Y%m%d%H%M%S\")\r\n    else\r\n      \"%.3d\" % (current_migration_number(dirname) + 1)\r\n    end\r\n  end\r\n\r\n  def create_migration_file\r\n    migration_template \'migration.rb\', \'db/migrate/create_audits_table.rb\'\r\n  end\r\nend\r\n</pre>\r\n<p>4.2 还要增加对应的migration 模板文件： </p>\r\n<pre>#  lib/generators/audited_controller/templates/migration.rb\r\n# -*- encoding : utf-8 -*-\r\nclass CreateAudits&lt; ActiveRecord::Migration\r\n  def change\r\n    create_table :audits, :comment =&gt; \'记录用户操作日志\' do |t|\r\n      t.string :action, :comment =&gt; \'用户访问的action\'\r\n      t.string :controller, :comment =&gt; \'用户访问的controller\'\r\n      t.string :description, :comment =&gt; \'具体描述\'\r\n      t.string :user_name, :comment =&gt; \'用户名\'\r\n      t.text :params, :comment =&gt; \'request的详细参数\'\r\n      t.string :remote_ip, :comment =&gt; \'用户的IP地址\'\r\n      t.string :restful_method, :comment =&gt; \'RESTful method, get, put, post, delete 中的一种\'\r\n\r\n      t.timestamps\r\n    end\r\n  end\r\nend \r\n\r\n</pre>\r\n<p>4.3 还要增加对应的model  文件</p>\r\n<pre># app/models/audited_controller/audit.rb\r\n# -*- encoding : utf-8 -*-\r\nclass Audit &lt; ActiveRecord::Base\r\n  attr_accessible :action, :controller, :description, :user_name, \r\n    :params, :remote_ip, :restful_method\r\n  AUDIT_TYPE_NO_GET = \'no get\'\r\n  AUDIT_TYPE_PUSH = \'push\'\r\n  AUDIT_TYPE_CREATE_MESSAGE = \'create_message\'\r\n  AUDIT_TYPE_UPDATE_MESSAGE = \'update_message\'\r\n  AUDIT_TYPE_APPROVAL = \'approval\'\r\nend\r\n</pre>\r\n\r\n<p>5.  配置正确的话， rubygem中的 app 和  config 目录是会被自动加载的。所以。... 建立我们的config/routes.rb : </p>\r\n<pre># config/routes.rb \r\nRails.application.routes.draw do\r\n  resources :audits\r\nend\r\n</pre>\r\n<p>6. 还要加上controllers 啊亲！ </p>\r\n<pre># application_controller.rb \r\n# -*- encoding : utf-8 -*-\r\nclass ApplicationController &lt; ActionController::Base\r\n  puts \"== in gem\'s application_controller\"\r\n  def add_to_audit\r\n    audit_config = HashWithIndifferentAccess.new(YAML.load(File.read(\r\n      File.expand_path(\"#{Rails.root}/config/audits.yml\", __FILE__))))\r\n    controller = params[:controller]\r\n    action = params[:action]\r\n    request_type = restful_method(params)\r\n    return if !audit_get_request?(audit_config) &amp;&amp; request_type == \'get\'\r\n    Audit.create!(action: action, controller: controller, user_name: current_user.login,\r\n      description: audit_config[controller][action],\r\n      :params =&gt; params.inspect,\r\n      remote_ip: request.remote_ip, restful_method: restful_method(params) )\r\n  end\r\n  private\r\n  def audit_get_request?(audit_config)\r\n    audit_config[\"audit_get_request\"]\r\n  end\r\n  # return: get, post, put or delete\r\n  def restful_method(params)\r\n    params[:authenticity_token].blank? ? \'get\' : ((params[:_method]) || \'post\')\r\n  end\r\n\r\nend   \r\n</pre>\r\n<p> 以及对应的 audits_controller.rb\r\n</p>\r\n<pre># app/controllers/application_controller.rb\r\n# -*- encoding : utf-8 -*-\r\nclass AuditsController &lt; ApplicationController\r\n  before_filter CASClient::Frameworks::Rails::Filter\r\n  def index\r\n    @audits = params[:user_name].blank? ?\r\n      Audit :\r\n      Audit.where(\"user_name like ?\",  \"%#{params[:user_name]}%\")\r\n    @audits = case params[:audits_type]\r\n      when Audit::AUDIT_TYPE_NO_GET then @audits.where(\"restful_method != \'get\'\")\r\n      when Audit::AUDIT_TYPE_PUSH then @audits.where(\"action = \'confirm_push\'\")\r\n      when Audit::AUDIT_TYPE_APPROVAL then @audits.where(\"action = \'update_approval\'\")\r\n      when Audit::AUDIT_TYPE_CREATE_MESSAGE then @audits.where(\"description = \'建立了一条消息\'\")\r\n      when Audit::AUDIT_TYPE_UPDATE_MESSAGE then @audits.where(\"description= \'更新消息\'\")\r\n      else @audits\r\n      end \r\n    @audits = @audits.where(\"created_at &gt;= ? \", params[:created_at_before]) unless params[:created_at_befo\r\n    @audits = @audits.where(\"created_at &lt;= ? \", DateTime.strptime(params[:created_at_after], \'%Y-%m-%d\').t\r\n    @audits = @audits.order(\'created_at desc\').page(params[:page])\r\n  end \r\nend\r\n</pre>\r\n<p> 以及这个controller: </p> \r\n<pre># -*- encoding : utf-8 -*-\r\nclass AuditsController &lt; ApplicationController\r\n  before_filter CASClient::Frameworks::Rails::Filter\r\n  def index\r\n    @audits = params[:user_name].blank? ?\r\n      Audit :\r\n      Audit.where(\"user_name like ?\",  \"%#{params[:user_name]}%\")\r\n    @audits = case params[:audits_type]\r\n      when Audit::AUDIT_TYPE_NO_GET then @audits.where(\"restful_method != \'get\'\")\r\n      when Audit::AUDIT_TYPE_PUSH then @audits.where(\"action = \'confirm_push\'\")\r\n      when Audit::AUDIT_TYPE_APPROVAL then @audits.where(\"action = \'update_approval\'\")\r\n      when Audit::AUDIT_TYPE_CREATE_MESSAGE then @audits.where(\"description = \'建立了一条消息\'\")\r\n      when Audit::AUDIT_TYPE_UPDATE_MESSAGE then @audits.where(\"description= \'更新消息\'\")\r\n      else @audits\r\n      end\r\n    @audits = @audits.where(\"created_at &gt;= ? \", params[:created_at_before]) unless params[:created_at_befo\r\n    @audits = @audits.where(\"created_at &lt;= ? \", DateTime.strptime(params[:created_at_after], \'%Y-%m-%d\').t\r\n    @audits = @audits.order(\'created_at desc\').page(params[:page])\r\n  end \r\nend\r\n\r\n</pre>\r\n<p> 6 .增加 views </p>\r\n<pre>用户的操作日志\r\n&lt;%# render :partial =&gt; \'search_form\' %&gt;\r\n&lt;%# paginate @audits %&gt;\r\n\r\n&lt;% @audits.each do |audit| %&gt;\r\n  \r\n&lt;% end %&gt;\r\n<table class=\"table table-hover\">\r\n  <tbody><tr>\r\n    <th style=\"width: 100px\"> 用户名</th>\r\n    <th>操作</th>\r\n    <th style=\"width: 180px\">时间</th>\r\n    <th>IP</th>\r\n    <th style=\"width: 300px\">详细参数</th> \r\n  </tr>\r\n<tr>\r\n    <td>&lt;%= audit.user_name %&gt;</td>\r\n    <td>&lt;%= audit.description %&gt;</td>\r\n    <td>&lt;%= audit.created_at %&gt;</td>\r\n    <td>&lt;%= audit.remote_ip %&gt;</td>\r\n    <td>&lt;%= audit.params %&gt;</td>\r\n  </tr>\r\n</tbody>\r\n</table>\r\n&lt;%# paginate @audits %&gt;\r\n]]&gt;\r\n</pre>',0,'2013-01-31 06:50:00','2013-01-31 06:52:59','2013-02-01 01:37:31',1,NULL,'writing-rails-engine-gem','','','',822,'writing-rails-engine-gem'),(82,'RAILS中的 rubygem:   cells  ( cells rubygem )','<p>这几天在弄Rails engine gem, 然后从 regular rubygem -&gt; enginex -&gt; rails plugin -&gt; &#160;Apotomo &#160;-&gt; \'cells\'. &#160; &#160;( these days I am dealing with how to setup \'rails engine gem\', the resources I have read are: &#160;<br />1. regular rubygems doc.<br />2. enginex rubygem. &#160;( for rails 3.0.x)<br />3. rails plugin ( 3.1.x, 3.2.x )&#160;<br />4. apotomo &#160;( to run the gem\'s test)<br />5. cells.&#160;</p>\r\n<p>&#160;今天试了下\"cells\" 这个rubygem, github上关注度到了1300+。 ( <a href=\"https://github.com/apotonick/cells\">https://github.com/apotonick/cells</a>)  &#160;&#160;</p>\r\n<p>很简单，按照官方的文档一步一步做就可以了：</p>\r\n<p>1. 在Gemfile中 ： &#160; &#160;gem \'cells\'</p>\r\n<p>2. 生成对应的scaffolding: &#160; &#160;</p>\r\n<pre>$ rails generate cell cart show -e haml\r\n  create  app/cells/\r\n  create  app/cells/cart\r\n  create  app/cells/cart_cell.rb\r\n  create  app/cells/cart/show.html.haml\r\n  create  test/cells/cart_test.rb\r\n</pre>\r\n<p> 3. 可以在某个view中把 生成的cell views 嵌入进去</p>\r\n<pre># in other views: \r\n<div id=\"header\">\r\n  &lt;%= render_cell :cart, :show, :user =&gt; @current_user %&gt;\r\n</div>\r\n</pre>\r\n<p> controller: </p>\r\n<pre># cells controller \r\nclass CartCell &lt; Cell::Rails\r\n  def show(args)\r\n    user    = args[:user]\r\n    @items  = user.items_in_cart\r\n\r\n    render  # renders show.html.haml\r\n  end\r\nend\r\n</pre>\r\n<p># cells views </p>\r\n<pre># show.html.haml\r\n#cart\r\n  You have #{@items.size} items in your shopping cart.\r\n</pre>\r\n<p>cells的优点： 可以减少 before filter, partial 和 helper的使用。 一个cell跟一个controller差不多。一个页面中可以包含多个cells. &#160;&#160;</p>\r\n<p>给我的感觉： 貌似比before_filter 好一些，确实是一个 Cart的不错的解决方案。 用起来跟controller一样，还可以在某个页面中多次使用。</p>\r\n<p>(Say you’re writing a Rails online shop - the shopping cart is reappearing again and again in every view. You’re thinking about a clean solution for that part. A mixture of controller code, before-filters, partials and helpers?&#160;\r\n</p>\r\n<p>Cells are View Components for Rails. They look and feel like controllers. They don’t have no DoubleRenderError. They can be rendered everywhere in your controllers or views. They are cacheable, testable, fast and wonderful. They bring back OOP to your view and improve your software design. ) </p>',0,'2013-02-01 02:05:00','2013-02-01 02:24:04','2013-02-01 02:26:26',1,NULL,'cells-rubygem-for-rails','','','',685,'cells-rubygem-for-rails'),(83,'一个视图层的gem: apotomo ( rubygem apotomo for Rails. )','<h3 style=\"color:red\"> 好吧，我失败了。。。  没有成功的跑起来，虽然经过查看源代码等等修改，也还是一直有失败消息。我怀疑这个GEM 不兼容 3.2.11 ，或者作者已经停止维护了（上一次提交代码是2个月前，再一次是8个月前，还有20+ issue没有 解决， 好多pull request 没有处理）  (OK, I admit that I failed to manage  this to work. I don\'t think this gem is compatible with Rails 3.2.11, and its last commit is 2 month ago, last but 1 commit is 8 months ago, and a dozen issues not fixed, many pull requests not processed.  ) </h3>\r\n\r\n<p>这几天在调试 rubygem for rails (including views/controllers/... ) , 所以google到了apotomo, 记录一下。（these days I am creating a rails engine gem, so I found apotomo, a rails view components framework )&#160;</p>\r\n<p>1. edit Gemfile: &#160;gem \'apotomo\'</p>\r\n<p>2. &#160;假设已经存在一个 模块：post, &#160; 它\"has_many comments\", 那么就需要： &#160;run the generation command &#160; &#160;(assuming we already have a \'post\' module which has_many \'comments\' )&#160;</p>\r\n<pre>sg552@youku:/sg552/workspace/test-cell$ bundle exec rails generate apotomo:widget Comments display write -e haml\r\n      invoke  haml\r\n      create    app/widgets/comments/display.html.haml\r\n      create    app/widgets/comments/write.html.haml\r\n      invoke  test_unit\r\n      create    test/widgets/comments_widget_test.rb\r\n      create  app/widgets/comments_widget.rb\r\n\r\n</pre>\r\n<p> 3. in post_controller: </p>\r\n<pre>class PostsController &lt; ApplicationController\r\n  include Apotomo::Rails::ControllerMethods\r\n\r\n  has_widgets do |root|\r\n    root &lt;&lt; widget(:comments, :post =&gt; @post)\r\n  end\r\n  def index \r\n    #...\r\n  end\r\nend\r\n</pre>\r\n<p> 4. in app/views/posts/show.html.haml </p>\r\n<pre>%h1 @post.title\r\n\r\n%p\r\n  @post.body\r\n\r\n%p\r\n  = render_widget :comments\r\n</pre>\r\n<p> 5. 实现这个 widget (一个迷你型的controller ) </p> \r\n<pre>class CommentsWidget &lt; Apotomo::Widget\r\n  responds_to_event :post\r\n\r\n  def display(args)\r\n    @comments = args[:post].comments\r\n    render\r\n  end \r\n  def post(evt)\r\n    @comment = Comment.new(:book_id =&gt; evt[:book_id])\r\n    @comment.update_attributes evt[:comment]  # a bit like params[].\r\n    update :state =&gt; :display\r\n  end\r\nend\r\n</pre>\r\n<p> 6. 最后，  display.html.haml 中： </p>\r\n<pre>= widget_div do\r\n  %ul\r\n    - for c in @comments\r\n      %li c.text\r\n\r\n  - form_for :comment, @comment, :url =&gt; url_for_event(:post), :remote =&gt; true do |f|\r\n    = f.error_messages\r\n    = f.text_field :text\r\n\r\n    = submit_tag \"Don\'t be shy, comment!\"\r\n</pre>\r\n\r\n<p> 好吧，我失败了。。。  没有成功的跑起来，虽然经过查看源代码等等修改，也还是一直有失败消息。我怀疑这个GEM 不兼容 3.2.11 ，或者作者已经停止维护了（上一次提交代码是2个月前，再一次是8个月前，还有20+ issue没有 解决， 好多pull request 没有处理） </p>',0,'2013-02-01 02:24:00','2013-02-01 02:34:08','2013-02-04 02:32:27',1,NULL,'rubygem-apotomo-for-rails','','','',614,'rubygem-apotomo-for-rails'),(84,'建立个简单的git server: gitosis ( gitosis: setting up a git server without complex authorization)','<p style=\"color:red\"> 注意： Gitosis 已经过时了，貌似不再维护。建议使用 gitolite. ( gitosis is long-defunct , let\'s use gitolite instead ) . \r\n所以我安装到倒数第二步的时候就放弃了。 参考： <a href=\"http://engineeredweb.com/blog/10/2/building-your-own-git-server/\">http://engineeredweb.com/blog/10/2/building-your-own-git-server/</a>\r\n</p>\r\n<p>如果每个核心成员都拥有一样的权限，那么GIT SERVER就非常简单了。 ( it\'s very simple to setup a git server if every committer has the same authorization )&#160;</p>\r\n<p>1. $ sudo apt-get install git-core </p>\r\n<p>2. setup git user: </p>\r\n<pre>sudo adduser \\\r\n--system \\\r\n--shell /bin/sh \\\r\n--gecos ‘git version control’ \\\r\n--group \\\r\n--disabled-password \\\r\n--home /home/git \\\r\ngit\r\n</pre>\r\n<p>3. $ su git <br /> $ mkdir ~/repositories </p>\r\n<p>4. $ su sg552 <br />  $ sudo apt-get install python-setuptools ( which is used for gitosis\' setup)</p>\r\n<p>5. get and setup gitosis : </p>\r\n<pre>cd /tmp\r\ngit clone https://github.com/res0nat0r/gitosis.git\r\ncd gitosis\r\nsudo python setup.py install\r\n</pre>\r\n<p>6. $ gitosis-init &lt;~/.ssh/id_rsa.pub </p>\r\n<p>7. $ cd /sg552/apps &amp;&amp; git clone sg552@192.168.1.36:gitosis-admin.git &#160;( don\'t use: localhost as the server address)&#160;</p>\r\n<p>8. $ edit your config file and submit ( sorry but I failed )&#160;</p>\r\n\r\n<p>参考(refer to ) ：<a href=\"https://github.com/res0nat0r/gitosis\">  https://github.com/res0nat0r/gitosis </a>\r\n</p>',0,'2013-02-09 00:29:00','2013-02-09 00:46:42','2013-02-09 06:52:51',1,NULL,'setting-up-a-gitosis-server','','','',696,'setting-up-a-gitosis-server'),(85,'建立Gitolite ( setting up gitolite server) ','<p>gitosis 是比较古老的的GIT server。 我今天早上弄了一下，发现官方的文档很不好用啊亲！自己之前成功的搭建过，今天居然不行。搜索了一下，发现官方承认他们文档欠缺，而且网上的声音也认为它失效很久了（long-defunct ) 。大家都用 gitolite 来搭建GIT 服务。而且GITOLITE的GITHUB关注度是 4000+, GITOSIS 400。 所以，我打算用gitolite来做~~~ &#160;(gitosis is an old product of git server. This morning I tried to setup a gitosis server, but failed on the last but two steps. I found its official document admits that it\'s lacking of document and out-of-date. And many posts say that \"gitosis\" is \"defunct\" , and let\'s use gitolite instead. On github, 4000+ people is watching gitolite, but only 400 watching gitosis. )&#160;</p>\r\n<p>参考1：refer to :&#160;<a href=\"http://sitaramc.github.com/3-server-usage/git-server.html\" title=\"http://sitaramc.github.com/3-server-usage/git-server.html\" target=\"_blank\">http://sitaramc.github.com/3-server-usage/git-server.html</a>&#160; &#160;</p>\r\n<p>参考2：refer to :&#160;<a href=\"http://engineeredweb.com/blog/10/2/building-your-own-git-server/\" title=\"http://engineeredweb.com/blog/10/2/building-your-own-git-server/\" target=\"_blank\">http://engineeredweb.com/blog/10/2/building-your-own-git-server/</a>\r\n</p>\r\n<p>1. login as \'git\' user. &#160;( useradd git, then passwd git , then su git ... )&#160;</p>\r\n<p>2.&#160;git clone git://github.com/sitaramc/gitolite</p>\r\n<p>3.&#160;git clone git://github.com/sitaramc/gitolite<br />            mkdir -p $HOME/bin<br />            gitolite/install -to $HOME/bin<br />home/git/bin/gitolite setup -pk YourName.pub</p>\r\n<p style=\"color:red\"> 注意：这里的 ssh pub key 绝对不可以有密码。 </p> \r\n<p>这时可以看到， gitolite为我们新建了 /home/git/repositories ... 等文件</p>\r\n<pre>-rw-rw-r-- 1 git git   12 Feb  9 15:10 projects.list\r\ndrwxrwxr-x 4 git git 4096 Feb  9 15:10 repositories\r\n</pre>\r\n<p>4. 下面的用法跟 gitosis一样， 想加入用户，就进入到gitolite folder,：<br />&#160; 4.1 编辑 conf/gitolite.conf, 加入&#160;<br />        repo foo<br />&#160; RW+         =   alice<br />&#160; RW          =   bob<br />&#160; 4.2 把 alice 和 bob 的pub文件 都放到 keydir下。 &#160;<br />&#160; 4.3 commit &amp; push.&#160;</p>\r\n<p>5. create new repo: &#160;编辑 config/gitolite.conf， 增加</p>\r\n<pre>repo shuashua_printer\r\n    RW+     =   @all</pre>\r\n<p>然后 commit &amp; push gitolite-admin , 就可以了。</p>',0,'2013-02-09 06:55:00','2013-02-09 07:00:43','2013-02-09 08:17:39',1,NULL,'setting-up-gitolite-server','','','',670,'setting-up-gitolite-server'),(86,'SVN 到 GIT 的转换（converting svn to git）','<p>1.&#160;sudo apt-get install git-svn &#160; (make sure you have the \'git svn\' installed )&#160;</p>\r\n<p>2.&#160;First you have to create a file that maps your Subversion commit author names to Git commiters, say ~/authors.txt:</p>\r\n<pre>jmaddox = Jon Maddox &lt;jon@gmail.com\r\nbigpappa = Brian Biggs &lt;bigpappa@gmail.com&gt;</pre>\r\n<p>Then you can download the Subversion data into a Git repository:</p>\r\n<pre>mkdir repo &amp;&amp; cd repo<br />git svn init http://subversion/repo --no-metadata<br />git config svn.authorsfile ~/authors.txt<br />git svn fetch</pre>\r\n\r\n<p>参考：(refer to:) <a href=\"http://stackoverflow.com/questions/79165/how-to-migrate-svn-with-history-to-a-new-git-repository\">http://stackoverflow.com/questions/79165/how-to-migrate-svn-with-history-to-a-new-git-repository</a>\r\n</p>',0,'2013-02-17 01:27:00','2013-02-17 01:52:04','2013-02-17 01:52:44',1,NULL,'converting-svn-to-git','','','',555,'converting-svn-to-git'),(87,'Rails的精髓之：ActiveSupport ( studying acitve-support) ','<p>用了Rails 4年多了。不过还没认真看过ActiveSupport. 只是发现很多优雅的方法都是出自于其中：</p>\r\n<ul>\r\n<li>blank?&#160;</li>\r\n<li>in?</li>\r\n<li>revert_merge</li>\r\n<li>try</li>\r\n</ul>\r\n<p>所以，今天看了一下。发现最重要的一点是：如何引用 ActiveSupport:</p>\r\n<p>require \'active_support\' &#160;# doesn\'t work</p>\r\n<p>require \'active_support/all\' &#160;# ok!&#160;</p>\r\n<p> 下面是一些翻译： (参考：<a href=\"http://guides.rubyonrails.org/active_support_core_extensions.html\">http://guides.rubyonrails.org/active_support_core_extensions.html</a>) </p>\r\n\r\n<p>1. blank? v.s. present?  </p>\r\n<p> blank?  :   nil, false,  \'\',  空数组，空Hash, 以及 所有empty? == true 的，都是 返回true </p>\r\n<p> present?  == !blank? \r\n</p>\r\n<p>2. presence:  返回它的  present?  ? receiver : nil  </p> \r\n<pre>  host = config[:host].presence || \'localhost\' </pre>\r\n<p>3. duplicable?  能否复制？</p>\r\n<pre> \"\".duplicable?     # =&gt; true\r\nfalse.duplicable?  # =&gt; false\r\n</pre>\r\n<p>4. try:  试着调用某个方法。出现exception 就返回nil  </p>\r\n<p>5. singleton_class:  貌似跟eigen_class 有关。。。 目前我用的不多。只记得前者的获取比较麻烦。又要 def &lt;&lt; self 啥的。。。</p>\r\n<p>6. class_eval  这个不陌生了。。。用的很多地方</p>\r\n<p>7. acts_like?(:some_thing):  如果某个class 中定义了: def acts_like_banana? ; ... ; end,  这时， acts_like? :banana =&gt; true  </p>\r\n<p>8. to_param: &#160;对于active_model, 默认返回id.&#160;</p>\r\n<p>9. to_query:&#160;{:c =&gt; 3, :b =&gt; 2, :a =&gt; 1}.to_query # =&gt; \"a=1&amp;b=2&amp;c=3\" \r\n</p>\r\n<p>10. with_options ... 用来简化代码的。。。</p>\r\n<p>11. instance variables:</p>\r\n<pre>instance_variable_names  返回的都是字符\r\ninstance_values  \r\n</pre>\r\n<p>12. silence_warnings, &#160;silence_stream, quietly ...&#160;</p>\r\n<p>13 in? &#160; &#160; 1.in? [1,2,3] # =&gt; true</p>\r\n<p>太多了。。。先看到这里。</p>\r\n',0,'2013-02-17 03:02:00','2013-02-17 03:05:26','2013-02-17 03:32:23',1,NULL,'studying-active-support','','','',598,'studying-active-support'),(88,'Ruby meta programming spell: alias_method_chain','<p>了解这个spell的基础是，你要知道 alias_method ：的用法：  alias_method :new_name, :old_name </p> \r\n<p>这个东东非常常见，遍及RAILS代码的每个角落。起源是：</p>\r\n<p>1. 假设我们希望为某个方法加上新功能：&#160; 可以用 alias_method.  </p>\r\n<pre>ActionController::TestCase.class_eval do\r\n  # save a reference to the original process method\r\n  alias_method :original_process, :process\r\n \r\n  # now redefine process and delegate to original_process\r\n  def process(action, params=nil, session=nil, flash=nil, http_method=\'GET\')\r\n    params = Hash[*params.map {|k, v| [k, v.to_s]}.flatten]\r\n    original_process(action, params, session, flash, http_method)\r\n  end\r\nend\r\n</pre>\r\n<p>2. 上面的方法有一点风险：如果 original_process 这个方法名已经被使用了的话，程序就会不正常。所以，为了避免这个问题，大家习惯于为新方法加一个文字后缀：</p>\r\n<pre>ActionController::TestCase.class_eval do\r\n  def process_with_stringified_params(...)\r\n    params = Hash[*params.map {|k, v| [k, v.to_s]}.flatten]\r\n    process_without_stringified_params(action, params, session, flash, http_method)\r\n  end\r\n  alias_method :process_without_stringified_params, :process\r\n  alias_method :process, :process_with_stringified_params\r\nend\r\n</pre>\r\n<p> 3. 后来大家觉得一次写两个alias_method 好麻烦啊。 因为目的仅仅是为了新增加一个方法。而不是要改动两个方法。所以，就诞生了 alias_method_chain: </p>\r\n<pre>ActionController::TestCase.class_eval do\r\n  def process_with_stringified_params(...)\r\n    params = Hash[*params.map {|k, v| [k, v.to_s]}.flatten]\r\n    process_without_stringified_params(action, params, session, flash, http_method)\r\n  end\r\n  # 这里是核心，替代了原来的两个 alias_method.  \r\n  alias_method_chain :process, :stringified_params\r\nend\r\n</pre>',0,'2013-02-17 03:32:00','2013-02-17 03:40:41','2013-02-17 03:40:41',1,NULL,'alias-method-chain','','','',690,'alias-method-chain'),(89,'使用 request-log-analyzer 分析Rails 日志（using request-log-analyzer to analyze your Rails log ) ','<p>这个东东非常强大，可以分析Rails, Merb, Nginx, Apache, MySQL, postgres,  等各种日志。 &#160;( it supports many formats of logs , including: mysql, postgres, apache .nginx ... ) </p>\r\n<p>$ gem install request-log-analyzer&#160;</p>\r\n<p>简单用法： 分析一个文件，并且把它输出到 report-for-cms-logs.html 中： (simple usage: analyze and export the result to a file ) </p>\r\n<p>$ request-log-analyzer cms_production_2013-02-17.log --format rails3 --output HTML --file report-for-cms-logs.html</p>',0,'2013-02-18 09:22:00','2013-02-18 09:26:02','2013-02-18 09:26:02',1,NULL,'analyze-your-rails-log','','','',917,'analyze-your-rails-log'),(90,'调试js 也要关注它的调用过程(debugging jquery error )','<p>这几天发现了一个奇怪的JQUERY问题，页面加载后，打开developer tools, 发现有的页面有JS错误提示，说jquery.js 79行 有问题，有的页面就没有。 ( these days I am struggling about a jquery problem. when the page is loaded, the \'developer tool\' complaints that there\'s a js error, saying that jquery.js has problems on line 75.&#160;</p>\r\n<p><img src=\"/system/images/BAhbBlsHOgZmSSIyMjAxMy8wMi8yMS8wOV8yMF81MV82OTVfanNfZXJyb3JfY29sbGFwc2UucG5nBjoGRVQ/js-error-collapse.png\" title=\"Js Error Collapse\" alt=\"Js Error Collapse\" rel=\"450x450\" width=\"533\" height=\"132\" /></p>\r\n<p>很奇怪，jquery.js 这个源文件内容是完整的，正确的。没问题啊～～～ &#160;(but it\'s obviously that the jquery.js file is normal and correct )</p>\r\n<p>我甚至做了diff, 一点一点的排查正常页面和问题页面的区别，也没发现，直到昨天下午，点了一下developer tools 中提示JS错误的向下的箭头，才发现这个JS 出错提示，是可以打开的（ back stack trace ... ) &#160;可以查看所有JS代码的调用过程。 ( I didn\'t find any problem after \'diff\' the good page and the problem-page, until yesterday afternoon, I clicked the \'-&gt;\' right arrow of the error message on developer tool. &#160;)&#160;</p>\r\n<p>终于发现，根源在另外一个js 文件中。。。 呵呵。。。于是问题很快解决了～ &#160;( and I found the root cause of this error. now problem solved! )&#160;</p>\r\n<p><img src=\"/system/images/BAhbBlsHOgZmSSIwMjAxMy8wMi8yMS8wOV8yMV8wMl80NzZfanNfZXJyb3JfdW5mb2xkLnBuZwY6BkVU/js-error-unfold.png\" title=\"Js Error Unfold\" alt=\"Js Error Unfold\" rel=\"450x450\" width=\"534\" height=\"269\" /></p>',0,'2013-02-20 21:58:00','2013-02-20 22:04:50','2013-02-21 01:25:08',1,NULL,'debugging-jquery','','','',627,'debugging-jquery'),(91,'Github 的顶级项目 (top projects on github ) ','<p><a href=\"https://github.com/search?l=&amp;p=1&amp;q=stars:%22%3E+500%22&amp;ref=advsearch&amp;type=Repositories\" title=\"https://github.com/search?l=&amp;p=1&amp;q=stars:%22%3E+500%22&amp;ref=advsearch&amp;type=Repositories\" target=\"_blank\">https://github.com/search?l=&amp;p=1&amp;q=stars:%22%3E+500%22&amp;ref=advsearch&amp;type=Repositories</a>\r\n</p>',0,'2013-02-20 22:32:00','2013-02-20 22:33:39','2013-02-20 22:33:39',1,NULL,'top-projects-on-github','','','',546,'top-projects-on-github'),(92,'backup & restore all the Mysql databases','<p>$ mysqldump -u root --all-databases &gt; all_databases-2013-02-25.sql</p>\r\n<p>$ mysqldump -u&lt;user_name&gt; -p&lt;pwd&gt; -h10.103.&lt;ip&gt; --all-databases &gt; all_databases-2013-03-12.sql</p>\r\n<p>$ mysql -uroot -pecare2@ &lt; alldatabases.sql</p>',0,'2013-02-25 09:57:00','2013-02-25 10:04:18','2013-03-12 00:19:10',1,NULL,'backup-and-restore-all-databases-for-mysql','','','',579,'backup-and-restore-all-databases-for-mysql'),(93,'磁带转mp3    (converting tape to mp3 file  )','<p>1. 使用 audacity。它有录音功能 (using audacity to record)</p>\r\n<p>2. 需要有个磁带机（我买的复读机，70块一个，360上），有一根双头音频线。 ( you need a tape reader, ￥70 RMB , a double ended audio cable )</p>\r\n<p>3. 一段接在磁带机的耳机上，是声音输出，另外一段接在电脑声卡的line in 上。( one end to the tape reader, another end should be plugged into the \'linein\' port of your sound card )&#160;</p>\r\n<p>4. 记得要设置 电脑的 音频属性， linein 那里要 设置音量比较大才好啊。 但是不要过大。 ubuntu下，选择 unamplified 就好。 &#160; (config the source preference of you PC. &#160;make sure the&#160;volume&#160;is not too low )</p>\r\n<p><img src=\"/system/images/BAhbBlsHOgZmSSIwMjAxMy8wMi8yNy8xM180MF8xNF83Mjdfc291bmRfcmVjb3JkaW5nLnBuZwY6BkVU/sound-recording.png\" title=\"Sound Recording\" alt=\"Sound Recording\" rel=\"225x255\" width=\"1280\" height=\"800\" /></p>\r\n<p>5. 设置audacity, &#160;edit -&gt; preference -&gt; devices -&gt; recording 选择 &#160;pulse: line: 0</p>\r\n<p><img src=\"/system/images/BAhbBlsHOgZmSSI3MjAxMy8wMi8yNy8xM180MV8yMV8xMzRfY29uZmlnX2F1ZGFjaXR5X2RldmljZS5wbmcGOgZFVA/config_audacity_device.png\" title=\"Config Audacity Device\" alt=\"Config Audacity Device\" rel=\"225x255\" width=\"1280\" height=\"800\" /></p>\r\n<p>6. 点击录音，就可以录了。 然后试着听一下，看效果是否满意吧！ :) &#160; &#160;( then you can get started ! )&#160;</p>',0,'2013-02-27 05:31:00','2013-02-27 05:39:45','2013-02-27 05:44:11',1,NULL,'converting-tape-to-mp3','','','',698,'converting-tape-to-mp3'),(94,'grep patterns','cat cms_production_2013-02-20.log | grep \'in [0-9]\\{4,6\\}ms\'\r\n\r\nfind \' in xxxms\'  logs. ',0,'2013-03-01 13:17:00','2013-03-01 13:17:54','2013-03-01 13:18:25',1,NULL,'','','','grep-patterns',589,'grep-patterns'),(95,'Merge 与 Base的优缺点  ( GIT Merge v.s. Rebase  )','看这里： <a href=\"http://www.jarrodspillers.com/2009/08/19/git-merge-vs-git-rebase-avoiding-rebase-hell/\">http://www.jarrodspillers.com/2009/08/19/git-merge-vs-git-rebase-avoiding-rebase-hell/ </a>\r\n\r\n\r\nConclusion:\r\n\r\nMerge works great, but creates lots of empty merge commits when you are working on a team.\r\nRebase keeps things tidy, but is destructive and potentially dangerous if you don’t know what you are doing.\r\nKeep yourself safe with a simple rule:\r\n\r\nDon’t rebase branches you have shared with another developer.\r\n\r\nDo otherwise at your own peril - yes, it will hurt.\r\n',0,'2013-03-04 09:29:00','2013-03-04 09:30:53','2013-03-04 09:30:53',1,NULL,'git-merge-vs-rebase','','','',773,'git-merge-vs-rebase'),(96,'一点点git的分支知识（more about git branch ) ','<p> $ git branch -a 的结果：  ( this morning, I ran a GIT command and got its result: )</p>\r\n<pre>sg552@youku:/sg552/workspace/m-cms$ git branch -a\r\n  clean_cache\r\n* master\r\n  siwei_branch\r\n  remotes/origin/HEAD -&gt; origin/master\r\n  remotes/origin/master\r\n  remotes/origin/siwei_branch\r\n</pre>\r\n<p> 我很好奇， origin/HEAD  和  origin/master 都是啥，两者有啥关系。搜索了一下，发现： origin/HEAD是默认的checkout 分支。 HEAD-》 master 表示 默认的分支就是origin/master.  ( I am curious about what are the HEAD and origin/master, what relationship is between them. after googling around, i found that origin/HEAD is the default cloned branch , and it\'s pointing to origin/master in my case ) </p>\r\n<p> 命令： git remote show origin 可以显示本地和远程的origin 上的分支情况  ( command $ git remote show origin lists the branches in local and remotely ) </p>\r\n\r\n<pre>sg552@youku:/sg552/workspace/m-cms$ git remote show origin\r\n* remote origin\r\n  Fetch URL: ssh://shensiwei@gforge.1verge.net:22022/gitroot/m-cms\r\n  Push  URL: ssh://shensiwei@gforge.1verge.net:22022/gitroot/m-cms\r\n  HEAD branch: master\r\n  Remote branches:\r\n    master       tracked\r\n    siwei_branch tracked\r\n  Local branch configured for \'git pull\':\r\n    master merges with remote master\r\n  Local refs configured for \'git push\':\r\n    master       pushes to master       (up to date)\r\n    siwei_branch pushes to siwei_branch (fast-forwardable)\r\n</pre>',0,'2013-03-06 01:12:00','2013-03-06 01:16:44','2013-03-06 01:16:44',1,NULL,'more-about-git-branch','','','',593,'more-about-git-branch'),(97,'ruby 操作zookeeper 的比较  (zookeeper ruby clients comparison) ','<p>为了寻找一个比较合适的RUBY ZOOKEEPER客户端，搜索了一下。( I am involving a project that uses zookeeper as a component and I am looking for a suitable ruby client for zookeeper. and I googled around with the results below: &#160;)</p>\r\n<p> 1. <a href=\"https://github.com/myelin/zookeeper_client\">https://github.com/myelin/zookeeper_client</a> 比较古老，5年前的东东了， 一直没更新啊有木有。 虽然看起来 一些基本操作都支持，但是没人维护了。果断不用。 ( its last commit is 5 year ago, it\'s out of date, although it supports all the basic operations like : get, set ... )&#160;</p>\r\n<p> 2. <a href=\"https://github.com/slyphon/zookeeper\">https://github.com/slyphon/zookeeper</a> 这个是比较新的客户端，用作者的原话是 ruby low level wrapper for zookeeper.  看了下文档，它应该是前者的加强版。前者有的功能它这里都有（有意思的是前者的文档被他原封不动的复制过来了^_^）  最新的提交时间是22天前，说明维护和开发还在持续进行中。 ( this is newer, its last commit is 22 days ago, it\'s the \'ruby low level wrapper for zookeeper, and it\'s a super set for the previous one. )</p>\r\n<p> 另外，第二个项目的作者，他还有另外一个 high level ruby wrapper for zookeeper ( 见 <a href=\"https://github.com/slyphon/zk\">https://github.com/slyphon/zk</a> ）</p>\r\n<p> 所以，果断选择第二种啊。 ( I decided to use the latter one in my project without a hesitate. )&#160;</p> ',0,'2013-03-13 00:52:00','2013-03-13 00:57:49','2013-03-13 01:02:04',1,NULL,'zookeeper-ruby-clients-comparison','','','',697,'zookeeper-ruby-clients-comparison'),(98,'zookeeper 的急速入门( zookeeper basic operations ) ','<p>算是我的学习笔记吧。 记录如下： ( 原文见：&#160;<a href=\"http://zookeeper.apache.org/doc/trunk/zookeeperStarted.html#sc_InstallingSingleMode\" title=\"http://zookeeper.apache.org/doc/trunk/zookeeperStarted.html#sc_InstallingSingleMode\" target=\"_blank\">http://zookeeper.apache.org/doc/trunk/zookeeperStarted.html#sc_InstallingSingleMode</a> &#160;)&#160;</p>\r\n<p>1. 安装并运行： download the file, unzip it. &#160;then $ bin/zkServer.sh start\r\n</p>\r\n<p>2. 使用JAVA客户端连接zookeeper 服务器：&#160;</p>\r\n<p>$ bin/zkCli.sh -server 127.0.0.1:2181 </p>\r\n<p>3. 基本操作来了： &#160; </p>\r\n<pre>$ ls /\r\n[zookeeper]\r\n$ ls /zookeeper\r\n[quota]\r\n$ create /siwei my_data\r\nCreated /siwei\r\n\r\n$ get /siwei\r\nmy_data\r\ncZxid = 0x19\r\nctime = Wed Mar 13 09:13:43 CST 2013\r\nmZxid = 0x19\r\n.......   \r\n\r\n$ set /siwei junk\r\ncZxid = 0x19\r\nctime = Wed Mar 13 09:13:43 CST 2013\r\nmZxid = 0x1a\r\n.....\r\n\r\n$ get /siwei\r\njunk\r\ncZxid = 0x19\r\nctime = Wed Mar 13 09:13:43 CST 2013\r\n\r\n$ delete /siwei\r\n$ ls /\r\n[zookeeper]\r\n\r\n\r\n\r\n</pre>',0,'2013-03-13 01:15:00','2013-03-13 01:21:19','2013-03-13 01:21:19',1,NULL,'zookeeper-basic-operatons','','','',587,'zookeeper-basic-operatons'),(99,'生成所有的rdoc （ generate all the rdocs for all/specific gem )','<p>我简直太笨了！ 今天才知道，如何为某个GEM生成RDOC，并且自动放到 $ gem server 可以识别的路径下。 ( I am really a fool that I didn\'t know (until today) how to generate a specific/all gems\' rdoc files and put them automatically somewhere that \'$gem server\' could recognize. )</p>\r\n<p>$ gem rdoc --rdoc zookeeper </p>\r\n<p> 然后 $ gem server ， 打开 localhost:8808 就可以看到最新生成的rdoc 文件了。 想想自己太笨了，以前居然RDOC之后还要手动COPY。。。哎，学习是王道，google是王道啊。 （这个答案在 这里已经有了： <a href=\"http://stackoverflow.com/questions/664651/can-you-install-documentation-for-existing-gems\">http://stackoverflow.com/questions/664651/can-you-install-documentation-for-existing-gems</a> ) </p>\r\n<p> \r\n\r\n附： gem help rdoc给出的帮助信息，\r\n</p>\r\n<pre>$ gem help rdoc\r\nUsage: gem rdoc [args] [options]\r\n\r\n  Options:\r\n        --all                        Generate RDoc/RI documentation for all\r\n                                     installed gems\r\n        --[no-]rdoc                  Generate RDoc HTML\r\n\r\n  Arguments:\r\n    GEMNAME       gem to generate documentation for (unless --all)\r\n</pre>',0,'2013-03-13 01:34:00','2013-03-13 01:38:27','2013-03-13 01:40:05',1,NULL,'generating-rdoc-for-rubygems','','','',554,'generating-rdoc-for-rubygems'),(100,'git tag 基本操作 （ git tagging basic   ）','<p>$ git tag -l &#160;查看所有的tag&#160;</p>\r\n<pre>$ git tag -a 1.1.0 a50fabb -m \'message content .... \'\r\n</pre>\r\n<p>$ git tag -d 1.0 &#160; # will remove tag 1.0</p>\r\n<p>$ git tag -n2 &#160; # will show the tags with their messages.&#160;</p>\r\n<pre>1.0.0           CMS 3.0 的抢先版，....\r\n1.0.1           3月14日下午.修改了若干BUG（大部分都是表单验证）...\r\n</pre>\r\n<p>$ git push --tags &#160;# push local tags to remote server</p>\r\n<p> $ git ls-remote --tags  # list all the remote tags \r\n</p>\r\n<pre>From ssh://....\r\na70cffc64e73ae4b5ab7329480999305f11d9c76	refs/tags/1.0.0\r\n6d1ad6c601652442d6d32fce5233ba50a1dd9f56	refs/tags/1.0.0^{}\r\n1acf5e9aabbd353ff45b7aa3fe319d3822acad19	refs/tags/1.0.1\r\n5bba7a637e64267ffad38dd48c30df00da6cc91e	refs/tags/1.0.1^{}\r\n</pre>\r\n',0,'2013-03-14 09:50:00','2013-03-14 09:53:08','2013-06-26 03:34:06',1,NULL,'git-tagging-101','','','',656,'git-tagging-101'),(101,'ssh/git 非常慢的解决办法 (ssh/git login extremely slow\'s solution) ','<p>今天终于忍不住了。进入公司3个月以来，SSH 登录服务器特别慢。而其他同事用MAC非常快。</p>\r\n<p>搜了一下，找到了解决办法：&#160;   <a href=\"http://superuser.com/questions/166359/top-causes-of-slow-ssh-logins\">http://superuser.com/questions/166359/top-causes-of-slow-ssh-logins</a>\r\n</p>\r\n<p>ssh root@xx.xx.xx -vvv </p>\r\n<p> 如果发现在这里速度很忙，停住了：debug1: Next authentication method: gssapi-with-mic ， 那么你就需要修改文件：</p>\r\n<pre># vim /etc/ssh/ssh_config :\r\nGSSAPIAuthentication no\r\n</pre>\r\n<p> 现在SSH速度如飞啊亲！</p>',0,'2013-03-14 11:51:00','2013-03-14 11:55:09','2013-03-14 11:55:09',1,NULL,'ssh-git-login-extremely-slow','','','',1084,'ssh-git-login-extremely-slow'),(102,'流行的工具都是有道理的（ best practices are best in most cases)','<p>1. 版本控制： SVN =&gt; &#160;GIT &#160; &#160; &#160; ( scm : &#160;from SVN to GIT)&#160;</p>\r\n<p>2. 部署方式： 人肉部署 =&gt; Capistrano &#160;</p>\r\n<p>原来项目中用到的是SVN， 就一个分支，也不打TAG。感觉用起来没啥。 &#160;( there\'s not so much trouble when the project is going under SVN and manual deployment)</p>\r\n<p>现在服务器的配置被运维同学限制了，无法连到SCM 服务器 (同时无法连接到外网，无法连接到很多内部网络，比如LDAP， RADIUS等等）。肿么办???? &#160; &#160; &#160;(but one day, the server was limited its access to the internet, git repo and local LDAP , Radius service... what shall we do? )</p>\r\n<p>如果用SVN的话，就得 用SCP的方式，打包过去，然后修修改改，每次都要人肉来做，还出错。(if using SVN, we have to copy the entire code folder to the target server, easy to make mistake and really painful for me )&#160;</p>\r\n<p>现在换成了GIT ， 不用capistrano的话，直接在本地把 git-patch 上传过去，然后 git am 就好。(now since we have migrated the SVN to GIT repo, it\'s very easy to achieve the same goal using \'git-patch\' and \'git am\' )</p>\r\n<p>用了 capistrano的话，用 deploy_via :scp 的 方式，我每次部署一行命令，自动搞定了。 ( and in capistrano, we just need to use \'deploy_via scp\' to do the deployment job )&#160;</p>\r\n<p>所以，老式的办法，在某些新问题出现的时刻，不是那么得心应手。业界流行的“最佳实践”，在大部分情况下，还是“最佳实践”的。 ^_^ &#160; &#160;( the conclusion is: &#160;best practices are always best in most cases. )&#160;</p>\r\n<p>—— 学习是王道！ &#160;( keep STUDYING everyday! )&#160;</p>',0,'2013-03-15 01:09:00','2013-03-15 03:51:10','2013-03-15 03:51:10',1,NULL,'best-practices-are-best','','','',585,'best-practices-are-best'),(103,'capistrano 中的logger, set-before (capistrano basic usages)','<p>Capistrano 灰常好用。 不过有几个常用的用法还是要留意一下：&#160;参考这个文章： </p>\r\n<p>http://stackoverflow.com/questions/4294970/rails-3-capistrano-tutorial-to-deploy-to-server-using-git </p>\r\n<p>http://www.aaginskiy.com/technology/2011/02/deploying-rails-3-apps-with-capistrano/</p>\r\n<p>1. vim Gemfile, 增加：</p>\r\n<p>gem \'capistrano\' </p>\r\n<p>2. $ bundle install </p>\r\n<p>3. $ capify . <br />会生成两个文件： Capfile ,  config/deploy.rb </p>\r\n<p>4. 编辑后者，然后 $ cap deploy. </p>\r\n<p>5. $ cap deploy:setup 会建立必须的 文件夹 </p>\r\n<p>6. 编辑 $ shared/config/database.yml </p>\r\n<p>这里是一个完整的deploy.rb ： </p>\r\n<p>https://github.com/beijing-rubyist/bjrubyist/blob/master/config/deploy.rb </p>\r\n<p>使用 输入： &#160;set(:user) { Capistrano::CLI.ui.ask(\"User name: \") }</p>\r\n\r\n<p>1. 总览：  <br />$ cap --help</p>\r\n<p>2. 使用logger，特别是在其他语言调用CAP时，非常有用（例如被fabric 调用）:&#160;<br />$ cap setup --logger STDOUT</p>\r\n<p>3. 使用变量， 要记得:  使用@. . 例如，我们要设置 \"deploy_type\" 这个变量：&#160;<br />$ cap say_hi --set-before deploy_type=staging</p>\r\n<p>然后在 config/deploy.rb 中这样使用：</p>\r\n<p>DEFAULT_TYPE = \"stable\"&#160;<br />  <br /># deploy_type 仅仅在 begin 这个区域中生效, 在rescue, ensure中都不行。  <br />begin  <br />  deploy_type  <br />  puts \"deploy_type was set successfully\"  <br />  @deploy_type = deploy_type  <br />rescue Exception =&gt; e  <br />  puts \"deploy_type not set, use default: #{DEFAULT_TYPE}\"  <br />  deploy_type = DEFAULT_TYPE  <br />  @deploy_type = deploy_type  <br />end  <br />  <br />task :say_hi do  <br />  puts \"hihihi, var_deploy_type: #{@deploy_type}\"  <br />end  </p>\r\n<p>输出：&#160;<br />deploy_type was set successfully&#160;<br />============= DEPLOY_PATH: /rails_apps/babble_portal/cutting_edge  <br />  * executing `say_hi\'  <br />hihihi, var_deploy_type: 444  </p>\r\n<p>最后，使用copy方式：</p>\r\n<pre>set :scm, :none\r\nset :repository, \".\"\r\nset :deploy_via, :copy\r\n</pre>\r\n\r\n',0,'2013-03-15 07:20:00','2013-03-15 07:22:55','2013-03-15 07:24:46',1,NULL,'capistrano-basics','','','',569,'capistrano-basics'),(104,'测试文件上传 (test file upload in Rails ) ','<p>非常简单。\r\nYou can use <a href=\"http://apidock.com/rails/v3.2.8/ActionDispatch/TestProcess/fixture_file_upload\"> fixture_file_upload </a> method to test file uploading: Put your test file in \"{Rails.root}/spec/fixtures/files\" directory\r\n</p>\r\n<pre>before :each do\r\n  @file = fixture_file_upload(\'files/test_lic.xml\', \'text/xml\')\r\nend\r\n\r\nit \"can upload a license\" do\r\n  post :uploadLicense, :upload =&gt; @file\r\n  response.should be_success\r\nend\r\n</pre>\r\n<p>记得第二个参数是 mime类型， 比如 &#160;\'image/png\', \'image/jpeg\' 啥的。 &#160;( the second parameter is the MIME type)</p>',0,'2013-03-16 06:09:00','2013-03-16 06:12:52','2013-03-16 06:12:52',1,NULL,'testing-file-upload-in-rails','','','',580,'testing-file-upload-in-rails'),(105,'Rails中使用uploadify 插件 ( using Uploadify in Rails3)','<p>这个插件非常好用。 可以看作是 SWFupload的后续 （SWFUPLOAD已经停止开发好久好久了）</p>\r\n<p>使用步骤也是一般吧，不是一下就可以搞定（我昨天花了大半天时间才做了个满意的封装，虽然我很讨厌封装），但是也不是特别麻烦。可以说解藕做的不错～ &#160;</p>\r\n<p>实现它的缘由<br />1. 由于我们的图片都保存在一个远程服务器上，所以我们不需要在本地永久保存上传的数据。 对应的数据库中的列也只是一个String类型（varchar(255))，所以，我们只需要获取远程（CDN 服务器）上的IMAGE URL就好了。</p>\r\n<p>2. 由于上传的限制很多（光服务器返回的错误代码就6种以上），所以，把这些出错消息返回给ERB页面很麻烦。所以我的想法就是做成GMAIL上传附件那样。可以即时的返回消息（AJAX方式）。这样用户就知道出错的原因 和解决办法了（原来出错的话没有任何消息）</p>\r\n<p>3. 原有项目中的upload代码 出现很多次，重复的代码太多。这样会导致项目的难以维护。代码越是简洁，维护起来就越方便。开发速度也就越快。</p>\r\n<p>4. 所以，我的方式是： AJAX 图片上传，本地表单项呢，是一个&lt;input text&gt;, 而不是&lt;input file&gt;。这样的话。上传图片后，这个&lt;input text&gt;就有了值，然后表单提交后，controller 用正常的方式 update_attribute(params[:entity]) 就直接把 params[:entity][:image_url]给更新了（假定属性叫 image_url)。 可以说， controller的代码一行都不用变。</p>\r\n<p>5. 保证系统中有一个专门的action 处理AJAX上传。例如： /commons/upload (POST)</p>\r\n<p>步骤如下：（参考它的官方DEMO），以及session的问题： 这个是for Rails2.3 的！！！(http://www.railstips.org/blog/archives/2009/07/21/uploadify-and-rails23/ &#160;)</p>\r\n<p>（也不好使。。。不过我根据它的修修改改弄好了）这个是session for Rails3的：<a href=\"http://www.damiangalarza.com/posts/ruby-on-rails/using-uploadify-with-rails-3/\"> http://www.damiangalarza.com/posts/ruby-on-rails/using-uploadify-with-rails-3/ </a>\r\n</p>\r\n<p>session 问题的关键是：</p>\r\n<p>1. env[\'HTTP_COOKIE\'] 要对的上。</p>\r\n<p>2. authentication_token 要传给Rails.&#160;</p>\r\n<p>如果Rails3 发现以上2个条件，任意一个不对，它都会关闭当前的session, 然后分配给你一个新的session.&#160;</p>\r\n<p>下面是我的具体步骤：&#160;</p>\r\n<p>1. config/environment.rb:</p>\r\n<pre> config.autoload_paths += %W(#{config.root}/app/middleware)\r\n</pre>\r\n<p>2. app/middleware/flash_session_cookie_middleware.rb&#160;</p>\r\n<p>( 注意！！！session_key 应该是你的APP的！）</p>\r\n<p>( 注意！！！ 下面的 &#160;env[\"REQUEST_URI\"] == \"/commons/upload\" 一行，根据你的需要进行修改！～)</p>\r\n<pre>require \'rack/utils\'\r\n\r\nclass FlashSessionCookieMiddleware\r\n  def initialize(app, session_key = \'_cms_session\') # !!! change it to your own! \r\n    @app = app \r\n    @session_key = session_key\r\n  end \r\n\r\n  def call(env)\r\n    if env[\"REQUEST_URI\"] == \"/commons/upload\" # env[\'HTTP_USER_AGENT\'] =~ /^(Adobe|Shockwave) Flash/\r\n      Rails.logger.debug \"===== (before frozen) env[\'HTTP_COOKIE\']: #{env[\'HTTP_COOKIE\'].inspect}\"\r\n      req = Rack::Request.new(env)\r\n      unless req.params[@session_key].nil?\r\n        env[\'HTTP_COOKIE\'] = [ @session_key, req.params[@session_key] ].join(\'=\').freeze\r\n      end \r\n      Rails.logger.debug \"===== (after frozen) env[\'HTTP_COOKIE\']: #{env[\'HTTP_COOKIE\'].inspect}\"\r\n    end \r\n\r\n    @app.call(env)\r\n  end \r\nend\r\nend\r\n</pre>\r\n\r\n<p> 3.config/initializers/session_store.rb,  add these lines of code:  </p>\r\n<pre> Rails.application.config.middleware.insert_before(\r\n   ActionDispatch::Session::CookieStore,\r\n   FlashSessionCookieMiddleware,\r\n   Rails.application.config.session_options[:key]\r\n )   \r\n                                                  \r\n</pre>\r\n<p> 4. in your ERB file (where the uploadify affects ) </p>\r\n<pre>&lt;% session_key = Rails.application.config.session_options[:key] %&gt;\r\n&lt;script&gt;\r\n...\r\n  data[\'&lt;%= session_key %&gt;\'] = \'&lt;%= cookies[session_key] %&gt;\'\r\n  data[\'authenticity_token\'] = \'&lt;%= form_authenticity_token %&gt;\'\r\n  ......\r\n  \'formData\' : data,\r\n  ......\r\n</pre>',0,'2013-03-17 01:21:00','2013-03-17 01:32:35','2013-03-17 10:31:12',1,NULL,'uploadify-in-rails','','','',852,'uploadify-in-rails'),(106,'rails 中使用cache （最简单的) ( caching in Rails for different parameters ) ','<a href=\"http://stackoverflow.com/questions/1988658/rails-action-caching-with-querystring-parameters\">&#160;http://stackoverflow.com/questions/1988658/rails-action-caching-with-querystring-parameters</a>\r\n<p> 1. in production.rb, : </p>\r\n<pre>config.action_controller.perform_caching = true\r\n</pre>\r\n<p> 2. in your controller : (will expire in 10 munites )  </p>\r\n<pre>class UsersController &lt; ApplicationController\r\n   caches_action :index, :cache_path =&gt; Proc.new { |c| c.params }, :expires_in =&gt; 10.minutes\r\n   def index\r\n     render :text =&gt; \" name is: #{params[:name]}, time.now is: #{Time.now}\"\r\n   end\r\nend\r\n</pre>\r\n<p> 3. stop &amp; start your Rails server completely, and check your logs : &#160;( focus on the \"Read fragment / Write fragment \" .)&#160;</p>\r\n<pre>14:29:37 INFO: Started GET \"/users?name=raynor\" for 127.0.0.1 at 2013-03-17 14:29:37 +0800 \r\n14:29:37 INFO: Processing by UsersController#index as HTML \r\n14:29:37 INFO:   Parameters: {\"name\"=&gt;\"raynor\"} \r\n14:29:37 INFO: Read fragment views/localhost:337/users?name=raynor (0.1ms) \r\n14:29:37 INFO:   Rendered text template (0.0ms) \r\n14:29:37 INFO: Write fragment views/localhost:337/users?name=raynor (2.5ms) \r\n14:29:37 INFO: Completed 200 OK in 6ms (Views: 0.7ms | ActiveRecord: 0.0ms) \r\n14:29:40 INFO:  \r\n14:29:40 INFO:  \r\n14:29:40 INFO: Started GET \"/users?name=raynor\" for 127.0.0.1 at 2013-03-17 14:29:40 +0800 \r\n14:29:40 INFO: Processing by UsersController#index as HTML \r\n14:29:40 INFO:   Parameters: {\"name\"=&gt;\"raynor\"} \r\n14:29:40 INFO: Read fragment views/localhost:337/users?name=raynor (0.2ms) \r\n14:29:40 INFO: Completed 200 OK in 2ms (ActiveRecord: 0.0ms) \r\n</pre>\r\n<p>你也可以使用 mem_cache， （这样的话就不要设置 &#160;:size option, &#160;）</p>\r\n<pre># in your Gemfile\r\n gem \'memcache-client\', \'1.8.5\'  \r\n\r\n# in your production.rb\r\nconfig.cache_store = :mem_cache_store, \'10.103.13.96:11311\', \'10.103.13.97:11314\'\r\n</pre>\r\n',0,'2013-03-17 06:24:00','2013-03-17 06:31:33','2013-03-20 01:49:38',1,NULL,'rails-action-caching-with-querystring-parameters','','','',545,'rails-action-caching-with-querystring-parameters'),(107,'单元测试的几个层次 ( implementation strategies for unit tests )','<p>1. 粗糙测试 &#160; （编译通过就行， 比如，一个controller里只测一个action )</p>\r\n<p>2. 一般测试 &#160; （测试 controller, view, model, lib ， 不测试web service )</p>\r\n<p>3. 精细测试 &#160; &#160; ( 各个分支都要测试到。。。 web service 也测试，管他mock 不mock )</p>\r\n<p>这个是草稿</p>',0,'2013-03-18 00:48:00','2013-03-18 00:52:18','2013-03-18 00:52:18',1,NULL,'implementation-strategies-for-unit-tests','','','',581,'implementation-strategies-for-unit-tests'),(108,'for chinese RVM users:  ruby.taobao.org','<p>国内的同学门，安装 RVM之后记得走淘宝哦～ &#160;&#160;</p>\r\n<p>安装各种rubygem也可以～～～</p>\r\n<p>详情见： &#160;ruby.taobao.org</p>\r\n<p>复制过来的内容：</p>\r\n<p>$ gem sources --remove https://rubygems.org/<br />$ gem sources -a http://ruby.taobao.org/<br />$ gem sources -l<br />*** CURRENT SOURCES ***</p>\r\n<p>http://ruby.taobao.org<br /># 请确保只有 ruby.taobao.org<br />$ gem install rails</p>\r\n<p>RVM 改用本站作为下载源, 提高 Ruby 安装速度</p>\r\n<p>FOR MAC<br />$ sed -i .bak \'s!ftp.ruby-lang.org/pub/ruby!ruby.taobao.org/mirrors/ruby!\' $rvm_path/config/db<br />FOR LINUX<br />$ sed -i \'s!ftp.ruby-lang.org/pub/ruby!ruby.taobao.org/mirrors/ruby!\' $rvm_path/config/db</p>',0,'2013-03-21 08:47:00','2013-03-21 08:49:17','2013-03-21 08:49:17',1,NULL,'ruby-in-taobao-for-chinese','','','',846,'ruby-in-taobao-for-chinese'),(109,'如何打印可读性强的JSON：(pretty-readable json in ruby) ','<p><a href=\"http://stackoverflow.com/questions/86653/how-can-i-pretty-format-my-json-output-in-ruby-on-rails\" title=\"http://stackoverflow.com/questions/86653/how-can-i-pretty-format-my-json-output-in-ruby-on-rails\" target=\"_blank\">http://stackoverflow.com/questions/86653/how-can-i-pretty-format-my-json-output-in-ruby-on-rails</a>\r\n</p>\r\n\r\n<pre> 43     json = Cms::Utils.object(videoid)\r\n 44     logger.info \"== json for url( #{url}) : #{JSON.pretty_generate(json)}\"\r\n</pre>',0,'2013-03-24 02:31:00','2013-03-24 02:32:51','2013-03-24 02:32:51',1,NULL,'pretty-readable-json','','','',604,'pretty-readable-json'),(110,'rails macro如何定义？where to define macros in Rails?','<p><a href=\"http://stackoverflow.com/questions/926489/rails-macro-style-functions\">http://stackoverflow.com/questions/926489/rails-macro-style-functions</a>\r\n</p>\r\n\r\n<p>如何定义rails macro?  上面的文章描述的很全面了。 对于controller使用的，就定义在application controller中。对于model会使用的，就reopen activerecord::base </p>\r\n<p>For models, you want to reopen ActiveRecord::Base:</p>\r\n<pre>module ActiveRecord\r\n  class Base\r\n    def self.acts_as_super_awesome\r\n      do_more_awesome_stuff\r\n    end\r\n  end\r\nend\r\n</pre>\r\n<p> I personally would put that in a file in config/initializers so that it gets loaded once, and so that I know where to look for it always.</p>\r\n<p>Then you can access it in models like so:</p>\r\n<pre>class MySuperAwesomeModel &lt; ActiveRecord::Base\r\n  acts_as_super_awesome\r\nend\r\n</pre>',0,'2013-03-24 02:53:00','2013-03-24 02:55:50','2013-03-24 02:57:41',1,NULL,'where-to-define-macros-in-rails','','','',577,'where-to-define-macros-in-rails'),(111,'安装 vim 及 vundle ( install vim and vundle)','<p>使用一件称手的工具是一个工匠最快乐的事情。 ( a suitable editor is necessary for a software developer)&#160;</p>\r\n<p>今天的一个服务器，vim 版本居然是6.3的。我服了。。。果断vim7.3啊亲 &#160; ( the steps below show how to install vim and vundle )&#160;</p>\r\n<p>1. 下载：&#160;<a href=\"ftp://ftp.vim.org/pub/vim/unix/vim-7.3.tar.bz2\" title=\"ftp://ftp.vim.org/pub/vim/unix/vim-7.3.tar.bz2\" target=\"_blank\">ftp://ftp.vim.org/pub/vim/unix/vim-7.3.tar.bz2</a>&#160; （貌似国内被墙了。。。）</p>\r\n<p>2. vundle:&#160;</p>\r\n<p>$ git clone https://github.com/gmarik/vundle.git ~/.vim/bundle/vundle</p>\r\n<p>3. <a href=\"http://siwei.me/system/resources/BAhbBlsHOgZmSSIjMjAxNC8wMS8xOS8wNV81MV8zOF82NjVfLnZpbXJjBjoGRVQ/.vimrc\" target=\"_blank\">.vimrc</a> </p>\r\n<pre>filetype on\r\nset langmenu=none\r\nset fileencodings=utf-8\r\nset fileencoding=utf-8\r\nset encoding=utf8\r\n\r\nset expandtab\r\nset shiftwidth=4\r\nset softtabstop=4\r\nset tabstop=4\r\nset number\r\nset autoindent\r\nset hlsearch\r\nset incsearch\r\nset encoding=utf-8\r\n\" highlight Normal ctermfg=white ctermbg=cyan\r\nset nowrap\r\nsyntax enable\r\n\r\nlet g:proj_window_width=5\r\nset laststatus=2\r\n\r\n\r\nmap  :FufFile\r\nmap  :MRU\r\nmap  :Rmodel\r\nmap  :Rcontroller\r\nmap  :Runit\r\nmap  :Rfunctional\r\nmap  :Rhelper\r\nmap  :Rview\r\nmap  :ZoomWin\r\nmap  :Rfixture\r\nmap rj :Rjavascript\r\n\r\n\r\n\" Strip trailing whitespace\r\nfunction! StripTrailingWhitespaces()\r\n    \" Preparation: save last search, and cursor position.\r\n    let _s=@/\r\n    let l = line(\".\")\r\n    let c = col(\".\")\r\n    \" Do the business:\r\n    %s/\\s\\+$//e\r\n    \" Clean up: restore previous search history, and cursor position\r\n    let @/=_s\r\n    call cursor(l, c)\r\nendfunction\r\nautocmd BufWritePre * :call StripTrailingWhitespaces()\r\n\r\n\" match Todo /\\s\\+$/\r\nfiletype plugin on\r\nlet mapleader = \",\"\r\n\r\n\r\n\" THE VIM OUTLINER (TVO)\r\n\" defaults:\r\nlet otl_install_menu=1\r\nlet no_otl_maps=0\r\nlet no_otl_insert_maps=0\r\n\r\n\" overrides:\r\nlet otl_bold_headers=0\r\nlet otl_use_thlnk=0\r\n\r\n\" au BufWinLeave *.otl mkview\r\n\" au BufWinEnter *.otl silent loadview\r\nlet maplocalleader = \",\"\r\n\r\n\"\"Only do this part when compiled with support for autocommands.\r\n\"if has(\"autocmd\")\r\n\"  autocmd Filetype java setlocal omnifunc=javacomplete#Complete\r\n\"endif\r\n\r\n\r\nset nocompatible               \" be iMproved\r\nfiletype off                   \" required!\r\n\r\n\r\n\r\n\r\n\" ============== Vundle part =================\r\nset rtp+=~/.vim/bundle/vundle/\r\ncall vundle#rc()\r\n\r\n\" let Vundle manage Vundle\r\n\" required!\r\nBundle \'gmarik/vundle\'\r\n\r\n\" My Bundles here:\r\n\"\r\n\" original repos on github\r\nBundle \'tpope/vim-fugitive\'\r\nBundle \'Lokaltog/vim-easymotion\'\r\n\"Bundle \'rstacruz/sparkup\', {\'rtp\': \'vim/\'}\r\nBundle \'tpope/vim-rails.git\'\r\nBundle \'tsaleh/vim-matchit.git\'\r\nBundle \'ecomba/vim-ruby-refactoring.git\'\r\n\r\n\" vim-scripts repos\r\nBundle \'L9\'\r\nBundle \'FuzzyFinder\'\r\n\r\nBundle \'git://git.wincent.com/command-t.git\'\r\n\"Bundle \'snipMate\'\r\n\"Bundle \'snipmate-snippets\'\r\nBundle \'Jasmine-snippets-for-snipMate\'\r\nBundle \'YankRing.vim\'\r\nBundle \'vividchalk.vim\'\r\nBundle \'The-NERD-Commenter\'\r\nBundle \'The-NERD-tree\'\r\n\r\ncolorscheme vividchalk\r\nset background=light\r\nset background=dark\r\nBundle \'mru.vim\'\r\nBundle \'greplace.vim\'\r\n\r\nfiletype plugin indent on     \" required!\r\n\"\r\n\" Brief help\r\n\" :BundleList          - list configured bundles\r\n\" :BundleInstall(!)    - install(update) bundles\r\n\" :BundleSearch(!) foo - search(or refresh cache first) for foo\r\n\" :BundleClean(!)      - confirm(or auto-approve) removal of unused bundles\r\n\"\r\n\" see :h vundle for more details or wiki for FAQ\r\n\" NOTE: comments after Bundle command are not allowed..\r\n\r\n\r\nmap  f\r\nmap a :YRShow\r\nmap t :NERDTree\r\nmap q :q\r\n\r\n4. Launch vim, run :BundleInstall</pre>',0,'2013-03-25 05:20:00','2013-03-25 05:47:20','2014-01-19 05:53:00',1,NULL,'installing-vim-and-vundle','','','',674,'installing-vim-and-vundle'),(112,'在缓存时，空字符是个大问题 。json不要返回空啊亲! (don\'t response with null )','<p>最近的一个项目中，用到了cache，结果出现了问题：&#160;</p>\r\n<p>cache会把所有 blank? 的值认为是 无效的。 比如： nil, null , \"\", {} &#160;</p>\r\n<p>这样就造成了服务器的负担很重。</p>\r\n<p>解决的办法很简单。比如： { results: [] } &#160;就可以避免。&#160;</p>',0,'2013-03-27 07:32:00','2013-03-27 07:35:19','2013-03-27 07:35:19',1,NULL,'do-not-response-with-blank','','','',589,'do-not-response-with-blank'),(113,'rbenv的流行果然是有原因的( rbenv is much greater than RVM in some cituation)','<p>前天晚上在一台centos 5.8上安装ruby, &#160;rvm 完全不行（没有git 模块，它跟我抱怨。我手动安装了GIT后，它还是跟我抱怨。我无视抱怨，继续按照ruby 1.9.3时，出错。还是因为GIT。我了歌曲。）我用了4个小时。 结果无奈之下转向rbenv. &#160;rbenv 很快搞定。（我第一次读github上的文档。。按照它的描述，15分钟搞定，没遇到任何问题）：</p>\r\n<p>(唯一的不足是 rbenv没能跟passenger 搭档跑RAILS。 出现 &#160;cannot load such file -- rubygems/path_support 错误。等喘口气的时候再查吧）</p>\r\n<p>下面是安装过程的记录（见 <a href=\"https://github.com/sstephenson/rbenv/\">https://github.com/sstephenson/rbenv/ </a> )</p>\r\n<p>  222  2013-03-26 21:30:58: git clone git://github.com/sstephenson/rbenv.git ~/.rbenv<br />  223  2013-03-26 21:31:18:echo \'export PATH=\"$HOME/.rbenv/bin:$PATH\"\' &gt;&gt; ~/.bash_profile<br />  224  2013-03-26 21:31:36: echo \'eval \"$(rbenv init -)\"\' &gt;&gt; ~/.bash_profile<br />  225  2013-03-26 21:31:55:exec $SHELL -l<br />  226  2013-03-26 21:32:49:git clone git://github.com/sstephenson/ruby-build.git ~/.rbenv/plugins/ruby-build<br />  227  2013-03-26 21:33:40:rbenv install 1.9.3-p327<br />  228  2013-03-26 21:50:37:rbenv rehash<br />  229  2013-03-26 22:02:10:rbenv global 1.9.3-p327</p>\r\n<p>rubygem:<br />  scp ....  rubygem 1.8.x<br />  unzip ... cd ... ruby setup.rb</p>\r\n<p>upload shared folder...</p>\r\n<p>cap deploy. ...</p>\r\n<p>$ gem install bundler<br />$ bundle</p>\r\n<p>yum install -y gcc ruby-devel libxml2 libxml2-devel libxslt libxslt-develyum install -y gcc ruby-devel libxml2 libxml2-devel libxslt libxslt-devel</p>\r\n<p>yum install mysql-devel</p>',0,'2013-03-27 23:53:00','2013-03-28 00:05:03','2013-03-28 00:05:03',1,NULL,'rbenv-getting-popular','','','',744,'rbenv-getting-popular'),(114,'design pattern:  builder v.s. factory','<p>原文见：<a href=\"http://stackoverflow.com/questions/757743/what-is-the-difference-between-builder-design-pattern-and-factory-design-pattern\">&#160;http://stackoverflow.com/questions/757743/what-is-the-difference-between-builder-design-pattern-and-factory-design-pattern </a> </p>\r\n<p>The Factory pattern can almost be seen as a simplified version of the Builder pattern.</p>\r\n<p>In the Factory pattern, the factory is in charge of creating various subtypes of an object depending on the needs.</p>\r\n<p>The user of a factory method doesn\'t need to know the exact subtype of that object. An example of a factory method createCar might return a Ford or a Honda typed object.</p>\r\n<p>In the Builder pattern, different subtypes are also created by a builder method, but the composition of the objects might differ within the same subclass.</p>\r\n<p>To continue the car example you might have a createCar builder method which creates a Honda-typed object with a 4 cylinder engine, or a Honda-typed object with 6 cylinders. The builder pattern allows for this finer granularity.</p>\r\n<p>Diagrams of both the Builder pattern and the Factory method pattern on available on Wikipedia.</p>\r\n<p>With design patterns, there usually is no \"more advantageous\" solution that works for all cases. It depends on what you need to implement.</p>\r\n<p>From Wikipedia:</p>\r\n<p>Builder focuses on constructing a complex object step by step. Abstract Factory emphasizes a family of product objects (either simple or complex). Builder returns the product as a final step, but as far as the Abstract Factory is concerned, the product gets returned immediately.<br />Builder often builds a Composite.<br />Often, designs start out using Factory Method (less complicated, more customizable, subclasses proliferate) and evolve toward Abstract Factory, Prototype, or Builder (more flexible, more complex) as the designer discovers where more flexibility is needed.<br />Sometimes creational patterns are complementary: Builder can use one of the other patterns to implement which components get built. Abstract Factory, Builder, and Prototype can use Singleton in their implementations.</p>',0,'2013-03-28 00:42:00','2013-03-28 02:23:25','2013-03-28 02:23:25',1,NULL,'builder-and-factory-patterns','','','',2319,'builder-and-factory-patterns'),(115,'rbenv + passenger:  no such file to load: rubygems/path_support ','<p>refer to: <a href=\"http://stackoverflow.com/a/15777738/445908\">http://stackoverflow.com/a/15777738/445908</a>\r\n</p>\r\n<p>In my case, I also met this problem:  \r\n( My environment: Centos 5.8, rbenv 1.9.3p327, passenger 3.0.19, nginx( compiled and installed by passenger) . I googled around but didn\'t find any direct answer ( keyword: `rbenv, passenger,  cannot load such file -- rubygems/path_support `), so I write my solution here.</p>\r\n\r\n<p>\r\nI have checked and set nginx user to root, not works.\r\nand changed all the privileges of gem folder to 777. not works.\r\n</p>\r\n<p>\r\nfinally I got the solution: add these 2 lines of code to your Nginx config file: \r\n</p>\r\n<pre>    passenger_default_user root;\r\n    passenger_default_group root;\r\n</pre>\r\n<p>\r\nso now your nginx config fie looks like:</p>\r\n<pre>    # /opt/nginx/config/nginx.conf\r\n    user  root;  # seems this line of code doesn\'t take effect.\r\n    http {\r\n      passenger_root /root/.rbenv/versions/1.9.3-p327/lib/ruby/gems/1.9.1/gems/passenger-3.0.19;\r\n      passenger_ruby /root/.rbenv/versions/1.9.3-p327/bin/ruby;\r\n\r\n      # these lines are the key!!!\r\n      passenger_default_user root;\r\n      passenger_default_group root;\r\n\r\n      server {\r\n        listen 80;\r\n        root <your_rails_project_public_folder>;\r\n        passenger_enabled on;\r\n      }\r\n    }\r\n</your_rails_project_public_folder></pre>',0,'2013-04-03 02:28:00','2013-04-03 02:46:00','2013-04-03 02:47:13',1,NULL,'rbenv-passenger-no-such-file-to-load-path-support','','','',771,'rbenv-passenger-no-such-file-to-load-path-support'),(116,'call bundle in capistrano + rbenv  ( capstrano + rbenv , bundle问题）','<p>it\'s very easy.</p>\r\n<p>1. make sure you have \"rbenv\" and a ruby version (e.g. 1.9.3) installed in remote server</p>\r\n<p>2. in your config/deploy.rb (capistrano file)&#160;</p>\r\n<p>require \'capistrano-rbenv\'</p>\r\n<p>3. in your Gemfile:&#160;</p>\r\n<p>gem \'capistrano-rbenv\', \'1.0.1\'</p>\r\n<p>that\'s it. to debug if it works, just run:&#160;</p>\r\n<p>$ cap shell</p>\r\n<pre>cap&gt; which ruby\r\n ** [out :: 10.103.13.74] /root/.rbenv/shims/ruby\r\ncap&gt; ruby -v\r\n ** [out :: 10.103.13.74] ruby 1.9.3p327 (2012-11-10 revision 37606) [x86_64-linux]\r\n\r\n</pre>',0,'2013-04-03 05:43:00','2013-04-03 05:48:56','2013-04-03 05:48:56',1,NULL,'call-bundle-in-capistrano-and-rbenv','','','',647,'call-bundle-in-capistrano-and-rbenv'),(117,'重构 v.s. 重写  （refactor v.s. rebuild)','<p>虽然重构这本书出现了14年，自己在重构方面也有一些实践（从07年开始），但是我发现重构在实际应用中还是需要思考一下的。 ( Although the book &lt;&lt;refactoring&gt;&gt; has been published for 14 years , and I had this kind of experience since 2007, I found that in the real world, we should think for a while before we do the refactoring. )</p>\r\n<p>是重构合适，还是重写合适？ &#160; ( should it be refactored , or rebuilt? )&#160;</p>\r\n<p>我的意见是，如果代码的质量很差，就不值得为其重构。差代码的特点是： ( my suggestion is: &#160;let\'s rebuild it if it doesn\'t worth refactoring. &#160;The bad code looks like: &#160;)&#160;</p>\r\n<p>1. 命名很糟糕。绕来绕去的。最怕怕的例子： &#160;red = \'green\', &#160; &#160;success = \'false\', &#160; get_an_apple() &#160; =&gt; \'banana\' &#160; &#160;( terrible naming)&#160;</p>\r\n<p>2. 逻辑很糟糕。大段大段的复制代码。 &#160; ( terrible logic)</p>\r\n<p>3. 底层架构就是错的。 &#160; &#160;( totally incorrect infrastructure code )&#160;</p>\r\n<p>在这样的差代码下做重构是浪费时间。一般说来，重构的步骤是： &#160;( to refactor this kind of code kinda of wasting time. I would rather ask the business analyser for the re-build. &#160;generally, the steps for refactoring are: )&#160;</p>\r\n<p>1. 保证代码可以运行 &#160;( make sure the targe code is running )&#160;</p>\r\n<p>2. 读懂代码，可以写单元测试或者 回归测试 &#160; ( read the code , know the logic, and write the unit tests)&#160;</p>\r\n<p>3. 开始着手重构。 &#160;写代码 ，运行测试，写代码，运行测试。。。 (start refactoring, &#160; run tests, write code, run tests, write code ... )&#160;</p>\r\n<p>我觉得让一个十年经验的程序员去读一个烂代码，从代码中分析业务逻辑，不如直接让他直接去找业务人员，了解业务需求。然后按照他自己的理解来重写。 &#160;( It\'s not a good idea to make a ten-years experienced programmer to read the code written by a newbie with lots of terrible code with bad smells )</p>\r\n<p>那么，在什么时候重构合适呢？ 我觉得有三种情况： &#160;( So, when should we do the refactoring? &#160;I think there are 3 cases: )&#160;</p>\r\n<p>1. 这个代码没有时间重写了。 (no time to write a new project )&#160;</p>\r\n<p>2. 这个代码正在生产环境中使用。没法在短时间内把它停下来。或者说，一换下来，就会发生重大的生产事故，没人敢碰。 ( this code is running for production&#160;purpose&#160;)</p>\r\n<p>3. 两个人的水平相差的不太悬殊。而且底层代码的架构不是差得离谱。还有拯救的可能。( the previous coder\'s ability is not too bad, and the infrastructure is not so bad. &#160;)&#160;</p>',0,'2013-04-04 02:44:00','2013-04-04 03:02:43','2013-04-04 03:02:43',1,NULL,'refactor-or-rebuild','','','',572,'refactor-or-rebuild'),(118,'在webservice中不要返回 无内容的结果( don\'t return blank result in webservice )','<p>有两个系统，之间用 webservice(json &#160;格式）通信，系统A 读取系统B。 &#160;( there are 2 systems: A and B. A read the web service from B )</p>\r\n<p>系统A有一层缓存系统，会对系统B返回的结果做缓存。但是有个条件：系统B给的结果必须是非空的。 ( system A has a cache system , but it can only cache non-blank values )&#160;</p>\r\n<p>结果系统B的一个特点是，找不到结果时，会返回 无内容的json 字符，如： [] , &#160;{} &#160; ( but the system B always return blank values )&#160;</p>\r\n<p>结果系统A就无法缓存。造成了系统B很大的负担。 &#160; &#160;( so System A has to read blank values again and again from System B )</p>\r\n<p>解决方案： &#160;系统B在找不到对应结果时，要返回一个默认的json, 例如： (the solution is to provide default values when result not found. e.g. )</p>\r\n<pre>{ \r\n  results: [\r\n    \'I am the default value! \'\r\n  ]\r\n}\r\n</pre>\r\n<p>道理很简单，效果很明显！ &#160;CPU的占用率 马上从 50% 降低到5 % 以下 ( this is very simple but very important to the system B, the CPU cost reduced from 50% to 5% )&#160;</p>',0,'2013-04-05 08:24:00','2013-04-05 08:33:33','2013-04-05 08:33:33',1,NULL,'never-return-blank-value-for-webservice','','','',536,'never-return-blank-value-for-webservice'),(119,'【TODO使用自动化来测试IPHONE,  ANDROID','<p>必须要注意做了。否则人肉的话实在没有精力。</p>\r\n<p>http://code.google.com/p/selenium/wiki/AndroidDriver</p>\r\n<p>http://code.google.com/p/selenium/wiki/IPhoneDriver</p>\r\n<p>http://stackoverflow.com/questions/1759626/how-do-you-test-an-android-application-across-multiple-activities</p>\r\n<p>http://www.netmagazine.com/tutorials/automate-your-android-app-testing</p>\r\n<p>http://www.infoq.com/news/2011/09/Android-Testing</p>',0,'2013-04-13 11:51:00','2013-04-13 11:52:36','2013-04-13 22:48:58',1,NULL,'','','','',494,'todo-iphone-android'),(120,'encoding problem in Ruby (ruby中的汉字转换）','<p>Today I am face a problem: &#160;how to convert 汉字 to \\uxxx\\uxxx ?&#160;</p>\r\n<p>after googled and quickly browsed several posts, I found <a href=\"http://stackoverflow.com/a/5561268/445908\">this answer: &#160;</a>\r\n</p>\r\n<p>Using active support:&#160;</p>\r\n\r\n<pre>&gt;&gt; require \'rubygems\'\r\n&gt;&gt; require \'active_support\'\r\n&gt;&gt; a =\'汉字\'\r\n\r\n&gt;&gt; a.encoding\r\n=&gt; #\r\n\r\n&gt;&gt; result = ActiveSupport::JSON.encode(a)\r\n=&gt; \"\\\"\\\\u6c49\\\\u5b57\\\"\"\r\n\r\n&gt;&gt; result.encoding\r\n=&gt; #\r\n</pre>\r\n<p>\r\n\r\nIt\'s strange that both of them are encoded in UTF-8. ( I am confused by this UTF8, UTF16, unicode stuffs... @.@ ) &#160;有点蒙。。。回头把它给补上。</p>',0,'2013-04-16 01:24:00','2013-04-16 01:30:48','2013-04-16 01:30:48',1,NULL,'unicode-encoding-in-ruby','','','',547,'unicode-encoding-in-ruby'),(121,'I prefer git merge to git rebase (喜欢merge)','<p>原因很简单， git merge 可以保留原始的commit 时间。 而rebase 会破坏这一点。( usually I prefer \'merge\' than \'rebase\')</p>\r\n<p>比如，</p>\r\n<p>branch2:&#160;</p>\r\n<pre>f738cf3 added line 2 to file 2 on branch2 (Siwei, 6 seconds ago)\r\na2f47a2 added line 1 to file 2 on branch2 (Siwei, 87 seconds ago)\r\n53f630f commit file2 on branch2 (Siwei, 3 minutes ago)\r\n29c906c added file1 (Siwei, 4 minutes ago)\r\n</pre>\r\n\r\n<p> master: </p>\r\n<pre>5d4cff1 added line 2 to file 1 on master (Siwei, 58 seconds ago)\r\n5ba53c5 added line 1 to file 1 on master (Siwei, 2 minutes ago)\r\n29c906c added file1 (Siwei, 4 minutes ago)\r\n</pre>\r\n\r\n<p>\r\nafter merge ( master to branch2)\r\n</p>\r\n\r\n<pre>256a762 Merge branch \'master\' into branch2 (Siwei, 2 seconds ago)\r\nf738cf3 added line 2 to file 2 on branch2 (Siwei, 57 seconds ago)\r\n5d4cff1 added line 2 to file 1 on master (Siwei, 2 minutes ago)\r\na2f47a2 added line 1 to file 2 on branch2 (Siwei, 2 minutes ago)\r\n5ba53c5 added line 1 to file 1 on master (Siwei, 3 minutes ago)\r\n53f630f commit file2 on branch2 (Siwei, 3 minutes ago)\r\n29c906c added file1 (Siwei, 5 minutes ago)\r\n</pre>',0,'2013-04-17 08:10:00','2013-04-17 08:17:07','2013-04-17 08:17:07',1,NULL,'prefer-git-merge','','','',553,'prefer-git-merge'),(122,'定时执行的几个GEM比较( comparison of scheduled-task gems )','<p>delayed_jobs: 可以延后执行一个任务。最常见的： 发送EMAIL。( it is used for one-off tasks, classic example: sending emails)</p>\r\n<p>whenever: 可读性极强的 crontab. &#160; 需要配合具有crontab的操作系统来使用 &#160; ( fits for those OS with crontab supported. )&#160;</p>\r\n<p>rufu-scheduler: 可以定时执行N次，也可以延后执行一次，可以看成是 delayed_job + whenever的混合版。 ( supports both recurring task and one-off tasks. )&#160;</p>\r\n<p>resque-scheduler: 需要跟redis配合使用的东东。没用过。看了说明，跟delayed_job 几乎一样的。 离不开redis是它最大的“特点”。比较有意思的是，提供了一个WEB UI. （不过我认为专业程序员 有console就足够了） &#160;( lives on Redis DB, also with a fancy WEB UI which is useless for professional programmers)&#160;</p>\r\n<p>clockwork: 也看了下，跟delayed_job, resque-scheduler 几乎一样的。 &#160;(almost the same with delayed_job, resque-scheduler )&#160;</p>\r\n<p>clockwork 和其他。。。比较全的对比见：https://www.ruby-toolbox.com/categories/scheduling</p>\r\n<p>每个gem都有自己针对的一面。所以根据现在项目的需求（要配置一个可以定时抓取视频的应用，需要可以随时开始，随时停止），看过前面3个之后，我决定选择rufu-scheduler 。它不但可以满足 one-off task, &#160;也满足recurring task. 呵呵， 最重要的是，可以随时同过ruby 代码来控制停止和开启。（而不是通过命令行的形式）） ，就它了。 &#160; ( considering the manually start/stop by ruby code but not the console, I decided to choose rufu-scheduler to do the job. )&#160;</p>',0,'2013-04-28 00:16:00','2013-04-28 00:34:47','2013-04-28 00:34:47',1,NULL,'comparison-of-scheduler-gems','','','',667,'comparison-of-scheduler-gems'),(123,'安装 Android SDK  (setup Android SDK in eclipse)','<p>根据这个指导文件：(just following this guide: &#160;) &#160;<a href=\"http://code.google.com/p/robotium/wiki/RobotiumTutorials\">http://code.google.com/p/robotium/wiki/RobotiumTutorials</a>\r\n</p><p>1. 下载并安装Eclipse ( install eclipse)</p>\r\n<p>2. 下载并安装 Eclipse ADT (android development tools)&#160;</p>\r\n<p>3. 安装Android SDK. &#160;（上面的说明文档有些过时，安装的过程参照 eclipse的引导就可以了。文档中的 AVD(android virtual device) 是没必要的。在最新的版本上已经有一个 AVD列表了... 吧？）</p> \r\n\r\n',0,'2013-05-04 23:34:00','2013-05-04 23:38:17','2013-05-04 23:38:17',1,NULL,'setting-up-adt','','','',917,'setting-up-adt'),(125,'Ubuntu 下安装ffmpeg ( Compile FFmpeg on Ubuntu Lucid Lynx 10.04 LTS ) ','<p>see: <a target=\"_blank\" href=\"https://trac.ffmpeg.org/wiki/CompilationGuide/Ubuntu\">https://trac.ffmpeg.org/wiki/CompilationGuide/Ubuntu</a>\r\n</p>\r\n<p>It also works for me on Ubuntu 11.&#160;</p>\r\n<p>Compile FFmpeg on Ubuntu Lucid Lynx 10.04 LTS<br />Contents<br />Preparation<br />Installation<br />Finish<br />Optional Installation<br />Updating FFmpeg<br />Reverting Changes Made by This Guide<br />If You Need Help<br />This guide supports Ubuntu Lucid Lynx 10.04 LTS. If you are using a different Ubuntu version see the main Compile FFmpeg on Ubuntu Guide. This guide will enable several external encoders and decoders: libfaac (AAC encoder), libmp3lame (MP3 encoder), libopencore-amr (AMR encoder/decoder), libtheora (Theora encoder), libvorbis (Vorbis encoder), libvpx (VP8 encoder/decoder), and libx264 (H.264 encoder). These are optional and may be omitted if desired.</p>\r\n<p>Note: Copy and paste the whole code box for each step.</p>\r\n<p>Preparation</p>\r\n<p>Remove any existing packages:</p>\r\n<p>sudo apt-get remove ffmpeg x264 libx264-dev yasm<br />Get the dependencies (Ubuntu Desktop users):</p>\r\n<p>sudo apt-get update<br />sudo apt-get install -y build-essential git-core checkinstall texi2html libfaac-dev \\<br />    libopencore-amrnb-dev libopencore-amrwb-dev libsdl1.2-dev libtheora-dev \\<br />    libvorbis-dev libx11-dev libxfixes-dev pkg-config zlib1g-dev<br />Get the dependencies (Ubuntu Server or headless users):</p>\r\n<p>sudo apt-get update<br />sudo apt-get install -y build-essential git-core checkinstall texi2html libfaac-dev \\<br />    libopencore-amrnb-dev libopencore-amrwb-dev libtheora-dev libvorbis-dev pkg-config zlib1g-dev<br />Installation</p>\r\n<p>Yasm</p>\r\n<p>Yasm is an assembler and is recommended for x264 and FFmpeg.</p>\r\n<p>cd<br />wget http://www.tortall.net/projects/yasm/releases/yasm-1.2.0.tar.gz<br />tar xzvf yasm-1.2.0.tar.gz<br />cd yasm-1.2.0<br />./configure<br />make<br />sudo checkinstall --pkgname=yasm --pkgversion=\"1.2.0\" --backup=no --deldoc=yes --default<br />x264</p>\r\n<p>H.264 video encoder. The following commands will get the current source files, compile, and install x264.</p>\r\n<p>cd<br />git clone --depth 1 git://git.videolan.org/x264<br />cd x264<br />./configure --enable-static<br />make<br />sudo checkinstall --pkgname=x264 --default --pkgversion=\"3:$(./version.sh | \\<br />    awk -F\'[\" ]\' \'/POINT/{print $4\"+git\"$5}\')\" --backup=no --deldoc=yes<br />Note: See  using snapshots if you are having connection issues with the Git server.</p>\r\n<p>LAME</p>\r\n<p>MP3 audio encoder.</p>\r\n<p>sudo apt-get remove libmp3lame-dev<br />sudo apt-get install nasm<br />cd<br />wget http://downloads.sourceforge.net/project/lame/lame/3.99/lame-3.99.5.tar.gz<br />tar xzvf lame-3.99.5.tar.gz<br />cd lame-3.99.5<br />./configure --enable-nasm --disable-shared<br />make<br />sudo checkinstall --pkgname=lame-ffmpeg --pkgversion=\"3.99.5\" --backup=no --default \\<br />    --deldoc=yes<br />libvpx</p>\r\n<p>VP8 video encoder and decoder.</p>\r\n<p>cd<br />git clone --depth 1 http://git.chromium.org/webm/libvpx.git<br />cd libvpx<br />./configure<br />make<br />sudo checkinstall --pkgname=libvpx --pkgversion=\"$(date +%Y%m%d%H%M)-git\" --backup=no \\<br />    --default --deldoc=yes<br />FFmpeg</p>\r\n<p>cd<br />git clone --depth 1 git://source.ffmpeg.org/ffmpeg<br />cd ffmpeg<br />./configure --enable-gpl --enable-libfaac --enable-libmp3lame --enable-libopencore-amrnb \\<br />    --enable-libopencore-amrwb --enable-libtheora --enable-libvorbis --enable-libvpx \\<br />    --enable-libx264 --enable-nonfree --enable-version3 --enable-x11grab<br />make<br />sudo checkinstall --pkgname=ffmpeg --pkgversion=\"5:$(./version.sh)\" --backup=no \\<br />    --deldoc=yes --default<br />hash x264 ffmpeg ffplay ffprobe<br />Note: Ubuntu Server users should omit --enable-x11grab.</p>\r\n<p>Finish</p>\r\n<p>Installation is now complete and FFmpeg is now ready for use. You can keep the x264, libvpx, and ffmpeg directories in your home directory if you plan on updating later. See Updating FFmpeg below for more details. Some optional steps are next followed by instructions on updating FFmpeg and finally instructions on reverting all changes made by this guide.</p>',0,'2013-05-08 07:53:00','2013-05-08 07:54:38','2014-06-20 07:37:36',1,NULL,'','','','',703,'ubuntu-ffmpeg-compile-ffmpeg-on-ubuntu-lucid-lynx-10-04-lts'),(126,'auto test tools for mobile applications （移动应用的自动化测试工具） ','<p>basically, &#160; appium or robotium is our choice ( perhaps, I am not sure)&#160;</p>\r\n<p>copied from:&#160; <a href=\"http://www.linkedin.com/groups/What-mobile-automation-tool-would-86204.S.192414075\">http://www.linkedin.com/groups/What-mobile-automation-tool-would-86204.S.192414075</a> </p>\r\n<p>Felipe Knorr Kuhn • Hi Aidan, it all depends on what platform(s) you want to work with, but I strongly recommend studying and helping open source tools. </p>\r\n<p>If you are into iOS, there\'s Appium [1] (which implements the WebDriver protocol for native apps), Frank [2], Calabash [3] and others. </p>\r\n<p>If you are into Windows 8 tablets and WinJS apps, there\'s RainbowDriver [4]. </p>\r\n<p>For Android, I can think of Robotium [5] and Calabash. </p>\r\n<p>If they don\'t do what you want, you can always try to extend them or request new features. </p>\r\n<p>[1] https://github.com/hugs/appium <br />[2] http://testingwithfrank.com/ <br />[3] http://calaba.sh/ <br />[4] https://github.com/rainbowdriver <br />[5] http://code.google.com/p/robotium/</p>',0,'2013-05-09 07:52:00','2013-05-09 07:54:47','2013-05-09 07:54:47',1,NULL,'auto-test-tools-for-mobile-applications','','','',627,'auto-test-tools-for-mobile-applications'),(127,'ruby only include module 1 time (prevent including a module multiple times ) ','<p>approaches:</p>\r\n<p>1. use raw ruby ( not recommended) &#160;&#160;</p>\r\n<p>2. use ActiveSupport::Concern (&#160;<a href=\"http://api.rubyonrails.org/classes/ActiveSupport/Concern.html\">http://api.rubyonrails.org/classes/ActiveSupport/Concern.html </a>)</p>\r\n<p>p.s. 3.&#160;require_dependency &#160;( this is used to require a file )&#160;\r\n</p>\r\n<p>p.s.2 实际上多次包含一个module 也不会出太大的错，除了 会多次调用 included 方法。如下：</p>\r\n\r\n<pre>module Tree\r\n    def name;         puts \"I am a tree~\" l;     end \r\nend\r\nclass Apple\r\n    include Tree\r\n    include Tree\r\n    include Tree\r\n    include Tree\r\nend\r\nputs Apple.included_modules #=&gt; [Tree, Kernel]\r\n</pre>',0,'2013-05-11 01:06:00','2013-05-11 01:08:07','2013-05-11 01:14:47',1,NULL,'prevent-including-a-module-multiple-times','','','',512,'prevent-including-a-module-multiple-times'),(128,'Use htop to have a better view layout than \'top\' (替换top的好东西： htop) ','<p>这几天在top 查看系统状态时，发现有个进程怎么都看不到完整名字（显示不下了）。时间特别短暂，几秒中就过去了。</p>\r\n<p>但是我觉得很吓人，于是就搜了一下。发现了这个回答：</p>\r\n<a href=\"http://serverfault.com/questions/139632/show-full-process-name-in-top\">http://serverfault.com/questions/139632/show-full-process-name-in-top</a>\r\n<p>试了下，效果非常不错，可以左右调整布局，耐心的等了一会儿，终于看到这个进程全名了。呵呵。。。</p>\r\n<p><img src=\"/system/images/BAhbBlsHOgZmSSIlMjAxMy8wNS8xNy8wOF8zMV8zOF85NzJfaHRvcC5wbmcGOgZFVA/htop.png\" title=\"Htop\" alt=\"Htop\" rel=\"110x110\" width=\"1280\" height=\"800\" /></p>',0,'2013-05-17 00:28:00','2013-05-17 00:32:15','2013-05-17 00:32:15',1,NULL,'using-htop-instead-of-top','','','',648,'using-htop-instead-of-top'),(129,'Git rebase 笔记 ( git rebase introduction)','<p>前几天的一个文章，我提到 自己比较偏好 git-merge. 现在看起来，这个问题不该带有个人偏好。而是需要根据情况，来选择使用 git rebase /merge &#160;( several days ago, I mentioned that I prefer \'git-merge\' to \'git-rebase\'. &#160;Now I admit that as a professional programmer, I should not be emotional. &#160;We should choosing the right one according to the real situation )&#160;</p>\r\n<p>merge: 会保留时间线。 适合需要保持时间线的场合。 &#160;(it would keep the commit order for each branch )&#160;</p>\r\n<p>rebase: 不会保留时间线。 适合按照 feature 来查看log的场合。比如，我现在同时在3个分支上工作，但是为了方便代码的提交，我会在一个完成之后再提交另外一个分支/功能模块。所以在这样的情况下使用rebase使得代码更加容易回滚，以及查看log. &#160; ( the origin commit would be removed and a new commit would be generated . &#160;if you are working on 3 branches at the same time, and want to merge the code till the whole module/branch is done, just use this \'rebase\' )&#160;</p>\r\n<p>简单用法：</p>\r\n<p>$ git rebase master &lt;current_branch&gt;</p>\r\n<p>这样就会把 master上的最后一个commit, 做为当前 分支的commit 的基础。</p>\r\n<p>更多详细，参考 man git-rebase. &#160; ( for more details, please refer to \'man git-rebase\' )&#160;</p>',0,'2013-05-27 02:56:00','2013-05-27 03:03:58','2013-05-27 03:03:58',1,NULL,'git-rebase-introduction','','','',574,'git-rebase-introduction'),(130,'正则表达式中的贪婪和懒惰 （greedy expression in regexp   ）','<p>in short: adding \"?\" to the regexp</p>\r\n<pre>\"123 123 123\".match(/1.*3/)   # =&gt; \"123 123 123\"\r\n\"123 123 123\".match(/1.*?3/)   # =&gt; \"123\"\r\n</pre>\r\n<p>http://rubyer.me/blog/357/</p>\r\n<p>6、贪婪匹配vs懒惰匹配<br />这两种匹配属于标准正则表达式内容，与Ruby没关，但新手如果不明白匹配时会发生莫名其妙的错误，所以特别总结一下。</p>\r\n<p>贪婪匹配：尽可能多匹配，正则默认是贪婪匹配。例子：a.*b它将会匹配最长的以a开始，以b结束的字符串。对于aabab的匹配结果是aabab。<br />懒惰匹配：尽可能少匹配。例子：a.*?b对于aabab的匹配结果是aab和ab。<br />一般是在原来表达式结尾加?就由贪婪匹配变成了懒惰匹配。常用的懒惰限定符有（去年最后的问题就是贪婪匹配）：</p>\r\n<p>?重复任意次，但尽可能少重复<br />+?重复1次或更多次，但尽可能少重复<br />??重复0次或1次，但尽可能少重复<br />{n,m}?重复n到m次，但尽可能少重复<br />{n,}?重复n次以上，但尽可能少重复</p>',0,'2013-05-29 07:18:00','2013-05-29 07:24:13','2013-05-29 07:24:13',1,NULL,'greedy-expression-in-ruby-regexp','','','',1481,'greedy-expression-in-ruby-regexp'),(131,'ruby selenium gem: selenium-webdriver  ( 复制过来的文档）','<div id=\"blog_content\" class=\"blog_content\">\r\n    <p>&#160;官方文档挂了，所以我就复制过来了。看起来很有效。( copied from other site because it seems that we can\'t access its official site from China mainland )&#160;</p>\r\n<h1 style=\"font-size: x-large; margin-top: 0px; background-image: none; background-color: initial; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-color: initial; padding-left: 0px;\">Introduction</h1>\r\n<p style=\"line-height: 1.25em;\">The Ruby bindings for Selenium/WebDriver are available as the&#160;<a style=\"color: #0000cc;\" href=\"http://rubygems.org/gems/selenium-webdriver\">selenium-webdriver</a>&#160;gem. There are many other Selenium gems out there, but this is the only official, maintained gem. If you\'re looking for a slightly higher level API built on the same technology, you may want to check out&#160;<a style=\"color: #0000cc;\" href=\"http://watirwebdriver.com/\">watir-webdriver</a>.</p>\r\n<p style=\"line-height: 1.25em;\">The bindings support Ruby 1.8.7 through 1.9.2, JRuby and Rubinius.</p>\r\n<ul style=\"padding-left: 25px;\">\r\n<li style=\"margin-bottom: 0.3em;\"><a style=\"color: #0000cc;\" href=\"http://selenium.googlecode.com/svn/trunk/docs/api/rb/index.html\">API docs</a>\r\n</li>\r\n<li style=\"margin-bottom: 0.3em;\"><a style=\"color: #0000cc;\" href=\"http://selenium.googlecode.com/svn/trunk/rb/CHANGES\">Changelog</a>\r\n</li>\r\n</ul>\r\n<p style=\"line-height: 1.25em;\">The gem also includes the older selenium-client gem for use with Selenium RC. When reading the docs, keep in mind that these two namespaces refer to different APIs:</p>\r\n<ul style=\"padding-left: 25px;\">\r\n<li style=\"margin-bottom: 0.3em;\">\r\n<tt style=\"font-family: Monaco, \'DejaVu Sans Mono\', \'Bitstream Vera Sans Mono\', \'Lucida Console\', monospace; font-size: 12px;\">Selenium::WebDriver</tt>&#160;- the WebDriver API</li>\r\n<li style=\"margin-bottom: 0.3em;\">\r\n<tt style=\"font-family: Monaco, \'DejaVu Sans Mono\', \'Bitstream Vera Sans Mono\', \'Lucida Console\', monospace; font-size: 12px;\">Selenium::Client</tt>&#160;- Selenium RC API (previously released as the selenium-client gem)</li>\r\n</ul>\r\n<p style=\"line-height: 1.25em;\">For people who are new to Selenium, we recommend starting directly with&#160;<tt style=\"font-family: Monaco, \'DejaVu Sans Mono\', \'Bitstream Vera Sans Mono\', \'Lucida Console\', monospace; font-size: 12px;\">Selenium::WebDriver</tt>, and focusing on the two main classes,<tt style=\"font-family: Monaco, \'DejaVu Sans Mono\', \'Bitstream Vera Sans Mono\', \'Lucida Console\', monospace; font-size: 12px;\">Selenium::WebDriver::Driver</tt>&#160;and&#160;<tt style=\"font-family: Monaco, \'DejaVu Sans Mono\', \'Bitstream Vera Sans Mono\', \'Lucida Console\', monospace; font-size: 12px;\">Selenium::WebDriver::Element</tt>. This is the entry point to the whole WebDriver API.</p>\r\n<p style=\"line-height: 1.25em;\">The rest of this document deals with&#160;<tt style=\"font-family: Monaco, \'DejaVu Sans Mono\', \'Bitstream Vera Sans Mono\', \'Lucida Console\', monospace; font-size: 12px;\">Selenium::WebDriver</tt>&#160;exclusively.</p>\r\n<h1 style=\"font-size: x-large; margin-top: 0px; background-image: none; background-color: initial; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-color: initial; padding-left: 0px;\">\r\n<a name=\"API_Example\"></a>API Example<a style=\"color: #bbbbbb; display: inline; text-decoration: none; margin-left: 0.7em; font-size: 20px;\" href=\"http://code.google.com/p/selenium/wiki/RubyBindings#API_Example\" class=\"section_anchor\"></a>\r\n</h1>\r\n<p style=\"line-height: 1.25em;\">The bindings provide a slightly rubified version of the WebDriver API:</p>\r\n<p style=\"line-height: 1.25em;\">&#160;</p>\r\n<p style=\"line-height: 1.25em;\">&#160;</p>\r\n<div class=\"dp-highlighter\"><div class=\"bar\"><div class=\"tools\">Ruby代码 <embed wmode=\"transparent\" src=\"/javascripts/syntaxhighlighter/clipboard_new.swf\" width=\"14\" height=\"15\" flashvars=\"clipboard=require%20%22selenium-webdriver%22%0A%0Adriver%20%3D%20Selenium%3A%3AWebDriver.for%20%3Afirefox%0Adriver.navigate.to%20%22http%3A%2F%2Fgoogle.com%22%0A%0Aelement%20%3D%20driver.find_element(%3Aname%2C%20\'q\')%0Aelement.send_keys%20%22Hello%20WebDriver!%22%0Aelement.submit%0A%0Aputs%20driver.title%0A%0Adriver.quit\" allowscriptaccess=\"always\" type=\"application/x-shockwave-flash\" />&#160;<a href=\"javascript:void()\" title=\"收藏这段代码\" onclick=\"code_favorites_do_favorite(this);return false;\"><img class=\"star\" src=\"/images/icon_star.png\" alt=\"收藏代码\" /><img class=\"spinner\" src=\"/images/spinner.gif\" style=\"display:none\" /></a>\r\n</div></div>\r\n<ol class=\"dp-rb\"><li><span><span>require&#160;</span>\r\n<span class=\"string\">\"selenium-webdriver\"</span>\r\n</span></li>\r\n<li></li>\r\n<li><span>driver&#160;=&#160;Selenium::WebDriver.<span class=\"keyword\">for</span>\r\n<span class=\"symbol\">:firefox</span>\r\n</span></li>\r\n<li><span>driver.navigate.to&#160;<span class=\"string\">\"http://google.com\"</span>\r\n</span></li>\r\n<li></li>\r\n<li><span>element&#160;=&#160;driver.find_element(<span class=\"symbol\">:name</span>\r\n<span>,&#160;</span>\r\n<span class=\"string\">\'q\'</span>\r\n<span>)&#160;&#160;</span>\r\n</span></li>\r\n<li><span>element.send_keys&#160;<span class=\"string\">\"Hello&#160;WebDriver!\"</span>\r\n</span></li>\r\n<li><span>element.submit&#160;&#160;</span>\r\n</li><li></li>\r\n<li><span>puts&#160;driver.title&#160;&#160;</span>\r\n</li><li></li>\r\n<li><span>driver.quit&#160;&#160;</span>\r\n</li></ol>\r\n</div><pre class=\"ruby\" style=\"display: none;\" title=\"Selenium2 with ruby\">require \"selenium-webdriver\"\r\n\r\ndriver = Selenium::WebDriver.for :firefox\r\ndriver.navigate.to \"http://google.com\"\r\n\r\nelement = driver.find_element(:name, \'q\')\r\nelement.send_keys \"Hello WebDriver!\"\r\nelement.submit\r\n\r\nputs driver.title\r\n\r\ndriver.quit</pre>\r\n\r\n<p style=\"line-height: 1.25em;\">&#160;</p>\r\n<p>Driver examples:</span>\r\n</p>\r\n\r\n\r\n\r\n<div class=\"dp-highlighter\"><div class=\"bar\"><div class=\"tools\">Ruby代码 <embed wmode=\"transparent\" src=\"/javascripts/syntaxhighlighter/clipboard_new.swf\" width=\"14\" height=\"15\" flashvars=\"clipboard=%23%20execute%20arbitrary%20javascript%0Aputs%20driver.execute_script(%22return%20window.location.pathname%22)%0A%0A%23%20wait%20for%20a%20specific%20element%20to%20show%20up%0Await%20%3D%20Selenium%3A%3AWebDriver%3A%3AWait.new(%3Atimeout%20%3D%3E%2010)%20%23%20seconds%0Await.until%20%7B%20driver.find_element(%3Aid%20%3D%3E%20%22foo%22)%20%7D\" allowscriptaccess=\"always\" type=\"application/x-shockwave-flash\" />&#160;<a href=\"javascript:void()\" title=\"收藏这段代码\" onclick=\"code_favorites_do_favorite(this);return false;\"><img class=\"star\" src=\"/images/icon_star.png\" alt=\"收藏代码\" /><img class=\"spinner\" src=\"/images/spinner.gif\" style=\"display:none\" /></a>\r\n</div></div>\r\n<ol class=\"dp-rb\"><li><span><span class=\"comment\">#&#160;execute&#160;arbitrary&#160;javascript</span>\r\n</span></li>\r\n<li><span>puts&#160;driver.execute_script(<span class=\"string\">\"return&#160;window.location.pathname\"</span>\r\n<span>)&#160;&#160;</span>\r\n</span></li>\r\n<li></li>\r\n<li><span><span class=\"comment\">#&#160;wait&#160;for&#160;a&#160;specific&#160;element&#160;to&#160;show&#160;up</span>\r\n</span></li>\r\n<li><span>wait&#160;=&#160;Selenium::WebDriver::Wait.<span class=\"keyword\">new</span>\r\n<span>(</span>\r\n<span class=\"symbol\">:timeout</span>\r\n<span>&#160;=&gt;&#160;10)&#160;</span>\r\n<span class=\"comment\">#&#160;seconds</span>\r\n</span></li>\r\n<li><span>wait.<span class=\"keyword\">until</span>\r\n<span>&#160;{&#160;driver.find_element(</span>\r\n<span class=\"symbol\">:id</span>\r\n<span>&#160;=&gt;&#160;</span>\r\n<span class=\"string\">\"foo\"</span>\r\n<span>)&#160;}&#160;&#160;</span>\r\n</span></li>\r\n</ol></div>\r\n<pre class=\"ruby\" style=\"display: none;\" title=\"Selenium2 with ruby\"># execute arbitrary javascript\r\nputs driver.execute_script(\"return window.location.pathname\")\r\n\r\n# wait for a specific element to show up\r\nwait = Selenium::WebDriver::Wait.new(:timeout =&gt; 10) # seconds\r\nwait.until { driver.find_element(:id =&gt; \"foo\") }</pre>\r\n\r\n<p>Element examples:</span>\r\n</p>\r\n\r\n<div class=\"dp-highlighter\"><div class=\"bar\"><div class=\"tools\">Ruby代码 <embed wmode=\"transparent\" src=\"/javascripts/syntaxhighlighter/clipboard_new.swf\" width=\"14\" height=\"15\" flashvars=\"clipboard=%23%20get%20an%20attribute%0Aclass_name%20%3D%20element.attribute(%22class%22)%20%0A%0A%23%20is%20the%20element%20visible%20on%20the%20page%3F%0Aelement.displayed%3F%0A%0A%23%20click%20the%20element%0Aelement.click%0A%0A%23%20get%20the%20element%20location%0Aelement.location%0A%0A%23%20scroll%20the%20element%20into%20view%2C%20then%20return%20its%20location%0Aelement.location_once_scrolled_into_view%0A%0A%23%20get%20the%20width%20and%20height%20of%20an%20element%0Aelement.size%0A%0A%23%20press%20space%20on%20an%20element%20-%20see%20Selenium%3A%3AWebDriver%3A%3AKeys%20for%20possible%20values%0Aelement.send_keys%20%3Aspace%0A%0A%23%20get%20the%20text%20of%20an%20element%0Aelement.text\" allowscriptaccess=\"always\" type=\"application/x-shockwave-flash\" />&#160;<a href=\"javascript:void()\" title=\"收藏这段代码\" onclick=\"code_favorites_do_favorite(this);return false;\"><img class=\"star\" src=\"/images/icon_star.png\" alt=\"收藏代码\" /><img class=\"spinner\" src=\"/images/spinner.gif\" style=\"display:none\" /></a>\r\n</div></div>\r\n<ol class=\"dp-rb\"><li><span><span class=\"comment\">#&#160;get&#160;an&#160;attribute</span>\r\n</span></li>\r\n<li><span>class_name&#160;=&#160;element.attribute(<span class=\"string\">\"class\"</span>\r\n<span>)&#160;&#160;&#160;</span>\r\n</span></li>\r\n<li></li>\r\n<li><span><span class=\"comment\">#&#160;is&#160;the&#160;element&#160;visible&#160;on&#160;the&#160;page?</span>\r\n</span></li>\r\n<li><span>element.displayed?&#160;&#160;</span>\r\n</li><li></li>\r\n<li><span><span class=\"comment\">#&#160;click&#160;the&#160;element</span>\r\n</span></li>\r\n<li><span>element.click&#160;&#160;</span>\r\n</li><li></li>\r\n<li><span><span class=\"comment\">#&#160;get&#160;the&#160;element&#160;location</span>\r\n</span></li>\r\n<li><span>element.location&#160;&#160;</span>\r\n</li><li></li>\r\n<li><span><span class=\"comment\">#&#160;scroll&#160;the&#160;element&#160;into&#160;view,&#160;then&#160;return&#160;its&#160;location</span>\r\n</span></li>\r\n<li><span>element.location_once_scrolled_into_view&#160;&#160;</span>\r\n</li><li></li>\r\n<li><span><span class=\"comment\">#&#160;get&#160;the&#160;width&#160;and&#160;height&#160;of&#160;an&#160;element</span>\r\n</span></li>\r\n<li><span>element.size&#160;&#160;</span>\r\n</li><li></li>\r\n<li><span><span class=\"comment\">#&#160;press&#160;space&#160;on&#160;an&#160;element&#160;-&#160;see&#160;Selenium::WebDriver::Keys&#160;for&#160;possible&#160;values</span>\r\n</span></li>\r\n<li><span>element.send_keys&#160;<span class=\"symbol\">:space</span>\r\n</span></li>\r\n<li></li>\r\n<li><span><span class=\"comment\">#&#160;get&#160;the&#160;text&#160;of&#160;an&#160;element</span>\r\n</span></li>\r\n<li><span>element.text&#160;&#160;</span>\r\n</li></ol>\r\n</div><pre class=\"ruby\" style=\"display: none;\" title=\"Selenium2 with ruby\"># get an attribute\r\nclass_name = element.attribute(\"class\") \r\n\r\n# is the element visible on the page?\r\nelement.displayed?\r\n\r\n# click the element\r\nelement.click\r\n\r\n# get the element location\r\nelement.location\r\n\r\n# scroll the element into view, then return its location\r\nelement.location_once_scrolled_into_view\r\n\r\n# get the width and height of an element\r\nelement.size\r\n\r\n# press space on an element - see Selenium::WebDriver::Keys for possible values\r\nelement.send_keys :space\r\n\r\n# get the text of an element\r\nelement.text</pre>\r\n\r\n\r\n<p>Advanced user interactions (see&#160;<a style=\"color: #0000cc;\" href=\"http://selenium.googlecode.com/svn/trunk/docs/api/rb/Selenium/WebDriver/ActionBuilder.html\">ActionBuilder</a>):</span>\r\n</p>\r\n\r\n\r\n<div class=\"dp-highlighter\"><div class=\"bar\"><div class=\"tools\">Ruby代码 <embed wmode=\"transparent\" src=\"/javascripts/syntaxhighlighter/clipboard_new.swf\" width=\"14\" height=\"15\" flashvars=\"clipboard=driver.action.key_down(%3Ashift).%0A%20%20%20%20%20%20%20%20%20%20%20%20%20%20click(element).%0A%20%20%20%20%20%20%20%20%20%20%20%20%20%20double_click(second_element).%0A%20%20%20%20%20%20%20%20%20%20%20%20%20%20key_up(%3Ashift).%0A%20%20%20%20%20%20%20%20%20%20%20%20%20%20drag_and_drop(element%2C%20third_element).%0A%20%20%20%20%20%20%20%20%20%20%20%20%20%20perform\" allowscriptaccess=\"always\" type=\"application/x-shockwave-flash\" />&#160;<a href=\"javascript:void()\" title=\"收藏这段代码\" onclick=\"code_favorites_do_favorite(this);return false;\"><img class=\"star\" src=\"/images/icon_star.png\" alt=\"收藏代码\" /><img class=\"spinner\" src=\"/images/spinner.gif\" style=\"display:none\" /></a>\r\n</div></div>\r\n<ol class=\"dp-rb\"><li><span><span>driver.action.key_down(</span>\r\n<span class=\"symbol\">:shift</span>\r\n<span>).&#160;&#160;</span>\r\n</span></li>\r\n<li><span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;click(element).&#160;&#160;</span>\r\n</li><li><span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;double_click(second_element).&#160;&#160;</span>\r\n</li><li><span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;key_up(<span class=\"symbol\">:shift</span>\r\n<span>).&#160;&#160;</span>\r\n</span></li>\r\n<li><span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;drag_and_drop(element,&#160;third_element).&#160;&#160;</span>\r\n</li><li><span>&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;perform&#160;&#160;</span>\r\n</li></ol>\r\n</div><pre class=\"ruby\" style=\"display: none;\" title=\"Selenium2 with ruby\">driver.action.key_down(:shift).\r\n              click(element).\r\n              double_click(second_element).\r\n              key_up(:shift).\r\n              drag_and_drop(element, third_element).\r\n              perform</pre>\r\n&#160;\r\n<p>\r\n</span>\r\n</p>\r\n<h2 style=\"font-size: large; background-image: none; background-color: initial; padding-left: 0px;\">IE</h2>\r\n<p style=\"line-height: 1.25em;\">Make sure that&#160;<em>Internet Options</em>&#160;→&#160;<em>Security</em>&#160;has the same&#160;<em>Protected Mode</em>&#160;setting (on or off, it doesn\'t matter as long as it is the same value) for all zones.</p>\r\n<h2 style=\"font-size: large; background-image: none; background-color: initial; padding-left: 0px;\">\r\n<a name=\"Chrome\"></a>Chrome</h2>\r\n<h3 style=\"font-size: medium; background-image: none; background-color: initial; border-top-style: solid; border-top-color: #3366cc; padding-top: 0.5ex; padding-right: 0.5em; padding-bottom: 0.5ex; padding-left: 0px; margin: 0px;\">\r\n<a name=\"Command_line_switches\"></a>Command line switches</h3>\r\n<p style=\"line-height: 1.25em;\">For a list of switches, see&#160;<a style=\"color: #0000cc;\" href=\"http://codesearch.google.com/codesearch#OAMlx_jo-ck/src/chrome/common/chrome_switches.cc&amp;exact_package=chromium\">chrome_switches.cc</a>:</p>\r\n<p style=\"line-height: 1.25em;\">&#160;</p>\r\n<p style=\"line-height: 1.25em;\">&#160;</p>\r\n<div class=\"dp-highlighter\"><div class=\"bar\"><div class=\"tools\">Ruby代码 <embed wmode=\"transparent\" src=\"/javascripts/syntaxhighlighter/clipboard_new.swf\" width=\"14\" height=\"15\" flashvars=\"clipboard=driver%20%3D%20Selenium%3A%3AWebDriver.for%20%3Achrome%2C%20%3Aswitches%20%3D%3E%20%0A%25w%5B--ignore-certificate-errors%20--disable-popup-blocking%20--disable-translate%5D%0A\" allowscriptaccess=\"always\" type=\"application/x-shockwave-flash\" />&#160;<a href=\"javascript:void()\" title=\"收藏这段代码\" onclick=\"code_favorites_do_favorite(this);return false;\"><img class=\"star\" src=\"/images/icon_star.png\" alt=\"收藏代码\" /><img class=\"spinner\" src=\"/images/spinner.gif\" style=\"display:none\" /></a>\r\n</div></div>\r\n<ol class=\"dp-rb\"><li><span><span>driver&#160;=&#160;Selenium::WebDriver.</span>\r\n<span class=\"keyword\">for</span>\r\n<span class=\"symbol\">:chrome</span>\r\n<span>,&#160;</span>\r\n<span class=\"symbol\">:switches</span>\r\n<span>&#160;=&gt;&#160;&#160;&#160;</span>\r\n</span></li>\r\n<li><span>%w[--ignore-certificate-errors&#160;--disable-popup-blocking&#160;--disable-translate]&#160;&#160;</span>\r\n</li></ol>\r\n</div><pre class=\"ruby\" style=\"display: none;\" title=\"Selenium2 with ruby\">driver = Selenium::WebDriver.for :chrome, :switches =&gt; \r\n%w[--ignore-certificate-errors --disable-popup-blocking --disable-translate]\r\n</pre>\r\n\r\n<p style=\"line-height: 1.25em;\">&#160;</p>\r\n<p>\r\n\r\n</span>\r\n</p>\r\n<h3 style=\"font-size: medium; background-image: none; background-color: initial; border-top-style: solid; border-top-color: #3366cc; padding-top: 0.5ex; padding-right: 0.5em; padding-bottom: 0.5ex; padding-left: 0px; margin: 0px;\">Tweaking profile preferences</h3>\r\n<p style=\"line-height: 1.25em;\">For a list of prefs, see&#160;<a style=\"color: #0000cc;\" href=\"http://codesearch.google.com/codesearch#OAMlx_jo-ck/src/chrome/common/pref_names.cc&amp;exact_package=chromium\">pref_names.cc</a>.</p>\r\n<p style=\"line-height: 1.25em;\">&#160;</p>\r\n<p style=\"line-height: 1.25em;\">&#160;</p>\r\n<div class=\"dp-highlighter\"><div class=\"bar\"><div class=\"tools\">Ruby代码 <embed wmode=\"transparent\" src=\"/javascripts/syntaxhighlighter/clipboard_new.swf\" width=\"14\" height=\"15\" flashvars=\"clipboard=profile%20%3D%20Selenium%3A%3AWebDriver%3A%3AChrome%3A%3AProfile.new%0Aprofile%5B\'download.prompt_for_download\'%5D%20%3D%20false%0Aprofile%5B\'download.default_directory\'%5D%20%3D%20%22%2Fpath%2Fto%2Fdir%22%0A%0Adriver%20%3D%20Selenium%3A%3AWebDriver.for%20%3Achrome%2C%20%3Aprofile%20%3D%3E%20profile\" allowscriptaccess=\"always\" type=\"application/x-shockwave-flash\" />&#160;<a href=\"javascript:void()\" title=\"收藏这段代码\" onclick=\"code_favorites_do_favorite(this);return false;\"><img class=\"star\" src=\"/images/icon_star.png\" alt=\"收藏代码\" /><img class=\"spinner\" src=\"/images/spinner.gif\" style=\"display:none\" /></a>\r\n</div></div>\r\n<ol class=\"dp-rb\"><li><span><span>profile&#160;=&#160;Selenium::WebDriver::Chrome::Profile.</span>\r\n<span class=\"keyword\">new</span>\r\n</span></li>\r\n<li><span>profile[<span class=\"string\">\'download.prompt_for_download\'</span>\r\n<span>]&#160;=&#160;</span>\r\n<span class=\"keyword\">false</span>\r\n</span></li>\r\n<li><span>profile[<span class=\"string\">\'download.default_directory\'</span>\r\n<span>]&#160;=&#160;</span>\r\n<span class=\"string\">\"/path/to/dir\"</span>\r\n</span></li>\r\n<li></li>\r\n<li><span>driver&#160;=&#160;Selenium::WebDriver.<span class=\"keyword\">for</span>\r\n<span class=\"symbol\">:chrome</span>\r\n<span>,&#160;</span>\r\n<span class=\"symbol\">:profile</span>\r\n<span>&#160;=&gt;&#160;profile&#160;&#160;</span>\r\n</span></li>\r\n</ol></div>\r\n<pre class=\"ruby\" style=\"display: none;\" title=\"Selenium2 with ruby\">profile = Selenium::WebDriver::Chrome::Profile.new\r\nprofile[\'download.prompt_for_download\'] = false\r\nprofile[\'download.default_directory\'] = \"/path/to/dir\"\r\n\r\ndriver = Selenium::WebDriver.for :chrome, :profile =&gt; profile</pre>\r\n<p style=\"line-height: 1.25em;\">&#160;</p>\r\n<p>\r\n\r\n</span>\r\n</p><p style=\"line-height: 1.25em;\">See also&#160;<a style=\"color: #0000cc;\" href=\"http://code.google.com/p/selenium/wiki/ChromeDriver\">ChromeDriver</a>.</p>\r\n<h2 style=\"font-size: large; background-image: none; background-color: initial; padding-left: 0px;\">\r\n<a name=\"Remote\"></a>Remote</h2>\r\n<p style=\"line-height: 1.25em;\">The&#160;<a style=\"color: #0000cc;\" href=\"http://code.google.com/p/selenium/wiki/RemoteWebDriver\">RemoteWebDriver</a>&#160;makes it easy to control a browser running on another machine. Download the jar (from&#160;<a style=\"color: #0000cc;\" href=\"http://code.google.com/p/selenium/downloads/list\">Downloads</a>) and launch the server:</p>\r\n<p style=\"line-height: 1.25em;\"><tt style=\"font-family: Monaco, \'DejaVu Sans Mono\', \'Bitstream Vera Sans Mono\', \'Lucida Console\', monospace; font-size: 12px;\">java -jar selenium-server-standalone.jar</tt>\r\n</p>\r\n<p style=\"line-height: 1.25em;\">Then connect to it from Ruby</p>\r\n<pre class=\"prettyprint\">driver </span>=</span> </span>Selenium</span>::</span>WebDriver</span>.</span>for</span>(:</span>remote</span>)</span>\r\n</pre>\r\n<p style=\"line-height: 1.25em;\">By default, this connects to the server running on localhost:4444 and opens Firefox. To connect to another machine, use the&#160;<tt style=\"font-family: Monaco, \'DejaVu Sans Mono\', \'Bitstream Vera Sans Mono\', \'Lucida Console\', monospace; font-size: 12px;\">:url</tt>&#160;option:</p>\r\n<pre class=\"prettyprint\">driver </span>=</span> </span>Selenium</span>::</span>WebDriver</span>.</span>for</span>(:</span>remote</span>,</span> </span>:</span>url </span>=&gt;</span> </span>\"http://myserver:4444/wd/hub\"</span>)</span>\r\n</pre>\r\n<p style=\"line-height: 1.25em;\">To launch another browser, use the :desired_capabilities option:</p>\r\n<pre class=\"prettyprint\">driver </span>=</span> </span>Selenium</span>::</span>WebDriver</span>.</span>for</span>(:</span>remote</span>,</span> </span>:</span>desired_capabilities </span>=&gt;</span> </span>:</span>chrome</span>)</span>\r\n</pre>\r\n<p style=\"line-height: 1.25em;\">You can also pass an instance of&#160;<tt style=\"font-family: Monaco, \'DejaVu Sans Mono\', \'Bitstream Vera Sans Mono\', \'Lucida Console\', monospace; font-size: 12px;\">Selenium::WebDriver::Remote::Capabilities</tt>, e.g.:</p>\r\n<pre class=\"prettyprint\">include </span>Selenium</span>\r\n\r\ncaps </span>=</span> </span>WebDriver</span>::</span>Remote</span>::</span>Capabilities</span>.</span>htmlunit</span>(:</span>javascript_enabled </span>=&gt;</span> </span>true</span>)</span>\r\ndriver </span>=</span> </span>WebDriver</span>.</span>for</span>(:</span>remote</span>,</span> </span>:</span>desired_capabilities </span>=&gt;</span> caps</span>)</span>\r\n</pre>\r\n<p style=\"line-height: 1.25em;\">You may want to set the proxy settings of the remote browser (this currently only works for Firefox):</p>\r\n<pre class=\"prettyprint\">include </span>Selenium</span>\r\n\r\ncaps </span>=</span> </span>WebDriver</span>::</span>Remote</span>::</span>Capabilities</span>.</span>firefox</span>(:</span>proxy </span>=&gt;</span> </span>WebDriver</span>::</span>Proxy</span>.</span>new</span>(:</span>http </span>=&gt;</span> </span>\"myproxyaddress:8080\"</span>))</span>\r\ndriver </span>=</span> </span>WebDriver</span>.</span>for</span>(:</span>remote</span>,</span> </span>:</span>desired_capabilities </span>=&gt;</span> caps</span>)</span>\r\n</pre>\r\n<p style=\"line-height: 1.25em;\">Or if you have a proxy in front of the remote server:</p>\r\n<pre class=\"prettyprint\">include </span>Selenium</span>\r\n\r\nclient </span>=</span> </span>WebDriver</span>::</span>Remote</span>::</span>Http</span>::</span>Default</span>.</span>new</span>\r\nclient</span>.</span>proxy </span>=</span> </span>Proxy</span>.</span>new</span>(:</span>http </span>=&gt;</span> </span>\"proxy.org:8080\"</span>)</span>\r\n\r\ndriver </span>=</span> </span>WebDriver</span>.</span>for</span>(:</span>remote</span>,</span> </span>:</span>http_client </span>=&gt;</span> client</span>)</span>\r\n</pre>\r\n<p style=\"line-height: 1.25em;\">See&#160;<a style=\"color: #0000cc;\" href=\"http://code.google.com/p/selenium/source/browse/trunk/rb/lib/selenium/webdriver/common/proxy.rb\">`Selenium::WebDriver::Proxy`</a>&#160;for more options.</p>\r\n<p style=\"line-height: 1.25em;\">For the remote Firefox driver you can configure the profile, see the section&#160;<a style=\"color: #0000cc;\" href=\"http://code.google.com/p/selenium/wiki/RubyBindings#Tweaking_Firefox_preferences\">Tweaking Firefox preferences</a>.</p>\r\n<h2 style=\"font-size: large; background-image: none; background-color: initial; padding-left: 0px;\">\r\n<a name=\"Firefox\"></a>Firefox</h2>\r\n<p style=\"line-height: 1.25em;\">The&#160;<a style=\"color: #0000cc;\" href=\"http://code.google.com/p/selenium/wiki/FirefoxDriver\">FirefoxDriver</a>&#160;lets you configure the profile used.</p>\r\n<h3 style=\"font-size: medium; background-image: none; background-color: initial; border-top-style: solid; border-top-color: #3366cc; padding-top: 0.5ex; padding-right: 0.5em; padding-bottom: 0.5ex; padding-left: 0px; margin: 0px;\">\r\n<a name=\"Adding_an_extension\"></a>Adding an extension</h3>\r\n<p style=\"line-height: 1.25em;\">It\'s often useful to have Firebug available in the Firefox instance launched by WebDriver:</p>\r\n<pre class=\"prettyprint\">include </span>Selenium</span>\r\n\r\nprofile </span>=</span> </span>WebDriver</span>::</span>Firefox</span>::</span>Profile</span>.</span>new</span>\r\nprofile</span>.</span>add_extension</span>(</span>\"/path/to/firebug.xpi\"</span>)</span>\r\n\r\ndriver </span>=</span> </span>WebDriver</span>.</span>for</span> </span>:</span>firefox</span>,</span> </span>:</span>profile </span>=&gt;</span> profile</span>\r\n</pre>\r\n<h3 style=\"font-size: medium; background-image: none; background-color: initial; border-top-style: solid; border-top-color: #3366cc; padding-top: 0.5ex; padding-right: 0.5em; padding-bottom: 0.5ex; padding-left: 0px; margin: 0px;\">\r\n<a name=\"Using_an_existing_profile\"></a>Using an existing profile</h3>\r\n<p style=\"line-height: 1.25em;\">You can use an existing profile as a template for the WebDriver profile by passing the profile name (see&#160;<tt style=\"font-family: Monaco, \'DejaVu Sans Mono\', \'Bitstream Vera Sans Mono\', \'Lucida Console\', monospace; font-size: 12px;\">firefox -ProfileManager</tt>&#160;to set up custom profiles.)</p>\r\n<pre class=\"prettyprint\">driver </span>=</span> </span>Selenium</span>::</span>WebDriver</span>.</span>for</span>(:</span>firefox</span>,</span> </span>:</span>profile </span>=&gt;</span> </span>\"my-existing-profile\"</span>)</span>\r\n</pre>\r\n<p style=\"line-height: 1.25em;\">If you want to use your default profile, pass&#160;<tt style=\"font-family: Monaco, \'DejaVu Sans Mono\', \'Bitstream Vera Sans Mono\', \'Lucida Console\', monospace; font-size: 12px;\">:profile =&gt; \"default\"</tt>\r\n</p>\r\n<p style=\"line-height: 1.25em;\">You can also get a Profile instance for an existing profile and tweak its preferences. This does not modify the existing profile, only the one used by WebDriver.</p>\r\n<pre class=\"prettyprint\">default_profile </span>=</span> </span>Selenium</span>::</span>WebDriver</span>::</span>Firefox</span>::</span>Profile</span>.</span>from_name </span>\"default\"</span>\r\ndefault_profile</span>.</span>native_events </span>=</span> </span>true</span>\r\n\r\ndriver </span>=</span> </span>Selenium</span>::</span>WebDriver</span>.</span>for</span>(:</span>firefox</span>,</span> </span>:</span>profile </span>=&gt;</span> default_profile</span>)</span>\r\n</pre>\r\n<h3 style=\"font-size: medium; background-image: none; background-color: initial; border-top-style: solid; border-top-color: #3366cc; padding-top: 0.5ex; padding-right: 0.5em; padding-bottom: 0.5ex; padding-left: 0px; margin: 0px;\">\r\n<a name=\"Tweaking_Firefox_preferences\"></a>Tweaking Firefox preferences</h3>\r\n<p style=\"line-height: 1.25em;\">Use a proxy:</p>\r\n<pre class=\"prettyprint\">profile </span>=</span> </span>Selenium</span>::</span>WebDriver</span>::</span>Firefox</span>::</span>Profile</span>.</span>new</span>\r\nproxy </span>=</span> </span>Selenium</span>::</span>WebDriver</span>::</span>Proxy</span>.</span>new</span>(:</span>http </span>=&gt;</span> </span>\"proxy.org:8080\"</span>)</span>\r\nprofile</span>.</span>proxy </span>=</span> proxy\r\n\r\ndriver </span>=</span> </span>Selenium</span>::</span>WebDriver</span>.</span>for</span> </span>:</span>firefox</span>,</span> </span>:</span>profile </span>=&gt;</span> profile</span>\r\n</pre>\r\n<p style=\"line-height: 1.25em;\">Automatically download files to a given folder:</p>\r\n<pre class=\"prettyprint\">profile </span>=</span> </span>Selenium</span>::</span>WebDriver</span>::</span>Firefox</span>::</span>Profile</span>.</span>new</span>\r\nprofile</span>[</span>\'browser.download.dir\'</span>]</span> </span>=</span> </span>\"/tmp/webdriver-downloads\"</span>\r\nprofile</span>[</span>\'browser.download.folderList\'</span>]</span> </span>=</span> </span>2</span>\r\nprofile</span>[</span>\'browser.helperApps.neverAsk.saveToDisk\'</span>]</span> </span>=</span> </span>\"application/pdf\"</span>\r\n\r\ndriver </span>=</span> </span>Selenium</span>::</span>WebDriver</span>.</span>for</span> </span>:</span>firefox</span>,</span> </span>:</span>profile </span>=&gt;</span> profile</span>\r\n</pre>\r\n<p style=\"line-height: 1.25em;\">If you are using the remote driver you can still configure the Firefox profile:</p>\r\n<pre class=\"prettyprint\">profile </span>=</span> </span>Selenium</span>::</span>WebDriver</span>::</span>Firefox</span>::</span>Profile</span>.</span>new</span>\r\nprofile</span>[</span>\'foo.bar\'</span>]</span> </span>=</span> </span>true</span>\r\n&#160; \r\ncapabilities </span>=</span> </span>Selenium</span>::</span>WebDriver</span>::</span>Remote</span>::</span>Capabilities</span>.</span>firefox</span>(:</span>firefox_profile </span>=&gt;</span> profile</span>)</span>\r\ndriver </span>=</span> </span>Selenium</span>::</span>WebDriver</span>.</span>for</span> </span>:</span>remote</span>,</span> </span>:</span>desired_capabilities </span>=&gt;</span> capabilities</span>\r\n</pre>\r\n<p style=\"line-height: 1.25em;\">For a list of possible preferences, see&#160;<a style=\"color: #0000cc;\" href=\"http://preferential.mozdev.org/preferences.html\">this page</a>.</p>\r\n<h3 style=\"font-size: medium; background-image: none; background-color: initial; border-top-style: solid; border-top-color: #3366cc; padding-top: 0.5ex; padding-right: 0.5em; padding-bottom: 0.5ex; padding-left: 0px; margin: 0px;\">\r\n<a name=\"Custom_Firefox_path\"></a>Custom Firefox path</h3>\r\n<p style=\"line-height: 1.25em;\">If your Firefox executable is in a non-standard location:</p>\r\n<pre class=\"prettyprint\">Selenium</span>::</span>WebDriver</span>::</span>Firefox</span>.</span>path </span>=</span> </span>\"/path/to/firefox\"</span>\r\ndriver </span>=</span> </span>Selenium</span>::</span>WebDriver</span>.</span>for</span> </span>:</span>firefox</span>\r\n</pre>\r\n<h3 style=\"font-size: medium; background-image: none; background-color: initial; border-top-style: solid; border-top-color: #3366cc; padding-top: 0.5ex; padding-right: 0.5em; padding-bottom: 0.5ex; padding-left: 0px; margin: 0px;\">\r\n<a name=\"Native_events\"></a>Native events</h3>\r\n<p style=\"line-height: 1.25em;\">Native events are enabled by default on Windows. To turn them off:</p>\r\n<pre class=\"prettyprint\">profile </span>=</span> </span>Selenium</span>::</span>WebDriver</span>::</span>Firefox</span>::</span>Profile</span>.</span>new</span>\r\nprofile</span>.</span>native_events </span>=</span> </span>false</span>\r\n\r\ndriver </span>=</span> </span>Selenium</span>::</span>WebDriver</span>.</span>for</span>(:</span>firefox</span>,</span> </span>:</span>profile </span>=&gt;</span> profile</span>)</span>\r\n</pre>\r\n<p style=\"line-height: 1.25em;\">Experimental support for native events is available on Linux. Set&#160;<tt style=\"font-family: Monaco, \'DejaVu Sans Mono\', \'Bitstream Vera Sans Mono\', \'Lucida Console\', monospace; font-size: 12px;\">profile.native_events = true</tt>&#160;to turn this on.</p>\r\n<h2 style=\"font-size: large; background-image: none; background-color: initial; padding-left: 0px;\">\r\n<a name=\"Opera\"></a>Opera</h2>\r\n<p style=\"line-height: 1.25em;\">The&#160;<a style=\"color: #0000cc;\" href=\"http://code.google.com/p/selenium/wiki/OperaDriver\">OperaDriver</a>&#160;is always run as a&#160;<a style=\"color: #0000cc;\" href=\"http://code.google.com/p/selenium/wiki/RemoteWebDriver\">RemoteWebDriver</a>&#160;server which the Ruby bindings connect to.</p>\r\n<p style=\"line-height: 1.25em;\">To get started, first&#160;<a style=\"color: #0000cc;\" href=\"http://code.google.com/p/selenium/downloads/list\">download</a>&#160;the&#160;<em>selenium-server-standalone</em>&#160;jar and set the&#160;<tt style=\"font-family: Monaco, \'DejaVu Sans Mono\', \'Bitstream Vera Sans Mono\', \'Lucida Console\', monospace; font-size: 12px;\">SELENIUM_SERVER_JAR</tt>&#160;environmental variable to point to its location:</p>\r\n<p style=\"line-height: 1.25em;\"><tt style=\"font-family: Monaco, \'DejaVu Sans Mono\', \'Bitstream Vera Sans Mono\', \'Lucida Console\', monospace; font-size: 12px;\">export SELENIUM_SERVER_JAR=/path/to/server-standalone.jar</tt>\r\n</p>\r\n<p style=\"line-height: 1.25em;\">Then you can simply create a new instance of&#160;<tt style=\"font-family: Monaco, \'DejaVu Sans Mono\', \'Bitstream Vera Sans Mono\', \'Lucida Console\', monospace; font-size: 12px;\">Selenium::WebDriver</tt>&#160;with the&#160;<tt style=\"font-family: Monaco, \'DejaVu Sans Mono\', \'Bitstream Vera Sans Mono\', \'Lucida Console\', monospace; font-size: 12px;\">:opera</tt>&#160;option:</p>\r\n<pre class=\"prettyprint\">driver </span>=</span> </span>Selenium</span>::</span>WebDriver</span>.</span>for</span> </span>:</span>opera\r\ndriver</span>.</span>navigate</span>.</span>to </span>\'http://opera.com/\'</span>\r\n</pre>\r\n<h2 style=\"font-size: large; background-image: none; background-color: initial; padding-left: 0px;\">\r\n<a name=\"Timeouts\"></a>Timeouts</h2>\r\n<h3 style=\"font-size: medium; background-image: none; background-color: initial; border-top-style: solid; border-top-color: #3366cc; padding-top: 0.5ex; padding-right: 0.5em; padding-bottom: 0.5ex; padding-left: 0px; margin: 0px;\">\r\n<a name=\"Implicit_waits\"></a>Implicit waits</h3>\r\n<p style=\"line-height: 1.25em;\">WebDriver lets you configure implicit waits, so that a call to&#160;<tt style=\"font-family: Monaco, \'DejaVu Sans Mono\', \'Bitstream Vera Sans Mono\', \'Lucida Console\', monospace; font-size: 12px;\">#find_element</tt>&#160;will wait for a specified amount of time before raising a<tt style=\"font-family: Monaco, \'DejaVu Sans Mono\', \'Bitstream Vera Sans Mono\', \'Lucida Console\', monospace; font-size: 12px;\">NoSuchElementError</tt>:</p>\r\n<pre class=\"prettyprint\">&#160; driver </span>=</span> </span>Selenium</span>::</span>WebDriver</span>.</span>for</span> </span>:</span>firefox\r\n&#160; driver</span>.</span>manage</span>.</span>timeouts</span>.</span>implicit_wait </span>=</span> </span>3</span> </span># seconds</span>\r\n</pre>\r\n<h3 style=\"font-size: medium; background-image: none; background-color: initial; border-top-style: solid; border-top-color: #3366cc; padding-top: 0.5ex; padding-right: 0.5em; padding-bottom: 0.5ex; padding-left: 0px; margin: 0px;\">\r\n<a name=\"Explicit_waits\"></a>Explicit waits</h3>\r\n<p style=\"line-height: 1.25em;\">Use the Wait class to explicitly wait for some condition:</p>\r\n<pre class=\"prettyprint\">&#160; wait </span>=</span> </span>Selenium</span>::</span>WebDriver</span>::</span>Wait</span>.</span>new</span>(:</span>timeout </span>=&gt;</span> </span>3</span>)</span>\r\n&#160; wait</span>.</span>until</span> </span>{</span> driver</span>.</span>find_element</span>(:</span>id </span>=&gt;</span> </span>\"cheese\"</span>).</span>displayed</span>?</span> </span>}</span>\r\n</pre>\r\n<h3 style=\"font-size: medium; background-image: none; background-color: initial; border-top-style: solid; border-top-color: #3366cc; padding-top: 0.5ex; padding-right: 0.5em; padding-bottom: 0.5ex; padding-left: 0px; margin: 0px;\">\r\n<a name=\"Internal_timeouts\"></a>Internal timeouts</h3>\r\n<p style=\"line-height: 1.25em;\">Internally, WebDriver uses HTTP to communicate with a lot of the drivers (the&#160;<a style=\"color: #0000cc;\" href=\"http://code.google.com/p/selenium/wiki/JsonWireProtocol\">JsonWireProtocol</a>). By default,&#160;<tt style=\"font-family: Monaco, \'DejaVu Sans Mono\', \'Bitstream Vera Sans Mono\', \'Lucida Console\', monospace; font-size: 12px;\">Net::HTTP</tt>&#160;from Ruby\'s standard library is used, which has a default timeout of 60 seconds. If you call&#160;<tt style=\"font-family: Monaco, \'DejaVu Sans Mono\', \'Bitstream Vera Sans Mono\', \'Lucida Console\', monospace; font-size: 12px;\">Driver#get</tt>&#160;on a page that takes more than 60 seconds to load, you\'ll see a&#160;<tt style=\"font-family: Monaco, \'DejaVu Sans Mono\', \'Bitstream Vera Sans Mono\', \'Lucida Console\', monospace; font-size: 12px;\">TimeoutError</tt>&#160;raised from&#160;<tt style=\"font-family: Monaco, \'DejaVu Sans Mono\', \'Bitstream Vera Sans Mono\', \'Lucida Console\', monospace; font-size: 12px;\">Net::HTTP</tt>. You can configure this timeout (before launching a browser) by doing:</p>\r\n<pre class=\"prettyprint\">&#160; client </span>=</span> </span>Selenium</span>::</span>WebDriver</span>::</span>Remote</span>::</span>Http</span>::</span>Default</span>.</span>new</span>\r\n&#160; client</span>.</span>timeout </span>=</span> </span>120</span> </span># seconds</span>\r\n&#160; driver </span>=</span> </span>Selenium</span>::</span>WebDriver</span>.</span>for</span>(:</span>remote</span>,</span> </span>:</span>http_client </span>=&gt;</span> client</span>)</span>\r\n</pre>\r\n<h2 style=\"font-size: large; background-image: none; background-color: initial; padding-left: 0px;\">\r\n<a name=\"JavaScript_dialogs\"></a>JavaScript dialogs</h2>\r\n<p style=\"line-height: 1.25em;\">You can use webdriver to handle Javascript&#160;<tt style=\"font-family: Monaco, \'DejaVu Sans Mono\', \'Bitstream Vera Sans Mono\', \'Lucida Console\', monospace; font-size: 12px;\">alert()</tt>,&#160;<tt style=\"font-family: Monaco, \'DejaVu Sans Mono\', \'Bitstream Vera Sans Mono\', \'Lucida Console\', monospace; font-size: 12px;\">prompt()</tt>&#160;and&#160;<tt style=\"font-family: Monaco, \'DejaVu Sans Mono\', \'Bitstream Vera Sans Mono\', \'Lucida Console\', monospace; font-size: 12px;\">confirm()</tt>&#160;dialogs. The API for all three is the same.</p>\r\n<p style=\"line-height: 1.25em;\">Note: At this time alert handling is only available in Firefox and IE (or in those browsers through the remote server), and only alerts that are generated post onload can be captured.</p>\r\n<pre class=\"prettyprint\">require</span> </span>\"selenium-webdriver\"</span>\r\n\r\ndriver </span>=</span> </span>Selenium</span>::</span>WebDriver</span>.</span>for</span> </span>:</span>firefox\r\ndriver</span>.</span>navigate</span>.</span>to </span>\"http://mysite.com/page_with_alert.html\"</span>\r\n\r\ndriver</span>.</span>find_element</span>(:</span>name</span>,</span> </span>\'element_with_alert_javascript\'</span>).</span>click\r\na </span>=</span> driver</span>.</span>switch_to</span>.</span>alert\r\n</span>if</span> a</span>.</span>text </span>==</span> </span>\'A value you are looking for\'</span>\r\n&#160; a</span>.</span>dismiss\r\n</span>else</span>\r\n&#160; a</span>.</span>accept\r\n</span>end</span>\r\n</pre>\r\n<h2 style=\"font-size: large; background-image: none; background-color: initial; padding-left: 0px;\">\r\n<a name=\"Using_Curb_or_your_own_HTTP_client\"></a>Using Curb or your own HTTP client</h2>\r\n<p style=\"line-height: 1.25em;\">For internal HTTP communication,&#160;<tt style=\"font-family: Monaco, \'DejaVu Sans Mono\', \'Bitstream Vera Sans Mono\', \'Lucida Console\', monospace; font-size: 12px;\">Net::HTTP</tt>&#160;is used by default. If you e.g. have the&#160;<a style=\"color: #0000cc;\" href=\"https://rubygems.org/gems/curb\">Curb gem</a>&#160;installed, you can switch to it by doing:</p>\r\n<pre class=\"prettyprint\">require</span> </span>\'selenium/webdriver/remote/http/curb\'</span>\r\ninclude </span>Selenium</span>\r\n\r\nclient </span>=</span> </span>WebDriver</span>::</span>Remote</span>::</span>Http</span>::</span>Curb</span>.</span>new</span>\r\ndriver </span>=</span> </span>WebDriver</span>.</span>for</span>(:</span>firefox</span>,</span> </span>:</span>http_client </span>=&gt;</span> client</span>)</span>\r\n</pre>\r\n<p style=\"line-height: 1.25em;\">If you have the&#160;<a style=\"color: #0000cc;\" href=\"https://github.com/drbrain/net-http-persistent\">net-http-persistent gem</a>&#160;installed, you can (as of 0.1.3) similarly use \"selenium/webdriver/remote/http/persistent\" to get keep-alive connections. This will significantly reduce the ephemeral ports usage of WebDriver, which is useful in&#160;<a style=\"color: #0000cc;\" href=\"http://code.google.com/p/selenium/wiki/ScalingWebDriver\">some contexts</a>. Note that this currently only works with the remote Java server (the other servers doesn\'t yet support keep-alive).</p>\r\n\r\n\r\n  </div>',0,'2013-05-30 00:33:00','2013-05-30 00:35:55','2013-05-30 00:35:55',1,NULL,'ruby-selenium-gem-webdriver','','','',10112,'ruby-selenium-gem-webdriver'),(132,'使用ffmpeg 组合两端视频 (combine videos using ffmpeg )','<p>see:&#160;<a href=\"http://ffmpeg.org/trac/ffmpeg/wiki/How%20to%20concatenate%20(join,%20merge)%20media%20files\">http://ffmpeg.org/trac/ffmpeg/wiki/How%20to%20concatenate%20(join,%20merge)%20media%20files</a>\r\n<br /><br />\r\n</p>\r\n<p>2014-06-23 更新： 更快的办法：\r\n</p>\r\n<pre>1: create a file containing x files: \r\nfile \'/workspace/videos/zhangong-new-1.mp4\'\r\nfile \'/workspace/videos/zhangong-new-2.mp4\'\r\n\r\n( 快速从开头获取到某部位的视频） : \r\n$ ffmpeg -i zhangong-0623.mp4 -t 00:00:10 -c copy zhangong-header.mp4\r\n\r\n2. $ ffmpeg -f concat  -i zhangong.txt -c copy zhangong-0623.mp4\r\n</pre>\r\n\r\n<p>简而言之，对于两个mp4文件，先把它们转换成mpegts 文件，再组合成一个mp4：</p>\r\n<pre>ffmpeg -i input1.mp4 -c copy -bsf:v h264_mp4toannexb -f mpegts intermediate1.ts\r\nffmpeg -i input2.mp4 -c copy -bsf:v h264_mp4toannexb -f mpegts intermediate2.ts\r\nffmpeg -i \"concat:intermediate1.ts|intermediate2.ts\" -c copy qiankunbu_total.mp4  ( 注意这里不要有  -bsf参数) \r\n</pre>\r\n<p>While the demuxer works at the stream level, the concat protocol works at the file level. Certain files (mpg and mpeg transport streams, possibly others) can be concatenated. This is analogous to using cat on UNIX-like systems or copy on Windows. In general, the demuxer is the better option.</p>\r\n<p>Instructions</p>\r\n<p>ffmpeg -i \"concat:input1.mpg|input2.mpg|input3.mpg\" -c copy output.mpg<br />If you have MP4 files, these could be losslessly concatenated by first transcoding them to mpeg transport streams. With h.264 video and AAC audio, the following can be used:</p>\r\n<p>ffmpeg -i input1.mp4 -c copy -bsf:v h264_mp4toannexb -f mpegts intermediate1.ts<br />ffmpeg -i input2.mp4 -c copy -bsf:v h264_mp4toannexb -f mpegts intermediate2.ts<br />ffmpeg -i \"concat:intermediate1.ts|intermediate2.ts\" -c copy -bsf:a aac_adtstoasc output.mp4</p>\r\n',0,'2013-05-30 02:05:00','2013-05-30 02:09:05','2014-06-22 21:43:46',1,NULL,'combine-videos-using-ffmpeg','','','',649,'combine-videos-using-ffmpeg'),(133,'run selenium in ubuntu server ( ubuntu server中运行selenium )','<p>看来遇到这个问题的人还不少。</p>\r\n<p>之前我只在 centos 上跑过 selenium, 那个centos 版本自动待了xwindows. 而ubuntu server 是不带的。所以google了一下。 参考这个文章:&#160; <a href=\"http://www.alittlemadness.com/2008/03/05/running-selenium-headless/\">http://www.alittlemadness.com/2008/03/05/running-selenium-headless/</a>\r\n</p><p>1.&#160; apt-get install xvfb</p>\r\n<p>2. &#160;apt-get install firefox</p>\r\n<p>3. &#160;nohup&#160;Xvfb :99 -ac &amp;</p>\r\n<p>4. &#160;export DISPLAY=:99 &#160; (注意这个 &#160; =:99 , 不是 =99 )</p>\r\n<p>5. &#160;firefox 就可以启动了。 &#160;或者直接 &#160;bundle exec rspec selenium_specs/pad_spec.rb&#160;</p>',0,'2013-05-30 02:10:00','2013-05-30 05:44:39','2013-05-30 05:44:39',1,NULL,'run-selenium-in-ubuntu-server','','','',532,'run-selenium-in-ubuntu-server'),(134,'为表单加上bootstrap 风格的focus CSS ( adding bootstrap style focus CSS to your input field)','<p>add these line to your CSS file:&#160;</p>\r\n<pre>textarea:focus, input[type=\"text\"]:focus, input[type=\"password\"]:focus, input[type=\"datetime\"]:focus, inpu\r\nt[type=\"datetime-local\"]:focus, input[type=\"date\"]:focus, input[type=\"month\"]:focus, input[type=\"time\"]:focus, input[type=\"week\"]:focus, input[type=\"number\"]:focus, input[type=\"email\"]:focus, input[type=\"url\"]:focus, input[type=\"search\"]:focus, input[type=\"tel\"]:focus, input[type=\"color\"]:focus, .uneditable-input:focus {\r\n  border: 1px solid #7F9EF4;\r\n  -webkit-box-shadow: inset 0 1px 1px rgba(0, 0, 0, 0.075), 0 0 6px #7ab5d3;\r\n  -moz-box-shadow: inset 0 1px 1px rgba(0, 0, 0, 0.075), 0 0 6px #7ab5d3;\r\n  box-shadow: inset 0 1px 1px rgba(0, 0, 0, 0.075), 0 0 6px #7ab5d3;\r\n}\r\n\r\n</pre>\r\n<p><img src=\"/system/images/BAhbBlsHOgZmSSImMjAxMy8wNi8wMy8xNl8wMV8xNV85OTJfZm9ybTIucG5nBjoGRVQ/form2.png\" title=\"Form2\" alt=\"Form2\" rel=\"450x450\" width=\"1280\" height=\"800\" /></p>',0,'2013-06-03 07:58:00','2013-06-03 08:02:02','2013-06-03 08:02:02',1,NULL,'adding-bootstrap-style-focus-css','','','',528,'adding-bootstrap-style-focus-css'),(135,'rails中手动开关connection ( close /open connections in Rails) ','<p> for details, please refer to : <a href=\"http://blog.daniel-azuma.com/archives/216\">http://blog.daniel-azuma.com/archives/216</a> </p>\r\n\r\n<pre>connection = User.connection\r\nobj = User.find(1)\r\nconnection = obj.connection\r\n\r\nUser.clear_active_connections!\r\n</pre>\r\n<p>$ show &#160;processlist;&#160;\r\n</p>',0,'2013-06-13 03:10:00','2013-06-13 03:12:57','2013-06-13 03:12:57',1,NULL,'close-open-connection-in-rails','','','',495,'close-open-connection-in-rails'),(136,'from Rails to Django (vice versa) 从Rails 到Django （反之亦然）','<p>checkout this post: &#160;&#160; <a href=\"http://blog.jupo.org/2011/07/30/rails-quick-start-for-djangonauts/\">http://blog.jupo.org/2011/07/30/rails-quick-start-for-djangonauts/</a>\r\n</p>\r\n<div class=\"container main\"><h6>July 30, 2011 &#160;/&#160; <a href=\"/\">Home</a>\r\n</h6>\r\n<p>I recently started a new role at a <a href=\"http://rubyonrails.org/\">Ruby on Rails</a> shop, which as a long time <a href=\"https://www.djangoproject.com/\">Django</a> specialist was a really interesting opportunity. There’s a lot of competition between the two frameworks’ communities, ranging from friendly rivalry and respectful admiration at the mature end of the scale, to all out fanboy fuelled flame-wars at the other.</p>\r\n\r\n<p>After you wade through the rivalry, the common wisdom voiced is that they’re conceptually the same. If you know <a href=\"http://python.org/\">Python</a>, go with Django and if you know <a href=\"http://www.ruby-lang.org/\">Ruby</a>, go with Rails. After spending several months with Rails I can attest to this being true. At a bird’s-eye view both frameworks contain almost identical concepts, implemented with different philosophies stemming from the ideals expressed by the languages they’re written in. Both frameworks provide a vastly superior approach to security, modularity and rapid development than <a href=\"/2010/09/28/on-modern-web-development/\">their predecessors do</a>.</p>\r\n\r\n<p>An interesting question to ask would be: <em>which would be the best framework to choose, not knowing either language?</em> It would be naive of me to believe I am unbiased, but I would certainly recommend Django over Rails. The relative strictness of Python and explicitness of each component in Django, compared to the implicit magic in Rails, is simply much more geared towards creating large-scale systems in a sane and transparent way. To Ruby’s credit though, I have developed a real admiration for the language itself, and have continued using it in my own projects - but that’s a topic for another post.</p>\r\n\r\n<p>Considering how similar the two frameworks are component-wise, one thing I did miss was a side-by-side cheat sheet for working out what each of the concepts were in Rails that I already knew well in Django. I’ve put one together below to help out anyone who might be picking up either framework while already knowing the other. For clarity, I’ve also included descriptions of each type of component, for those who haven’t used either framework.</p>\r\n\r\n<table class=\"table table-striped\">\r\n<tbody><tr>\r\n    <th>Django</th>\r\n    <th>Ruby on Rails</th>\r\n    <th>&#160;</th>\r\n</tr>\r\n<tr>\r\n    <td><a href=\"https://docs.djangoproject.com/en/dev/topics/http/urls/\">URL patterns</a>\r\n</td>\r\n    <td><a href=\"http://guides.rubyonrails.org/routing.html\">Routes</a>\r\n</td>\r\n    <td>Regular expression definitions for each type of URL and what part of the web site they map to.</td>\r\n</tr>\r\n<tr>\r\n    <td><a href=\"https://docs.djangoproject.com/en/dev/topics/http/views/\">Views</a>\r\n</td>\r\n    <td><a href=\"http://guides.rubyonrails.org/action_controller_overview.html\">Controllers</a>\r\n</td>\r\n    <td>The units of code that the above regular expressions map to, that perform application logic and pass data to a rendering layer.</td>\r\n</tr>\r\n<tr>\r\n    <td><a href=\"https://docs.djangoproject.com/en/dev/topics/templates/\">Templates</a>\r\n</td>\r\n    <td><a href=\"http://guides.rubyonrails.org/layouts_and_rendering.html\">Views</a>\r\n</td>\r\n    <td>The rendering layer that is given data from the code described above, and performs display logic typically wrapped around HTML code.</td>\r\n</tr>\r\n<tr>\r\n    <td><a href=\"https://docs.djangoproject.com/en/dev/ref/templates/builtins/\">Template tags</a> <em>(built-in)</em>\r\n</td>\r\n    <td><a href=\"http://www.ruby-doc.org/stdlib-1.9.3/libdoc/erb/rdoc/ERB.html\">Embedded Ruby</a>\r\n</td>\r\n    <td>The flow-control language that can be used in the rendering layer.</td>\r\n</tr>\r\n<tr>\r\n    <td><a href=\"https://docs.djangoproject.com/en/dev/howto/custom-template-tags/\">Template tags</a> <em>(custom)</em>\r\n</td>\r\n    <td><a href=\"http://guides.rubyonrails.org/getting_started.html#view-helpers\">Helpers</a>\r\n</td>\r\n    <td>The system for defining custom functions that can be used in the rendering layer.</td>\r\n</tr>\r\n<tr>\r\n    <td><a href=\"https://docs.djangoproject.com/en/dev/topics/db/models/\">Models</a>\r\n</td>\r\n    <td><a href=\"http://guides.rubyonrails.org/getting_started.html#getting-up-and-running-quickly-with-scaffolding\">Models</a>\r\n</td>\r\n    <td>The data-definition layer that maps classes to database tables - the <a href=\"http://en.wikipedia.org/wiki/Object-relational_mapping\">ORM</a>.</td>\r\n</tr>\r\n<tr>\r\n    <td><a href=\"https://docs.djangoproject.com/en/dev/topics/db/managers/\">Managers</a>\r\n</td>\r\n    <td><a href=\"http://guides.rubyonrails.org/active_record_querying.html#scopes\">Scopes</a>\r\n</td>\r\n    <td>The way to extend the ORM to define custom database queries.</td>\r\n</tr>\r\n<tr>\r\n    <td><a href=\"https://docs.djangoproject.com/en/dev/howto/custom-management-commands/\">Management commands</a>\r\n</td>\r\n    <td><a href=\"http://guides.rubyonrails.org/command_line.html\">Rake tasks</a>\r\n</td>\r\n    <td>Scripts for performing administrative tasks via the command line.</td>\r\n</tr>\r\n<tr>\r\n    <td><a href=\"https://docs.djangoproject.com/en/dev/glossary/#term-project\">Project</a>\r\n</td>\r\n    <td><a href=\"http://guides.rubyonrails.org/getting_started.html#creating-the-blog-application\">App</a>\r\n</td>\r\n    <td>An entire application built with the framework.</td>\r\n</tr>\r\n<tr>\r\n    <td><a href=\"https://docs.djangoproject.com/en/dev/intro/tutorial01/#creating-models\">App</a>\r\n</td>\r\n    <td><a href=\"http://guides.rubyonrails.org/plugins.html\">Plugin</a>\r\n</td>\r\n    <td>The way in which all components in the framework can grouped together in separate areas of functionality.</td>\r\n</tr>\r\n<tr>\r\n    <td><a href=\"http://south.aeracode.org/\">South</a> <em>(third-party)</em>\r\n</td>\r\n    <td><a href=\"http://guides.rubyonrails.org/migrations.html\">Migrations</a>\r\n</td>\r\n    <td>The system used for automatically applying changes in the ORM definition to the underlying database tables, such as adding and removing columns.</td>\r\n</tr>\r\n<tr>\r\n    <td><a href=\"https://docs.djangoproject.com/en/dev/ref/contrib/admin/\">Admin</a>\r\n</td>\r\n    <td><a href=\"https://github.com/sferik/rails_admin\">RailsAdmin</a> <em>(third-party)</em>\r\n</td>\r\n    <td>A web-based interface for authenticating administrative users and providing CRUD tools for managing data.</td>\r\n</tr>\r\n<tr>\r\n    <td colspan=\"3\">\r\n    <p>The following table lists software that aren\'t part of Django or Rails, but are core parts of the Python and Ruby eco-systems, and go hand-in-hand with using either framework.</p>\r\n    </td>\r\n</tr>\r\n<tr>\r\n    <th>Python</th>\r\n    <th>Ruby</th>\r\n    <th>&#160;</th>\r\n</tr>\r\n<tr>\r\n    <td><a href=\"http://www.virtualenv.org/\">Virtualenv</a>\r\n</td>\r\n    <td><a href=\"http://beginrescueend.com/\">RVM</a>\r\n</td>\r\n    <td>The system used for running isolated environments bound to a particular language version, combined with a set of installed libraries.</td>\r\n</tr>\r\n<tr>\r\n    <td><a href=\"http://www.pip-installer.org/\">PIP</a>\r\n</td>\r\n    <td><a href=\"http://gembundler.com/\">Bundler</a>\r\n</td>\r\n    <td>The package manager for installing libraries.</td>\r\n</tr>\r\n<tr>\r\n    <td><a href=\"http://www.wsgi.org/\">WSGI</a>\r\n</td>\r\n    <td><a href=\"http://en.wikipedia.org/wiki/Rack_(web_server_interface)\">Rack</a>\r\n</td>\r\n    <td>A standard specification for applications to interface with HTTP, allowing for a single application entry point and middleware to be implemented.</td>\r\n</tr>\r\n<tr>\r\n    <td><a href=\"http://fabfile.org/\">Fabric</a>\r\n</td>\r\n    <td><a href=\"http://en.wikipedia.org/wiki/Capistrano\">Capistrano</a>\r\n</td>\r\n    <td>A system for automating tasks on remote servers from a local machine, typically as part of a deployment process.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n\r\n<p>Not all of these pairings are a perfect one-to-one match conceptually, but should be good enough to get an overall view of what each concept is within both frameworks.</p>\r\n</div>',0,'2013-06-13 22:08:00','2013-06-13 22:13:45','2013-06-13 22:13:45',1,NULL,'mapping-of-rails-django-concepts','','','',1211,'mapping-of-rails-django-concepts'),(137,'使用logrotate 为nginx日志 分卷 (rotate the nginx logs ) ','<p>see:&#160; <a href=\"http://serverfault.com/questions/284729/nginx-log-rotation\">http://serverfault.com/questions/284729/nginx-log-rotation</a>\r\n</p>\r\n<p>1. locate your Nginx pid file: &#160; ( normally it\'s at: &#160;/opt/nginx/logs/nginx.pid &#160;in my Ubuntu) </p>\r\n<p>2. you should know this key process: &#160;</p>\r\n<pre># this just simply make nginx start a new log file, but NOT restart.  ( quite fast)\r\nkill -USR1 `cat /opt/nginx/logs/nginx.pid`\r\n</pre>\r\n<p>3. create a new file (/etc/logrotate.d/nginx) &#160;containing this :&#160;</p>\r\n<pre># nginx SIGUSR1: Re-opens the log files.\r\n\"/opt/nginx/logs/access.log\" \"/opt/nginx/logs/error.log\"{\r\n  daily\r\n  rotate 7\r\n  dateext\r\n  copytruncate\r\n  missingok\r\n  notifempty\r\n  delaycompress\r\n  sharedscripts\r\n  postrotate\r\n    test ! -f /opt/nginx/logs/nginx.pid || kill -USR1 `cat /opt/nginx/logs/nginx.pid`\r\n  endscript\r\n}</pre>\r\n<p>4. 记住： logrotate 运行时，是有一个自己的状态记录文件的。( /var/lib/logrotate.status ) 它会在这个文件中记录好每个文件的最早时间。然后每次运行时把目标文件跟自己的表做对比。如果发现目标文件的日期超过了这个表的日期，比如一个星期，那么 logrotate 才会对它分卷。 &#160;( keep in mind that logrotate has its own status file which is used to remember when the target file is created and determine if the target file should be rotated. &#160;)&#160;\r\n</p>\r\n<p>5. 典型命令： &#160;$logrotate -v /etc/logrotate.d/nginx &#160; (如果你使用了 -vd 那么就仅仅是一个dry-run 预演，不会对 /var/lib/logrotate.status 生效 ) ( also remember that don\'t use the debug mode since it\'s just lead to a dry-run result and won\'t take effect on /var/lib/logrotate.status file )&#160;</p>\r\n<p>6. 把logrotate增加到你的 crontab中去。 &#160;(make it affect via crontab -e)&#160;</p>\r\n<pre>例如：\r\n# in crontab editor: \r\n0 0 * * * logrotate -v /etc/logrotate.conf\r\n</pre>\r\n<p>p.s. 所以，想要你的改动立即生效的话，</p>\r\n<p>1. 先运行logrotate : $&#160; logrotate -v /etc/logrotate.d/nginx \r\n</p>\r\n\r\n2. 编辑 vim /var/lib/logrotate.status\r\n把里面对应的内容，改成昨天。<div>例如：\"/usr/local/nginx/logs/access.log\" 2013-12-22&#160;</div>\r\n<div>&#160;要改成： \"/usr/local/nginx/logs/access.log\" 2013-12-21&#160;</div>\r\n<div>3. 再运行： logrotate -v /etc/logrotate.d/nginx </div>',0,'2013-06-14 00:41:00','2013-06-14 00:55:46','2013-12-23 09:27:42',1,NULL,'rotate-ngin-logs','','','',517,'rotate-ngin-logs'),(138,'ubuntu下手机截图(使用adb, DDM )  (capture your android device in linux)','<p>see:&#160; <a href=\"https://help.ubuntu.com/community/AndroidScreenshots\