INSERT INTO `refinery_page_parts` VALUES (1,1,'Body',' \r\n<p>欢迎光临我的个人网站( shensiwei.com &#160;or siwei.me) 。我是申思维，主要使用RUBY从事于WEB 开发（05~08年用JAVA）<br />我熟悉js (coffeescript), CSS, HTML，跟web相关的服务器(apache, nginx, passenger, mongrel, tomcat) ,<br />熟悉单元测试，重构，日常工作中也使用一些自动化工具、框架。<br />我很重视代码质量，以及持续集成。<br />我会在这里发些技术类文章，谈论些自己的观点。</p>\r\n<p>欢迎给我写信：  sg552sg552@gmail.com <br />github: <a target=\"_blank\" title=\"https://github.com/sg552\" href=\"https://github.com/sg552\">https://github.com/sg552</a>\r\n<br />stackoverflow: <a target=\"_blank\" title=\"http://stackoverflow.com/users/445908/siwei-shen\" href=\"http://stackoverflow.com/users/445908/siwei-shen\">http://stackoverflow.com/users/445908/siwei-shen</a>\r\n</p>\r\n<p>Hi there, I am Siwei Shen, a web application developer for 9 years ( 3.5 java + 5.5 ruby) . I am able to build &amp; setup a website from head to foot.&#160;</p>\r\n<p>I am familiar with JS, CSS, CoffeeScript, database, has been always writing Unit Tests, has lots of experience in refactoring, TDD and automation tools such as: Ant, Maven, Selenium.<br />contact me : sg552sg552@gmail.com </p>',0,'2012-08-04 06:36:47','2014-08-07 03:22:44'),(2,1,'Side Body','',1,'2012-08-04 06:36:47','2014-08-07 03:22:44'),(3,2,'Body','<style>\r\n.highlight { color: blue; font-weight:bold; font-family: Arial, Courier, Verdana; background-color:white}\r\n</style>\r\n<p><img src=\"/system/images/BAhbB1sHOgZmIioyMDEyLzA4LzEwLzE3XzQzXzE3XzUzMF9zaGVuc2l3ZWkuanBnWwg6BnA6CnRodW1iIg0yMjV4MjU1Pg/shensiwei.jpg\" title=\"Shensiwei\" alt=\"Shensiwei\" rel=\"225x255\" height=\"255\" width=\"169\" /></p>\r\n<p><span class=\"highlight\">A Web Developer using Ruby/Rails, Java, Nodejs, coffee/javascripts, Linux, VIM, MySQL, mongo. </span>\r\n</p>\r\n<p>\r\n<span class=\"highlight\">Shen Siwei  申思维</span>  \r\nmale | Single | Born in 1982/9 . \r\nLiving in BEIJING , \r\nGraduated from <span class=\"highlight\">South China University of Technology (华南理工大学）</span> in Guangzhou (广州） in July 2005 with a <span class=\"highlight\">Bachelor degree</span>, majored in <span class=\"highlight\">Computer Science software technology. </span>\r\n</p>\r\n<p>E-mail: sg552sg552@gmail.com&#160;&#160; </p>\r\n<p>My Github:  <a href=\"https://github.com/sg552\" title=\"https://github.com/sg552\" target=\"_blank\">https://github.com/sg552</a>\r\n<br />\r\nStackoverflow: <a href=\"http://stackoverflow.com/users/445908/siwei-shen\" title=\"http://stackoverflow.com/users/445908/siwei-shen\" target=\"_blank\">http://stackoverflow.com/users/445908/siwei-shen</a>\r\n<br />\r\nSome Demos could be found here: <a href=\"demos\"> demos page </a>\r\n<br />\r\nand I sometimes <span class=\"highlight\"><a href=\"speaks\">give speaks in technology meetings. </a> </span>\r\n<br />\r\n</p>\r\n<p>Self-assessment</p>\r\n<p>Working hard, honest, optimistic, a 9 years Web Application Developer.<br />\r\nGood at <span class=\"highlight\">Ruby on Rails (5.5 years) and Java (3.5 years)</span>. Familiar with CSS and Javascript (based on jQuery).<br />\r\nI am familiar with the technologies of web development, attach importance to the <span class=\"highlight\">quality of code and agile methodology</span> in development. Through all of my past projects, I have practiced most of the <span class=\"highlight\">agile methods, the unit tests</span> and necessary documents were the important part and done well.<br />\r\nEspecially I have experience in <span class=\"highlight\">refactoring, TDD, BDD, optimization, automatical testing and continuous integration </span> which were really helpful during my work time.  <br />\r\nAlso experienced in: <span class=\"highlight\">Selenium</span>, setting up SCM( GIT, SVN),  operations (deployment, linux server configuration, database management, optimization, etc. )\r\n</p>\r\n<p>Education Background</p>\r\n<p>2001/09 -- 2005/07：South China University of Technology | Computer Science | Bachelor</p>\r\n\r\n<div style=\"display:none\">\r\n<p>Language Skills</p>\r\n<p>English：Fluent speaking and strong abilities of reading&amp;writing. </p>\r\n<p>Work Experience<br />2010/01 -- now： Motorola (contractor) | Senior Rails Engineer </p>\r\n<p>2008/09 -- 2009/02：	Advanced Systems Development Co., Ltd. | Senior Software Engineer<br />As a senior developer, my job is to design and develop some sofeware systems, including testing, optimizing and ect.</p>\r\n<p>2007/05 -- 2008/05：	Beijing BidLink Info-Tech Co., LTD | Senior Software Engineer<br />Working as a developer, my job is to design and develop some sofeware systems.</p>\r\n<p>2005/07 -- 2007/04：	 freelancer <br />I was doing a short-period fulll time job. For example, I worked full-time for a company for three month , and as soon as its project finished, I would go to find another company to begin a new project.</p>\r\n<p>2011/03 -- now: Babble Portal, a sub-system of Moto Blur.</p>\r\n<p><br />Responsibilities: core developer</p>\r\n<p>Project Description: a Middle layer between operators and Motorola phone users, which is used for synchorizing data from server to client. e.g. to control the client phone by pushing some data from Moto server to it. And there are many webservice calls in this system. </p>\r\n<p>Severial modules: devices, device groups, cloudsets management.</p>\r\n<p>Technologies：Rails 3.0.5, Sqlite3, MySQL5 , jQuery, httparty, delayed_jobs.</p>\r\n<p><br />2010/10 -- 2012/3: Zurich contractor management system.(https://focusbeijing.com)</p>\r\n<p><br />Responsibilities: core developer</p>\r\n<p>Project Description: This project is a management system for Zurich Insurance Company to manage all the information of their customers, e.g.: register, contract, and other useful data. It is growing bigger and now consists of several sub-modules: <br />1. Contractor Depot: to manage the stuffs related to user\'s information.<br />2. Focus Application: Core module, where the contractor could fill all the forms and finish all the operations that is needed to an insurance contract. <br />3. Approval Module: Core module, where the employees from the insurance company could verify and approve the contracts.</p>\r\n<p>Feel free to click the demo link, register an user account to take a look at it~</p>\r\n\r\n<p>Technologies：Rails 2.3.5 =&gt; 3.0.1, MySQL5 , jQuery, CruiseControl.rb ...</p>\r\n<p><br />2010/05 -- 2010/10: Smart Start Project for Focussi. (cc.focusbeijing.com) </p>\r\n<p>Responsibilities: core developer</p>\r\n<p>Project Description: It\'s anther contractor management system, very similar with the previous project(Zurich), used for managing the user, contractor for an insurance company. It\'s small however the business inside is complex. It consists of: <br />1. user module: user\'s register, switching status, invitation...<br />2. organization module: to manage an organization and also all the members in it.<br />3. contract module: contract\'s management and approval.<br />Technologies：Rails 2.3.5, MySQL5 , Prototype</p>\r\n<p>2010/04 -- 2011/11 ：Motorola Arkitek</p>\r\n<p>Responsibilities: core developer</p>\r\n<p>Project Description: Arkitek is a light weight ERP system, it is aiming to help moto\'s engineers build the system of mobile phones, and it is becoming a core application which communicates and works with other motorola web applications. It consists of these modules:</p>\r\n<p>1. Build Package: user can specify a product and build its package, or config its Hudson\'s jobs.(Hudson is a continuous integration tool, and in Moto every prototype mobile phone have to build its system by the Hudson server)</p>\r\n<p>2. Product Matrix: where user can select products, edit its customers and commit.</p>\r\n<p>3. Blur module: including configuration, location, versions management. I am not familiar about this module, because it\'s implemented by others.</p>\r\n<p>4. Google online approval module: Because of the copyright of Android, once a Motorola\'s engineer changed something special of Android, he has to fill a form and submit to Google to request for approval. This module is used to automatically fill most fields of a google\'s form from the hudson\'s build result files, and submit it to Google for approval.</p>\r\n<p>5. Admin module: to manage everything in Arkitek. (products, customers, hudson jobs, blur server\'s informations...)</p>\r\n<p>6. Some webservice interfaces for transfering data, in RESTful style.</p>\r\n<p>Technologies：Rails 2.3.5, MySQL5 , JQuery, plugin: will-paginate, TinyMCE editor.</p>\r\n<p>.</p>\r\n<p>2010/03 -- 2010/04：Motorola FlexRay comparison system</p>\r\n<p>Responsibilities: developer, maintainer</p>\r\n<p>Project Description: FlexRay is a comparison system to compare moto\'s products about detailed build information. User is able to choose a [model package] in the list, then he will get all the versions of this [model package] and compare two or more of them. It just like a WEB enhenced version of \"diff\" command. :-) In this project, a comparison tool from Google is used as core algorithm.</p>\r\n<p>In this project, there is a program which is constantly running to fetch data from a remote server.</p>\r\n<p>Technologies：Rails 2.3, MySQL5 , JQuery, Google\'s comparison tool, Webservice, plugin: willing-paginate</p>\r\n<p>.</p>\r\n<p>2010/02 -- 2010/03：Motorola Reflex report system</p>\r\n<p>Responsibilities: core developer, maintainer</p>\r\n<p>Project Description: Reflex is a report system for Motorola\'s all products. The report is generated by date(weekly, monthly, yearly), by platform(such as Android platform), by a period of time, and the result shows the amount of products in different status and other necessary information.</p>\r\n<p>As well as FlexRay, there is a synchronizer program running to synchronize and fetch data from a remote server.</p>\r\n<p>Technologies：Rails 2.3, MySQL5 , JQuery, Webservice, plugin: willing-paginate, Open flash chart</p>\r\n<p>.</p>\r\n<p>2010/01 -- 2010/02：Motorola Product Library</p>\r\n<p>Responsibilities: core developer, maintainer</p>\r\n<p>Project Description: This project is used to manage all the products of motorola. It consists of these modules:</p>\r\n<p>1. List and Search products: user can search or list product by criteria.</p>\r\n<p>2. Favorites: manage one\'s favorite products.</p>\r\n<p>3. History: show a detailed history of a product, including internal name, status, updated date, the gate it passed ...</p>\r\n<p>4. Analysis: display the detailed information of products, comparison results and generate an Excel file.</p>\r\n<p>Technologies：Rails 2.3, MySQL5 , JQuery, plugin: willing-paginate, exception-notification, customized ruby libs.</p>\r\n<p>.</p>\r\n<p>2009/09 -- 2010/01：<a target=\"_blank\" title=\"http://www.archcy.com\" href=\"http://www.archcy.com\">www.archcy.com</a>\r\n</p>\r\n<p>Responsibilities: core developer, CSS developer.</p>\r\n<p>Project Description: This is a portal website in construnction domain in China, it is being maitained by RCCChina, which is a top X construction consultant company. This website is based on Radiant CMS( a very famous open source project ), it has all the basical features that a CMS should have(Post text and images, comment, manage the hierachy of pages, user-role system ..) as well as more special features: gallery module, special topic module, rank module and so on.</p>\r\n<p>It is worth mentionning that I played a CSS developer role in this project and did well.</p>\r\n<p>Technologies：Rails 2.3, Oracle11, Prototype, plugin: willing-paginate, FCKEditor</p>\r\n<p>.</p>\r\n<p>2009/05 -- 2009/07：Silly Crow bug management system <br />Responsibilities: core developer</p>\r\n<p>Project Description: a bug management system just like Jira, very easy to use and to be modified. The \"tester\" rises a bug , \"admin\" assign this bug to a \"developer\", and the \"developer\" can resolve this bug after resolution.At last the \"tester\" can close or reopen it . It\'s small and stupid but effective. :-)</p>\r\n<p>Technologies：Rails 2.3, MySQL5 , plugin: willing-paginate, log4r.</p>\r\n<p>2009/04 -- 2009/04：a web crawller that can fetch information ( http://shappy.sourceforge.net) <br />Responsibilities: core developer.</p>\r\n<p>Project Description: a pure ruby application that can fetch the specificate informations, such as : email address or qq number and so on. It recursively scan the url that user gives and compare the page content to the Regular Expression. It\'s small but useful, used by myself for helping others.</p>\r\n<p>Plateform and Tools: Linux(Slackware) , Apatana RadRails, Ruby 1.8.6</p>\r\n<p>2009/02 -- 2009/04：Ruby on Rails Content Management System<br />Responsibilities：core developer. designer.</p>\r\n<p>Project Description：a CMS with basic functions such as :category management , content management, user-role subsystem, file upload and download. It\'s in simply architecture and easy to modify and maintain.<br />used technologies: Ruby on Rails, MySQL, RAD, Linux(Slackware)<br />plugins: log4r, cache_fu, will_paginate. FckEditor.</p>\r\n<p>2008/01 -- 2009/02：Dudufish -- a Forum System<br />Responsibilities：core developer, desinger.</p>\r\n<p>Project Description：a lightweight-level Forum with basic functions: post, reply, thread management, category management , user-role subsystem. It\'s very easy to maintain or extend.<br />Used plugins: log4r, cache_fu, restful_authenticate, will_paginate, FckEditor</p>\r\n<p>2008/12 -- 2009/01：Optimization for a big music website</p>\r\n<p>Responsibilities: core tester</p>\r\n<p>Project Description: this website went down after 1 month\'s running, its response time falled from less then 1 sencond to more than 60 seconds. After many testing and profiling, the root causes were found from the view layer to the database layer, total in 10+ places. I resolved these errors and so that this website became fine. Now it supports more than 1000+ users online. <br />Platform &amp; Tools：J2EE, Tomcat, MySQL5, Windows, JProfiler, Jmeter. </p>\r\n<p>2008/09 -- 2008/12：Performance Management System of Beijing Mobile</p>\r\n<p>Responsibilities：coding, writing unit test, and organize requirements.<br />Project Description：It can manage most kinds of performances , manage user, role, department and process some complex work flows. This system can also communicate with other servers which is implemented by WebService.<br />Platform &amp; Tools : DB2, Websphere, IBM Server, Eclipse. SVN. Ant,JUnit, Log4j, FreeMarker, Sitemesh, SSH. JBPM. CXF.</p>\r\n<p>2008/04 -- 2008/05：Big Screen Advertise Management System for Digital Radio Express Co.Ltd<br />Responsibilities：coding. Writing unit test and help newcomers.<br />Project Description：It is a Content Management System which contains special function: hardware interface . It can manage the content , screen, cluster and user-role. It is used by two super markets in China : Gome and Sunning. The models done by me are: user management, device management and cluster management.<br />Platform &amp; Tools :Eclipse, Windows, SVN, JSP+ Struts2 + Hibernate + Spring IOC. TDD. Role :core developer</p>\r\n<p>2007/10 -- 2008/01：Bid management system for Shanghai Volkswagen<br />Responsibilities：coding and writing unit test.<br />Project Description：It can support numbers of supplier to bid, and at the same time it can communicate with other servers to exchange the bid-date or bid-result. The model finished by me was the WebService, with Axis1.4, Tomcat4.<br />Platform &amp; Tools :Linux, Postgres, JSP，Struts1, Hibenrate2, WebService., TDD.</p>\r\n<p>2007/09 -- 2007/10：Purchase Website for Bidlink, Beijing . Co.Ltd.</p>\r\n<p>Responsibilities：coding and writing unit test.<br />Project Description：It is similar to an ERP, contains many models and functions . My job is to finish a model called Order Management, which consists of an order\'s creation, management, and process.<br />Platform &amp; Tools :Eclipse, JSP, Aceigi ,Velocity, Hibenrate2, WebService., TDD. Role :developer</p>\r\n<p>2007/05 -- 2007/08：Medicine Website for Bidlink , Beijing, Co.Ltd.</p>\r\n<p>Responsibilities：coding and unit testing, optimize performance .<br />Project Description：This system is more complex than the Purchase Website introduced above. It contains models such as: urse-role management, product management, data and bidding management, enterprise space. I was full participate in it.<br />Platform &amp; Tools :Velocity 1.4, Spring 2.0 IOC, Hibernate3 ，Lucene 2.0，Acegi，Javascript. TDD , CruiseControl</p>\r\n<p>2007/03 -- 2007/04：Production Management System for State Grid, China.<br />Responsibilities：It is used for State Grid to manage this corperation\'s devices all over China. .<br />Platform &amp; Tools :Eclipse, JSP，Struts, Hibenrate2, Jprofiler.<br />Project Description：Mainly optimize the server\'s performance ,also do some testing and coding .</p>\r\n<p>2006/11 – 2006/12： Java implementation of Inheritance arithmetic and L-F encryption arithmetic <br />Project Description : The both two projects are used by a team of Hamburg University in Germany. They are not web applications: one is for calculation and the other is for encryption. Platform &amp; Tools :Eclipse, Swing, Log4j, Junit, TDD<br />Responsibility : coding and unit testing </p>\r\n<p>2006/07 – 2006/09： Blog and Wiki System for Rightlinker Beijing. Co.Ltd Project <br />Description : This system consists of Blog and Wiki, it also has other features like album, media player , message management.</p>\r\n<p>Platform &amp; Tools :Eclipse, JSP，Struts, Hibenrate. <br />Responsibility : coding, code review, and process control. </p>\r\n<p>2006/02 – 2006/04： Contract Management System for Xianming Hongkong Co.Ltd. <br />Project Description : There are a mass of contracts to manage in Xianming company, so this system was required strongly. This System can manage the save, update, delete and other operations such as input or modify orders, input samples and photos of a contract.</p>\r\n<p>Platform &amp; Tools :Dreamweaver, JSP，Struts1.2, MySQL <br />Responsibility : coding and organize requirements. </p>\r\n<p>2005/07 -- 2005/08： Finance Management System for someone Company in Guangdong , China <br />Project Description : This system consists of models like: finance management, people and production management, monthly and yearly bonus management.</p>\r\n<p>Platform &amp; Tools :Struts, Hibernate, Spring IOC. MySQL. Jbuilder. Tomcat <br />Responsibility : coding and writing documents. </p>\r\n<p>2005/03 -- 2005/07 :Remote Education System for South China University of Tech . <br />Project Description : Using SMIL technology developed by RealNetWorks.co , this system can play diffrent parts of the lesson videos according to the students condition. It is a smart video player. It knows what a student already have learned and what not learned by checking his exam papers.</p>\r\n<p>Platform &amp; Tools :Dreamweaver, JSP，MSSQL2000 <br />Responsibility : coding</p>\r\n</div>\r\n',0,'2012-08-04 06:36:48','2014-08-01 08:22:50'),(22,12,'Body','',0,'2012-08-11 23:46:36','2012-08-24 05:07:16'),(23,12,'Side Body','',1,'2012-08-11 23:46:36','2012-08-24 05:07:16'),(28,15,'Side Body','',1,'2012-08-14 23:06:50','2012-08-24 05:32:57'),(29,15,'Body','<p>之前的文章在这里：(my previous posts could be found here):&#160;<a href=\"http://sg552.iteye.com\" title=\"http://sg552.iteye.com\" target=\"_blank\">sg552.iteye.com</a>\r\n</p>',0,'2012-08-14 23:06:50','2012-08-24 05:32:57'),(30,16,'Side Body','',1,'2012-08-15 23:07:44','2012-11-05 05:28:23'),(31,16,'Body','<br /><p><a href=\"http://www.shensiwei.com:333\" title=\"http://siwei.me:333\" target=\"_blank\" id=\"wym-1345617857335\"></a>\r\n</p>\r\n',0,'2012-08-15 23:07:44','2012-11-05 05:28:23'),(32,17,'Side Body','',1,'2012-08-22 06:54:03','2014-08-05 09:34:58'),(33,17,'Body','<h1>演讲</h1>\r\n<p><a href=\"http://siwei.me/system/resources/BAhbBlsHOgZmSSIiMjAxNC8wOC8wMS8xNl8yMV81Nl8xMzFfXy5wZGYGOgZFVA/%E5%A6%82%E4%BD%95%E6%8E%A5%E6%89%8B%E8%85%90%E6%9C%BD%E9%A1%B9%E7%9B%AE.pdf\">2014-08-01 分享： 如何接手腐朽项目</a>\r\n</p>\r\n<p><a href=\"http://siwei.me/system/resources/BAhbBlsHOgZmSSI1MjAxNC8wNy8yMC8yMV8xMV81OV82NzJfXzIwMTRfMDdfMTNfYmFyY2FtcF8ucGRmBjoGRVQ/%E6%BC%94%E8%AE%B2-2014-07-13-barcamp-%E8%BD%AF%E4%BB%B6%E9%A1%B9%E7%9B%AE%E7%94%9F%E5%AD%98%E6%8C%87%E5%8D%97.pdf\">2014-07-12 Barcamp 演讲： 如何拯救死亡项目</a>\r\n\r\n</p>\r\n<p><a href=\"/blog/posts/meta-programming-ruby\"> 2012-08-11 演讲：meta-programming ruby</a>\r\n</p>\r\n<p><a href=\"/blog/posts/unit-tests-in-ruby\">2012-08-05. barcamp演讲：ruby 中的单元测试(something about unit tests in Ruby)</a>\r\n</p>\r\n<p><a href=\"/system/resources/BAhbBlsHOgZmIjIyMDEyLzEyLzA3LzA2XzAyXzU3XzkxNF9ydWJ5X2ludHJvZHVjdGlvbi5vZHA/ruby_introduction.odp\" title=\"Ruby Introduction\">2012-09-19.  为MOTO 的同事介绍ruby.&#160;</a>&#160;</p>\r\n<p><a href=\"/system/resources/BAhbBlsHOgZmIjkyMDEyLzEyLzIxLzExXzQxXzI4XzQwNl9ydWJ5X2ludHJvX29uX3JhaWxzZ3JpbHMub2Rw/ruby-intro-on-railsgrils.odp\" title=\"Ruby Intro On Railsgrils\">2012-12-15. Rails Girls上的对RUBY的简单介绍</a>\r\n</p>\r\n<h1>其他</h1>\r\n<p><a href=\"http://www.infoq.com/cn/articles/devops-in-my-view\">翻译： 《我眼中的DevOps》 http://www.infoq.com/cn/articles/devops-in-my-view</a>\r\n</p>',0,'2012-08-22 06:54:03','2014-08-05 09:34:58'),(34,18,'Body','<p>微软的孵化器：&#160;微软创投孵化器</p>\r\n<p>要有成型的产品： 1. CMS。 &#160;2. 论坛。 &#160;3. ERP。 &#160;4 CRM。 &#160;5。 网店 &#160;6. 微网站。 7. android app . 8.ios app</p>\r\n<p>我们目前CMS 各个子系统的架构（当前拆分的情况， 要做的新的子系统，<br />（面临的问题） ， 以及可以优化的地方（死代码 做成灵活的， 筛选条件。。。），<br />必须懂得： 静态化 ， 清API缓存， 以及抓取视频。<br />非技术： 职业规划， 每天必须学习/进步， 学好英语， 埋头干活不想办公室习气。<br />当今的项目发展趋势 （ 创业潮流） ：<br />小步快跑，<br />要走短平快的受益，<br />不要做大平台（第二个淘宝，第二个天猫商城） ，<br />先做出产品（哪怕是粗糙的原型也行），然后就路演，找投资人， 融资，（天使， A轮， B轮） 。。。<br />不要一开始就想赚钱。 抢到用户是真格的。有了用户就不愁没有受益的路子。 比如：QQ 一直免费，但是QQ周边 各种收费方式。 （QQ秀， QQ空间黄钻等）<br />投资人一般不关心你的项目会给创造多少收益，它关心的是你要把项目“炒大， 炒火”。 他投入100W， 希望你的项目变成 500W， 然后让下一轮融资投入更多的钱。 下一轮的投资方也是一样的心里，所以我们看到拉勾网 融资越来越多， 最后上市， 大捞一笔。<br />程序员必备的素质 （ 沟通能力，学习能力， ）<br />做人必备的素质（ 要知道与人沟通， 控制情绪， 为解决问题出发， 乐观开朗， 不拘泥细节， 善于吃小亏 ）<br />项目管理：<br />下决策要缓慢<br />执行要坚决</p>\r\n<p>退款API &#160;http://open.taobao.com/api/api_cat_detail.htm?spm=a219a.7386789.0.0.JRNdOb&amp;cat_id=5&amp;category_id=102</p>',0,'2014-07-28 23:33:13','2014-08-30 23:30:17'),(35,18,'Side Body','',1,'2014-07-28 23:33:13','2014-08-30 23:30:17'),(36,19,'Body','<p>1. IT上全归我管。 &#160;其他人不许插手， 特别是新入股的人（如YG）。&#160;</p>\r\n<p>2. 至少安卓有个前端， 招个优秀的实习生。或者有经验的人。</p>\r\n<p>3. 买显示器，每人一个大的。 better to have.&#160;</p>\r\n<p>4. 至少两个正式服务器， 一个测试服务器。 &#160;</p>\r\n<p>5. 办公室内部有个热饭的地方，有个冰箱。</p>',0,'2014-09-03 01:41:05','2014-09-03 01:42:12'),(37,19,'Side Body','',1,'2014-09-03 01:41:05','2014-09-03 01:42:12');
